\r\n\r\nHalo \"Little Fams\" (sebutan untuk penggemar LITTLE DAY)\r\nPerkenalkan band pop punk yang berasal dari jakarta\r\nWe are LITTLE DAY\r\nYap...band yang di gawangi oleh Dhara sebagai Vocalis , Ice pada Gitar , lalu ada Nty di posisi Gitar , dan Iwank di Bass , yang terakhir di posisi yang selalu berada di belakang panggung Perkenalkan Drummer kami Mr.Bonge.\r\nBand yang lahir pada tanggal 20 Oktober 2015 ini terbilang cepat perkembangannya\r\nKarena apa...\r\nDi umur yang terbilang masih belia ini,\r\nAkan tetapi LITTLE DAY sudah memiliki jam terbang perform/off air yang sudah cukup padat di dua tahun ini\r\nTerbukti juga dari ketotalitasan dari setiap personilnya yang saat ini sudah memiliki Album E.P (Perdana) yang berjudul \"BERJUANG\" yang berarti kita berjuang untuk maju dan menciptakan karya. di setiap lagu, dan di dalam album ini pun punya cerita masing-masing dan penuh perjuangan di setiap lagu di album E.P ini\r\n\r\nDan dalam waktu yang sangat berdekatan pula LITTLE DAY akan kembali masuk ke dapur rekaman untuk Album selanjutnya\r\nEntah Album atau E.P nantinya\r\nDari kekompakan dan cemistry dari setiap personil LITTLE DAY yang membuat Band ini sangat produktif\r\nBanyak sudah materi yang sudah kami siapkan untuk beberapa Album ke depan,\r\nSeperti apa sih perform dan musik LITTLE DAY ??\r\nBanyak persamaan dari setiap personilnya\r\nYaitu mempunyai referensi dari band ² seperti ENDANK SOEKAMTI , ROCKET ROCKERS , SUPERGLAD , PEE WEE GASKINS ,dll\r\nSelain referensi lokal, Banyak juga musisi dari luar untuk kita jadikan referensi, tapi kita lebih cenderung mengangkat band lokal karna kita hidup di negara INDONESIA, Sebagai simbol bangga pada musisi dalam negeri , yang sesuai dengan genre LITTLE DAY sendiri.\r\nMusik yang di suguhkan oleh LITTLE DAY memiliki Beat yang Energic\r\nApalagi di setiap perform nya\r\nKalian pasti terhipnotis dengan musik dan aksi panggung yang mereka tampilkan\r\nSudah pasti kalian di buat tidak bisa diam dan berkeringat semangat\r\nPenasaran kaaaan...\r\nMakanya pantengin terus sosial media LITTLE DAY untuk mengetahui update jadwal terbaru dan kegiatan setiap harinya dari LITTLE DAY\r\nSilahkan di Follow sosial media kami di bawah ini :\r\n- Instagram : @littleday5\r\n- Path : LITTLE DAY\r\n- Twitter : @littleday5\r\n- Facebook : LITTLE DAY\r\n- Youtube : LITTLE DAY\r\n\r\nMakna dan arti dari setiap lagu LITTLE DAY ??\r\nAda sebuah pesan pastinya dari setiap lagu kami\r\nKarena yang menarik itu menurut kami adalah hal-hal atau cerita sehari hari\r\nPagi , siang , sore , dan malam\r\nPasti memiliki cerita yang berbeda di setiap waktu itu\r\nTeman , musuh , keluarga , mantan ,dll\r\nDan di tema ini pastinya ada pesan semangat/motivasi di dalamnya\r\nEasy listening\r\nYak...itulah musik LITTLE DAY\r\nAkan tetapi , keanggunan suara dari sang vocalis (Dhara)\r\nDi balut dengan beat musik yang energic , dan banyak pesan sosial dan motivasi di dalam lirik setiap lagunya\r\nLITTLE DAY selalu siap membakar semangat kalian kembali\r\nSo...sampai bertemu \"Little Fams\" di panggung yang akan menampilkan LITTLE DAY di kotamu.\r\nBest Regards.\r\n\r\nLittle Day Live perform 2015 s/d 2017\r\n\r\n-Live Gulp & Gulf Rockin Bar resto\r\n-Live Grand Charly Rawamangun Square (Gigs)\r\n-Live Obesphere distro Rawamangun\r\n-Live Cimanggis-depok (Gigs)\r\n-Live Pentas Seni SMK Ganesa Satria 1 Depok\r\n-Live \"Friday Coustic\" At JX Tainment,jakarta\r\n-Live Grand Charly rawamangun Square(Gigs)\r\n-Live Beerhouse Caffe JX Tainment, jakarta (Gigs)\r\n-Live Ancol Beach City \"GEBYAR BAMBU RUNCING\" 2016\r\n-Live \"MARKET MENTENG # 2 \" At Taman Menteng Jak-Pus\r\n-Live Beerhouse Caffe JX Tainment, Jakarta (Gigs)\r\n- ON-AIR 104,2 Radio MS-TRI FM (live perform Acoustic)\r\n-Live \"WARUNG DEEBONG\" Jak-Pus\r\n-Live \"PRO JAM\" 2016 At Lap. BLOK M SQUARE Jak-Sel\r\n-Live Halaman gedung \"KEMENPORA RI\" Jak-Sel\r\n-Live Grand Charly Rawamangun Square (Gigs)\r\n-Live \"PASAR SENI ANCOL\" Jak-Pus\r\n-Live \"OUTFEST 2017\" Ex Golf Driving Range senayan\r\n-Live universitas JAYABAYA PULOMAS JAKARTA\r\n-Live in JAKARTA FAIR 2017','Rock','instagram;','Jakarta',23,'2017-08-03 15:09:12','2017-08-03 15:09:12'),
	(13,'HIVE ID','1501818701.JPG','Berawal dari band kampus yang dibentuk oleh Faisal, Aha, dan Aris di akhir 2010, mimpi yang besar dan keinginan untuk tetap menjalankan passion bermusik walaupun setelah lulus kuliah menjadikan HIVE tetap eksis hingga sekarang.\r\n\r\nTelah aktif manggung di Jakarta sejak akhir 2015 khususnya di scene indie berbasis komunitas tempat mereka aktif bersosialisasi, 101% Music Community, HIVE mulai dikenal luas di Jakarta, dan telah bermain di beberapa panggung besar seperti panggung Cardinal di Pekan Raya Jakarta dan juga telah pernah tampil live sebagai guest star di program Teras Sore di Elshinta TV.\r\n\r\nKini di tahun 2017, HIVE fokus kembali ke root mereka sebagai musisi yaitu untuk berkarya, kembali ke studio untuk menyelesaikan beberapa lagu barunya yang siap untuk direkam dan diperdengarkan ke khalayak.\r\n\r\nKesempatan yang ditawarkan Levi\'s Band Hunt merupakan peluang emas bagi HIVE untuk bisa mendapatkan partner yang mumpuni dalam memperdengarkan karya-karya bermusik terbaru mereka, karya musik yang memadukan karakter vocal falsetto khas dari Aha yang berbau Japanese Rock, dengan aransemen musik khas British yang banyak dipengaruhi oleh Radiohead, Oasis, dan tentunya, The Beatles.\r\n\r\nGet ready to be HIVED.\r\n\r\nFB Page: https://www.facebook.com/HIVE.ID.OFFICIAL/\r\nTwitter: @HIVE_ID\r\nYoutube Channel: https://www.youtube.com/channel/UC1s4jn4MzCy63uNKwlgT1Sw','Alternative Rock','instagram;','Jakarta',10,'2017-08-04 02:51:41','2017-08-04 02:51:41'),
	(14,'Dua Pintu','1501994272.JPG','Terbentuk tahun 2015. Dua Pintu merilis EP tahun 2016 di Earhouse. Tampil di beberapa festival: Hai Day 2015, RRI Pro2 Indie Fest, Pamulang festival. Gigs: Round Up by Indoestri, Ruang Musik, dll. Media coverage by: Hai Magazine, Deathrockstar, Googs, Ganlob. Radio airplay/chart: 8eh ITB, Kiss FM Medan. EP available at Eargasm record store Ps. Santa; Digital stores/ streaming platforms.','Alternative Rock','teman;','Jakarta',35,'2017-08-06 03:37:52','2017-08-06 03:37:52'),
	(15,'JNKY','1502010470.png','Kami adalah band yang baru saja terbentuk tahun 2017, dan kami menyajikan kombinasi genre music pop dan rock dengan karakter vocal yang unik.','Pop','instagram;','Yogyakarta',36,'2017-08-06 08:07:50','2017-08-06 08:07:50'),
	(16,'High Gain','1502043188.JPG','We didn\'t play music\r\nBut what we do, telling stories.','Others','instagram;','Jakarta',37,'2017-08-06 17:13:08','2017-08-06 17:13:08'),
	(17,'Dynamic Trio','1502127897.jpg','Dynamic Trio terbentuk pada tahun 2013, berawal dari teman nongkrong, dan jamming bareng, awal manggung biasanya bareng komunitas blues setempat, lalu mulai dibawa oleh legend blues indonesia, Alpha De Frets untuk main reguler di beberapa cafe, sempat reguler di cafe daerah bsd untuk 2 tahun, Dynamic Trio di pilih untuk menjadi endorser/ brand ambassador dari Brand Squier Guitar and Bass dan Mapex Drum, bersama artis seperti Yoyo Bassman, Ferri HK, dan Andi Bayou, beberapa kali melakukan clinic dan manggung di pameran yang diadakan oleh PT Citra Intirama selaku distributor tunggal Squier dan Mapex. Dynamic Trio juga sudah beberapa kali main diluar kota seperti Bandung, Surabaya, dan yang terakhir tahun 2015 di kota Palu, bersama artis seperti Gideon Tengker, Indah Winar, Yoyo Bassman, dll.','Blues','facebook;','Jakarta',40,'2017-08-07 16:44:57','2017-08-07 16:44:57'),
	(18,'JAD !!','1502157155.jpg','Saya seorang penyanyi solo dengan format band. Setiap event yang ditawarkan saya meminta bantuan orang yang berbeda untuk mengisi band. Saya sering mengisi beberapa event seperti wedding, acara gereja, terakhir saya mengisi di diversity run Bandung. Prestasi terbaik pernah menjuarai Ignatius Got Talent (Juni 2017). Saya berharap bisa memenangkan kompetisi ini agar saya bisa mendapat kesempatan lebih banyak untuk menghibur banyak orang.','Alternative Rock','facebook;instagram;informasi_toko;vipclub;','Jakarta',41,'2017-08-08 00:52:35','2017-08-08 00:52:35'),
	(19,'evnflo','1502161724.png','band ini berawal dari mahasiswa dari Universitas Lampung yg sering diundang untuk acara internal kampus. namun seiring berjalannya waktu, kami menjadi salah satu band yang diperhitungkan di Lampung. sampai saat ini, kami sering perform sebagai guest star baik dari panggung skala kecil sampai skala besar.','Rock','instagram;teman;','Jakarta',42,'2017-08-08 02:08:44','2017-08-08 02:08:44'),
	(20,'Abe Project','1502163529.JPG','Abe Project merupakan bagian dari Rising Star Indonesia Tahun 2014\r\n\r\nJuara 1 Acustico Baywalk Mall\r\n\r\nPrestasi Personil :\r\nJuara 3 singing competition XL Axiata (Evin Kusuma-Gitaris Abe Project)\r\n\r\nIklan Djarum (Adam-Bassist Abe Project)','Pop','teman;','Jakarta',43,'2017-08-08 02:38:49','2017-08-08 02:38:49'),
	(21,'Elegant Band','1502167300.PNG','terbentuk 17 June 2017. Juara Festival Band di Kecamatan Cibarusah Bekasi.','Rock','facebook;instagram;','Jakarta',46,'2017-08-08 03:41:40','2017-08-08 03:41:40'),
	(22,'HocuspocuZ','1502184685.jpg','HocuspocuZ; berdiri lewat pencarian kepuasan serta penggabungan idealisme dalam bermusik, terbentuk pada tanggal 14 Februari 2004 yang lalu. Perjalanan bersama yang cukup panjang tersebut menyumbangkan banyak pengalaman bagi band ini, untuk ikut dalam berbagai macam event dan kompetisi baik lokal maupun nasional. \r\n\r\nAdapun achievement yang pernah didapat adalah :\r\n- Juara 4 Festival Musik Indie (Indiecaholic), by Sampoerna (2014).\r\n- 12 Bear Finalis Gudang Garam Rock Competition, by Log Zhelebour.\r\n- Finalis, Best Guitar, Best Drummer : Cardinal Music Awards at Kuta - Bali (2009)\r\n- Finalis Hardrock Calling at Kuta-Bali (2011)','Rock','instagram;','Surabaya',49,'2017-08-08 08:31:25','2017-08-08 08:31:25'),
