	(25,'Neverland','1502202082.PNG','Band yang terbentuk secara pertemanan dari kecil, bikin lagu lalu upload di youtube, masing-masing personel pernah punya band sendiri.','Alternative Rock','instagram;','Jakarta',56,'2017-08-08 13:21:22','2017-08-08 13:21:22'),
	(26,'LAMAFA','1502204414.JPG','Lamafa adalah sebuah band folk asal Jakarta yang digawangi oleh Achgulanjo pada Vocal dan Satrio pada Guitar. Lamafa sendiri berdiri sejak Oktober 2016 dengan mengusung genre folk ethnic. Awalnya Satrio ingin membuat proyek solo bermaterikan Ethnic instrumentalia yang sudah digarap sejak awal 2016. Namun pada pertengahan jalan ia mengalami stuck dan memutuskan untuk memformulasikan musik tersebut dengan format band. \r\nAchgulanjo (jojo) sapaan akrabnya memiliki ketertarikan pada musik-musik blues,reggeae, rockabilly dan musik Indonesia era 70-an. Sedangkan Satrio memiliki ketertarikan pada musik jazz,soul,folk dan alternative. Irama dan lirik yang ada dalam album mata air mata ini merupakan asimilasi dari influence musik Satrio dan Achgulanjo.\r\nInstrument yang kami gunakan berupa; bass,gitar,perkusi dan strings. Musikalitas kami disupport juga oleh dua  additional player bass dan perkusi. Hal ini menjadikan warna yang berbeda saat Lamafa bermain live. \r\nArti dari nama Lamafa adalah julukan seorang pemburu paus di lamalera,NTT. Terdapat nilai filosofis yang unik ketika kami memutuskan untuk menggunakan nama Lamafa. Pemburu paus di lamalera memiliki tujuan yang mulia dengan rela berkorban memburu paus ditengah lautan menggunakan peralatan sederhana demi kelangsungan hidup dan ritual adat  masyarakat setempat. Berangkat dari hal tersebut kami menghubungkan filosofi ini dengan musik. Ambisi dan tekad seorang lamafa kami coba terapkan dalam mengarungi dunia musik yang cukup fluktuatif dan dinamis. Kami berharap mampu menelurkan karya-karya musik yang memiliki energi dan intensitas yang baik untuk semua penikmat musik Indonesia.\r\n\r\n\r\nPrestasi : Juara 1 Band Audition 7th Ramadhan Jazz 2017','Folk','facebook;instagram;guitar_plus;','Jakarta',63,'2017-08-08 14:00:14','2017-08-08 14:00:14'),
	(27,'D\'Vriza','1502207017.jpg','Kami adalah grup band yang beraliran pop progresive, yang mulai terbentuk pada pertengahan tahun 2011. Kami beberapa kali berkesempatan menjadi guest star pada even di Mall di daerah Depok dan Bogor. Selain itu kami juga sempat menjadi band reguler di beberapa kafe di Bogor dan Jakarta.','Pop','facebook;','Jakarta',66,'2017-08-08 14:43:37','2017-08-08 14:43:37'),
	(28,'Black drama','1502208846.JPG','Kami adalah band yg berasal dari daerah sulawesi tengah,bermusik di ibu kota , suda mengikuti event2 di ibu kota seperti jkarta fair,miss eart,dan masi banyak lagi','Rock','facebook;instagram;','Jakarta',68,'2017-08-08 15:14:06','2017-08-08 15:14:06'),
	(29,'Secret Wall Revenge','1502209132.jpg','Ditahun ini kami akan merilis mini album yang bertemakan tentang kemanusia, album ini akan berisi 6 lagu. 1 intro, 2 lagu recycle dari lagu kami terdahulu, 2 lagu baru, dan sebuah lagu dari band metal papan atas indonesia yang akan kami cover dengan versi yg berbeda','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;teman;lainnya;','Jakarta',64,'2017-08-08 15:18:52','2017-08-08 15:18:52'),
	(30,'Toilet Surfers','1502211608.jpg','Toilet Surfers, sebuah kuartet punk rock asal ibukota, berdiri pada 2015 silam. Pada Juni 2016, kami menjadi headliner pada acara \'Punk Parade by Cardinal Awards\' di Pekan Raya Jakarta. Agustus 2016, kami merilis sebuah single secara independen berjudul \"Sick Weirdo\" yang didistribusikan secara digital melalui iTunes, Spotify, Amazon Music, dan lain sebagainya. Pada Juli 2017, kami kembali menjadi headliner pada acara \'Punk Parade by Cardinal Awards\' di Pekan Raya Jakarta.','Rock','teman;','Jakarta',72,'2017-08-08 16:00:08','2017-08-08 16:00:08'),
	(31,'PeKa','1502221060.jpg','Bogie,Emre,Lucky dan Reynard (additional player) pernah tergabung dalam band Venue dibawah label Keci Music, Kekuatan dan gairah bermusik yang selalu ada membuat kami selalu \"PeKa\" untuk membuat karya-karya musik dan ingin kembali menyentuh penikmat musik di Indonesia.. pada awal mula prestasi kami sebagai Band (Venue) pernah menjadi 20 besar Finalis A Mild Most Wanted wilayah Jabar,membuat single di album KFC keci catchy star (Keci), Ost Dalam Mihrab Cinta album kekuatan cinta (KFC), semoga kami dapat berkarya dan berprestasi lebih dengan adanya event dari Levi\'s ini...salam hangat dari kami -PeKa-','Pop','instagram;','Jakarta',78,'2017-08-08 18:37:40','2017-08-08 18:37:40'),
	(32,'Spiky Monster','1502227072.jpg','Spiky Monster adalah band pop punk yang berdiri sejak tahun 2011. dan ketika itu terbentuknya ketika masih dalam bangku smp\r\nSpiky Monster telah mengeluarkan album dan video clip secara mandiri, dimana semua pengerjaan dilakukan oleh tim spiky monster dan teman teman para personil','Others','facebook;','Yogyakarta',81,'2017-08-08 20:17:52','2017-08-08 20:17:52'),
	(33,'Lorong Waktu','1502248374.JPG','band rock asal medan yang terbentuk di pertengahan 2015 dan sudah merilis EP di 2016 kemarin bersamaan 2 video klip','Rock','instagram;','Medan',61,'2017-08-09 02:12:54','2017-08-09 02:12:54'),
	(34,'HOPE REBEL','1502253682.jpg','Sebuah band yang membawakan genre Punk Rock. Mereka berasal dari salah satu kota di Jawa Tengah yaitu Brebes. Mereka beranggotakan 3 orang yaitu Anzas Gembul (Vocal and Guitar) , Denny (Backing Vocal and Bassist), Uyiex (Drummer). Mereka banyak terpengaruh oleh The Living End, Superman Is Dead, Tiger Army, Suicidal Sinatra, Green Day, Blink 182, Bad Religion, DESALUKANEGARA, Anti Flag.','Alternative Rock','facebook;instagram;','Jakarta',97,'2017-08-09 03:41:22','2017-08-09 03:41:22'),
	(35,'CABRON','1502257455.jpg','Cabron adalah band Funk Rock asal Jakarta yang dibentuk pada tahun 2017. Cabron bermula sebagai evolusi dari band HEADmove yang beranggotakan Ald (Gitar & Vokal), Hendri (gitar), Reza (Bass), dan Dio (Drum) yang telah dibentuk sejak 2008 lalu.\r\n\r\nNamun, ditengah-tengah perjalanannya, Dio dan Reza mendadak mengundurkan diri mereka dari HEADmove. Ald dan Hendri kemudian mengajak Martyn (Bass) serta Ganda (Drum) untuk bergabung dan mengisi kekosongan pada band itu. Ald lalu menyarankan mengubah nama band mereka menjadi Cabron.\r\n\r\nNama Cabron sendiri di ambil dari bahasa latin yang artinya \"berandalan\" .. Namun kami mengartikan kata \"berandalan\" tersebut dengan arti lain, yaitu : berandalan dalam berkarya.\r\n\r\n\r\nGaya bermusik Cabron sangat dipengaruhi oleh RHCP, sebuah pengaruh yang seringkali disebut sebagai sebuah \"inspirasi\" oleh para anggotanya. Sebagai tambahan, para anggota Cabron juga menyebutkan Extreme, Wild Cherry, Lenny Kravitz, dan masih banyak lagi sebagai band atau grup musik yang membuat gaya bermusik mereka menjadi seperti sekarang ini.\r\n\r\nSaat ini Cabron tengah menggarap EP (Extended Play/Mini Album) secara Indie sebagai modal awal kami untuk meramaikan pergerakan musik Funk di Indonesia khususnya di Jakarta.','Funk','instagram;teman;','Jakarta',99,'2017-08-09 04:44:15','2017-08-09 04:44:15'),
	(36,'D\'Ark Legal Society','1502258601.jpeg','D\'Ark Legal Society adalah band Alternative Metal dari Jakarta.\r\n\r\nD\'Ark Legal Society terbentuk tahun 2007 dan telah merilis 1 EP (Life) dan 1 album (Fruit of Chaos - 2015).  \r\n\r\nTahun 2017 ini D\'Ark Legal Society atau biasa di kenal sebagai D.L.S. akan mewakili Indonesia ke festival musik International di Quebec, Canada, bernama Envol et Macadam.  Dan juga tanggal 9 September mendatang D.L.S. akan merilis EP yang bertajuk \"Simulacra\"','Rock','facebook;guitar_plus;','Jakarta',103,'2017-08-09 05:03:21','2017-08-09 05:03:21'),
	(37,'No Resign','1502259023.jpg','No Resign berdiri ketika Zakir dan Okie sedang bermain disalah satu studio musik, mereka berdua hanya bermain iseng-iseng atau biasa disebut \"jammin\" Pada saat itu, Zakir mencoba menghubungi Ichal untuk coba menjadi drummer dalam band. Berselang 2 hari No Resign pun merecord sebuah lagu yang berjudul \"Selamat Jalan\" yang akan dijadikan single pertamanya nya dalam album \"The Sun Goes Down\"','Alternative Rock','facebook;','Jakarta',104,'2017-08-09 05:10:23','2017-08-09 05:10:23'),
	(38,'Klarity','1502260160.JPG','Dear Levi\'s Band Hunt Team, \r\n\r\n8 tahun kami bersama dalam bermain musik pada tahun ke 6 kami membentuk \"Klarity\" sebagai karakter musik kami \"Jelas dan Apa Adanya\". Genre pada group ini juga tidak terfokus hanya pada satu aliran (mostly Alternative Rock) namun kami juga memberikan beberapa aliran berbeda sehingga musik ataupun karya yang kami hasilkan jauh lebih berwarna. Beberapa pengalaman yang sudah kami lewatkan yaitu :\r\n- As a Guest Star at Margo Friday Jazz\r\n- As a Band Ambassador HAI Magazine (HAI Demos Band) pada acara Tumplek Blek \"Otobursa\"\r\n- As a 3rd winner di kediaman Bang Iwan Fals \"StudiKota Competition\"\r\n- As a Guest Star at Kompas Gramedia Kebon Jeruk\r\n- As a Guest Star at Marley Cafe Energy Building SCBD\r\n- As a Guest Stay at PENSI 48 HS, 39 HS, 28 HS, 6 HS.\r\n- DLL\r\nMelalui ini kami selalu berusaha untuk terus belajar dan mencari kesempatan untuk kami terus mengembangkan pengalaman kami dalam bermusik. Semoga bersama lagu dan pengalaman yang telah kami kirimkan dapat menjadi bahan pertimbangan untuk para dewan juri dan para penikmat musik. Sekali lagi terimakasih dan suses selalu.\r\n\r\nWarm Regards,\r\nKlarity','Alternative Rock','instagram;','Jakarta',105,'2017-08-09 05:29:20','2017-08-09 05:29:20'),
	(39,'REJECTED KIDS','1502263566.jpg','Band ini terbentuk pada awal 2004 dimana saat itu helmy dan 2 personil lama yaitu Ostra dan Ridzki masih duduk dibangku sekolah menengah pertama. Sekitar tahun 2007 tirta masuk untuk membantu gitar dan back vocal kemudian kami merilis ep yang berjudul \"unspoken feelings\" yang dirilis oleh plush records. Singkat cerita lalu ditahun 2011 kami merilis sendiri album kami yang berjudul \"A New Chapter Has Begun\" dengan fallacies records dan juga kami bekerja sama dengan big circle records (slovenia) dan bells on records (japan), di album ini Ostra sudah tidak bermain gitar yang kemudian digantikan dengan ragam kusdinar, lalu seiring berjalannya waktu perubahan personil pun kembali terjadi, Ridzki yang saat itu bermain bass harus digantikan dengan agung karena kesibukan pekerjaan lalu disusul ragam pada tahun 2016 yang ikut juga harus keluar dan digantikan oleh ridwan sampai sekarang dan pada tahun itu juga kami kembali merilis album yang berjudul \"home\" yang dirilis oleh rise and girnd records dan IIOI records (singapore) dilanjutkan dengan serangkaian tour malaysia-singapore yang kami beri nama \"no reason to stop\" ditahun yang sama. Terakhir kemarin kami juga baru saja mengadakan tour beberapa kota yaitu Bali, Malang, Jogjakarta, Bandung, dan Jakarta bersama beberapa band japan (waterweed, dradnats, dan lext).','Others','facebook;','Jakarta',106,'2017-08-09 06:26:06','2017-08-09 06:26:06'),
	(40,'ALLEIA','1502269417.jpg','Hallo apa kabar semuanya??\r\n\r\nlagu yang kami kirimkan berjudul DENGAN SENYUMAN direkam pada tahun 2013 awal bulan, lalu ikutan demoday trus diajak rekaman sm Capung Javajive, bikin album deh... hehehe. ini ada beberapa press release  tahun 2013 hahah kelamaan yakkk. \r\n\r\nPress Release 2013 Alleia, adalah sebuah band yang berasal dari kota Bandung beranggotakan 5 personel yang dibentuk pada awal tahun 2010 oleh Feroz,Izzy,dan Anggie yang kuliah di Fakultas Ekonomi Universitas Parahyangan,Ryan (Universitas Padjajaran),Surya (Universitas Islam Bandung) . Perjalanan Alleia dimulai dengan merambah berbagai macam panggung di sekitar kampus juga beberapa cafe di kota bandung. Berbekal sebuah demo lagu yang berjudul “Dengan Senyuman” , mereka mencoba peruntungan dengan mengikuti sebuah acara komunitas musik “Demoday” Bandung yang digagas oleh kang Capung “JavaJive”, setelah melewati berbagai macam diskusi positif dalam acara tersebut akhirnya tercapailah keputusan membuat sebuah album dengan keterlibatan musisi ternama seperti Capung JavaJive, sebagai Produser , untuk mendukung proses dari awal pembuatan hingga release-nya single perdana Alleia pada tahun 2013 ini. Dengan mengusung tema musik Pop- yang dikemas penuh warna juga mudah dimengerti, pada lead guitar, Ryan sangat menyukai genre musik rock-blues, guitar rhytm Izenk menyukai genre music Pop-Rock sementara drummer Surya dan bassis, Anggi, menyenangi aliran Funk-beat, Lalu ditambah vokalis, Feroz, yang menggemari genre music Alternative. Perbedaan aliran tersebut dicampur menjadi satu membuat genre musik Alleia terdengar sangat unik. . Dari penggabungan talenta masing-masing personil yang saling melengkapi, seluruh ide dan kreativitas dalam mencipta karya diakomodasi sebagai bentuk ekspresi untuk bergabung baik dalam industri musik juga dengan para pecinta musik Dalam single pertama yang berjudul “Selamanya”, Alleia ingin menyampaikan sebuah karya yang ekspresif, easy listening dengan lirik yang catchy namun tidak kacangan dan terdengar lebih menyegarkan bagi anak-anak muda jaman sekarang, dengan harapan berbonus impresi terhadap pendengar musik di berbagai kalangan. Dengan segala kerendahan hati dan obsesi sederhana ingin menyemarakkan warnawarni apresiasi musik negeri ini, Alleia lahir, hadir dan bersemangat untuk Indonesia.\r\n\r\n\r\nhttps://musik.kapanlagi.com/rising-star/alleia-andalkan-pop-aneka-warna-37974f.html\r\n\r\n\r\nKapanlagi.com - Band asal Bandung yang diberi nama Alleia ini dibentuk tahun 2010 oleh Feroz (vokal), Izenk (gitar), Anggi (bass), Ryan (gitar), dan Surya (drum). \r\nPerjalanan bermusik mereka dimulai dari panggung di sekitar kampus dan kafe yang ada di Kota Kembang. Dan berbekal sebuah demo lagu berjudul Dengan Senyuman, mereka pun mencoba peruntungan dengan mengikuti sebuah acara komunitas musik Demoday Bandung yang digagas oleh Capung \'Java Jive\'.\r\n\r\nSetelah melewati berbagai macam diskusi positif dalam acara tersebut, akhirnya tercapailah keputusan untuk membuat album dengan keterlibatan Capung sendiri sebagai produser. Hingga terciptalah single perdana Alleia di 2013 ini.\r\n\r\nMengusung tema pop yang dikemas penuh warna membuat Alleia justru tampil unik. Semua itu merupakan campuran dari hobi masing-masing personel yang memiliki hobi dan warna musik yang berbeda-beda. Ryan mencintai musik rock-blues, Izenk lebih ke pop rock, Surya dan Anggi menyukai funk-beat, dan Feroz di alternatif.\r\n\r\nDi single perdananya berjudul Selamanya, Alleia ingin menyampaikan sebuah karya yang ekspresif, easy listening, dengan lirik yang catchy namun tidak kacangan dan terdengar lebih menyegarkan. Mereka berharap single ini juga berbonus impresi terhadap pendengar musik di berbagai kalangan.\r\nitu duluu........\r\n\r\n2017.....\r\nTapi saat ini kami sudah indie mencoba peruntungan kembali untuk maju kembali dan ingin memberikan angin segar.... kalo bisa juga angin gelebug yah biar bisa menghantam..... hehehe  \r\n\r\ncontact person\r\nANGGIE GUSTIAR \r\n081313999980','Alternative Rock','facebook;instagram;','Jakarta',102,'2017-08-09 08:03:37','2017-08-09 08:03:37'),
	(41,'olsam','1502269752.jpg','OLSAM adalah sebuah grup orkes kontemporer berdiri sejak  Ramadhan 2017 yg suka gegendingan dan wara wiri naek vespa dibilangan cagar alam depok , \r\ndigawangi oleh : \r\nJakul Gendang\r\nZamal Melod\r\nRudibagol Rhytm\r\nOcan Tamborin\r\n\r\nKalo ade jarum yg patah jangan simpen dalem peti , kalo ade kata yg salah jangan di simpen dalem ati .\r\nFrom gang with love \r\n\r\n#orkeslaughscooterandmanymore','Others','teman;','Jakarta',113,'2017-08-09 08:09:12','2017-08-09 08:09:12'),
	(42,'The Flins Tone','1502270702.jpg','Terbentuk sejak 2004 sebagai projek \"iseng-iseng\" satu keluarga hingga akhirnya kita memutuskan untuk serius dan merilis EP \"Flinsnopsis\" di tahun 2011. Setelah ada beberapa pergantian personil, kami tidak bisa berhenti disitu saja, setaun kemudian kami merilis full album pertama kami \"He\'s the Best Actor for this Episode\". Dan pada tahun 2016 lalu kami merilis full album kedua kami \"Good News\". Semua album kami rilis secara independen. Pada tahun 2015 akhir kami juga mendapatkan kesempatan untuk muncul sedikit di video clip salah satu band idola kami New Found Glory, untuk lagu \"Ready and Willing\". Hingga di akhir 2016 lalu kami mendapat kabar bahwa \"Good News\" masuk nominasi \"Produksi karya metal terbaik\" (meskipun sebenarnya kami bukan metal) di ajang AMI AWARDS 2016 yang sejauh ini merupakan prestasi terbesar kami sebagai sebuah band.','Rock','facebook;teman;','Surabaya',114,'2017-08-09 08:25:02','2017-08-09 08:25:02'),
	(43,'RoyalBandit','1502272632.jpg','Rebel rockers asal jakarta yang konsisten dengan musik rock nya , lirik yang membicarakan masalah sosial menjadi andalan RoyalBandit mengarungi deras nya dunia musik indonesia, band ini pernah menjadi pembuka KPR (kelompok penerbang roket) dan Superglad di jakarta fair 21 juni 2017 .\r\nBesar dari panggung ke panggung karena radio dan televisi terlalu mengecilkan aliran yang royalbandit bawakan.','Rock','instagram;','Jakarta',115,'2017-08-09 08:57:12','2017-08-09 08:57:12'),
	(44,'Rhetoric states','1502284360.JPG','Adalah sebuah ikatan persahabatan antara Maul Skiba dan Yudhi WarMan yang menjadi bakal terbentuknya band punk rock asal Tangerang ini. Perkenalan keduanya pada genre punk California dekade tahun 90an, seperti Bad Religion, Pennywise, Rancid, The Offspring, Total Chaos, Operation Ivy, NOFX, membawa aroma tersendiri pada terbentuknya punkrock ala Rhetoric States (RXS). Sering bergonta-ganti drummer, bergonta-ganti nama band, sampai akhirnya Oktober 2006 mendapatkan nama yang bertahan hingga saat ini. Kata \"Rhetoric\" diilhami dari salah satu bait pada lagu band punkrock lawas asal California Bad Religion, dan menggabungkan kata \"States\" yang memiliki nilai falsafah, bahwasanya Rhetoric States adalah sebuah resistensi dalam diri untuk tidak terbuai dengan janji-janji politik penguasa negeri.\r\n \r\nFormasi awal Maul Skiba (gitar, vokal), Yudhi WarMan (bass, vokal) dan Bima Sky (drums) menelurkan Live Demo \"Factory Of Hell\" dirilis tahun 2007 diproduksi 100 keping CD, dengan singel \"Di Bawah UMR\" yang didedikasikan untuk perjuangan buruh di Indonesia. Lalu tahun 2011 RXS meriliskan album EP \"First Blood\", album yang berisi kisah aktivis era reformasi \'98 penuh dengan aroma perjuangan, cinta dan revolusi. \"Bangkit dan Hancurkan\", \"Bungaku\" dan \"Paling Benar Sedunia\" menjadi lagu-lagu yang ditunggu dan menjadi andalan dalam setiap pentas. Lagu \"Pemuda\" yang mampu memacu adrenalin dapat dilihat official video clip nya di Kanal https://youtube.com/rhetoricstates. Proses mixing dan mastering album \"First Blood\" dilakukan di Bandung oleh Yoni Gayot, sound engineer band-band fenomenal seperti, Superman Is Dead (Bali), Rocket Rockers (Bandung), Koil (Bandung), dan sebagainya.\r\n \r\nAwal tahun 2012, RXS mendapat apresiasi dari Majalah Hai, berkesempatan membuka konser Anti-Flag band punkrock politikal asal Amerika Serikat di Jakarta. Dan bulan Februari, lagu \"Bungaku\" terpilih masuk dalam kompilasi CD \"Independent Love Song\" Majalah Hai bersama band Last Child (Jakarta) dan beberapa band lainnya. Sampai di Januari 2013 menapakkan kaki di negeri tetangga Malaysia, dalam \"Semenanjung Malaysian Tour\" di dua kota, \"Pesta Hantu Violence vol.3\" di Shah Alam dan di Rumah Api, Kuala Lumpur.\r\n \r\nAwal tahun 2014 , Bima Sky (drums) digantikan oleh Luffy DC. Mei 2015, selanjutnya Rhetoric States merampungkan Tour Malaysia untuk yang ke dua kalinya, kali ini di Kuala Lumpur dan Penang. Bertema \"Semalam di Malaysia\".\r\n \r\nAktifit bergerak bersama dalam kegiatan sosial donor darah \"Blood Care\" kegiatan rutin 3 bulanan. Mengajak kawan-kawan aktifis punkrock Tangerang, sebagai wadah kebersamaan yang dapat membantu sesama.\r\n \r\n \r\nLine Up:\r\nMaul Skiba – Vokal/Gitar\r\nYudhi WarMan – Vokal/Bass\r\nLuffy DC – Drum\r\n \r\nRXS Base\r\nJl. Mandala No. 37 RT 003/01, Tanah Tinggi\r\nKota Tangerang – Banten 15119','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;teman;lainnya;','Jakarta',124,'2017-08-09 12:12:40','2017-08-09 12:12:40'),
	(45,'Felicia','1502286194.jpg','Felicia terbentuk november 2016. Terbilang baru namun bukan pemula dalam dunia musik. Masing-masing personel memiliki pengalaman pada gorup/band sebelumnya yang membuat felicia semakin mantap.\r\nBelum lama terbentuk felicia sudah diundang dalam beberapa event di Jogja karta, beberapa event menjadi guest star.\r\nPada tahun 2017 felicia merilis single pertama yang berjudul steffany, sudah bisa dinikmati di gerai musik online.','Alternative Rock','instagram;teman;','Yogyakarta',129,'2017-08-09 12:43:14','2017-08-09 12:43:14'),
	(46,'Alurmaju','1502290748.jpg','Alurmaju adalah sebuah projek Solo Faizal Aditya R. yang diresmikan pada pertengahan 2016 di Yogyakarta. Sebagai frontman, Faizal berperan sebagai Vokalis & Gitaris (Songwriter) di projek ini. Mengusung aliran Pop Nusantara, projek ini awalnya dibentuk untuk mewadahi beberapa lagu yang tercipta semenjak 2012 tapi dirasa kurang pas dibawakan di projek Faizal yang lain. Karenanya, lewat projek ini Faizal berharap dapat menyalurkan dan mempresentasikan karya-karya tersebut dengan baik. Projek ini pertama kali diperkenalkan di Sebuah Event Daerah FKY (Festival Kesenian Yogyakarta )2016 dengan format full band. Ketika di panggung biasanya dibantu oleh beberapa player additional. di tahun 2017,Saat ini tengah menyelesaikan rekaman EP (Mini Album) Pertamanya.','Pop','instagram;teman;','Yogyakarta',137,'2017-08-09 13:59:08','2017-08-09 13:59:08'),
	(47,'Flowchart','1502292684.jpg','History\r\n\r\nFlow Chart, musisi  musisi muda asal Bekasi yang memberikan sebuah warna baru dengan menuangkan dua vokal tunggal di dalamnya, dan Flow chart memulai karirnya dengan nama awal The Flowchart (18 Februari 2015). Dari nama awal tersebut telah melahirkan satu buah single \"Takkan Terlupa\" dan satu buah Album yang bertajuk \"Kita , Dia dan Mereka\" di bawah label rekaman Rush Record Production, dimana ada satu lagu yang dikeluarkan untuk promo Album tersebut yang berjudul Hadapi dan Lalui , dan lagu tersebut masih turut berkontribusi serta dibawa kedalam reinkarnasi flow chart hingga kini.\r\nNama Flow Chart pun di resmikan pada tanggal 17 juni 2017 setelah menetapkan personilnya dengan : Koy (Lead Vocal), Dianto (Vocal), Ical ( Bass), Tomkids (Lead Guitar), Sandi (Rhytm Gitar), dan Agung (Drum). Dengan 3 punggawa baru ( Tomkids, Agung, dan Sandi) Flow Chart mengluarkan single terbaru yang berjudul \"Curhat\" dan lagu ini merupakan simbol perubahan konsep yang lebih melekatkan nuansa Pop Punk di dalam aransement musik Flow Chart itu sendiri.\r\nSedangkan untuk lagu dan lyrik yang disajikan Flow Chart tidak jauh berbeda dengan sebelumnya, kami masih membahas tentang isu seputar percintaan, kehidupan, dan persahabatan. Memilih genre Pop Punk adalah jalan tengah bagi kami yang berlatar belakang musik yang berbeda seperti punk rock, metal dan lain nya. \r\nArti nama Flow Chart itu sendiri adalah gambaran langkah - langkah dalam menyelesaikan suatu masalah, dan nama inilah yang memotivasi mereka sebagai pacuan untuk memulai, melangkah, dan meraih mimpi dengan apa yang telah dijalani, dimana baik buruknya suatu masalah pasti akan terselesaikan.\r\nMengenai influence, sebenarnya banyak band yang menginspirasi dikarenakan selera kami yang beragam. Namun kami begitu mengagumi All Time Low, New Found Glory, Blink 182, Angels and Airwaves, dan Paramore. \r\nMengenai visi dan misi band ini, kami ingin muncul ke masyarakat luas, dan dapat memperdengarkan hasil karya kami tersebut dalam suatu alunan musik yang dicintai masyarakat. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nFlowChart Experiences\r\n\r\nBekasi Population” Pensi @ SMK Mangunjaya, 22 Desember 2015\r\nBekasi Expo 2017 @ Summarecon Mall Bekasi, 16 Maret 2017\r\nMesin Bersatu XIII @ Kampus Unisma Bekasi, 18 Maret 2017\r\nBekasi ClothFest @ Kota Harapan Indah Bekasi, 1 April 2017\r\nBeFEST Bekasi Food Festival @ Bekasi Town Square, 15 April 2017\r\nMusic Creativity Ripstore Asia @ Condet, 16 April 2017\r\nIndie Revive #1 @ Abnormal Cafe Cilegon, 30 April 2017\r\nHello! Good Ideas @ Condet, 28 Maret  2 April 2017\r\nDont Forget Your Roots @ Rossi Fatmawati, 13 Mei 2017\r\nBogor Clothing Fastingval @ Gor Padjajaran Bogor, 16 Juni 2017\r\nPekan Raya Jakarta (PRJ) @ Jakarta Fair Kemayoran Gambir Stage, 16 Juli 2017\r\n A Zone Go A Head People @ Castle Disctrict Bekasi, 30 Juli 2017','Others','facebook;instagram;informasi_toko;poster;teman;lainnya;','Jakarta',142,'2017-08-09 14:31:24','2017-08-09 14:31:24'),
	(48,'Chuck Jones','1502294807.jpg','Chuck Jones terbentuk tahun 2008, dimana kami berkeinginan untuk membuat suatu karya musik yang bisa diterima semua kalangan masyarakat luas','Alternative Rock','facebook;','Jakarta',146,'2017-08-09 15:06:48','2017-08-09 15:06:48'),
