	(50,'Redzahra','1502298485.jpg','Band dengan teman satu sekolah yang awalnya dibentuk untuk mengisi acara Pensi. semenjak itu band ini diteruskan dan memiliki lagu-lagu sendiri','Pop','facebook;','Jakarta',153,'2017-08-09 16:08:05','2017-08-09 16:08:05'),
	(51,'NEVERLONE','1502305317.jpg','NEVERLONE\r\nTepat pada Tanggal 21 April 2011 …\r\nBerawal dari kesamaan dalam hobby musik, Uwiek ( Lead Vocal ), Riki ( Screamming Vocal & Rapp ),  Zhany ( Bass ), Butoy ( Guitar ), Abee ( Synthe ), Aan ( Drum ) mencoba menyatukan visi dan misi dalam membentuk sebuah grup band Yaitu NEVERLONE yang berasal dari kota Jakarta .\r\n\r\nNama NEVERLONE sendiri di ambil dari bahasa inggris yang terdiri dari NEVER dan ALONE yang artinya Tak Pernah Sendiri. Namun agar terdengarnya simple dan mudah di ingat jadi kami memutuskan untuk menggabungkan kata kata tersebut menjadi NEVERLONE. Makna dari kata kata yang kami buat dengan nama NEVERLONE yang sebenarnya adalah agar semua personil tak pernah merasa sendiri dalam berkarya di musik, sekaligus agar semua orang bisa menikmati dan tidak pernah merasa sendiri setelah mendengarkan lagu NEVERLONE.\r\n\r\nSeiring berjalan nya waktu dalam mencari jati diri NEVERLONE, yang sesungguhnya cukup memakan waktu yang sangat lama dan tidak instan pertama kali kami mengusung Genre Pop, Pop Rock, Kini NEVERLONE mengusung jenis aliran musik \" NEW RAPP CORE \" , adalah jenis aliran musik rapp/hip-hop, yang di kombinasikan dengan sedikit sentuhan musik Rock, dan hardcore.','Alternative Rock','facebook;teman;lainnya;','Jakarta',158,'2017-08-09 18:01:57','2017-08-09 18:01:57'),
	(52,'The Sailor & The Waves','1502305671.jpeg','The Sailor And The Waves, sebuah grup dengan format 3 piece band yang sengaja dibangun tahun 2014. Pada bermulanya TSATW dibentuk akibat kebutuhan akan wadah berkarya oleh seorang gitaris blues yang akhirnya mengajak drummer punk serta dibumbui bujuk rayu pada seorang bassis.\r\n\r\nMeski baru seumur jagung, berbagai jenis panggung dan gigs sering dicicipi oleh TSATW. Debur ombaknya dapat disaksikan di link berikut: https://youtu.be/Lyj4EnsK-Yk\r\n\r\n3 bujang keren dibalik TSATW; Pradana Samara pada Gitar, Widyuta Wibisana pada Drum, dan Raema Yoratian pada Bass. Memadukan nuansa Surf, Rock, Space, Punk, dan Blues untuk menceritakan pahit getir asam manisnya dunia Mahasiswa.\r\n\r\nDalam lagu berjudul Alien yang ditautkan pada form ini misalnya, bercerita tentang malasnya mahasiswa pengendara motor dengan jas hujan. Lebih memilih balik kanan bubar jalan daripada kehujanan dan pakai jas hujan.\r\n\r\nUntuk prestasi, kami The Sailor & The Waves pernah menyabet gelar juara ke-2 ide/gagasan terbaik yang disuarakan lewat lagu pada Averland, sebuah kompetisi prestis yang diadakan oleh GoAheadPeople by PT. HM Sampoerna Tbk.\r\n\r\nSeperti itu. Terima kasih.','Rock','instagram;','Yogyakarta',156,'2017-08-09 18:07:51','2017-08-09 18:07:51'),
	(53,'TEOPE BAND','1502313653.jpg','Band yang beranggotakan 6 orang ini sering manggung di pensi pensi dan berbagai festival musik','Pop','facebook;instagram;','Jakarta',161,'2017-08-09 20:20:53','2017-08-09 20:20:53'),
	(54,'Mud Reaper','1502330247.JPG','Mud Reaper, previously Teenage Outlaw, is a heavy metal/rock band from Bandung, Indonesia. The Band was founded in 2014 in \'the middle of nowhere\' by bunch of dirtbike enthusiasts consisting of guitarist Yagi Febriana, vocalist Nara Witaraga, bassist Bobbie Zulfikar, drummer Iko and guitarist Ichad. Originated from a desire to contributed in their dirtbike community that called \'Rebel Dirtbike\' by way of writing an anthem that representing the spirit of Rebel Dirtbike and also as an adrenaline injection for all dirtbike enthusiasts.\r\n\r\nUnder the name of Teenage Outlaw, in early 2015 Nara as vocalist had to leave the band for some reasons while The Band ready to produce their singles project, spontaneously The Band took a quick decision by pass down the microphone to Bobbie Zulfikar considering that he used to be a vocalist before, and The Band decided to change the band name into \'Mud Reaper\' which is representing more their passion on dirtbike.\r\n\r\nMay 2015, with Bobbie on Bass & Vocals, Ichad and Yagi on Guitars, and Iko on Drums, Mud Reaper has completed their delayed singles project. They were recorded two songs at Masterplan Recording Chamber Bandung and engineered by Zoteng from Forgotten, mixed and mastered by Simon from In Place of Hope, and also Baruz from Godless Symptoms with Sarkasz from Bars of Death participated as vocal directors. The lyrics from one of Mud Reaper\'s singles tittled \'Gasspoll\' written by Addy Gembel from Forgotten (One of founder of Rebel Dirtbike) as his dedication for Rebel Dirtbike and all Adrenaline Junkies in the Universe.','Heavy Metal','facebook;instagram;','Jakarta',167,'2017-08-10 00:57:27','2017-08-10 00:57:27'),
	(55,'DPR','1502330504.jpg','Perkenalkan kami DPR band, kami pemida yang menyalurkan hobi kami lewat musik, kami sudah bersama dari tahun 2006, berawal di sekolah yang sama, pahit manis kami bangun band ini, kami belum pernah bongkar pasang personil, tetapi yang berawal dari 5 orang dan bertambah menjadi 6 orang, seiring berjalannya waktu dua dari anggota kami memilih untuk hengkang karena pendidikan, dan mulai tahun 2014 sampai saat ini formasi resmi kami tinggal ber4, sama seperti band yang sudah mapan di indonesia atau pun kelas internasional yang mengalami perubahan nama, kami pun juga mengalami itu tercatat 3 kali pergantian nama karena perubahan anggota kami, kami mendirikan band ini dengan nama No One pada tahun 2006 berganti menjadi A Name One di tahun 2010, dan pada tahun 2014 kerja sama dengan label indie lokal dan ikut dalam pembuatan Album kolaborasi nama kami berganti menjadi DPR yang mana diambil dari huruf depan nama kami masing2,\r\nuntuk dibidang prestasi kami, yaitu :\r\n- 20 Besar Coca-cola school band fest se indonesia di tahun 2007\r\n- Opener Arsyla band di tahun 2014 pada event KlaProject\r\n- Pengisi acara di Pharmacy Fair Univ. Pancasila pada tahun 2013\r\n- Pengisi acara di Ubhara fair di Univ. Bhayangkara pada tahun 2013','Pop','facebook;','Jakarta',168,'2017-08-10 01:01:44','2017-08-10 01:01:44'),
	(56,'all sizerband','1502331185.jpg','Introduction\r\nSejak awal terbentuk tahun 2012, All Sizer band yang terdiri dari Shandy (Vocal),Ardan (Bass) dan Ilham (Drum) memutuskan untuk selalu membawakan lagu ciptaan mereka sendiri di setiap event, berbagai respon dari pendengar dan teman2, baik positif maupun negative menjadi motivasi buat mereka.\r\n\r\nGenre\r\nDalam bermusik, All Sizerband mengalami evolusi, dahulu band ini bergenre Pop,  namun sejalannya perkembangan musik,  saat ini  All Sizer band berevolusi kejalur pop rock, hal ini dipengaruhi oleh masing – masing personil All Sizer.\r\n\r\nInfluence\r\nPass Band,FiveMinute,Muse\r\n\r\nVisi&Misi\r\nAll Sizer band berusaha terus berkarya  yang sesuai dengan perkembangan musik yang sudah ada dan berharap dapat diterima oleh pecinta music Indonesia.Selain terus berkarya dan bermusik, All Sizer band mempunyai misi, turut member kontribusi terhadap perkembangan music Indonesia khususnya indie.\r\n\r\nMedia Promo\r\nAll Sizer band dalam mempromosikan lagunya lewat media internet, www.All Sizer band, youtube.com, facebook.com,twitter.musik indie Indonesia,soundcloud.\r\n\r\n\r\nPerform\r\n-	Ikatan Remaja Anti Narkoba ( IRAN ) yang disponsori oleh Djarum Super\r\n-	Peringatan 17 Agustus\r\n\r\nProduct :\r\nhttp://www.AllSizerband.com\r\n-Mini Album (2012)\r\nMini album ini terdiri dari 1 lagu,\r\n* MasihAdakah\r\n-Mini Album (2013) Mini album ini terdiri dari 5 lagu\r\n* Biarkanlah\r\n* Hingga Sakit Hati Ini\r\n* Kasih\r\n* Kuingin Kau Kembali\r\n* Meski Kau\r\nMini album ini dibuat khusus untuk Fasizle ( fans All Sizer ),Penggarapan album ini dilakukan secara serius oleh All Sizer band, baik konsep lagu, sound, semua proses recording,mixing dan mastering dilakukan di Avega Music Studio.\r\n\r\nVideo\r\nAll Sizer band berencana akan membuat Video klip pada tahun ini( Hingga Sakit hati ini ).\r\n\r\n\r\n\r\nBiografi\r\n\r\nNama			: Shandy Wibowo B		\r\n\r\nNama panggilan	: Gantenx\r\n\r\nTempat/Tgllahir		: Indramayu,04 April 1982\r\n\r\nMakananfavorit		: Mie Swa,Mieayam\r\n\r\nMinumanfavorit	: Air putih,jusAlpukat\r\n\r\nHobby			: Baca buku\r\n\r\nPosisi di band		: Vocal\r\n\r\nAlamat			: jl.mushollah nurul amal no.37 peninggilan selatan – Tangerang\r\n\r\n\r\n\r\n\r\n\r\nNamalengkap		: IlhamWahyudi	\r\n\r\nNama panggilan	: Ilham/Qray\r\n\r\nTempat/Tgllahir		: Jakarta,28 Mei 1993 	\r\n\r\nMakanan favorit	: Tahu,Tempe,Bakso\r\n\r\nMinuman favorit	: Air putih,MinumanDingin\r\n\r\nHobby			: Playing guitar,Membuatlagu\r\n\r\nPosisi di band		: Drumer\r\n\r\nAlamat			: Jl.H.Sadeli no.63 rt005/001 Larangan selatan – Tangerang\r\n\r\n\r\n\r\n\r\nNama lengkap		: Ardan Said	\r\n\r\nNama panggilan	: kamplenk\r\n\r\nTempat/Tgllahir		: Bandung,26Juni 1989\r\n\r\nMakanan favorit	: All Food\r\n\r\nMinuman favorit	: Mineral Water\r\n\r\nHobby			: Playing Guitar\r\n\r\nPosisi di band		: Bassist\r\n\r\nAlamat			: Jl.Sunter Utara no.3A Jakarta Utara','Alternative Rock','facebook;','Jakarta',166,'2017-08-10 01:13:05','2017-08-10 01:13:05'),
	(57,'The Old Coffee','1502331708.jpg','The Old Coffee adalah sebuah band bergenre blues-rock dari Bandung, Indonesia yang terbentuk dibulan Agustus 2011. Kami terpengaruh oleh band yang popular di era 60’s - 70’s, khususnya yang bergenre blues, rock, progressive, dan rock n roll. Di tahun 2017 ini kamipun sudah merampungkan Album yang berisi 5 Track yang bertajuk \"Basa Basi\" dan sudah launching dibeberapa digital music publisher seperti Spotify, iTunes, Deezer dsb.\r\n\r\nPrestasi:\r\n•Bandung Beatles Day fest the 1st winner at Festival Citylink, 2012\r\n• Informatics fest the 2nd winner at Widyatama, 2013\r\n• Economic fest the 2nd winner at STIE Inaba, 2014\r\n• Festival koes plus the 1st winner at The Historich Cimahi, 2016\r\n• Super Rockin\' Performance Bandung, 2017','Blues','facebook;','Yogyakarta',154,'2017-08-10 01:21:48','2017-08-10 01:21:48'),
	(58,'Monday like sunday','1502332331.JPG','Jujur untuk prestasi kita belum ada karena kita main di dunia indie yang bergenre kan punkrock. Tapi kalo soal nama kita sudah punya nama di bekasi karena sering main di gigs gigs bekasi maupun di luar bekasi. Di akui dochi peewee gaskins sebagai dustbox nya bekasi.','Others','facebook;','Jakarta',173,'2017-08-10 01:32:11','2017-08-10 01:32:11'),
