	(62,'Tuturnada','1502334788.jpg','Tuturnada berawal dari side project beberapa personil dari band yang sudah ada terlebih dulu yang sama-sama ingin membuat band yang berbeda dari band sebelumnya, kecenderungan itu yang mengawali kami untuk membentuk Tuturnada sebagai wadah bermusik bagi kami untuk menyalurkan hasrat terpendam yang tidak bisa disalurkan di band sebelumnya. Kami sedang mempersiapkan sebuah album dan sekarang dalam proses merekam beberapa lagu untuk di masukkan dalam album nanti, kemungkinan beberapa bulan kedepan akan merilis sebuah single pertama kami.','Pop','facebook;instagram;informasi_toko;guitar_plus;teman;','Yogyakarta',177,'2017-08-10 02:13:08','2017-08-10 02:13:08'),
