	(64,'Nocturnal','1502335691.jpg','Nocturnal adalah band beraliran post-grunge yang berdomisili di pulau Bali dan didirikan oleh Freddie (vocals,guitars) dan Rian (Bass) pada tahun 2010.\r\nPada tahun 2012 Nocturnal menjadi salah satu peserta band kompilasi album Bali Total Grunge Vol.1','Rock','teman;','Surabaya',170,'2017-08-10 02:28:11','2017-08-10 02:28:11'),
	(65,'Lada','1502336883.jpg','Band rock yang berasal dari Cibinong, Bogor\r\n\r\nJuara 1 Yamaha (2014) Juara 1 Rock Band Ciawi','Rock','guitar_plus;','Jakarta',25,'2017-08-10 02:48:03','2017-08-10 02:48:03'),
	(66,'Freak City','1502337944.jpg','Band kami sering diundang di acara acara komunitas, kampus, pensi sekolah dan gigs di Jabodetabek dan Bandung.\r\nDan kami sudah mempunyai Album EP dengan 5 lagu track, dan album ini kita beri nama \"Lari Pagi\" yang diambil dari judul lagu kita. Album ini diproduksi oleh kami sendiri.','Others','facebook;guitar_plus;teman;','Jakarta',186,'2017-08-10 03:05:44','2017-08-10 03:05:44'),
	(67,'Hidden Message','1502340020.jpg','Hidden Message!!\r\n\r\nBand ini terbentuk 18 Februari 2006. Pada suatu malam di sebuah acara hingar-bingar anak muda di kota Cibinong, seorang remaja beranjak dewasa, dia adalah gitaris band punk yang bernama OTRE. Gitaris itu bernama Iwan Cakra yang biasa di sapa Nawi dan kini menjadi cikal bakal Vokalis serta Lead Guitar dari band ini.\r\n\r\nSingkat cerita, band ini sempat vakum beberapa tahun dari kancah musik Lokal dan Interlokal. Sampai akhirnya, tinggal tersisa beberapa personil, yaitu Nawi Message [Vocal dan Lead Guitar] dan Angga Hide [Bass]. Pemain bass yang bernama Angga ini adalah pemain terakhir yang bergabung di Hidden Message [Pada masa itu].\r\n\r\nPada tahun 2015 akhir, Nawi dan Angga sempat membuat project untuk Album baru, tetapi mereka berfikir jika dikerjakan berdua, nanti akan seperti Same-Same atau Too Phat. Dan akhirnya merekapun sepakat untuk merekrut Vokal dan Guitar untuk mengisi kekosongan formasi depan panggung. Dia bernama Zulfikar Iqbal yang sempat tergabung bersama band tersohok di kota Bogor.\r\n\r\nKemudian, setelah Iqbal bergabung, mereka terfikir kembali untuk mengajak Josua mengisi kekosongan Drum. Josua adalah teman kampus dan band terdahulu Nawi dari band OTRE. Lengkap sudah formasi Hidden Message, mereka berkumpul karena mempunyai kesamaan yaitu mengidolakan band yang mempunyai angka 182. Mereka berharap, formasi ini adalah formasi yang pas dan solid untuk melanjutkan perjalanan mereka untuk membuat soundtrack para Messenger [Sebutan Fans Mereka].','Alternative Rock','facebook;','Jakarta',190,'2017-08-10 03:40:20','2017-08-10 03:40:20'),
	(68,'SHADE','1502345852.JPG','dengan mengusung genre musik yang sedikit berbeda yaitu Jazz-Punk / Japanese rock, SHADE cukup mengambil perhatian beberapa pihak dengan single pertamanya. Bahkan Dapat respons dari warga Chiba-Jepang. Sampai saat ini banyak brand lokal yang mempercayai SHADE untuk menggunakan product mereka masing-masing. Seolah-olah SHADE adalah band of brand.  Dengan personil yang irit hanya bertiga mampu memeriahkan event- event musik / gigs yang sering di adakan. Berharap kedepannya bisa menjalin kerja sama dengan pihak-pihak yang luar biasa di bidangnya, terimakasih (:','Others','teman;','Jakarta',195,'2017-08-10 05:17:32','2017-08-10 05:17:32'),
	(69,'Kecoa Terbang','1502346346.jpg','Pada bulan juni 2017 lalu kami pernah menjadi finalist event planetrox indonesia dan pemenangnya akan tampil di event yang bernama envol et macadam di canada dan event ini diikuti 400 band seluruh indonesia, dan kami tidak menjadi pemenang kami finish di posisi kedua.PlanetRox 2017 Indonesian Finalist Envol & Macadam Festival At Quebec Canada.','Rock','teman;','Jakarta',194,'2017-08-10 05:25:46','2017-08-10 05:25:46'),
	(70,'Batiga','1502354344.JPG','Batiga berdiri sejak tahun 2011 di Yogayakarta. Beranggotakan 5. Telah memiliki satu album, dan sedang proses mastering album terbaru di Nashville, USA yang rencananya akan di rilis pertengahan tahun mendatang. 5 anggota dengan komposisi 5 kepribadian, karakter serta influence musik yang unik unik. Riosa terkenal dengan nuansa vokal dengan vibra yang tebal, sewaktu kecil hingga SMA penyabet juara pop singer kancah lokal maupun nasional, serta ditunjuk sebagai wakil dari Yogyakarta untuk student exchange di NEw Zealand, pertengahan 2015 kemarin. Talcha Sultanik Hanalaneng, terlahir dari keluarga yang tekun dengan musik & seni, Kakak perempuannya, juga sempat memiliki band bernama Niwangi yang dulu sempat mencicipi industri perlabelan indonesia, pernah menjadi brand ambassador lokal Yogayakarta untuk produk sennheiser dan bersama sama dengan Batiga tour bersama sennheiser tema drum clinic dan simple miking untuk keperluan recording bersama sennheiser. Yunan Patrajuangga, gemar memainkan piano sejak dia umur 6 tahun, karena memang Ayahnya seorang musisi, dalam Batiga, dia ditunjuk untuk menggawangi musik musik Batiga sebagai Music Director.Andreas Dwi Cahyadi atau yang sering dikenal sebagai Andreas DC dan Luke Ottaviandri adalah dua orang sabahat sejak SMA. Dua duanya pernah dipercaya sebagai arranger beberapa lagu dari Nano Tirta Group serta  Lana Nitibagaskarta (Warner Musik Indonesia) tahun 2013 - 2014. Saat ini Andreas DC pun sebagai brand ambasador dari produsen Bass Lokal, yaitu F.A.D bersama dengan Om Indro Harjodikoro dan teman teman lainnya, serta dia pun memiliki product signed sendiri di F.A.D yang bersama sama dengan F.A.D dan Batiga dipasarkan secara nasional. Secara terpisah, Batiga sendiri pun (secara utuh) memiliki beberapa prestasi, antara lain adalah seringkali diminta untuk mengarasemen lagu lagu jingle/backsound perusahaan ataupun film film indie, pernah sebagai brand ambasador dari salah satu produk kecantikan wanita di Yogyakarta, bersama salah satu media indiependent Yogakarta melakukan tour di Jakarta, Jawa Tengah, serta Jawa Timur.','Pop','instagram;','Yogyakarta',197,'2017-08-10 07:39:04','2017-08-10 07:39:04'),
	(71,'RELIEFS','1502363328.JPG','Relief dalam kamus besar bahasa indonesia yang berarti corak-corakan jadi setiap personil memiliki cirikhas nya masing-masing baik itu dari genre dan cara bermain musik, kami tambahkan huruf S, karena band ini berasal dari kota Sukabumi. 1st Winner Dapur Letter Rock Shows Gigs, 1st Winner Komunitas Music Sukabumi Fest.','Rock','lainnya;','Jakarta',202,'2017-08-10 10:08:48','2017-08-10 10:08:48'),
	(72,'Fortypercent','1502365192.JPG','Berawal dari SMA yang sama, kami sering ngumpul bareng meskipun awalnya berbeda band. seiring berjalannya waktu, berlandaskan visi, misi, kesukaan musik, dan kecocokan antar personil, kami sepakat untuk membentuk band ini, dengan mengusung aliran rock alternative. Kami sudah beberapa kali manggung di event kecil maupun besar, nampil di event indie lokal, serta opening beberapa artis.','Alternative Rock','instagram;teman;','Medan',201,'2017-08-10 10:39:52','2017-08-10 10:39:52'),
	(73,'ARTHUR','1502371631.JPG','ARTHUR band memulai langkah di tahun 2010 , kami memulai dari band keluarga,yg di isi oleh Ruby di gitar, kikikeroz di drum, dan sopian di vocal ( dengan nama MAKE-UP band) Yg mulai di bentuk antara tahun 2001-2008 hilir mudik naik turun stage ,  BANDUNG-KARAWANG-CiIKARANG-BEKASI seiring dengan berjalannya waktu,vokalis sopian memilih karir Yg lain, dan di awal 2010, sang Drumer kikikeroz berganti posisi menjadi vokalis, gitar tetap di isi oleh Ruby, dan selanjutnya kita menggaet , bassis YANT TAGARA, Drum EKI, Dan juga sekaligus mengganti nama BAND kita dari MAKE-UP menjadi ARTHUR ,kenapa kita memilih ARTHUR menjadi nama BAND kita , karna di beberapa cerita dan kisah ,ARTHUR adalah seorang raja Yg bijaksana,pemberani,dan di sukai oleh rakyatnya, jd Kuta berharap , musik , dan karya kita ,bisa di nikmati,disukai oleh pencinta,penikmat musik di seluruh dunia, \r\nGenre Yg kita bawakan ada POP , pop Yg baru yg segar ,Yg kita namakan sebagai FRESHPOP\r\ndi awal langkah ARTHUR ,kita sempat beberapa kali perfom, antara Cikarang - Bekasi, di tahun Yg sama 2010 , kita mengikuti ajang festival BAND Nasional A-mild wanted , dan Alhamdulillah kita langsung masuk Final regional jawa barat , dari seribu lebih band , kita masuk 10 besar, selanjutnya kita banyak perfom dipanggung besar, menjadi opening band , seperti, ada band, naif, Vagetoz, anji,dll','Pop','facebook;','Jakarta',148,'2017-08-10 12:27:11','2017-08-10 12:27:11'),
	(74,'zoo elephant','1502383641.jpg','-masuk kompilasi demajorsxurbangigs\r\n-masuk kompilasi kick fest','Pop','instagram;teman;','Jakarta',221,'2017-08-10 15:47:21','2017-08-10 15:47:21'),
	(75,'Green Octave','1502384393.jpg','Green Octave (biasa disebut GO) merupakan grup band asal kota Indramayu. GO berawal dari band indie bernama BASS BAND yang kemudian dengan member yang baru pada tahun 2014 berganti nama sebagai Green Octave. Selama lebih dari 2 tahun GO telah menelurkan beberapa single andalan diantaranya Cinta Tak Capai, Cinta Datang Kembali, dan Wanita terakhir. Single Wanita Terakhir direkam sebagai salah satu reward atas pencapaian runner-up Festival Band Duta Indramayu 2016.','Pop','facebook;','Jakarta',220,'2017-08-10 15:59:53','2017-08-10 15:59:53'),
	(76,'Pasir Pantai','1502386145.jpg','Awal terbentuknya band kami mulai dari sebuah sekolah menengah tingkat atas. Dari sekadar bersenda gurau, lalu meningkat pada intensitas pertemuan, kemudian lahirlah sebuah ide untuk membentuk sebuah band dengan nama Seven Rastaman\r\n\r\nLazimnya pertumbuhan sebuah band, kami pun mengalami perombakan personil. Seiring tambal sulam personil, maka pada tanggal 9 Desember 2009 kami tentukan sebuah nama baru untuk mewakili kami ber 5 , yaitu Pasir Pantai\r\n\r\nPemilihan nama tersebut bagi para kami tidak memiliki arti yang sangat khusus. Penggunaan nama Pasir Pantai bagi kami bukan hanya sekedar simple tapi ada makna tersendiri untuk nama tersebut yaitu adalah Pasir merupakan benda padat yang sulit untuk dipisahkan yang dimana harapan kami para pendengar tidak untuk dilipakan. Dan kata pantai kami pilih karena kesejukan dari suasana tersebut yang membuat perasaan dan jiwa kami menjadi relex.\r\n\r\nkami beranggapan bahwa pasir di pantai melambangkan sebuah hubungan yang saling mengenal satu sama lainnya yang berasal dari semua golongan. Kesemua itu, bagi kami merupakan sebuah nilai yang tak terhingga.\r\n\r\nBand yang berdomisili di bagian selatan Kota Jakarta ini beranggotakan Leso (vokal1), Kinoy (rhythm), Danni (lead), Yugo (bass), dan Ryan (drum). dan muncul Mega (keyboard) . Serta dibantu oleh beberapa pemain additional perkusi dll\r\n\r\nKami berharap dapat menjadi band yang berkembang lebih baik, maju, sukses, dan dapat memberikan kesan terdalam bagi semua golongan. Sehingga setiap orang yang menyaksikan performansi Kami dapat terhibur, baik secara live maupun dengan mendengarkan via perangkat audio.\r\n\r\nPenilaian masyarakat atas respon karya-karya kami merupakan dorongan semangat para personil untuk terus berkarya. Dorongan tersebut diibaratkan seperti ombak yang selalu menggerakkan butiran pasir di pantai ,\r\n\r\nSeiring pertumbuhannya, alhamdulillah kini kami sudah memiliki 7 buah karya (Lagu). berkat doa orang tua dan kalian semua sahabat brader & sista yang sudah dukung kami dari awal sampai saat ini, Terimakasih','Others','facebook;','Jakarta',218,'2017-08-10 16:29:05','2017-08-10 16:29:05'),
