	(83,'Shout Keepers','1502420417.jpg','SHOUT KEEPERS a.k.a @shokeepHC adalah PROJECT band HARDCORE asal tambun selatan - BEKASI yang terbentuk tepat pada tanggal 12 - 12 - 2012, dengan berawalkan personil aldino - vocal, awank “racer dancer” - guitar, kiki - drum. dengan terinfluence seperti shutdown, strife dan agnostic front. tetapi dikarenakan kesibukan dari setiap personilnya, project ini harus berhenti di tahun 2013.\r\nTepat diawal tahun 2015 diteruskan kembali dengan personil gita “ex pesona 13” - vocal, awank “racer dancer” - gitar, ardi “back to the future” - bass, aat “losetime” - drum. dengan formasi baru ini shokeepHC melakukan mini tour pertama di jonggol & cipanas 1-2 januari 2015, serta banyak perubahan baik dari sound dan influence seperti hatebreed, wolfdown, terror & madball\r\n\r\nUsai mini tour tersebut ardi & aat harus resign, project ini kembali terus dilanjutkan setelah bergabungnya konx “ex secret forgotten & mesin rusak” - drum, benk “ex destination before death & secret forgotten” - lead guitar serta kake - bass, dengan terbentuknya formasi ini shokeepHC langsung melakukan mini tour kedua mereka di rawa mangun, jonggol & bekasi 14-15 maret 2015, serta berlanjut dengan banyak tampil di gigs & events baik didalam kota maupun diluar kota\r\n\r\nSaat ini kami baru saja mengeluarkan mini-album bertitle “aliansi//alliance” dan trailer nya sekarang sudah dapat dilihat di youtube official maupun beberapa portal video dunia yaitu hardcore worldwide dan blankTV, salah satu dari empat materi yang terdapat di mini-album tersebut yaitu “blood stage” juga telah dikeluarkan dalam bentuk video lirik, yang sudah di unggah di youtube official serta di unggah ulang oleh kembali blankTV.','Others','facebook;','Jakarta',225,'2017-08-11 02:00:17','2017-08-11 02:00:17'),
	(84,'NEARMINE','1502426792.jpg','BIOGRAFI NEARMINE Band\r\n\r\n‘Nearmine Band’ terbentuk pada tanggal  8 november 2012\r\nDidirikan atas dasar hobby dan kecintaan personil terhadap musik ,\r\nMasing-masing personil memiliki latar belakang dan basic yang berbeda, namun memiliki visi dan misi yang sama dalam bermain musik.\r\n‘Nearmine Band’ berkeinginan bermain musik untuk ikut meramaikan belantika musik di tanah air dan menciptakan karya musik yang dapat di nikmati oleh para pendengar musik di tanah air.\r\nMaka ditahun 2016 ini Nearmine Band,Memutuskan untuk bergabung dengan Lebel Musik “ATO Production” dengan Tujuan agar ‘Nearmine Band’ semakin dikenal oleh masyarakat luas bahkan bisa dikenal sampai Mancanegara. Dengan single hits “Masih Mencintaimu”, masyarakat dapat menikmati lagu kami yang bernuansa romantic.\r\nDengan memperbanyak jadwal life performance baik On air atau Off air,kami mengharapkan antusias warga indonesia untuk selalu mendukung kami dengan cara mengaktifkan RBT ( Ring Back Tone ) kami serta mendownload album kami di amazon.com dan Itunes Apple. sehingga Para penikmat musika dapat menikmati dan merasa puas dengan Karya - karya ‘Nearmine Band’.\r\nDalam perwujudannya, ‘Nearmine Band’  akan menyuguhkan suatu musik yang menarik untuk dinikmati dan dikemas secara profesional.\r\n‘Nearmine Band’ menawarkan sebuah konsep musikalitas untuk ikut memeriahkan suasana tempat dengan lagu-lagu yang disuguhkan.\r\nKonsep kami menyuguhkan hiburan segar dengan penampilan professional yang tidak hanya mementingkan keindahan harmonisasi music tapi juga menampilkan performance yang dapat menarik dan membuat pendengarnya terbawa suasana.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nTRACK RECORD BAND\r\nSelama perjalanan sejak tahun 2013 kurang lebih kami memiliki beberapa pengalaman di berbagai event & Acara\r\nSeperti :\r\n	Februari 2013 : Kami menjadi salah satu band pengisi acara yang ikut berpartisipasi dalam acara ‘STAR MUSIC’ bakti sosial dalam rangka penggalangan dana untuk para korban banjir Jakarta yg diselenggarakan di. (Mall Ramayana Depok)\r\n	Januari 2014 : Kami meraih penghargaan dan menjadi juara dalam kompetisi band ‘WE LOOP U BOGOR’ yang diselenggarakan di Padjajaran Bogor oleh salah satu perusahaan yang bergerak dibidang provider telekomunikasi. (Telkomsel)\r\n	Maret 2014 : Kami menjadi bintang tamu di salah satu stasiun radio FM yang ada di bogor dalam acara ‘MUSIK INDIE AKUSTIK’.\r\n	September 2014 : Kami menjadi band pengisi acara ulang tahun di gedung pernikahan. (Gedung Golden Bogor)\r\n	November 2014 : Kami meraih penghargaan dan terpilih menjadisalah satu band dalam kompetisi ‘BOGOR ALL STAR COMPILATION’ yang diselenggarakan di salah satu café di bilangan padjajaran bogor. (Catherius Café)\r\n\r\n\r\n\r\n	Desember 2014 : Kami diundang untuk menjadi bintang tamu dalam sebuah acara di salah satu café yang terletak di bilangan bantar jati bogor. (Terrace Café)\r\n	Januari 2015 – Sekarang : Kami diterima dan dipercaya menjadi ‘HOME BAND’ atau band pengisi di salah satu café di bilangan yasmin bogor. (Food Paradise Café)\r\n	Agustus 2015 : Kami menjadi bintang tamu selama beberapa minggu di salah satu café di bilangan suryakencana bogor. (Cyrano Café)\r\n	Juni 2016 – Juli 2016 : Kami menjadi ‘HOME BAND’ atau band pengisi di AEON Mall BSD City, dengan di 3 venue berbeda yaitu di Food Culture, Café Street ,dan Food Carnaval . Sepanjang masa kontrak dari tempat ke tempat yang lain,antusias penonton sangat positif dan banyak yang mengapresiasi aksi panggung “Nearmine Band” di AEON Mall BSD City .','Pop','facebook;','Jakarta',217,'2017-08-11 03:46:32','2017-08-11 03:46:32'),
	(85,'Pepton','1502437853.jpg','Pepton adalah sebuah band yang terdiri dari omball sebagai vocalis ,F levi sebagai gitaris, CeiiJe sebagai basis dan Danang sebagai drumer.\r\n\r\nYang berdiri pada bulan Juli di tahun 2009.\r\n\r\nPepton berdiri dari hoby setiap personil yaitu bermain musik dan menciptakan lagu.\r\n\r\nKami bertemu dan memainkan lagu-lagu ciptaan kita di studio band. Tak hanya membawakan lagu ciptaan sendiri tapi kita juga memainkan lagu-lagu band papan atas seperti maroon 5, Audioslave dan G n R .\r\n\r\nTetapi pada tahun 2015 akhir F Levi dan Danang memilih untuk hengkang  dari band Pepton.\r\n\r\nTinggal tersisa Omball dan CeiiJe yang masih ingin melanjutkan mimpi dan hoby di dunia musik.\r\n\r\nKita berdua bertahan karena ingin memperdengarkan lagu-lagu yang sudah di rekam agar semua orang dapat menikmati dan mendengarkan hasil karya kita.\r\n\r\nHarapan kita lagu-lagu Pepton dapat di jadikan memori lagu di setiap perjalanan hidup para pendengar','Pop','facebook;','Jakarta',230,'2017-08-11 06:50:53','2017-08-11 06:50:53'),
	(86,'The Scientist','1502438888.jpg','Hanya band biasa','Alternative Rock','instagram;teman;','Jakarta',14,'2017-08-11 07:08:08','2017-08-11 07:08:08'),
	(87,'Narayana','1502441077.jpg','Narayana adalah band beraliran Alternative Pop Rock. Kami mengusung tema kemanusian, cinta, sosial dan spiritual. \r\nLagu kami yang berjudul \"Embun di Asia\" pernah tergabung dalam album kompilasi bertajuk \"Akalliar ; Pop Alt.\" yang diproduseri oleh Ali Akbar dan Ian Antono pada tahun 2007, dengan kontrak hanya sampai 1 tahun.\r\nKami juga pernah mengisi berbagai pentas band di Yogyakarta, dan tampil di stasiun televisi lokal \"Jogja TV\".','Alternative Rock','teman;','Yogyakarta',229,'2017-08-11 07:44:37','2017-08-11 07:44:37'),
	(88,'Pasukan Penjaga Pohon','1502441837.jpg','Pasukan Penjaga Pohon band yang bermarkas di Tangerang - Banten , terbentuk pada 11 November 2017, Band ini terbentuk dikarenakan masih ada passion untuk berkarya di bidang musik dari ke empat laki laki yang dulunya masing masing punya band sendiri sendiri namun sudah bubar jalan, dikarenakan masih memiliki keingginan untuk bermusik mereka pecahan dari 4 band yang menjadi satu ( Pasukan Penjaga Pohon ). Event inde sering mereka ikuti oleh band yang terbilang baru ini salah Satunya adalah Panggung PRJ 2017 dll.','Funk','instagram;teman;','Jakarta',232,'2017-08-11 07:57:17','2017-08-11 07:57:17'),
