	(92,'JENOVA','1502446531.jpg','Jenova adalah Band yang terbentuk di Purwokerto pada tanggal 8 Agustus 2010, merupakan band yang mengusung genre Japanese Alternatif dan di gawangi oleh Sigit (Bassist) , Bait (Vocal), Danny (Rhythm), dan Yogo (Drum). Setelah hengkangnya Bayu dari Jenova , untuk sementara posisi tersebut digantikan oleh Five (Lead Guitar) .Musik yang dimainkan Jenova terinfluence dari band-band bergenre Japanese Rock seperti One Ok Rock, L’Arc En Ciel dan J-Rock.\r\nJenova sering menjadi pengisi acara dan guest star di event-event lokal terutama yang berbau jejepangan.\r\nJenova juga tergabung di salah satu komunitas band indie yang dinaungi oleh salah satu Radio dan sering ikut serta dalam berbagai acara musik indie di kota Purwokerto.\r\nUntuk prestasi , Jenova pernah lolos ke tahap semifinal ajang pencarian bakat yang diselenggarakan oleh salah satu merk rokok pada tahun 2014.\r\nUntuk saat ini Jenova sudah memiliki 4 lagu.','Rock','teman;','Yogyakarta',234,'2017-08-11 09:15:31','2017-08-11 09:15:31'),
	(93,'OLLY OXEN','1502451774.jpg','Band yang berdiri Agustus 2016 lalu pada mulanya dibentuk sebagai proyek alter-ego ini  kemudian direkatkan oleh kesamaan visi untuk membuat komposisi lagu rock yang imajinatif dan variatif. Gemby (Gitar), Mere (Vokal), Novelino (Bass), dan Gawank (Drum) telah mengusung musik yang sarat akan riff berat yang catchy, bumbu vocal yang penuh pertualangan dan konten yang kritis.\r\nSetelah merilis ulang edisi terbatas single \"Adult’s Dream is a Violations\" dalam format kaset dan mampu terjual habis pada gelaran Record Store Day lalu, grup rock Olly Oxen memantapkan eksistensinya dengan merilis sebuah EP bertajuk \"Bad Mantra\". EP dalam format CD ini akan dirilis pada 12 Mei 2017 kemarin. Momentum ini juga menjadi kesempatan bagi Olly Oxen untuk memperkenalkan video-clip lead single kedua mereka yang berjudul sama dengan album “Bad Mantra”. Seluruh materi yang ada di mini album ini sudah dapat didengarkan melalui kanal streaming musik seperti Apple Music, Spotify dan Deezer.\r\nEP \"Bad Mantra\" berisi tentang kontrol media atas kehidupan manusia, bagaimana citra dan informasi dibingkai untuk melemahkan pemikiran dan memutar persepsi. Keempat lagu dalam mini album ini mewadahi narasi tersebut melalui sudut pandang korban dalam lagu \"Adult’s Dream is A Violation\", sang antagonis “Bad Mantra” yang dibangun melalui sound tremolo gitar yang kelam, optimisme\r\nagen perubahan dalam ketukan 3/4 pada “Self Preaching\" dan diakhiri dengan nyanyian perayaan ketidakberdayaan bernuansa vokal hip-hop “Mr. Dunnowattudu\". \"EP ini adalah tentang mengingatkan diri untuk tidak berhenti berpikir dan mempertanyakan sistem disekitar kita, dan untuk menolak hidup dalam mimpi orang lain','Rock','facebook;instagram;teman;','Yogyakarta',140,'2017-08-11 10:42:54','2017-08-11 10:42:54'),
	(94,'Beeswax','1502456186.jpg','Beeswax adalah band beraliran emo yang berdiri di Malang sejak 2014. Beeswax telah menelurkan 2 album yakni \"First Step\" dan \"Growing Up Late\" dan sedang dalam proses merampungkan album ketiga. Pada tahun 2016, Beeswax terpilih menjadi finalis We The Fest x Demajors Band Showdown dan tampil dalam gelaran We The Fest 2016. Band ini juga telah masuk dalam kompilasi \"Emotion, No\" berisikan musisi-musisi emo di Asia, serta kompilasi \"Music For Brighter Day\" di tahun 2017. Beeswax juga menjadi band pembuka untuk rangkaian tur band Turnover di Yogyakarta, dan telah menjajal panggung di berbagai kota di Pulau Jawa.','Alternative Rock','teman;','Surabaya',239,'2017-08-11 11:56:26','2017-08-11 11:56:26'),
	(95,'Ris And Soul','1502464164.jpeg','Terbentuk di tahun 2009, tepatnya tanggal 19-agustus-2009..\r\nBerawal dari keisengan mengikuti sebuah lomba yang mendadak,dan terbentuklah kami..\r\nMemulai perjalan yang sedikit mebuat kami dewasa dalam bermusik…\r\nPergantian personilpun telah kami rasakan…\r\nBerat, tapi itulah sebuah pilihan yg kami harus pilih waktu itu..\r\nSekarang dengan formasi baru kami, kami ingin terus mecoba berkarya dan mencipta…\r\nMelangkah kedepan dan tak pernah melupakan memori masa lalu..\r\nTerus mencoba dan mencoba, membuat sesuatu yang berguna…\r\nInilah kami,hanya sekelompok remaja ya terus belajar dalam berkarya\r\nInilah kami…\r\nRis And Soul\r\n\r\nprestasi :\r\n1. juara 3 festival flexi aksi band SMA Se DKI Jakarta rolling stone kemang 2009','Pop','facebook;instagram;','Jakarta',241,'2017-08-11 14:09:24','2017-08-11 14:09:24'),
	(96,'Fingerstyle','1502472779.JPG','Sebelum bernama Fingerstyle, nama band kami sebelumnya adalah The Rings, dan sudah berjalan lima tahun, banyak pengalaman dan prestasi yang kami raih, salah satunya adalah menjadi juara 3 ajang pencarian bakat yang di selenggarakan oleh Alfarecords dengan tema Naga Mencari bintang, kami di kontrak selama satu tahun, namun selama berjalannya promo yang dilakukan oleh pihak label kami rasa tidak ada progres yang signifikan, hingga habis masa kontak, dan setelah itu juga tiga personil dari kita mengundurkan diri, dan sekarang hanya tinggal dua orang saja, dan memutuskan untuk mengganti nama menjadi Fingerstyle.','Others','facebook;','Jakarta',238,'2017-08-11 16:32:59','2017-08-11 16:32:59'),
	(97,'Japra','1502475515.jpeg','Japra terbentuk 7 Juli 2009 dengan nama awal Japrajazz. Namun di tahun 2013 kata jazz sepakat ditanggalkan karena dinilai sudah tidak relevan dengan warna musik kami yang semakin luas. Di tahun 2015 kami akhirnya merilis sebuah album berjudul SOULOUT yang kami produseri sendiri. Pop, jazz, folk, blues dan RnB, berpadu jadi satu di album tersebut. Album itu adalah representasi musik yang kami mainkan selama kurang lebih 6 tahun karenanya warna musik dalam album itu begitu variatif.  \r\n\r\nHingga saat ini kami masih aktif tampil di berbagai acara. Berikut beberapa acara musik yang pernah kami ikuti dan prestasi yang pernah kami raih.\r\n\r\n- UI Sound Explotion (2010)\r\n- Festival Budaya, UI (2011)\r\n- Margo Friday Jazz (2012)\r\n- Juara Festival Musik Akustik Green Pramuka Square (2013)\r\n- Adfest, Universitas Brawijaya, Malang (2013)\r\n- Perwakilan Indonesia di Asean Jazz Festival, UKM, Malaysia (2013)\r\n- Labs Project (2014)\r\n- Postig 6 (2014)\r\n- Banten Jazz Night (2014)\r\n- Ramadhan Jazz (2014)\r\n- Jazz Atas Awan (2014)\r\n- Juara 2 Torabika Jingle Jazz (2014)\r\n- Soundsations (2015)\r\n- Juara 1 Regional Amild Road to Soundrenaline (2015)\r\n- Soundrenaline (2015)\r\n- Taman Buaya Beat Club (2016)\r\n- Love Donation (2017)\r\n- (Ismail Marzuki Jazz Festival (2017)','Pop','facebook;','Jakarta',150,'2017-08-11 17:18:36','2017-08-11 17:18:36'),
	(98,'NABULA','1502479402.jpg','Diangkat dari sebuah nama Nebula yang ada diluar bima sakti, yang kami ubah menjadi NABULA. Mahakarya Tuhan yang maha agung yang menginspirasikan banyak orang tentang keindahan alam semestanya, tanpa terkecuali kami yang menjadikan nama Nabula sebagai nama band yang terbentuk di bandung pada awal bulan agustus tahun 2015. Anggotanya berjumlah 3 orang yaitu Sendy (vocal), Bonchu (guitar), Wahyu (Guitar).\r\n\r\n  Radiohead, Coldplay, The Maccabees, Blur, beberapa band ini lah yang menginspirasi Nabula untuk terus berkarya menyuarakan musik Indie Rock.\r\n\r\n  Nabula tidak hanya ingin sekedar meramaikan belantika musik di Indonesia, melainkan karena NABULA SANGAT SIAP memperkenalkan karya-karya yang sudah KAMI komposisikan dan banyak dipengaruhi oleh music Indie Rock/alternatif 90-an dengan sajian yang terdengar lebih Fresh lagi.','Alternative Rock','facebook;instagram;teman;','Jakarta',77,'2017-08-11 18:23:23','2017-08-11 18:23:23'),
	(99,'Sheriff And Gun','1502482653.JPG','Kami adalah Sheriff And Gun.\r\n\r\nBand kami berdiri pada 5 April 2009 dengan nama lama Visit the Angel Rebel yang mengusung genre Punk Rock.\r\n\r\nKami terdiri dari 3 personil :\r\n\r\nValiant sebagai gitaris\r\nAgung sebagai bassis dan vokal.\r\nRizky sebagai stand up drummer dan back vokal.\r\n\r\nSetelah 4 tahun bergelut dalam musik punk rock, kami memutuskan juga menetapkan pilihan untuk berganti genre menjadi Rockabilly pada 5 April 2012 dan mengganti nama band kami menjadi Sheriff And Gun.\r\n\r\nBand kami diklasifikasikan sebagai sangat muda tapi kami membawa jenis musik yang dewasa. Alasan kita untuk band ini yaitu berdasarkan satu visi, misi yang satu dan satu tujuan.\r\n\r\nFilosofi musik kami adalah warna kehidupan kita sendiri dan orang lain.\r\nTerdapat nilai-nilai kehidupan seseorang serta banyak pihak.\r\n\r\nSemenjak berganti nama dan beralih genre dari 05 April 2012, kami menjadi bagian dari komunitas Jakarta Rockabilly & Indonesia Rockabilly bersama band rockabilly lainnya dan kami telah mengikuti beberapa acara musik gigs di beberapa tempat hingga pertengahan tahun 2015. Dan dari pertengahan tahun 2015 hingga awal tahun 2016, kami sempat break/vakum dikarenakan salah satu personil kami sedang fokus untuk menyelesaikan skripsi kuliahnya.\r\n\r\nDi awal tahun 2016, kami memulai kembali dengan melakukan rekaman untuk lagu-lagu kami yang saat ini sudah menjadi EP atau Mini Album.\r\n\r\nSetelah selesai melakukan proses rekaman, kami bergabung dengan salah satu komunitas musik indie yaitu FORMI (Forum Musik Indie Indonesia) dan 101% Music Community. Dalam melanjutkan karir kami dibidang musik. Kami berpartisipasi dalam beberapa event musik hingga saat ini.','Others','instagram;','Jakarta',245,'2017-08-11 19:17:33','2017-08-11 19:17:33'),
	(100,'Knuckle Bones','1502497615.jpg','Knuckle Bones is a Melodic Metalcore band from Jakarta that started in 2017. The band consists of 3 members, Pras(vocals), Raka (Guitarist) and Riki (Guitarist). Knuckle Bomes just releast their first ever EP \"Inception\". The EP tells a story about Lucid Dreaming (where youre awake but in dream state). If you want to understand more, you can watch the movie Inception by Christopher Nolan. If you want to listen to our EP or buy it, you can stream on iTunes, Spotify and other media outlets.','Rock','teman;lainnya;','Jakarta',247,'2017-08-11 23:26:55','2017-08-11 23:26:55'),
	(101,'AUDIOTERAPI','1502521432.jpg','Audioterapi band was found at the end of 2009 by three medical students in Jakarta who felt able to play songs, Yudha DP, Ryan Tantri Ardo, and Aditia Nata Kusuma. \r\n\r\nThey met Ramadaridesa, the vocalist and the author who never finished the song, at the same school, in the same year. Since then, the songs are never finished, began to be solved together. \r\n\r\nAudioterapi start spreading some of their songs through electronic data and from gigs to gigs around Jakarta, Bogor and Bandung. \r\n\r\nIn 2010, Gilang Kusmayadi, a friend at the same school, still, who often lends a guitar to Audioterapi began to join, then he left in 2014. \r\nRio began to join us as a guitar player in 2017.\r\n\r\nGenre that they played is what they like. Adjusted for the purpose of the song that was made. That\'s Audioterapi genre. Based on the atmosphere.','Others','instagram;vipclub;','Jakarta',134,'2017-08-12 06:03:52','2017-08-12 06:03:52'),
	(102,'SLOWLY SHINE','1502528242.jpg','SLOWLY SHINE yg berarti perlahan bersinar dan akan selalu bersinar, prestasi juara 1 jingle Muscle Car Indonesia','Alternative Rock','facebook;instagram;informasi_toko;','Jakarta',248,'2017-08-12 07:57:22','2017-08-12 07:57:22'),
	(103,'Inrain','1502529239.jpg','Pada tanggal 7 Mei 2017 Inrain memenangkan juara ke-2 pada audisi Jakcloth band. yg bertempat di Arena PRJ-Kemayoran.','Heavy Metal','facebook;','Jakarta',250,'2017-08-12 08:13:59','2017-08-12 08:13:59'),
	(104,'BYTHEWAY','1502538192.jpg','Musik adalah suatu perwujudan ekspresi jiwa yang tercipta dari imajinasi dan perasaankami. Dari sinilah kami bercerita tentang indahnya persahabatan,kebersamaan persaudaraanserta melewati suka dan duka yang luar biasa.Inilah bentuk kegiatan positif kami,ekspresi kami,wadah dimana kita menuangkankreatifitas,tempat terkumpulnya ide ide kami dan dimana lahirnya karya BYTHEWAY.BYTHEWAY sendiri terbentuk pada tanggal 20 Mei 2016. BYTHEWAY terbentuk dari Dika (Vokal), Gilank (Gitar), Adit (Bass), Rangga (Drum), yang bermula dari persahabatan yangmempunyai cita cita yang sama dalam bermusik. Bersatu bersama­sama mewujudkan mimpiyang selama ini menghantui.Dengan menggunakan nama BYTHEWAY,Kami akan berusaha menciptakan musik dengan gaya BYTHEWAY. Keinginan untuk terus maju dan berkembang,itulah semangat kami.Semoga saja dengan segenap upaya kami,BYTHEWAY dapatmenghasilkan karya yangberkualitas dan menjadi bermanfaat bagi penikmat dan pecinta musik semuanya.','Pop','facebook;instagram;teman;','Yogyakarta',253,'2017-08-12 10:43:12','2017-08-12 10:43:12'),
	(105,'Drown','1502539252.jpeg','Drown terbentuk di tahun 2015\r\nDengan line up \r\nHasan maulana gitar ,taufik lukmana gitar ,adhi septia gitar,afifur rohman bass,pandu sandhya vokal ,adin hidayat drum drown mengusung konsep antara perpaduan genre postrock dan emotive di blend menjadi satu menjadikan sebuah fresh genre dengan 3 gitaris mengusung unsur reverb,echo dan luapan emosi.\r\nTelah merekam 5 lagu ep bertajuk worthless ditahun 2015 \r\nSeling beberapa waktu kemudian adhi septia memutuskan untuk keluar dari band \r\nDan pada tahun ini kami akan melangsungkan album ke 2 dengan title \"ANOTHER SAD ANTHEMS\"','Rock','facebook;','Surabaya',243,'2017-08-12 11:00:52','2017-08-12 11:00:52'),
