	(108,'PARAS','1502557969.jpg','PARAS TERBENTUK PADA TANGGAL 2 JULI 2015 DI DEPOK JAWA BARAT. BERAWAL DARI PERTEMANAN BERMAIN DI RENTAL STUDIO MUSIK. WARNA MUSIK YANG MEREKA USUNG IALAH POP ROMANTICK , DENGAN PENGARUH BAND BAND SEPERTI GOO GOO DOOLS, NOAH, THE CALLING, DEWA 19 HINGGA KANGEN BAND.\r\nSETELAH BERMAIN DARI PANGGUNG KE PANGGUNG AKHIRNYA PARAS MENYELESAIKAN LAGU PERTAMA MEREKA DENGAN JUDUL LAGU \"HAPUS RASA\" MENURUT MEREKA INI MENJADI LAGU PALING DI ANDALKAN DARI BERBAGAI MATERI LAGU YANG MEREKA MILIKI.\r\nPERSONIL PARAS TERDIRI DARI Armand (VOCAL), Vesa ( GITAR), Dio (BASS) Zizi ( RHYTEM GITAR) Faisal (DRUM).\r\n\r\n1.pengisi acara mall to mall (2014 - 2015)\r\n2.wedding to wedding\r\n3.opening band\r\n4.top 40 cafe \r\n5.juara 2 djarum super music id\r\n6.Guest Star kementerian perindustrian (2016 - 2017)\r\n7.Guest Star Perpustakaan nasional indonesia (2016 - 2017)','Pop','informasi_toko;','Jakarta',92,'2017-08-12 16:12:49','2017-08-12 16:12:49'),
