	(113,'JEANE BAND','1502614344.jpg','Jeane terbentuk pada tanggal 30 Agustus 2016, dan sebetulnya kami sudah saling mengenal satu sama lain sebelum band ini terbentuk, kami sering melakukan jamming bareng mengisi acara pensi-pensi dan festival musik lainnya di kota kami ataupun luar kota, ikutan festival/perlombaan yang alhamdullilah kami pernah menjadi peserta yang layak untuk mendapatkan predikat juara, seperti :\r\n1. Juara 1 OMBUDSMAN lagu cipta anti korupsi\r\n2. Juara 3 Superrawk Bandung Dago\r\n3. Juara 2 Breakpoint Fest.Music\r\n4. Juara 3 Jazzphoria Music','Blues','instagram;','Jakarta',268,'2017-08-13 07:52:24','2017-08-13 07:52:24'),
	(114,'Red White Band','1502626984.jpg','Red White adalah sebuah band yang terbentuk pada 7 Agustus 2015. Adapun Musik Yang diusung oleh red white adalah  musik ethnic yang dibungkus dengan nuansa alat musik kenusantaraan dan kami ingin menyuarakan hal-hal kebaiakan baik dari segi sosial, cinta, maupun spiritual hakiki yang nantinya kami berharap lewat alunan nada dan lirik lagu-lagu kami akan memberi dampak positif bagi para pendengar musik kami.','Alternative Rock','facebook;instagram;teman;lainnya;','Jakarta',70,'2017-08-13 11:23:04','2017-08-13 11:23:04'),
	(115,'A dulphy time','1502631834.jpg','Band kami terbentuk pada 2016 tepatnya bulan desember dengan mengusung genre \'rock alternative\' ,beranggotakan 5 personil berasal dari garut dan kami baru menghasilkan 2 single lagu karya kami sendiri','Alternative Rock','instagram;','Jakarta',262,'2017-08-13 12:43:54','2017-08-13 12:43:54'),
	(116,'Bona & The Rong-rong','1502635797.png','Single on itunes, spotify and Joox','Pop','vipclub;','Jakarta',261,'2017-08-13 13:49:57','2017-08-13 13:49:57'),
	(117,'B2 Band','1502639679.jpg','Perkenalkan kami band dari kota Majalengka Jawa Barat. yang ingin ikut serta dan mudah mudahan ada rezeqinya dengan adanya band hunt levi\'s ini.\r\n\r\nTerbentuk saat bulan Ramadhan 2017. Dengan personil kawan kawan bermain yang awalnya bukan kawan ngband. Masing masing personil yg awalnya memiliki band sendiri dan dengan memegang alat yang berbeda juga. namun saat masing2 band memiliki kesibukan peribadi maka Billal Akbar atau yg sering di panggil (Bam) mengajak Bombom sebagai vocal, Karena minimnya Vokalis di daerah kami terpaksa bombom yang lihai memainkan gitar dipaksa untuk bernyanyi, untuk memulai lagi perjalanan ngband dikota kami, kemudian bam dan bombom mengajak M. Dadan untuk mengisi gitar utama di band. Karena nada nada dan irama gitarnya yang dirasa cocok untuk sebuah band baru yang akan kami jalani. dimana awalnya tiap personil mempunyai genre yang berbeda. saat kami bingung memulai namun tidak ada penggebuk drum. Lalu Bam mengajak teman sahabat bahkan bisa dibilang guru dalam dunia musik, yaitu Robby Cahyadi yang mahir dan sudah memulai lama di dunia musik. kami ber 4 konsisten dengan genre yang simple namun dapat mengajak dan yang pasti ingin berkarya hasil ciptaan sendiri. setelah terbentuk kami mulai sharing dan mengobrol (musik) agar tau 4 orang ini akan seperti apa musiknya. Mulai memainkan gitar dan bernyanyi semua akhirnya kami mendapatkan nada nada yang easy listening. \r\nDan kami menamai band ini dengan B2 yg bisa di artikan bam&bom, namun tidak dirasa cocok maka diganti makna menjadi Ber Bagi.\r\nAlhamdulillah kami sudah memiliki 6 konsep lagu ciptaan dan yang pertama sudah kami buat demo di home studio record. dengan alat dan mixing yang apa adanya. meskipun kami tau masih banyak kekurangan karena drum yang kita gunkaan adalah midi. dan masih banyak yang kurang. namun kami jadikan itu sebagai demo untuk acar Levi\'s Band Hunt 2017 ini.\r\nsemoga kami dapat memberi dan membuat orang yang mendengarnya suka dengan karya kami.\r\n\r\nprestasi yang band B2 dapat untuk saat ini masih belum ada. karena kami masih baru terbentuk, belum ada event dikota atau daerah kita yang harus di ikuti. Namun tiap tiap personil pernah mendapat prestasi di band dahulunya.\r\n\r\nsekian cerita singkat dari kami. tidak ada yang istimewa namun semoga juri dan pihak terkait di Levi\'s Band Hunt 2017 ini senang dan suka dengan musik kami.. Aminn','Pop','facebook;','Jakarta',226,'2017-08-13 14:54:39','2017-08-13 14:54:39'),
	(118,'CHORD','1502689661.jpg','GROUP BAND YANG TERBENTUK PADA TAHUN 2014 DI PURWAKARTA INI , BERLATAR BELAKANG BERMACAM GENRE MUSIK YANG DI USUNG PARA PERSONIL.\r\n\r\nSEIRING KESERIUSAN PERSONIL UNTUK MENGEMBANGKAN CHORD BAND , MEREKA MENSEPAKATI GENRE MUSIK POP MODERN YANG AKAN DI USUNG CHORD BAND PADA INDUSTRI MUSIK INDONESIA.\r\n\r\nMULAI DARI PANGGUNG KE PANGGUNG ,KOMPETISI , CAFE KE CAFE CHORD BAND SUDAH LALUI DAN SAMPAI SAAT INI SUDAH ADA BEBERAPA LAGU YANG DI CIPTAKAN.\r\n\r\nCHORD BAND DIGAWANGI LIMA (5) ANAK MUDA BERBAKAT DAN BERPOTENSI DI DUNIA MUSIK (ABRAHAM – VOCAL , WISNU – GITAR 1 , ERWIN - GITAR 2 , BADIES – BASS , CALVIN – KEYBOARD ) .\r\n\r\n“ IMPIAN “ ADALAH NAMA ALBUM PERDANA CHORD BAND SEBAGAI LANGKAH TEPAT UNTUK BERADA DI JALUR INDUSTRI MUSIK INDONESIA. \r\n\r\nCHORD BAND SANGATLAH SIAP UNTUK MENGIBARKAN KARYA NYA DI INDUSTRI MUSIK INDONESIA , DENGAN HARAPAN KARYANYA BISA DI TERIMA DI MASYARAKAT SERTA BISA MEMBAWA ARAH POSITIVE UNTUK KEMAJUAN INDUSTRI MUSIK INDONESIA.\r\n\r\nMORE INFORMATION \r\nInstagram   	: Chord_Band      	Instagram   		: Creative_Musikindo  \r\nFacebook 	: Chord Band        Facebook 		: Creative Musikindo  \r\nTwitter  	: @Band_Chord      Twitter  		: @Creative_Musikindo\r\n\r\n\r\nOUR PERFORMANCE / DISCOGRAPHY RELEASE\r\n-	GEBYAR UNDIAN PANEN HADIAH BRI PURWAKARTA\r\n-	PEMUTARAN SERENTAK RADIO SE- INDONESIA , MALAYSIA & BRUNEI DARUSALAM  HITS SINGLE CHORD “ YANG PERTAMA “\r\n-	RELEASE HITS SINGLE CHORD “ YANG PERTAMA “ SOUNDTACK INFOTAINMENT EXPOSE & SELEBRITA TRANS7\r\n-	RELEASE 2nd SINGLE CHORD “ AKU YANG SAKIT “ DI RADIO-RADIO SE-INDONESIA\r\n-	PURWAKARTA NGANPLAG\r\n-	WEEKEND MUSIC – PLAZA AREA MALL KARAWANG CENTRAL PLAZA\r\n-	JAK INDIE PRO – PANTAI KARNAVAL ANCOL – JAKARTA\r\n-	INDOMUSICALLY – LA PIAZZA KELAPA GADING – JAKARTA\r\n-	SOUND OF TRI – SERANG PROV.BANTEN\r\n-	WEEKEND KOTA TUA – MUSEUM FATAHILA – JAKARTA\r\n-	ON AIR PROGRAM MUSIC ZONE “ KEMUNING TV “\r\n-	ON AIR SPESIAL TALKSHOW BANTEN RADIO\r\n-	SUBANG RAMADHAN FAIR 2017\r\n-	PEKAN RAYA JAKARTA / JAKARTA FAIR KEMAYORAN 2017\r\n-	LEBARAN FESTIVAL – PANTAI KARNAVAL ANCOL – JAKARTA\r\n-	DAN MASIH BANYAK LAGI OFF / ON AIR CHORD','Pop','facebook;instagram;','Jakarta',264,'2017-08-14 04:47:41','2017-08-14 04:47:41'),
	(119,'ZYTHUS','1502690995.jpg','ZYTHUS diambil dari nama dewa \"ZETHUS\" (Dewa penggembala), kami proyeksikan ke musik sesuai dengan karakter PENGGEMBALA yang memanjakan hewan gembalaannya, berharap musik kami bisa memanjakan pendengar musik ZYTHUS.\r\nPrestasi berkesan untuk kami adalah masuk 10 Besar FInalis A Mild Soundrenalin daerah Yogyakarta tahun 2012 dan beberapa kali mengisi Dies Natalis kampus yang ada di Yogyakarta.','Pop','teman;','Yogyakarta',278,'2017-08-14 05:09:55','2017-08-14 05:09:55'),
	(120,'jou barakati','1502696449.JPG','JOU BARAKATI - \r\n\r\nM.Irsyad (ex Moiss, ex Warehouse), Lazuardi Rifki (Sugar Bitter), Dimas Sadewa (Sugar Bitter), Hari Candra (ex Moiss) Erwin Handoko (ex UKLunch) yang tergabung dalam grup musik psychedelic-rock asal Semarang, Jou Barakati, telah melepas single perdana berjudul “My Uniform and Super Close Buddy”. Lagu yang menjadi draf dalam penggarapan album untuk project tahun ini sudah dapat dinikmati di kanal youtube \'Elok Nada Grup\'\r\n\r\nDalam pers rilisnya, Jou Barakati menjelaskan “My Uniform and Super Close Buddy” mengulas tema romansa remaja yang dikemas dengan lantunan psychedelic-rock ala bohemian. Sebuah pengalaman pribadi Lazuardi Rifki yang memiliki hubungan eksentrik dengan dara manis, membawa penembang berkhotbah melalui tulisannya. Dentum ketukan yang tidak lambat maupun cepat dan harmoni melodi yang lembut membangun nuansa dalam spektrum kebahagiaan dan kegusaran mewarnai kehidupan, bahkan penyesalan. Buaian suara flute di akhir lagu yang menjadi klimaks menuntun pendengar ikut mengobservasi inti cerita di lagu ini.\r\n\r\nDidalangi oleh Tommy Saputra (manajer Holy Baby Horny), yang tumbuh kembang di skena musik metal Semarang, ingin memulai sebuah eksperimen baru. Dengan keberhasilan Holy Baby Horny merilis … album dan melangsungkan tour, Tommy yang akrab disapa Tomek, ingin memproklamirkan band baru dengan musikalitas yang kontras dengan sebelumnya. Tidak menunggu waktu lama bergabunglah personil lengkap Jou Barakati yang cukup dibilang berpengalaman di dunia musik, khususnya Semarang. Dengan menyajikan nuansa musik gelap wewangian psychedelic rock ala bohemian yang dapat dinikmati oleh orang banyak.\r\n\r\n\r\n\r\n\r\n“My Uniform and Super Close Buddy”\r\n “cliche” mungkin adalah kata yang tepat untuk menggambarkan suatu lagu yang bertemakan romansa. Yang membedakan\r\nadalah dari pendekatan yang digunakan, baik secara musikal maupun sudut pandang\r\nyang “tidak biasa”. Seperti JOU BARAKATI, sebuah band psychedelic-rock ala\r\nbohemian asal Semarang yang baru saja merilis single perdana berjudul “My Uniform and Super\r\nClose Buddy”. Dan ini lagu cinta yang tidak biasa-biasa saja,  \r\n\r\nDalam single “My Uniform and Super Close Buddy”, JOU BARAKATI mengulas tema romansa remaja\r\nyang dikemas dalam lantunan psychedelic rock ala Bohemian. Sebuah pengalaman pribadi seseorang\r\nyang memiliki hubungan eksentrik perempuan, membawanya ber-”khotbah” melalui tulisannya. Dentuman\r\nketukan yang tidak lambat maupun cepat, serta harmoni melodi yang lembut membangun nuansa dalam\r\nspektrum kebahagiaan dan kegusaran yang telah mewarnai kehidupan. Buaian suara flut diakhir lagu\r\nyang menjadi klimaks menuntun pendengar ikut mengobservasi inti cerita dilagu ini.\r\n\r\nProses pengerjaan single ini sangat sederhana, pada bulan April lalu pengerjaan lagu ini dilakukan sendiri.\r\nSingle lagu “My Uniform and Super Close Buddy” dioperatori oleh personilnya sendiri,\r\n\r\n\r\n\r\nTembang-tembang romantis yang berlalu lalang mendongengkan keindahan patah hati.\r\nSetuju, sangat “cliche”.\r\n Joubarakati pun setuju, band psychedelic ala bohemian asal Semarang ini secara explisit \r\nmenggambarkan betapa romansa itu sangatlah luas. Suasana 70an, dengan menambah vibe statis ala undersubstanced hippies\r\n \r\n\r\nterangkum manis dalam balutan lagu berjudul “My Uniform and Super\r\nClose Buddy”.','Rock','instagram;informasi_toko;guitar_plus;poster;teman;lainnya;','Yogyakarta',219,'2017-08-14 06:40:49','2017-08-14 06:40:49'),
