	(123,'Sedalanen Etnik','1502705268.jpg','Sebuah group musik asal Sumatera Utara yang mengangkat nilai nilai bunyi tradisi nusantara di kolaborasikan dengan combo band. Slalu Aktif di beberapa event yang beraroma budaya dan event musik lainnya. Pernah menjadi pengisi acara di event KMANV 2017  (kongresmasyarakatadatnusantaralima)\r\nDan kegiataan sekarang masih terus berlatih merangkai bunyi\"an etnik nusantara','Others','facebook;','Medan',205,'2017-08-14 09:07:48','2017-08-14 09:07:48'),
	(124,'Projecta','1502708822.jpg','Projecta Profile:\r\n\r\nBand asli kota Banda Aceh ini, dibentuk pada tahun 2015 dan telah terus mencoba menghadirkan kembali nuansa Rock n Roll 80an di Aceh. Dimana seperti kita ketahui saat ini scene musik yang paling mendominasi adalah Underground. Lebih tepatnya Projecta terbentuk di pertengahan Agustus 2015 dan memulai aksi mereka di bulan September 2015 pada event lokal bertajuk \" Aceh On Stage\". Projecta diisi oleh Ghazi pada Vokal, Alam pada Bass, Raja pada Gitar, Ewee pada Drum dan Tom pada Gitar, mereka menjelma sebagai salah satu band Rock n roll yang menarik untuk disaksikan.\r\n\r\n\r\nDi awal aksi mereka, Projecta memiliki gaya yang menarik, menjadi anak muda yang membawakan lagu-lagu lama dari AC/DC. Projecta juga semakin dikenal dengan aksi hebohnya diatas panggung. Beberapa kali mereka juga memenangkan Festival musik lokal di Aceh\r\n\r\nUntuk saat ini, Projecta sedang menyiapkan materi materi untuk penggarapan mini Album mereka.','Rock','facebook;','Medan',274,'2017-08-14 10:07:02','2017-08-14 10:07:02'),
	(125,'POPMISSPOKE','1502708929.JPG','berdiri kisaran 2013 kami cuma bermain di gigs gigs kisaran jawa timur dan memiliki mini album 2017 berisi 6 lagu dan rilis berupa kaset pita, CD audio yang kami produksi secara mandiri.','Others','instagram;teman;','Surabaya',283,'2017-08-14 10:08:49','2017-08-14 10:08:49'),
	(126,'KeyP.A.D','1502718269.jpg','Band asal Banda Aceh yang genre pastinya tidak dapat diidentifikasi secara khusus oleh personilnya dan rocklah yang menjadi titik temu genre pastinya.Dengan 3 orang anggotanya,KeyP.A.D berhasil membuat musik, dan aksi yang apik menurut mereka.','Rock','instagram;poster;teman;','Medan',17,'2017-08-14 12:44:29','2017-08-14 12:44:29'),
	(127,'KAZE','1502719278.jpg','KAZE didirikan tanggal 19 Februari 2014, dengan single pertama “Perjalanan Masih Panjang” yang sempat masuk dan terhenti di tahap 5 besar seleksi live audition dalam kompetisi Star Hunt Simpati Loop Makassar 2014.\r\nSetelah pergantian vocalist, saat ini KAZE hadir dengan formasi baru dengan hanya menyisakan Rezki di Vocal serta Ayub di Bass/Backing vocal, dengan formasi ini KAZE hadir untuk memberi warna baru sekaligus melawan stigma bahwa keterbatasan bukanlah penghalang untuk berkarya, hal ini telah kami buktikan dengan tampil berdua dibantu backsound minus one lagu kami (minus vocal/bass) saat dipercaya oleh masyarakat Bone untuk ikut ambil bagian dalam perhelatan Bone Fair 2016 dengan membawakan total 2 lagu cover & 4 lagu dari KAZE sendiri, disana kami mendapat pengalaman yang sangat berharga karena bisa sepanggung dengan band reggae keren asal Makassar Galarasta, & 2 vocalist favorit kami Fadly Padi juga Andi /Rif.\r\n total 7 lagu & 4 klip yang telah dikerjakan sampai saat ini secara indiependent “Biarkan Semua Berlalu”, “Pergilah”, “Perjalanan Masih Panjang”,”Cahaya”, “Andai Saja” ,“White Knight”, “Cahaya (Ost.Ultimate Glad)”, salah satu single KAZE di mini album ini yang berjudul “Cahaya”  juga inshaallah akan jadi Opening Soundtarck(Ost) sebuah film animasi karya komikus Bandung yang juga masih tahap proses pengerjaan sampai saat ini, kami coba lawan keterbatasan dengan cara ini & menjadi band indie Sulawesi Barat pertama yang melakukan rilisan fisik, & pencapaian terakhir kami di tahun 2017 ini masuk dalam 20 besar regional Makassar di event Sound Of Tri, berharap proses yang KAZE kerjakan sampai sekarang bisa berjalan sesuai rencana demi bisa juga mengangkat nama daerah kami Polman, Sulawesi Barat melalui jalur musik sekaligus menjadi pembuktian bahwa kita band asal kota kecil yang jauh dari industri pasar musik juga mampu berkarya lewat jalur indie, berharap apa yang kami lakukan bisa menjadi sugesti kepada teman-teman indie lain di daerah kami untuk tidak pesimis dalam berkarya.','Alternative Rock','instagram;maliq;teman;','Yogyakarta',284,'2017-08-14 13:01:18','2017-08-14 13:01:18'),
	(128,'Tremor','1502721983.JPG','band asal banda aceh yang bergenre metalcore, rock, hardcore. band ini dibentuk tahun 2016 dan baru saa merilis album yang bertajuk trigger mouth. band ini memiliki lick guitar yang khas dan lirik-lirik tentang kehidupan.','Others','instagram;poster;','Medan',288,'2017-08-14 13:46:23','2017-08-14 13:46:23'),
	(129,'Dejammer And The Matoa Tree','1502724838.jpg','Prestasi terbesar adalah mereka menyanyikan cerita kita :)\r\n\r\nDenniel dan duo kembar kribo (Rio , Reo) sudah 2 Tahun sangat senang bercerita.. \r\n1 single , dan dalam tahap pengerjaan album..\r\nbanyak yang bilang Folk.. tapi kita apa saja boleh dalam arti yaaa siapa sih yang mau di kotakkan di satu warna saja..\r\njadi salam kenal dari kita , Dejammer and the matoa tree..','Folk','teman;','Surabaya',289,'2017-08-14 14:33:58','2017-08-14 14:33:58'),
	(130,'Meneer','1502737755.jpg','Meneer  dengan musik minimalis, mampu bermain secara maksimal dan sangat menghibur.\r\nDi tambah dengan kostum baru kebangsaan ala tuan tuan belanda pada zaman dulu.\r\n MENEER cukup dikenal di daerah seperti Jawa Tengah, Jawa Timur, Jawa Barat, dan tentunya daerah ibukota Jakarta.\r\n- Pada tahun 2010 Meneer memenangkan lomba festival band sejabodetabek di TMII(Taman mini indonesia indah)\r\nJadi Guest Star di acara Freaky Friday pada tahun 2012\r\nJadi Guest Star di JTV Surabaya tahun 2012\r\nJuara 1 festival band di menpora pada tahun 2013\r\nJuara 2 festival ulang tahun TVRI yang ke 50th tahun 2013\r\nJuara 3 festival ipkindo di sesco tahun 2013\r\nJadi GS ( guest star) di acara skin head pride di Gasibu Bandung,thn 2013\r\nJadi GS acara pemilihan cagub dan cawagub di semarang tahun 2013\r\nJadi Band pembuka Roy Jeconiah Boomerang di semarang pada tahun 2014\r\nMainstage with Ungu, Lastchild di Jakarta Fair 2015','Others','teman;lainnya;','Jakarta',257,'2017-08-14 18:09:15','2017-08-14 18:09:15'),
	(131,'Useless Rebels','1502762604.jpg','Band kami terbentuk sejak 2010 mengusung genre yang belom ada di indonesia yaitu Electronic Hardcore Music(EHM) kita terbentuk dr teman satu komplek dirumah dengan hobi dan visi misi yang sama. Kita telah menelurkan satu Ep album berjudul Alive. Lagu single kita yang pertama sudah bisa di request di radio lokal indonesia dan menjadi chart nomer 1 di hai magazine hai demos. Mencampur musik edm dan musik hardcore/metal semoga kita bisa terpilih. Terimakasih!','Rock','teman;','Jakarta',302,'2017-08-15 01:03:24','2017-08-15 01:03:24'),
	(132,'Fossil band','1502778322.jpg','Fossil Band merupakan band yg terbentuk tahun 2010, band ini pernah memenangkan djarum super friendship moment sebagai juara ke 3','Pop','teman;','Jakarta',303,'2017-08-15 05:25:22','2017-08-15 05:25:22'),
	(133,'Arashi JE','1502791450.jpg','Arashi Je is Indonesian band formed in 2014, composed of Bimo,Reza,Paulus,Barep, and Alvin. The foundation for Arashi began when Reza Maulana, Then a High school student, wanted to start a band. He told his firend Reynaldi , a fellow member of Blue Eyes Band to as vocals and asked Barep Prasetyo to join. he asked his classmate Rendy Alviansyah to play drums and Rendy asked Rizal Firdaus to join. Reynaldi left the band to pursue an career. At that time, Bimo Prakoso was playing in another band, Bimo didn\'t enjoy playing with them, so Reza insisted that he join Arashi Je instead and then Bimo joined Arashi in November 2014 . Rendy left the band in January 2015 to persue an drum career . and then Rendy was later replaced by Alvin Pratama. In April 2015 Rizal Firdaus left the band because his parents didn\'t want their son to pursue that line of work, it was announced that ARASHI JE would continue on without Rizal Firdaus, Reza Maulana took his place as lead guitar, and the band re-arranged their songs to be played for one guitar. \r\nWith the new four-member formation, the band released the single \"Kejarlah\" on July 17, 2015.In November 2015 Reza Maulana asked Paulus Perkasa, who was their friend in school to join as Rythm Guitarist . and now Arashi Je composed by the new five member formation . ARASHI JE\'s basic influences were One Ok Rock and Another Japanese Rock Band.','Rock','poster;','Jakarta',314,'2017-08-15 09:04:10','2017-08-15 09:04:10'),
