	(136,'Arashi JE','1502791533.jpg','Arashi Je is Indonesian band formed in 2014, composed of Bimo,Reza,Paulus,Barep, and Alvin. The foundation for Arashi began when Reza Maulana, Then a High school student, wanted to start a band. He told his firend Reynaldi , a fellow member of Blue Eyes Band to as vocals and asked Barep Prasetyo to join. he asked his classmate Rendy Alviansyah to play drums and Rendy asked Rizal Firdaus to join. Reynaldi left the band to pursue an career. At that time, Bimo Prakoso was playing in another band, Bimo didn\'t enjoy playing with them, so Reza insisted that he join Arashi Je instead and then Bimo joined Arashi in November 2014 . Rendy left the band in January 2015 to persue an drum career . and then Rendy was later replaced by Alvin Pratama. In April 2015 Rizal Firdaus left the band because his parents didn\'t want their son to pursue that line of work, it was announced that ARASHI JE would continue on without Rizal Firdaus, Reza Maulana took his place as lead guitar, and the band re-arranged their songs to be played for one guitar. \r\nWith the new four-member formation, the band released the single \"Kejarlah\" on July 17, 2015.In November 2015 Reza Maulana asked Paulus Perkasa, who was their friend in school to join as Rythm Guitarist . and now Arashi Je composed by the new five member formation . ARASHI JE\'s basic influences were One Ok Rock and Another Japanese Rock Band.','Rock','poster;','Jakarta',314,'2017-08-15 09:05:33','2017-08-15 09:05:33'),
