	(143,'The Armstrong Band','1502863894.jpg','The Armstrong adalah sebuah band beraliran pop punk yang terbentuk pada tahun 2009 di Bandung. Band ini terdiri dari 3 orang personil yaitu Junto (gitar&vokal), Erik (drum), Roy (gitar) dan seorang additional untuk bermain bass. Sebenarnya masing masing personil berteman sudah sejak lama, sudah sering bermain bersama, karena memang lahir dari komunitas yang sama pula. Tapi pada tahun 2009 kebetulan diadakan sebuah acara musik yang membuat mereka sepakat untuk sama sama membentuk band.\r\n\r\nBeberapa prestasi :\r\n\r\n2010 - Juara 1 Lomba Video Band dari LG\r\nhttp://thearmstrongband.blogspot.co.id/2010/09/sasarengan-nambih-seru-pisan-euy-lg.html\r\n\r\n2011 - Masuk Kompilasi Pop Is Dead III\r\nhttps://mindblasting.wordpress.com/2011/12/31/pop-is-dead-iii/\r\n\r\n2012 - Masuk Kompilasi Flowers City Fresh rilisan dari Komunitas Akustik / Ariesco Music Studio.','Alternative Rock','guitar_plus;','Jakarta',332,'2017-08-16 05:11:34','2017-08-16 05:11:34'),
	(144,'Visual Dream Band','1502864012.JPG','Visual Dream Band terbentuk di Tangerang pada 27 April 2010 dengan genre Pop Rock di Tangerang yang beranggotakan :\r\nVokalis	: Anata\r\nGitaris	: Jeffry\r\nBassist	: Bily\r\nDrumer	: Steven\r\nAwal mulanya kami membentuk band untuk mengcover lagu-lagu dari Band Jepang seperti L’arc en ciel dan beberapa lagu Ost.Anime lainnya hanya untuk mengikuti beberapa event musik seperti pensi SMA / kampus dan Festival band.\r\nKami juga pernah mendapatkan juara di beberapa festival band, namun bukan itu saja yang kami inginkan, Sebab seiring berjalannya waktu, kami menciptakan karya yang tentunya agar dapat diterima kalangan masyarakat luas.\r\n\r\nPrestasi :\r\n-	Juara 1 Festival Band di Kalideres, 2014\r\n-	Juara 2 Festival Band UNAS, 2015\r\n-	Juara 1 Festival Band di Jatiuwung, 2015\r\n-	Juara 1 Festival Band UNJ, Jiyuu Matsuri 2016\r\n-	Juara 1 Festival Band Animaku No Hibi di Ramayana Bogor, 2016','Rock','guitar_plus;','Jakarta',334,'2017-08-16 05:13:32','2017-08-16 05:13:32'),
	(145,'Self confidence band','1502864421.jpg','Kami berasal dari kota makassar\r\nTerdiri dari 4 personil\r\nKami merintih di dunia musik sudah 7 tahun \r\nPrestasi alhamdulillah\r\nKami pernah juara satu festival musik yg di adakan oleh telkomsel\r\nSaat itu festival ajang pencarian bakan lagu ciptaan\r\nBand kami jadi juara satu\r\nLagu kami juga sudah berapa kali top chart pertama di radio2 musik di makassar','Pop','guitar_plus;teman;','Jakarta',335,'2017-08-16 05:20:22','2017-08-16 05:20:22'),
	(146,'HEROES PARTY','1502867710.jpeg','Kita Heroes party Band yg berasal dari tangerang ingin mengungkapkan apa yg kita alamai selama ini melalu pesan sebuah nada untuk kalian semua','Heavy Metal','guitar_plus;teman;','Jakarta',339,'2017-08-16 06:15:10','2017-08-16 06:15:10'),
	(147,'ACEMOJO','1502868037.jpg','Acemojo, band yang berasal dari kota Solo ini mencoba peruntungan baru dalam dunia musik di Indonesia. Band yang pada awalnya bernama The Brown ini merilis lagu single yang menjadi andalan sekaligus gebrakan baru yang bertajuk “After The Rain”. Lagu ini bercerita tentang dampak hebat dalam perubahan baru dan sedikit menyinggung cerita tentang keadaan band yang sempat berganti-ganti personil hingga sepakat mengganti nama menjadi “Acemojo” yang dimana para personil memiliki harapan yang besar untuk memiliki nasib baru dan lebih baik. Single “After The Rain” ini memiliki makna dimana munculnya pelangi sebagai simbol dan pelengkap keindahan setelah turunnya hujan deras, juga membawa suasana yang bersemangat untuk kita bergerak. \r\n\r\nkami pernah terlibat dalam beberapa gigs komunitas, beberapa dalam panggung seni, serta yang terakhir kami terlibat dalam Kompilasi Warningmagz vol.1\r\n\r\nkami juga selalu mendokumentasikan live act kami, dan kami upload via youtube kami ACEMOJO serta Instagram Acemojo','Rock','guitar_plus;teman;','Yogyakarta',340,'2017-08-16 06:20:37','2017-08-16 06:20:37'),
	(148,'The Hoodie','1502870229.jpg','The Hoodie merupakan grup rock asal Bogor yang dibentuk oleh Alfian (Gitar), Alwan (Gitar), Fakih (Vokal), Yugi (Bass), dan Adrie (Drum). The Hoodie banyak terpengaruh oleh sound band rock/bluesrock 70-an yang mengandalkan distorsi, beat yang cepat, dan harmoni. Nama-nama seperti Deep Purple, Led Zeppelin, Black Sabbath merupakan beberapa band yang mempengaruhi musikalitas The Hoodie.','Rock','instagram;','Jakarta',347,'2017-08-16 06:57:09','2017-08-16 06:57:09'),
	(149,'Classroom','1502871239.jpg','Alternative rock with influence Nirvana, Foo Fighters, Red Hot Chili Peppers, Alice in Chain, Rage Against The Machine, Muse, Bee Gees, Audio Slave, Led Zepellin, Guns n Roses, Black Flag and kind some out of the box music genre like Kvelertak and many more.....\r\n\r\nWe have 5 songs material that already package in EP album in 2015. Walk in independent movement and just do everything we love.....\r\n\r\nWhy we are join The Levi\'s Band Hunt?\r\nIt\'s passion no commercial needed.....','Alternative Rock','instagram;','Jakarta',348,'2017-08-16 07:13:59','2017-08-16 07:13:59'),
