	(153,'Halus Lembut','1502879810.jpg','Band ini terbentuk tanggal 8 Agustus tahun 2014. Beranggotakan Zulaika Nafira pada vocal, Xander Ongko sebagai pencipta lagu, backing vocal dan lead guitar, dan Julian Patty pada drum. Lagu pertama Halus lembut berjudul \"Kapal Miring\" dijadwalkan untuk dirilis di Youtube pada pertengahan September 2017. Debut panggung mereka dapat disaksikan di akun Youtube mereka: Official Halus Lembut yang menampilkan performa mereka membawakan lagu-lagu ciptaan merek sendiri pada acara Jakarta Fair 2017 di panggung gambir.','Pop','guitar_plus;','Jakarta',365,'2017-08-16 09:36:50','2017-08-16 09:36:50'),
	(154,'PAREIDLOIA','1502883519.jpeg','Terbentuk di akhir tahun 2012 dengan mengusung musik pembaruan dalam ranah indie pop dengan nuansa new wave dibalut lik gitar tremolo dan nuansa elemnt elktornik.','Others','instagram;','Jakarta',355,'2017-08-16 10:38:39','2017-08-16 10:38:39'),
