	(157,'Glowing butterfly','1502890761.jpg','Glowing butterfly adalah band yang berasal dari Banjarmasin / Kalimantan selatan yang berdiri pada 20 Agustus 2013. Band ini terbentuk dari Anak – anak pemusik pencinta musik Japanese,Dengan mengusung genre Japanese rock.\r\n	Dan kami sering mengisi acara – acara musik di Banjarmasin / banjarbaru. Selain mengikuti lomba-lomba band. Glowing butterfly Jugasering menjadi Guest star pada event-event Jepang Festival yang sering di adakan di kota Banjarmasin dan sekitarnya.\r\n\r\nPrestasi yg sudah di gapai	 ;\r\n-	JUARA 1 JAPANESE FESTIVAL BAND SMA 3 ( 2013 )\r\n-	JUARA 1 JAPANESE FESTIVAL BAND SMAVEN 7 ( 2013 )\r\n-	JUARA 1 JAPANESE FESTIVAL ANIME GATERING ( Banjarbaru )\r\n-	JUARA 2 JAPANESE FESTIVAL BAND SMAVEN 7 ( 2015 )\r\n-	GUEST STAR EVENT JAPAN MUSIC PARTY ( 2015 )\r\n-	GUEST STAR EVENT HIKARI COSWALK COMPETITION  ( 2016 )\r\n-	 GUEST STAR EVENT HANAMI MATSURI “ KIREI NO SAKURA “ ( 2016 )','Rock','guitar_plus;','Surabaya',381,'2017-08-16 12:39:21','2017-08-16 12:39:21'),
	(158,'Blackstone29','1502891239.jpg','BlackStone29 banyak dipengaruhi oleh band-band rock seperti Guns & Roses, Metallica, Alter Bridge dan masih banyak lagi. Setelah dua tahun berdiri BlackStone29 merekam beberapa lagu, diantaranya Kota Istimewa, Melayang dan Untuk Vokasi yang dijadikan sebagai anthem Sekolah Vokasi Universitas Gadjah Mada.','Rock','instagram;','Yogyakarta',108,'2017-08-16 12:47:19','2017-08-16 12:47:19'),
	(159,'Jackfruitband','1502892735.jpg','Didasari oleh persahabatan lima pemuda dari masa sekolah yang kemudian diperkaya oleh kecintaan mereka terhadap musik, Jackfruitband tumbuh menjadi kelompok musik yang kompak, harmonis, dan kuat.\r\n\r\nDipimpin oleh Camille Secioria, putra sulung dari Elfa Secioria, salah satu maestro musik Indonesia. Dengan arahan langsung dari sang maestro, Jackfruitband telah terbiasa berlatih, secara grup maupun personal untuk membawakan karya-karya yang unik dan menantang sejak dini. Khususnya berbagai lagu dengan genre Latin, Jazz, dan Blues.\r\n\r\nDisamping Elfa Secioria, musisi-musisi besar yang ikut membentuk Jackfruitband, Stevie Wonder, Michael Jackson, Jamiroquai, Incognito dan Earth Wind and Fire, juga menginspirasi komposisi karya-karya Jackfruitband.\r\n\r\nJackfruitband digawangi oleh Camille (drums), Cavell (keys), Gilang (guitars), Robby (bass) dan Farlan (vocals), selama kurang lebih 1 dekade bermusik bersama-sama, Jackfruitband telah merilis satu mini album (EP) yang berjudul “We Are Here” berisikan 6 lagu; Dancing Tonight, Oasis Song, Simple Whisper, Happy Life, It Just Got To Be You dan We Are Here, yang dirilis dalam bentuk digital (iTunes, Spotify, Soundcloud, Youtube, dll.)  dan CD fisik pada tahun 2015.\r\n\r\nJackfruitband sendiri telah aktif mengikuti beberapa ajang atau festival musik di Indonesia, dari tingkat nasional dan Internasional seperti Bekasi Jazz Festival, Margo Friday Jazz, TP Jazz Bandung Festival, Java Jazz Festival, dll.','Jazz','instagram;','Jakarta',382,'2017-08-16 13:12:15','2017-08-16 13:12:15'),
	(160,'THE YOUNGSTERS','1502893378.jpg','THE YOUNGSTERS berasal dari kota Nganjuk Jawa Timur, berdiri pada bulan september 2015 lalu beranggotakan tiga orang yaitu Yogi ( Vocalist + Guitarist), Aldi (Bassist) dan Shandy (Drummer). \r\nKami sudah lama berkarya dan berkecimpung dalam dunia musik sejak awal SMA sampai sekarang. Banyak karya lagu yang kami ciptakan salah satunya \" I\'m sorry \" yang menjadi lagu andalan kami yaitu perpaduan antara musik rock dan electric.\r\nMeskipun kami sudah memiliki banyak lagu, namun terasa percuma karena kota kelahiran kami sendiri kurang memperhatikan bakat dan kreativitas para kaula muda. Tidak ada wadah bagi band indie untuk bisa berapresiasi.\r\nSatu - satunya cara untuk sedikit mengobati kekecewaan itu yaitu kami selalu mengupload lagu ke reverbnation, youtube dan soundcloud yang sudah kami kerjakan dengan sederhana melalui komputer.\r\nDengan adanya LEVI\'S BAND HUNT kami sangat terdorong untuk mengikutinya. Andai saja kami tidak lolos seleksi kami akan berlapang dada dan berkarya lebih baik lagi karena dengan adanya LEVI\'S BAND HUNT yang sangat mendukung band dengan lagu ciptaan sendiri dan mendukung semua genre bisa membuat band indie semakin bersemangat untuk selalu berkarya.','Alternative Rock','instagram;','Surabaya',374,'2017-08-16 13:22:58','2017-08-16 13:22:58'),
	(161,'foxteen','1502894702.jpeg','Foxteen is a band formed by college mates.\r\nThe name itself is a joint form of some words,\r\nwhich are FOX (acronym for Freedom Of\r\nXoul; freedom of soul, freedom in artistic\r\nworks and freedom in musical expressions)\r\nand Teen (refers to the members of the band,\r\nwhich have dragged into music since they\r\nwere teenagers).\r\nFoxteen offers alternative rock genre,\r\nestablished in 2007 with a few changing of\r\nthe members. As the time goes by, in 2012\r\nmembers\r\nwe tried to renew our appearances, song\r\narrangements, packaging and the members’\r\ncharacter. The story goes on since then','Alternative Rock','guitar_plus;','Jakarta',372,'2017-08-16 13:45:02','2017-08-16 13:45:02'),
	(162,'SHAL','1502895018.jpg','SHAL band adalah singkatan dari See, Hear and Feel, di adopsi dari\r\nbahasa inggris yang erarti “Lihat, dengar dan rasakan”.\r\n\r\nJauh Sebelumnya, cikal bakal SHAL dimulai oleh teman satu sekolahan yakni\r\nFira, Ragil, Firman, Abdy, & Iqbal, band yang sebatas perform di studio dan meng-cover\r\nlagu dari band-band ternama. Setelah beberapa bulan kemudian mereka mencoba\r\nikut tampil di beberapa kompetisi band, Setahun berselang setelah SHAL\r\nterbentuk, mereka Vakum karena terbentur oleh kesibukan akademik mereka.\r\n Dan Setahun kemudian, SHAL kembali dan mencari drumer baru. Fahrul yang\r\nmasih teman satu sekolah, terjun menggantikan Iqbal.  Saat itu mereka sepakat untuk\r\nmerapatkan barisan, lalu memutuskan mengganti nama band mereka  dengan nama SHAL\r\ndan meresmikan tanggal 01 Agustus 2012 sebagai hari terbentuknya SHAL band.\r\n\r\nSelama Dua tahun lebih, mereka telah banyak melaui suka duka\r\ndan seiring waktu sang Vocalist (Fira) sudah tidak punya waktu luang untuk band mereka,\r\nlalu mereka sepakat untuk merekrut Vocalist baru dan sejak itu beberapa nama telah tercatat\r\ndalam history SHAL band, yang tak terpungkiri mereka (Fira, Ryta, Alwi, Cimy & Fadel)\r\ntelah menorehkan banyak prestasi untuk SHAL band.\r\n\r\nSejak terbentuk, SHAL telah menjajal berbagai  panggung kompetisi band dan di tahun 2015,\r\nmereka memutuskan untuk maju di jalur Indie band dan merekrut Vocalist baru “Emen”.\r\n\r\n* * *\r\n\r\nTerbentuk :\r\n01 Agustus 2012\r\n\r\nMember :\r\nEmen\r\nRagil\r\nFirman\r\nFahrul\r\n\r\nGenre :\r\nEasycore Synth\r\nElectronic Rock\r\n\r\nSosial Media :\r\nInstagram :  @shal.band | Twitter :  @shal_band | Facebook :  shal band\r\n\r\nLink lagu ciptaan :\r\nwww.soundcloud.com/shalofficial\r\nwww.youtube.com/shalofficial\r\n\r\nAlamat :\r\nJl Abd Rasyid Dg Lurang No 4b / Sungguminasa / Gowa / Makassar / Sulawesi Selatan / Indonesia\r\n\r\nContact Us :\r\n0853 9444 6266\r\nsheehearfeel@gmail.com','Others','instagram;','Jakarta',329,'2017-08-16 13:50:18','2017-08-16 13:50:18'),
