	(166,'SABI','1502905407.jpg','Sebuah kelompok musik beraliran alternative rock yang berasal dari Kota Pekanbaru Provinsi Riau Indonesia ini telah berdiri sejak desember 2011, dan pernah mengikuti berbagai kompetisi di tingkat lokal, nasional, dan internasional.','Alternative Rock','instagram;','Medan',384,'2017-08-16 16:43:27','2017-08-16 16:43:27'),
