	(168,'HIPTODAY!','1502909389.jpg','“ HIPTODAY!\" adalah sebuah band RapRock yang berasal dari kota Kupang, Nusa Tenggara Timur, yang kini berdomisili di Bandung.  \r\nTerbentuk pada tanggal 22 maret 2015. HIPTODAY! Terdiri dari : Big V (mc rap) , Jio (lead vocal), Eman (gitaris), Fandi DonJ (drummer) dan Yozhy (synthesizer).\r\nSejauh ini, HIPTODAY! Sudah berhasil menghasilkan sebuah EP perdana dengan tajuk EXPLORASI. Album EP ini juga sudah tersebar di beberapa digital store seperti Spotify, Itunes, dll, dan juga 2 buah video klip “EXPLORASI” dan “SIKSA DOSIS TINGGI”\r\n        Berikut panggung dan beberapa prestasi yang sudah didapatkan oleh HIPTODAY!\r\n1.	Juara 1 dalam kompetisi GoAheadPeople NTT “Road To Soundrenaline 2015” dan mendapatkan kesempatan untuk bermain di welcoming stage Soundrenaline di tahun 2015.\r\n2.	Manggung di beberapa panggung GoAheadPeople di NTT\r\n3.	Menjadi Opening stage beberapa musisi nasional seperti Judika, J-rocks, Mario Klau\r\n4.	Menjadi Guest star di acara :\r\na.	Road To Soundrenaline 2016\r\nb.	CrossBorder 2016\r\nc.	BNN hari anti narkoba 2016\r\nd.	Mega Amplification in Timor Leste 2016\r\n5.	Juara 1 dalam kompetisi band “Jakcloth band competition 2017”','Others','instagram;','Jakarta',391,'2017-08-16 17:49:49','2017-08-16 17:49:49'),
	(169,'Young And Powerfull','1502912680.jpg','Berawal dari kesenangan atas genre musik yg sama, kita sepakat membentuk band ini pada 28 september 2014, nama Young And Powerfull sendiri memiliki makna bahwa kita adalah sekumpulan anak muda yg penuh dengan semangat, kreativitas yg tinggi serta selalu dipenuhi dengan pikiran optimisme dan positive thinking\r\nPrestasi terbaru kita adalah kita sudah berhasil menyelesaikan album indie pertama kami yg bertajuk \"Antusias\"','Others','guitar_plus;teman;','Surabaya',367,'2017-08-16 18:44:40','2017-08-16 18:44:40'),
