	(171,'Class Of The Moon','1502914014.JPG','Class Of The Moon adalah band yang terlahir dari sebuah mimpi yang sama & hobi yang sama. Terlahir di kota yang penuh dengan musisi - musisi kreatif yaitu bandung membuat Class of the moon bangga bisa memeriahkan kancah musik indie dan termotivasi agar tetap konsisten dan bisa menuangkan warna baru di dunia musik indie. Secara resmi Class Of The Moon Berdiri pada tanggal 14 Agustus 2013 sebagai main Genrenya Indie Rock. Band yang di nahkodai oleh Seva (Seva Pratama), Wilman (Wilman Bratawijaya), Taufiq (Taufiq Akbar) telah meluncurkan beberapa single diantaranya pada tahun 2014 mereka merilis single yang berjudul \'Nyata\' yang telah masuk dalam beberapa kompilasi dan salah satunya kompilasi \'5th Compilation Anniversary Jakcloth\'. Setelah itu pada tahun 2016 Class Of The Moon Merilis sebuah single yang berjudul \'Fault\' yang juga sempat masuk dalam top chart di salah satu radio di bandung, dan juga single tersebut tergabung dalam sebuah kompilasi \'Pop punk Revolution vol.1\' yang dirilis oleh Digital Publisher Ana Music yang bisa didengarkan secara streaming melalui aplikasi spotify dan juga bisa didapatkan secara legal di itunes, deezer, Amazon MP3, dan lain lain.\r\nClass Of The Moon Sendiri telah banyak mengisi acara-acara seperti pensi,bazar market, dan lain lainya di berbagai daerah diantaranya bandung, jakarta, bogor, banten dan pandeglang. Dan juga sempat menjadi juara pertama dalam sebuah band competition accoustic di event CHIP FIESTA 2014 yang diselengarakan di Universitas budi luhur pada 20 mei 2014.','Rock','instagram;guitar_plus;','Jakarta',396,'2017-08-16 19:06:54','2017-08-16 19:06:54'),
