	(177,'No Slide','1502942911.JPG','Noslide ialah.. Audrey in Guitar (vocal) Arief in Guitar (Back Vocal) Fakhran ramadhan (Bass) Dendy (drum) Dengan segala kesungguhan, kerja keras kami merilis mini album yg berjudul “realita” ini oleh Trifusion Music Records”. Sebagai rincian atas produksi kami sebagai berikut : Band : Noslide Genre	: Punk Rock Release	: 10 November Tahun	: 2016 Label	: Trifusion Music Records List track	: 6 track/lagu Judul mini album : Realita Noslide.. Kota dan kaum muda akan selalu berkolaborasi dan memainkan sebuah interaksi sosial dan akan selalu berhadapan dengan barbagai permasalahan di dalam sebuah keseharian. Untuk tetap mempertanyakan dan melawan otoritas, Punk memainkan peranan penting untuk selalu mempertanyakan standar hidup masyarakat moderen dan mainstream sekarang ini. Sebagai hasil dari itu semua, kota dan kaum muda menjadi sebuah arena dan masyarakat yang ada di dalamnya mempengaruhi pembuatan lirik yang kami buat yang berkaitan dengan praktik-praktik budaya di dalamnya. Hal ini juga yang mendefinisikan ulang pengalaman kami dan pemahaman kami tentang tinggal di sebuah kota dan sebagai agen perubahan di masyarakat. Apakah musik kami akan disukai semua orang? Siapa yang berhak mengklaim musik yang kami mainkan di dalam ruang kota? Ataukah modernitas dari cara baru ber-Punkrock dan bising yang dihasilkan kami terlalu arogan untuk diakui? No slide adalah punkrock band yang berasal dari jakarta. Sejujurnya, punkrock telah memberikan sebuah pencerahan bagi masing-masing personil kami untuk tetap melawan. Misi yang akan kami sampaikan adalah lirik yang kami tulis dan nyanyikan bisa diterima semua orang, dan pesan yang kami artikulasikan bisa meraih pendengar global. Satu hal yang pasti, kami akan terus melawan. Sejak band ini dibentuk pada tahun 2013 dan karena kecintaan kami kepada band punk tahun 90 dan 80an, kami masih harus belajar untuk memberikan pesan yang ‘baik’ kepada pendengar kami dimanapun mereka berasal dan mereka berada. Kami telah merilis mini album pertama kami yang bertajuk “Realita” yang berisikan sebanyak 6 lagu. Rise against, Bad Religion, Lagwagon, Local Resident Failure, The Decline, No Use For a Name, Speak Up, NTRL, Buddy Bully, My Name adalah band yang mewarnai musik kami dan menjadi sebuah warna baru yang bernama No Slide. Kami memiliki 1 lirik berbahasa Inggris dan 5 lirik yang berbahasa Indonesia. Hal tersebut dilakukan karena mini album dan untuk album-album berikutnya akan dibuat dengan format seperti itu dan bisa meraih pendengar yang berasal dari luar Indonesia.','Funk','guitar_plus;','Jakarta',403,'2017-08-17 03:08:31','2017-08-17 03:08:31'),
	(178,'ALL ICE','1502944457.jpg','Kami band dari kota kecil padang sumatra barat ..  Sering terjadi masalah internal dalam band kami,  sudah beberapa kali bertukar formasi,  tapi karna kami punya semangat bermusik yang sama, kami tetap bisa berkarya, dan semoga karya kami dapat di terima di industri musik indonesia\r\nPrestasi yang pernah kami peroleh\r\nJuara dua padang fair 2016\r\nJuara satu festival yamaha 2016\r\nJuara dua di pekan inovasi rri padang 2016\r\nJuara satu festival sesumatra barat di tarusan pesisir selatan 2015\r\nJuara dua festival tiger camp 2016 \r\nDan beberapa kali dapat the best player...  Di beberapa event','Pop','instagram;','Medan',373,'2017-08-17 03:34:17','2017-08-17 03:34:17'),
