	(182,'The Marsu','1502959852.jpg','THE MARSU adalah sekumpulan anak anak muda dari bandar lampung yang mempunyai bakat dan hobby yang sama tentang bermusik maka terbentuk lah THE MARSU pada awal tahun 2010.\r\nTHE MARSU itu sendiri mengusung genre yang berbeda dari genre musik yang biasanya\r\ngenre musik THE MARSU itu ialah Rock Electronica antara perpaduan dentuman distorsi progres dan sentuhan nuansa nuansa electro, dubstep, dan loop loop Dj, tetap dengan lirik lagu yang\r\neasy listening.\r\nselain itu genre dan lagu lagu THE MARSU bisa di nikmati dari semua kalangan dan usia.\r\n\r\nTHE MARSU itu sendiri terdiri dari lima pria tampan asal kota tapis berseri yaitu :\r\n(BAIM)vocal,\r\n(ENNO) bass,\r\n(FAJAR) drum,\r\n(PHENYOETZ) guitar ,\r\n(ANOM) keyboard.\r\n\r\nDari sekian event performance THE MARSU selalu mendapat support dan antusias dari para audience di event tersebut, THE MARSU selalu mendapat nilai plus dan prestasi yang dapat di bangga kan antara lain :\r\n\r\n- 10 Finalis Terbaik MOKA CLASS MUSIC COMPETITION 2010\r\n- Juara I Festival Musik Akbar HUT KOTA BANDAR LAMPUNG 2010\r\n- Juara I Festival Musik HONDA PT.NUSANTARA SURYA SAKTI 2010\r\n- Juara I Festival Vallentine Gunung Sulah 2010\r\n- Juara I Festival Musik Tanjung Bintang 2010\r\n- Juara II Festival Musik kemerdekaan Sumur Waru PALEMBANG 2010\r\n- Juara III HOME BAND TALENT BEOLI FM MUSIK LIVE 2011\r\n- Juara III Festival Musik Kemerdekaan Sawah Brebes 2012\r\n- Juara III Festival Musik Gokil Jagabaya 2013\r\n- Juara III Festival Musik Kemerdekaan Kec. Panjang 2014\r\n- Juara III Festival Campus DCC 2013\r\n- Juara III Respect Independet 2012\r\n- Band Favorit Festival Musik Tiger Day Fakultas Hukum Unila 2015\r\n- Best Live Guest Star & Supremation of THE MARSU 2014\r\n- LIVE PERFORMANCE SENSASI HITS CLASS MILD 2012 (IBI Darmajaya)\r\n- LIVE PERFORMANCE Launching Album MOKA COMPILATION 2013\r\n- Juara 1 live performance soprest season universitas UNILA 2016\r\n- Juara 1 live performance anniversarry universitas bandar lampung (UBL) 2016\r\n- Juara 1 live performance sikam terusik universitas POLINELA 2016\r\n- Juara 2 live performance festival akbar 2016 universitas DARMAJAYA 2016\r\n- juara 1 live performance event yamaha 2016\r\n- juara 1 live performance hut 17 agustus gedong air kemiling Bandar Lampung 2016\r\n- juara 1 festival musik ramayan robinson 2017\r\n- juara 2 festival musik universitas gentiaras 2017\r\n- juara 3 band competition Tapis evolutin piala gubernur lampung 2017\r\n- juara 3 fesyival akbar ibi darmajaya 2017\r\n- opening stage burgerkill and siksa kubur tibal pride 2017\r\n- juara 3 festival rock se sumbagsel 2017\r\nAND MANY MORE...','Rock','guitar_plus;','Jakarta',349,'2017-08-17 07:50:52','2017-08-17 07:50:52'),
