	(185,'FOR YOU ALL','1502971261.jpg','Foryouall adalah band yang mengusung genre british poppunk, terbentuk tahun 2012 dengan formasi 5 orang. Saat ini FYA (Foryouall) sudah mempunyai 5 lagu dan siap untuk launching album pada tahun 2017 nanti. Lagu berjudul “Wake Up” akan menjadi pondasi FYA melangkah lebih maju dari saat ini. Bongkar pasang pemain sudah seringkali dilakukan, sampai sekarang kira-kira sudah 3kali rombak pemain. Pada tahun 2016 ini, FYA menetapkan 4 personil awal yaitu Chandra (23th) asal Kebumen sebagai Vocalist, Ivan (22th) asal Semarang sebagai Gitaris, Edo (23th) asal Pekalongan sebagai Lead Gitar, Anugerah Arief / biasa dipanggil Aan (22th) asal Blora sebagai Drummer, kemudian Rendra (22th) asal Boyolali sebagai pengisi / pengganti Bassis di FYA sejak 2015 hingga sekarang dan tambahan 1 personil baru sebagai pelengkap formasi adalah Yayan / kerap dipanggil Benjis (22th) sebagai pemain Keyboard. Dengan formasi 6 orang ini FYA akan meneruskan perjalanan untuk mencapai puncak kesuksesan.\r\nSejak berdiri tahun 2012 lalu, tidak sedikit prestasi yang telah dicapai oleh FYA. Menjuarai lomba, Sebagai Guestar acara, main di Tv walaupun tv lokal, sampai sepanggung dengan artis Nasionalpun pernah dirasakan oleh kami. Pada akhir tahun 2016 ini, kami sedang gencar mempromosikan karya karya kami. Bukan hanya berbentuk audio saja tetapi visual juga. Mengikuti perkembangan jaman juga, kita banyak menshare karya kita lewat medsos juga seperti Facebook, Twitter, Instagram, Youtube sampai myspace pun kita punya. Bukan hanya gencar di medsos, kita juga mengikuti banyak event musik.','Others','guitar_plus;teman;','Jakarta',380,'2017-08-17 11:01:01','2017-08-17 11:01:01'),
	(186,'You!','1502972085.jpg','Band yang dibentuk tahun 2012 oleh 2 bersaudara Jusman & Ogan. Dengan personil tetap 2 orang dan ditambah additional player sesuai kebutuhan panggung.\r\n\r\nDuo/group yang berasal dari Cianjur ini sudah sering mengisi berbagai acara kampus, instansi, showcase, dll.\r\n\r\nSudah mempunyai single yang berjudul \"Hingga Aku Tiada\", \"Berharap\" dan \"Dia Atau Dia\".\r\n\r\nSempat masuk ke 30 besar dari sekitar 2000 peserta kompetisi Talent Development Guinness Amplify yang di adakan oleh Guinness Beer dan bekerja sama dengan Music Label Musica Studio yang dinilai oleh Steve Lilliwhite.','Pop','facebook;instagram;umi;','Jakarta',417,'2017-08-17 11:14:45','2017-08-17 11:14:45'),
