	(193,'Create Think Band','1503013650.jpg','CREATE THINK band berasal dari kota PURWAKARTA (jawa barat) yang terbentuk pada 20 Januari 2016 yang terdiri dari 3 personil band yaitu : TRI DARMA PUTRA / MATOEL (VOCAL & GUITARS RYTHEM), RICKY PRATAMA ISNANDI / Q’PAY (GUITARS MELODY), & ERICK KURNIA SOPANDI / ENDUT (DRUMS).\r\nFilosofi CREATE THINK  di ambil dari karakter  RAMBUT dari masing – masing personil yang kriting akan tetapi arti dalam kata CREATE THINK adalah BUAT BERFIKIR  karna CREATE THINK termotivasi  untuk slalu  memberikan kreasi2 musik  Rock yang di taburi dengan lyric  bernuansa Realita Cinta Dan Kehidupan.CREATE THINK sudah mempunyai Jam terbang yang  lumayan banyak Dan  salah satu nya slalu  di undang untuk mengisi  acara-acara  ANNIVERSARY CLUB  MOTOR, CREATE THINK pada  tanggal 25 NOVEMBER  2016 meliris Single Lagu yang berjudul “BEIIBY” dan Alhamdulillah dari semua kalangan dari yang muda sampe yang tua banyak yg menyukai SINGLE Lagu CREATE THINK, Kami pun saat ini sedang meliris  untuk  Mini  ALBUM  yaitu berjudul “AKHIRI MIMPI”.','Rock','teman;','Jakarta',275,'2017-08-17 22:47:30','2017-08-17 22:47:30'),
	(194,'ID Band','1503024191.jpg','Berdiri 7 November 2016 dengan 5 personil berformat akustik dan bergenre akustik EDM. Personil terbentuk semenjak 2 personil ID Band yang berkuliah membentuk sebuah band dan kemudian datang 3 personil yang saat itu sedang mencari personil untuk manggung, Latar belakang mulai dari yang bersekolah, berkuliah, sampai yang bekerja. Prestasi ID Band sudah sangat banyak mulai dari dipercaya bermain di mall-mall ternama, weddingan, dipercaya sebagai band untuk shooting trans 7 di sebuah cafe, sampai yang terakhir duet dengan DIVA Indonesia, Krisdayanti a.k.a KD','Pop','facebook;','Jakarta',433,'2017-08-18 01:43:11','2017-08-18 01:43:11'),
