	(196,'Full Lights Out','1503041587.jpg','Cerita:\r\nFull Lights Out adalah sebuah band beraliran pop-jazz yang terlahir di kota Bandung. Band ini diinisiasikan oleh Jose(Gitar), Crist(Drum) dan Boy(Bass) pada tahun 2015, yang kemudian menggaet Raken(Piano) dan Nico(Vokal) pada tahun 2016. Setiap syair dan nada pada lagu-lagu band ini diambil dari pengalaman pribadi mereka, membuat lagu-lagunya lebih berarti.\r\n\r\nPrestasi:\r\n- The 9th International Kampoeng Jazz, Universitas Padjadjaran Bandung, 29 April 2017\r\n- Borobudur Nite Music & Lantern, Candi Borobudur Magelang, 31 Desember 2016\r\n- AWSM FSTVL, Secapa AD Bandung, 3 Desember 2016\r\n- Walk eat & sound, USB YPKP Bandung, 29 Oktober 2016','Pop','maliq;','Jakarta',318,'2017-08-18 06:33:07','2017-08-18 06:33:07'),
	(197,'ZIA BAND','1503045685.JPG','VI.	Prestasi\r\n\r\nTahun 2014 single hits ZIA Band  yg berjudul indah bersamamu telah menjuarai disetiap radio lokal yg ada di palembang, Zia band juga berhasil sebagai juara disalah satu kompetisi akustik di Palembang. Selain itu, Zia Band juga menjadi Juara Favorit ILCC Telkomsel 2014 dan 5 besar band terpilih nasional Pro 2 RRI Palembang\r\nZIA Band telah mengeluarkan 2 (dua) single yang berjudul \"Indah Bersamamu\" di ciptakan oleh Putra (bassis) serta dua lagu \"Salah Jalan\" dan \"Touch Your Dream\" yang di ciptakan oleh Adit (gitaris).','Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',392,'2017-08-18 07:41:25','2017-08-18 07:41:25'),
	(198,'Vietnam rose','1503047533.jpg','VIETNAM ROSE\r\nTerinspirasi dari cerita tragis, Sebuah politisasi di negara Vietnam,  perlawanan rakyat kususnya kaum wanita terhadap penjajah dimana sebuah penyakit bernama Vietnam Rose menjadi wabah mematikan\r\n\r\nBerdiri tambun,Bekasi sejak 2007 , fakum selama kurang lebih 10tahun dan mulai di resmikan kembali tahun 2017 .\r\nBintang Bassis sekaligus pendiri band ini mengajak untuk meneruskan VIETNAM ROSE dengan merekrut Abel ex Path Of Shadow , Pijay ex Secret Forgotten , Erwin ex Mr.peanut , dan mengajak Reska Vokalis  masih menjadi vokalis Danger Of Destination & Battle Blood\r\n\r\ncerita berlanjut dengan terjadi perubahan formasi pada vocal Reska keluar digantikan oleh Doyeh ex vocalis Tower (Deathcore),\r\ndengan perubahan formasi nuansa musikpun berubah yang awalnya mengusung genre Metal core menjadi Death metal core / melodick Death Metal, Sebagai Bukti existensi single INFIDEL & RHYMES OF THE INSULT diluncurkan  dan berlanjut pengerjaan debut album pertama bertajuk SINGULARITY.','Heavy Metal','instagram;guitar_plus;teman;','Jakarta',442,'2017-08-18 08:12:13','2017-08-18 08:12:13'),
