	(200,'Namaskara','1503052167.jpg','Dimulai dari kesamaan visi dalam bermusik, band yang beranggotakan Fella Oktaria sebagai vokalis, Bobby Marsatya sebagai bassis, Ardi Ardian & Mario Morada sebagai gitaris, dan Mahendra Yogaswara sebagai drummer, sepakat untuk membentuk sebuah band. Walaupun terbilang band baru, namun band yang terbentuk pada tanggal 20 Agustus 2015 ini memiliki para personil yang berpengalaman dan mempunyai jam terbang yang cukup tinggi dalam bermusik.','Pop','facebook;instagram;poster;','Yogyakarta',444,'2017-08-18 09:29:27','2017-08-18 09:29:27'),
