	(202,'THE WORKING PUNK HEROES','1503061964.jpg','DIBENTUK TAHUN 2015 ATAS DASAR PENGEN SENANG - SENANG. \r\n\r\nPRESTASI SEJAUH INI ADA DUA :\r\n- MANGGUNG DI LOCAL GIGS KALIBARU BERISIK, TANJUNG PRIOK, TAHUN BARU 2015\r\n- LAUNCHING CHANNEL YOUTUBE SETELAH DUA TAHUN, BARU ADA SATU LAGU\r\n\r\nOIA, SALAH SATU MEMBER KITA ADA YANG UMURNYA LEWAT BATAS MAKSIMAL DI TAHUN INI. COBA AJA BOLEH DONG YA KARENA SENI GAK MANDANG UMUR KAN? HEHE OKE.\r\n\r\nSEMOGA GAK MENYURUTKAN ANIMO LEVI\'S BAND HUNT YA. AMIN.','Others','facebook;','Jakarta',451,'2017-08-18 12:12:44','2017-08-18 12:12:44'),
	(203,'KLIF','1503065143.jpg','Yogyakarta yang terkenal dengan predikat kota budaya, menjerumuskan kami pada panggung kesenian. Bidang musik, memberi kami ruang untuk berekspresi lebih dalam melampiaskan kesuntukan aktivitas sehari-hari. Melihat realita itu, menggugah kami untuk memberikan perspektif baru di telinga pecinta musik. Ketukan padat, nada yang terjal merupakan cara kami untuk mengajak pecinta musik untuk rehat sejenak dari suntuknya hidup. Ya, itulah karakter kami, band Klif yang berproses di kota budaya dengan atmosfir seni. Fancy Lady, sebagai judul single pertama kami melegitimasi deskripsi di paragraf ini. Enjoy our first single.','Alternative Rock','instagram;','Yogyakarta',448,'2017-08-18 13:05:43','2017-08-18 13:05:43'),
