	(208,'9.11 (NINE TO ELEVEN)','1503081829.jpg','9.11 (Nine To Eleven) adalah sebuah band yang mengusung genre musik Rock yang berasal dari kota Sukabumi. Nine To Eleven terbentuk pada tanggal 25 Des 2016\r\nBerawal dari pertemuan Evert (vocalis) dengan Ivan (Gitaris) di salah satu cafe, yang berlanjut dengan obrolan seputar musik, ternyata kedua orang ini mempunyai selera musik yang sama, maka iseng iseng kami berdua berniat membentuk sebuah band, lalu Evert mengajak Yusuf (Bassis) untuk bergabung, disusul dengan Heru/co\'er (gitaris) dan Iskandar (drummer) maka terbentuklah 9.11 (NINE TO ELEVEN).\r\n9.11 pernah menjuarai event SUPER RAWK FEST 2017 yang di adakan oleh SUPER MUSIC ID untuk area Sukabumi,Bogor, dan Cianjur. dan bermain satu panggung dengan band besar seperti GOD BLESS, KOTAK dan /rif.','Rock','guitar_plus;','Jakarta',459,'2017-08-18 17:43:49','2017-08-18 17:43:49'),
