	(210,'Bangsal 13','1503115581.jpg','Kami adalah band lokal asal kota Garut dengan genre Hardcore Punk. Kami pernah mengikuti ajang festival di beberapa acara seperti Hellprint West Java Invassion, Camp Magnify, Studio show dan acara-acara lainya. Pada saat Festival Hellprint 2016 kami pernah memasuki 10 band terbaik, meskipun tidak juara utama, tetapi kami sangat bangga bisa berada dalam 10 band terbaik pada saat itu hehe. Tidak hanya itu, dari beberapa personil kita pernah mendapatkan the best player ke 1 (drum) di satu ajang Festival Pelajar antar SMA yang dulu pernah di selenggarakan di salah satu event di Garut.','Others','facebook;','Jakarta',460,'2017-08-19 03:06:21','2017-08-19 03:06:21'),
