	(217,'ACTINIUM','1503142198.jpg','Actinium band Asal Kota Bogor yang terbentuk pada tanggal 12 Desember 2012, yang bergenre Rock & NuMetal.\r\nActinium telah merilis mini album pada bulan april 2017 yang berisikan 4 lagu di dalam nya, selain di rilis secara fisik, mini album ini pun telah di rilis secara digital dan tersedia di Itunes, Joox, Spotify, Amazon, dan situs resmi lain nya','Rock','instagram;','Jakarta',476,'2017-08-19 10:29:58','2017-08-19 10:29:58'),
