	(219,'Blue eyes','1503161762.JPG','Blue Eyes adalah band yang terbentuk pada 2014 dengan misi mewarnai musik Indonesia, band kami ber genre pop punk .kami mengambil nama BLUE EYES karena BLUE itu biru identik dengan warna laut yg menggambarkan dari mana kita berasal yaitu priok, dan EYES adalah mata merupakan bagian tubuh dari tubuh manusia yg penting fungsinya . jadi BLUE EYES itu mempunyai arti band yg berasal dari priuk berharap menjadi sesuatu yg penting fungsinya bagi manusia AMIN :D\r\nPrioritas kami dalam berkarya adalah lagu yang Easy listening ga harus dengan skill yg hebat . yang terpenting lagu kita bisa diterima masyarakat .\r\n\r\nbanyak pergantian personil di band ini dan Blue Eyes bertahan sampai sekarang dengan formasi\r\n\r\nVocal / gitar :Muhammad Arief Fauzy : https://www.facebook.com/m.delong.12?ref=ts \r\nVocal / bass : Erlando Putrama https://www.facebook.com/erlando.putrama?fref=ts\r\nDrumm : Shulis Chiio : https://www.facebook.com/creamzmayonez\r\nLead Guitar : Teguh Islean : https://www.facebook.com/tseptura?fref=ts\r\n\r\n\r\nTanpa Blue Eyes People kami bukan apa - apa \r\nBlue Eyes People most of our lives :)','Pop','instagram;umi;poster;teman;','Jakarta',482,'2017-08-19 15:56:02','2017-08-19 15:56:02'),
	(220,'RISING BAND','1503168722.png','RISING BAND adalah gabungan dari tim kesenian SMA PGRI 4 & SMAN 7 BOGOR yang di bina oleh R.Dang Iyos Manggung dan Rising band terbentuk tahun 2015\r\nSejak tahun 2015 hingga sekarang RISING BAND telah meraih 37 piala dari Festival Band maupun Akustik','Jazz','instagram;guitar_plus;teman;lainnya;','Jakarta',357,'2017-08-19 17:52:02','2017-08-19 17:52:02'),
	(221,'Selaksa Senja','1503205451.png','Selaksa Senja terbentuk karena panggilan jiwa masing-masing personelnya yg ingin bermain musik dengan jujur dan apa adanya. Band ini baru terbentuk di tahun 2017 setelah kami ber-empat cukup lama saling sharing ide dan bermusik bersama-sama. Nama Selaksa Senja yang berarti bayangan di saat senja/sore hari dipilih karena mewakili nuansa musik kami yang di satu sisi teduh, damai, mengalir, tapi juga terkadang keras dan penuh amarah.\r\n\r\nKami mengusung aliran Alternative Rock/Post-rock dengan pengaruh musik dari beberapa band diantaranya Kodaline, Mew, Radiohead, Padi dll. \r\n\r\nDengan modal lirik dan kekuatan sensasi musik trance Post-rock yg soulful, kental dan mengalir, Selaksa Senja ingin menyampaikan pesan melalui lagu-lagunya, serta menyentuh hati dan membius siapapun yang mendengarkannya.','Alternative Rock','instagram;','Surabaya',484,'2017-08-20 04:04:11','2017-08-20 04:04:11'),
	(222,'The BRICE','1503210162.jpg','Terbentuk di Yogyakarta pada akhir tahun 2015. Mengusung jenis musik \'alternatif\' dengan nuansa \'british/britpop\' pada era 90-an. Personil The BRICE merupakan alumni dari Fakultas Seni Pertunjukan Jurusan Musik Pop Jazz di Institut Seni Indonesia Yogyakarta (ISI). Beberapa kali menjadi Guest Star di acara panggung musik di Yogyakarta. Dengan jenis musik britpop 90-an yang cukup langka ditemui di era sekarang ini, kami sangat percaya diri dengan jenis musik dan lirik dari The BRICE yang cukup easy listening dan mudah dipahami oleh masyarakat umum. Kami yakin, musik The BRICE bisa memecah kerinduan masyarakat yang tumbuh di generasi 90-an. \r\n\r\nwww.thebricemusic.com','Alternative Rock','instagram;','Yogyakarta',472,'2017-08-20 05:22:42','2017-08-20 05:22:42'),
	(223,'RANKAIO','1503215413.jpg','ORKESMELAYU UGAL-UGALAN','Others','guitar_plus;','Jakarta',493,'2017-08-20 06:50:13','2017-08-20 06:50:13'),
	(224,'MOTH','1503218579.JPG','HISTORY \r\nMOTH is an Indonesian psychedelic rock band founded by alif kikin and fian juli in 2014. The group began as a home recording project for alif kikin, fian juli and julio who writes, records, and produces the music. The project consists of alif kikin (bass guitar & vocals), fian juli (guitar & synthesiser), julio (drums). MOTH released their debut studio ep album, Men Of The Hocus Pocus, which was make a showcase ep launching concert in 10th of july in this year.\r\n\r\nPERFORMANCE \r\n- Mothday ( Moth ep launching concert)\r\n- Indonesian Night Market at UNSW (sydney,Australia)\r\n- Captain Cook\'s Hotels Bar (sydney,Australia)\r\n- Sydney Jamming Club','Others','instagram;','Jakarta',491,'2017-08-20 07:42:59','2017-08-20 07:42:59'),
	(225,'Looking to the future','1503221332.png','Kami dari band asal kota bandar lampung, terbentuk dri tahun 2013, yg terdiri dari 4 personil.\r\nLatif (gitar+vocal), rio (bass), agus (lead gitar), dan taming (drum).\r\nTahun ke tahun kami pun berganti personil. \r\n2015 agus (lead gitar) keluar krna fokus mnerus ke pendidikannya. Sementara kami hanya berjalan dengan 3 orang personil, gitaris pun memakai audisional.\r\nStelah agus keluar, taming pun menyusul keluar krna lebih fokus ke pekerjaannya. Akhirnya, phian alias engkoh masuk menggantikan posisi taming. Tapi tak lama engkoh pun keluar tanpa sebab..\r\n... sempat vakum 1 tahun setelah kehilangan agus dan taming. \r\nLambat laun, 2016, kami pun mulai bangkit setelah bertemu dengan rizky (kiki) yg mengisi Lead Guitar, dan bertemu teguh aditya  drumer dri band cello, bergabung dengan kami. \r\nKami pun mencoba untuk tampil di setiap acara seperti, acara pagelaran musik, festival, Jakcloth, dan mengisi live music dicafe.\r\nKami yang terdiri dari 4 orang personil ini pun dengan genre yang berbeda, latif cenderung ke aliran alternative rock, ryo screamo, kiki classik rock, teguh  melayu. \r\nTapi untuk di Looking to the future/LTTF Band, smuanya pun komitmen dengan Genre ALTERNATIVE ROCK. \r\nUntuk prestasi, belum banyak yg kami dapat, karena untuk sekarang kami pun baru bangkit untuk berkarya... \r\n2015 kami membuat sebuah karya kecil untuk di dengar. Sebuah lagu yang berjudul \"Kukenang semua\"\r\nDan 2017 ini baru membuat karya kecil lagi untuk di dengar masyarakatn. Lagu yg berjudul Akhir Perjalanan feat yunni.\r\nBisa di lihat di you tube dengan link https://m.youtube.com/watch?v=u8fLquQeAcg','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',394,'2017-08-20 08:28:52','2017-08-20 08:28:52'),
	(226,'Bless The Knights','1503230064.jpg','Bless The Knights was established in 7 April 2009, with an old name called Blitzkrieg by their guitarist, mrfritzfaraday, who thought that there was such an urgency of change on Indonesian music, since there were a lot of bands having quite the same genre and tend to follow each other\'s pathway. Regarding to the meaning of Blitzkrieg, which is a “quick attack”, Blitzkrieg music that is having a lot of details and complexity has to be accountable when it is performed live on stage as what is happening to a military attack, which effect has to be accountable to the public.\r\nIn the beginning, Blitzkrieg chose Progressive metal as the core of their music. Furthermore as the time goes by, they were having a lot of maturity process until they finally discover their own usually called ‘Aggressive Heavy Metal Core Progressive’.\r\nIn 2010, the band released their very first album called ‘The Energy of Anger’ including their 6 original songs. At that time, there were just 2 people left in the band, which were mrfritzfaraday (Guitar, Bass and Vocal) and Erick Kevin (Drums). Blitzkrieg was also one of line up of Indonesian phenomenal compilation album ‘Born to Fight’ involving legendary bands, such as Rotor, Imanissimo, Divine and many more dangerous bands.\r\nBlitzkrieg got a public attention as they were one of the opening act of the super band PSMS Amazing Union (Mike Portnoy, Billy Sheehan, Tony Macalpine, Derek Sherinian) at Rock Fest 2012, as well as being the opener of Swedish Death Metal band, Grave in 2013. At the same year, Blitzkrieg was also being one of the headlining action of the Jakarta Guitar Festival 2013 alongside with the 2009 Guitar Idol from Thailand, Jack Thammarat and British Fingerstyle Guitarist, Mike Dawes.\r\nIn 2014, they finally decided to start producing their second album entitled “Bless The Knights”. This is finally becoming their new name for ‘Blitzkrieg’ is still existing or used by several bands and will not be appropriate to be used for a world wide album issue.\r\nOn their newest album, Bless the Knights is working alongside Indonesian professional label, Greenland Indonesia. They were once very close to an Italian recording label, but the deal were never ended into one clear point until finally they were joining Shredguy Records of Ohio, United States of America for their international distribution label.\r\nTheir recent formation are: mrfritzfaraday (Guitars and Vocals), Rad (Vocals), Olgie Alvianus (Guitars), Opic (Drums) and Arry (Basses). This formation is a combination of aggression, complexity, creativity and modernity that will surprise the crowd they performed for.','Heavy Metal','guitar_plus;','Jakarta',388,'2017-08-20 10:54:24','2017-08-20 10:54:24'),
	(227,'Anastasys','1503235619.JPG','Main Stage Jakarta Fair 2015 \r\nMain Stage Jakarta Fair 2016 \r\nTanggerang Summerfest 2016 \r\nPekan Raya Indonesia (1000Band United) 2016 \r\nLive on Teras Sore Elshinta TV 2017 Youtube Channel : Anastasys TV\r\nCloth Fest at Teras Rimbun Cibubur Jaktim 2017\r\nGuest Star Anniversary 28th Poltek LP3i 2017\r\nPerform at Teras JB Extracoustic at Joglo beer Kemang 2017\r\nIndie Star Kartini Day at Pasar Seni Ancol 2017\r\nIndomusically at La Piazza Kelapa Gading 2017\r\nIndie Kota Tua Weekend at Taman Fatahila Kota Tua Jakarta 2017','Rock','facebook;teman;','Jakarta',508,'2017-08-20 12:26:59','2017-08-20 12:26:59'),
