	(229,'Jejak Awan Pesawat','1503241212.jpg','Jejak Awan Pesawat adalah sebuah band atau kelompok musik yang terbentuk pada tanggal 3 juni 2016 berasal dari kota Bandung, yang awal mulanya hanya sebuah project kecil2an untuk sesuatu hal, tapi lama kelamaan malah semakin menjadi seurius untuk di jalani, yang didirikan oleh 3 orang yaitu cepi, eki dan dyka, didirikan karena atas kecintaan kami terhadap musik dan hobi yang sama, lalu masuklah ahmad untuk mengisi kekosongan di posisi drum, karena saat itu posisi drum sedang kosong, karena kami bertiga tidak ada yang mengisi posisi itu. Nama Jejak Awan Pesawat sendiri kami ambil dari salah satu judul lagu sebuah idol group. Jejak Awan Pesawat mengusung jenis musik yang bergenre pop alternatif, tapi di setiap lirik dan musiknya kami berusaha memasukan bahasa dan musik2 sunda, jepang dan inggris.','Pop','guitar_plus;','Jakarta',431,'2017-08-20 14:00:12','2017-08-20 14:00:12'),
	(230,'VICT','1503243768.jpg','VICT adalah band asal Semarang, Indonesia yang terbentuk tahun 2013. mereka beranggotakan 3 orang, Ery (vokalis/gitaris), Bayu (basis) dan Adit (drummer). pada tahun 2015, mereka merilis 2 single yang berjudul \"Ex-Friend\" dan \"King Of The World\" melalui media sosial soundcloud dan bandcamp','Alternative Rock','guitar_plus;','Yogyakarta',510,'2017-08-20 14:42:48','2017-08-20 14:42:48'),
	(231,'BERANTAI','1503246389.jpg','BERANTAI founded 2010 is born a metal scene , From Pasuruan Eat Java, Indonesia\r\nGenre : Technical Death Metal\r\n\r\nLine up 2017 :\r\n\r\nAdhe - Vocal\r\nDhany - Guitar 1\r\nBodrek - Bass\r\nAdham - Drum\r\n\r\n\r\n\r\nIn years 2012, successfully launching EP (extended play)\r\ncontains 5 track songs :\r\nTitle : SUGENG RAWUH SANG CEMENG ING TLATAH JAWI\r\nGenre : Experiment Death Metal\r\n1. Pengantin sak getih\r\n2. Jihad\r\n3. Cantik membunuh\r\n4. Mata satu bangsat\r\n5. Madab nyawa\r\n\r\n• And was in the self release only 50 copies on CD, We held a tour in East Java\r\n- BETWEEN BLACK AND SAND “anniversary” 12 Feb 2012 at Pasuruan East Java”\r\n- MALANG SEDARAH #2 “26 Feb 2012 at Malang East Java”\r\n- WAR BLOOD Fest #2 “03 March 2012 at Malang East Java”\r\n- STEP FOR GLORY “23 March 2012 at Malang East Java”\r\n- TRENDY BANGSAT #25 “03 Juny 2012 at Surabaya East Java”\r\n- BURNING GORE Fest “09 Des 2012 at Surabaya East Java”\r\n- UNDERGROUND PEDULI “15 Des 2012 at Malang East Java”\r\n\r\nIn years 2014, we officially changed the concept of music\r\nFebuary 2015 we self release single song\r\nTitle : DISTRICT OF WAR\r\nGenre : Technical/Melodic Death Metal\r\n\r\n• And was in the self release only 25 copies on CD, we has a tour in 2 city\r\n- MOJOKERTO MOSHPIT AREA “08 Feb 2015 at Mojokerto East Java”\r\n- PARTY FOR MY FRIEND “22 Feb 2015 at Bangil, Pasuruan East Java”\r\n- JOMBANG GROUNG MOVE ON “22 Feb 2015 at Jombang East Java”\r\n\r\n\r\nLine Up : (2010 - 2013)\r\nAdhe - Vocal\r\nDhany - Lead Guitar\r\nAira - Rhythm (Hyperteroid)\r\nEkik - Drum\r\n\r\nLine up : (2013 - 2014)\r\nAdhe - Vocal\r\nDhany - Guitar\r\nHaidar - Bass (Virgin Corpse)\r\nAdham - Drum\r\n\r\nLine up : (2014 - 2015)\r\nAdhe - Vocal\r\nDhany - Guitar\r\nBodrex - Bass (ex Divine Hatred / ex Trexi Sick HC / ex Scum Syndrome)\r\nAdham - Drum\r\n\r\n\r\nDrummer and Guitar additional player that has been filling our line up position\r\nAndre - Drum (Haram, Stagnated)\r\nDoni - Guitar (Nasty, Black Sunday)\r\n\r\n\r\n\r\n“C O M I N G S O O N P R O M O 2 0 1 7”\r\nW.A.R (Worldly As Revenge)\r\nPenghargaan\r\nDiscography\r\n\r\n- EP album 2012 \"SUGENG RAWUH SANG CEMENG ING TLATAH JAWI\"\r\n\r\n- Single 2013 \"DISTRICT OF WAR\"\r\n- Single 2015 \"GARIS DOMINAN\"','Heavy Metal','instagram;','Surabaya',512,'2017-08-20 15:26:29','2017-08-20 15:26:29'),
	(232,'SITIHINGGIL','1503247998.jpg','Band yg berasal dari ujung timur pulau jawa ini dibentuk oleh Anton (drum) dan Hanafi (gitar) pada 2009 saat duduk bangku Sma dan resmi berdiri pada 2014 lalu. Band yg mengusung progressive rock ini berhasil merekam demonya di tahun 2016 dan sukses menjadi band pembuka di konser band asal Bandung, Jasad saat konser di kota Genteng, banyuwangi.','Others','guitar_plus;','Surabaya',489,'2017-08-20 15:53:18','2017-08-20 15:53:18'),
	(233,'ID band','1503254375.jpg','\"id\" iyaaa \"id\"\r\nkenapa namanya \"id\" ?\r\n\"id\" artinya identitas..\r\ndibaca inggris \"aiiiidiiii\"\r\nDibaca indonesianya \"iiideee\"\r\nKita anak muda yang ingin menciptakan \"iiideeee\" baru di musik indonesia agar musik indonesia semakin berkualitas!\r\n\r\nYang sebenarnya nama singkatan dari 2 personil dalam band kami yaitu \"id\" \r\nDi vocal \"icky\" dan gitaris \"Dedi\" jadinya \"id\" \r\nGenre musik kami Pop British\r\nSemoga \"id\" bisa menghibur dan meramaikan industri musik di negara kita yaitu INDONESIA.\r\nDan bisa membawa nama negara INDONESIA di industri musik luar negri..\r\nMembawa harum nama negara kita di berbagai negara.. Amin\r\n\r\nMateri lagu dari kami tentang percinta\'an anak anak abg yang lagi pdkt pacaran gitu gitu hehe\r\nMY DECISION selalu menjaga komunikasi tentang hubungan kita agar kita tidak SALAH PAHAM\r\nKenapa aku begini semua KARNA CINTA\r\nWalaupun aku itu masih RAHASIA \r\nTapi hati dan perasa\'an aku itu TAK INGIN SESA\'AT \r\n\r\n\"My Decision\" nama di mini album kami..\r\nDi mini album kami ada 5 lagu :\r\n1. ID - My Decision\r\n2. ID - Salah Paham\r\n3. ID - Karna Cinta\r\n4. ID - Rahasia\r\n5. ID - Tak Ingin Sesa\'at\r\n\r\n#salammusikindonesia\r\n( ID #ickydedi )\r\nMaju terus musik INDONESIA..? \r\n#musik #indonesia #untuk #dunia \r\n\r\nContact person :\r\nrizky.moersas@gmail.com','Pop','facebook;','Jakarta',515,'2017-08-20 17:39:35','2017-08-20 17:39:35'),
	(234,'AWAN','1503254886.jpg','Berawal dari prodject band cafe ke cafe, mengikuti beberapa festival dan menjadi band event di JAKCLOTH serta band penghibur di acara weeding . Membuat kita tetap terus semangat berkarya di dunia musik indonesia.','Alternative Rock','guitar_plus;','Jakarta',443,'2017-08-20 17:48:06','2017-08-20 17:48:06'),
	(235,'MISCLEF!','1503283725.jpg','Misclef! adalah band bergenre pop-alternative yang berasal dari Jatinangor, Bandung. Berawal dari sebuah perkumpulan mahasiswa dengan latar belakang pendidikan yang sama, mereka membuat band yang pada awalnya hanya untuk mengisi di acara angkatan pada tahun 2013. Seiring berjalannya waktu, selama 4 tahun terakhir ini Misclef sudah meraih beberapa prestasi di tingkat regional kampus diantaranya Juara 1 Festival Band di tingkat Agrokompleks Unpad (2014), Juara 2 Festival Band FORSI Unpad (2014 & 2015), hingga mengisi acara di beberapa event besar di regional Bandung dan sekitarnya, seperti di acara NGAMPLAGFEST INFOBDG. Saat ini, Misclef sudah memiliki 5 lagu sendiri yang rencananya akan dibentuk sebuah EP / Mini Album yang bertajuk \"Fase Frase\" pada akhir tahun 2017 ini.','Pop','instagram;teman;','Jakarta',143,'2017-08-21 01:48:45','2017-08-21 01:48:45'),
