	(238,'PLAYFVL CAB','1503290718.JPG','Playfvl Cab berdiri dari tahun 2014 terdiri dari Arief as Guitar, Wira as Bass, Wendo as Vocals dan Eres as Drum. Playfvl Cab mengusung genre Alternative Rock. Prestasi yang kita peroleh Manggung di LALALA Fest, Rock in Celebes Dan Alternatif Menggugat. Selain prestasi manggung kita di event yang besar kita mempunyai prestasi di video clip. Video Clip kita di terima oleh VEVO.','Alternative Rock','facebook;','Jakarta',522,'2017-08-21 03:45:18','2017-08-21 03:45:18'),
