	(240,'Assenaband','1503293504.jpg','Assena adalah sebuah nama group band yang terlahir karena persahabatan Farras dengan Bastian. Sejak duduk dibangku SMP kami berdua (farras dan bastian) ingin sekali mempunyai group band yang handal dan berprestasi dalam bermusik.\r\n   Oleh karena itu kami berdua mencoba membuat lagu dari gabungan syair dan lirik, sampai akhirnya kami berhasil membuat beberapa lagu. Setelah kami menciptakan beberapa lagu, kami pun sempat bingung untuk kelanjutannya agar lagu kami dapat sempurna di bawakan oleh sebuah group band.\r\n  Dan kami mencoba untuk mencari personil agar dapat di ajak membentuk sebuah group band seperti yang kami inginkan. Setelah sempat gonta-ganti personil dan kini akhirnya kami berdiri dengan 3(tiga) personil, yang dapat bekerja sama dalam bermusik dengan baik.\r\n\r\nKapan Assena Terbentuk ?\r\nAssena pun terbentuk pada tanggal 28 November 2009,  itu pun setelah kami mendapatkan personil untuk melekapi music dalam group band ini. Assena pun mempunyai arti yang simple yaitu, “ Anda Suka Saya Senang “.  menurut kami untuk nama sebuah band itu gak perlu mempunyai makna yang dalam, yang penting mudah diingat dan diucap.  Karna kami disini ingin sekali diingat dengan karya bermusik kami, bukan sekedar nama yang puitis atau pun bermakna indah.\r\n\r\nPengaruh Musik Assena.\r\n· Scorpions, Deep purple, Queen, Yngwie malmsteen, dan Muse.\r\n· Genre yang kami buat dalam band kami adalah Slow Rock, dimana lagu slow yang didalamnya menpunyai interlude rock.\r\n\r\nJudul Lagu yang sudah Recording :\r\n1. Kamu-kamulah\r\n2. Sadarkah\r\n3. Sahabat\r\n4. Sungguhku ingin\r\n5. Telahku beri\r\n\r\nCatatan.\r\nMemiliki komitmen Menjadi seorang musisi adalah kerja keras seumur hidup, bukannya hanya iseng-iseng! Musisi yang sukses di industri musik tidak sekedar memasukan jempol kaki mereka untuk memeriksa keadaan air. mereka langsung terjun dengan kepala mereka lebih dahulu dan tidak melihat kebelakang lagi . Sekali anda menjadi musisi maka selamanya anda adalah seorang Musisi.\r\n\r\nPengalaman Kami.\r\n\r\nMengikuti acara Pensi Kampus :\r\n- STIMIK (jakarta barat)\r\n- Trisakti (jakarta barat)\r\n- Ista Al-kamal (jakarta Barat)\r\n- UI (Depok)\r\n- BSI\r\n- Dll.\r\n\r\nPensi SMA :\r\n- SMK AA (tanjung duren)\r\n- Yadika 1 (jakarta barat)\r\n- SMAN 111 (Bandengan)\r\n- Dll.\r\n\r\nPensi Umum :\r\n- Audisi Hut TVRI\r\n- Mall Atrium (Jakarta barat)\r\n- Ramayana Semper/priuk (jakarta utara)\r\n- Cafe Wapres (jakarta selatan)\r\n- KFC cideng (jakarta barat)\r\n- Indomart Point jl.Ampera (jakarta selatan)\r\n- Sting Belaraja (tanggerang)\r\n- Puri Walk Kembangan (jakarta barat).','Pop','facebook;instagram;informasi_toko;umi;maliq;poster;teman;lainnya;','Jakarta',524,'2017-08-21 04:31:44','2017-08-21 04:31:44'),
	(241,'SOVEREIGN','1503298268.jpg','Lewat penggalan video lirik untuk single pertamanya, Sovereign menggoda para penikmat musik lewat balutan musik cadasnya. Single “The One Whom Earth Refuse” yang dirilis dalam format video lirik berupa teaser debut EP-nya lewat layanan streaming tersebut, telah berumur setahun dalam perilisannya dan kini mereka mengabarkan bahwa ada 7 lagu yang akan dimasukan dalam mini albumnya. Pada video liriknya, Sovereign mencoba menghantarkan beberapa potongan konstruksi lirik bernuansa agnostic yang dibawakan dengan kegeraman.','Heavy Metal','instagram;','Jakarta',496,'2017-08-21 05:51:08','2017-08-21 05:51:08'),
