	(247,'VELLAROSE','1503311972.jpg','Vellarose, grup musik bergenre pop punk asal Jakarta ini tidak lagi disebut band pendatang baru. Memulai debutnya dengan single lagu mutiara terindah dan Let Itu Flow, Vellarose berhasil menjadi \"demos terpilih\" di salah satu edisi HAI Magazine tahun 2013.\r\n\r\nSeiring perjalanannya sejak pertengahan 2013, Vellarose telah mengalami beberapa pergantian personil. Vellarose kini digawangi oleh Nicola (Vocal), Niel (Bass), Ayi (Guitar), Carlos (Guitar), dan Mejun (drum). \r\nDalam bermusik, Vellarose mengedepankan attitude, aransemen yang ciamik, kekuatan lirik, ditambah adanya wanita di posisi penggebuk drum yang menjadi daya tarik.\r\n\r\nBeberapa band internasional seperti All Time Low, New Found Glory, Blink 182, Totalfat, Four Year Strong, ADTR, dan band pop punk lainnya telah menjadi pengaruh bagi musik Vellarose. Tidak ketinggalan band pop punk tanah air seperti Rocket Rockers dan Pee Wee Gaskins yang juga menjadi panutan mereka.\r\n\r\nHingga kini, di waktu yang masih terbilang seumur jagung, Vellarose sudah meraih banyak kesempatan tampil di berbagai stage. Baik gigs underground, festival, pensi, atau acara musik ternama diikuti. Pencapaian terbesar dicapai setelah Vellarose terpilih sebagai Rising Star dari Levi’s dan berhak tampil di acara musik Breakout Net TV. Selain itu, Vellarose juga tampil di acara Pensi Fair yang diadakan Global Tv dan Loop ID. Acara tahunan seperti Jakcloth pun jarang dilewatkan. Berbagai pensi dan acara musik kampus pun akrab dihadiri Vellarose. Tidak juga ketinggalan lagu-lagu Vellarose sering muncul di berbagai Kompilasi musik dan radio-radio.\r\n\r\nPencapaian Vellarose yang belum seberapa ini pun tidak lepas dari karya-karyanya yang telah dikemas dalam bentuk digital di setiap akun social media mereka maupun dalam kepingan CD. Terbukti mereka melepas sebuah mini album bertajuk “A Luta Continua” pada tahun 2014. Respon positif yang mereka terima membawa mereka semakin terinspirasi untuk terus berkarya secara positif pula. Single baru kerap mereka sebar di dunia maya. Dari mulai lagu teranyarnya yang berjudul Mutiara Terindah sampai lagu terbaru bertajuk Bisa Bahagia.\r\n\r\nVELLAROSE EXPERIENCE\r\n\r\nPENTAS SENI DI SEKOLAH DAN UNIVERSITAS\r\n1. SMAN BHK Cibubur (2016)\r\n2. SMA Al-Azhar 4 Bekasi (2016)\r\n3. MAN 11 Jakarta (2014, 2015, 2016)\r\n4. SMAN 29 Jakarta (2016)\r\n5. SMAN 3 Jakarta (2016)\r\n6. SMAN 2 Bekasi (2015 & 2016)\r\n7. Univ. Yarsi Jakarta (2016)\r\n8. SMA Al-Azhar Harapan Indah (2016)\r\n9. SMA Jakasampurna Bekasi (2016)\r\n10. SMAN 10 Bekasi (2015)\r\n11. Univ. Negeri Jakarta (2015 & 2016)\r\n12. SMPN 216 Jakarta (2014 & 2015)\r\n13. SMAN 1 Tangerang (2015)\r\n14. SMAN 13 Jakarta (2015)\r\n15. SMA Sang Timur Jakarta (2015)\r\n16. SMAN 15 Bekasi (2015)\r\n17. MAN 4 Jakarta (2014 & 2015)\r\n18. SMAN 10 Bogor (2015)\r\n19. SMAN 14 Jakarta (2015)\r\n20. SMAN Global Mandiri Cibubur (2015)\r\n21. SMAN 1 Bekasi (2015)\r\n22. SMPN 9 Jakarta (2015)\r\n23. SMA Bakti Idhata Jakarta (2015)\r\n24. Univ. Pancasila (2014 - 2017)\r\n25. SMPN 99 Jakarta (2015)\r\n26. MAN 8 Ciputat (2014)\r\n27. Univ. Tarumanegara (2014)\r\n28. SMA Regina Pacis Bogor (2014)\r\n29. SMPN 117 Jakarta (2013)\r\n30. Institut Musik Indonesia (2013)\r\n31. SMAN 65 Jakarta (2013)\r\n32. SMAN 59 Jakarta (2013)\r\n33. Univ. Indonesia (2013)\r\n34. SMAN 11 Jakarta (2017)\r\n35. Etc . . . \r\n\r\nFESTIVAL DAN MUSIC EVENT\r\n1. Jakcloth (2013-2017)\r\n2. Street Wear Tour (2014)\r\n3. Road To Jakarta Fair (2014)\r\n4. Festival Musik Kementerian Perikanan 2013 (20 Besar)\r\n5. Breakout NET TV as Rising Star Levi’s (2014)\r\n6. Paramore Nite Paramore Indonesia (2014)\r\n7. Band Challenge OZ Radio 2014 (20 Besar)\r\n8. Demos Hero Hai Magazine 2013 (10 Besar)\r\n9. Demoskustik Hai Magazine & Chip Magazine (15 Besar)\r\n10. Demos Terpilih Hai Magazine edisi \r\n20/XXXVII/2013 (2013)\r\n11. Music Bite Greensand & 7 Eleven 2015 (3 Besar)\r\n12. Kickfest Bandung (2016)\r\n13. Teras Sore E