	(248,'Bleeding Last Season','1503313856.jpg','Band asal kota Banyuwangi - Jawa Timur yang terbentuk dari tahun 2015 yang mencoba memberi warna baru pada musik indie Indonesia dengan mengusung genre Deathcore yang berbeda dari musik Underground yang lain. Bleeding Last Season mempunyai dua single. Single perdana berjudul \"Bloody Mary\" dan baru saja mengeluarkan single kedua yang berjudul \"Shoot Me\" yang sudah dapat didengar di Reverbnation / Soundcloud beserta VideoClip yang dapat ditonton pada saluran YouTube kami \"Bleeding Last Season\"\r\n\r\nUntuk prestasi, kami masuk top 10 bands dalam event BeholderFest (Bandung) yang di ikuti oleh band Indie seleruh Indonesia dan kami adalah salah satu yang mewakili Jawa Timur dalam audisi tersebut. Dan juga kami sudah sering perform dalam event besar di wilayah kami maupun di luar kota. Event besar yang pernah kami kunjungi seperti BeholderFest (Bandung), JakCloth 2016 (Jember), JemberIndieClothing (Jember), JemFest (Jember) dan kami juga sering menjadi Guest Stars di kota kami (Banyuwangi) seperti GrandOpening ExhaleApparel Store, RockGoJampi, Serdadu Blambangan #1 dan lain lain. Lagu kita \"Shoot Me\" juga sering masuk dalam nominasi top Indonesia Deathcore songs di berbagai Channel YouTube indie di Seluruh Indonesia seperti PalingBerisik, Loudonesia, Indonesian Deathcore dan lain lain.\r\n\r\nLebih lengkap nya bisa di cek FansPage akun media sosial kami \r\nInstagram : https://www.instagram.com/bleedinglastseason/\r\nFacebook : https://www.facebook.com/bleedinglastseason/\r\nReverbnation : https://reverbnation.com/bleedinglastseason\r\nSoundcloud : https://soundcloud.com/bleedinglastseason\r\nChannel YouTube : Bleeding Last Season','Others','instagram;guitar_plus;','Surabaya',534,'2017-08-21 10:10:56','2017-08-21 10:10:56'),
