	(252,'Vyo ardie','1503317058.jpg','VYO ARDIE & BAND\r\n\r\n1.       Latar Belakang\r\n\r\nRasa syukur saya panjatkan kepada Tuhan Yang Maha Esa atas lagu saya MERAIH MIMPI  yang saya ciptakan bertujuan demi meramaikan industri musik tanah air.\r\n\r\nDengan bermunculan band-band indie dan penyanyi solo di kota sidoarjo maka persaingan pun sangat ketat. Karenanya saya ingin membuat lagu dengan genry pop modern  hingga akhirnya tercipta lagu MERAIH MIMPI\r\n\r\nsaya yang mencintai music dan ingin terjun serta maksimal dalam musik bertekad akan terus berusaha untuk memberikan yang terbaik.\r\n\r\nKarena mengawali karier dari bawah maka saya memutuskan untuk berkarier untuk mencari label jika suatu saat nanti saya mendapat tawaran rekaman dari salah satu label music di indonesia\r\n\r\n2.      Sejarah Singkat\r\n\r\nSaya vyo ardie\r\nPernah masuk  audisi dream band 3 2006 masuk 5 besar wakil jawa timur yang di adakan di kota surabaya di stasiun televisi swasta TV7 sekarang ( trans 7)\r\nDan sekarang masih aktif manggung di sidoarjo dan sekitar nya di bantu sama aditional player bass,drum,kybord\r\n\r\n3.      Visi & Misi\r\n\r\nAdapun Visi & Misi saya adalah memberikan hiburan yang menyenangkan pada setiap event  Dengan tujuan kedepannya bisa menjadi salah satu penyanyi solo dari sidoarjo yang berhasil sukses di belantika musik tanah air.','Pop','instagram;guitar_plus;','Surabaya',539,'2017-08-21 11:04:18','2017-08-21 11:04:18'),
	(253,'Chikin Braders','1503317533.jpg','Band alternative asal cirebon terbentuk februari 2016, berawal dari kejenuhan masing masing personil yang sudah memiliki band sendiri, mencoba warna baru dalam satu projectan, nama Chikin Braders sendiri di ambil dari nama Vokalisnya Chikin Muhammad dan Braders sendiri sebagai penambahnya, Eka Pratama digitar, Rahman Bass, dan Dirgantara disektor drum\r\nChikin sendiri adalah salah satu finalis 25 besar Indonesian Idol 2012 dan 2014, dan beinisiatif membentuk project braders ini\r\nPrestasi :\r\nFinalis Sound Of Tri 2017 indonesia, album kompilasi Revolusi Musik Indie Cirebon, EP Album indie \"Revolution Dreams\" by Chikin Braders 2016, Finalis Rockin Battle 2016, Guest Star SuperRawk Cirebon','Alternative Rock','instagram;teman;','Jakarta',531,'2017-08-21 11:12:13','2017-08-21 11:12:13'),
