	(255,'eP\'s','1503325077.png','berawal dari kelas 2 sma kami sering main alat musik sambil bernyayi di kelas, hingga band kami sering tampil di acara acara besar:\r\n1. Hari kartini SMAN 5 Bogor\r\n2. Five Nativistic Anthem (Braja mustika Bogor)\r\n3. Thanks Giving (gumati Bogor)\r\n4. Wedding Party (Novotel Bogor)\r\n\r\nSelain live music, kami telah merilis 1 lagu buatan kami yang berjudul \"Tak Mengapa\" dan muncul di koran Radar bogor.','Pop','instagram;guitar_plus;','Jakarta',529,'2017-08-21 13:17:57','2017-08-21 13:17:57'),
	(256,'nggak rock n roll','1503325388.jpg','nggak rocknroll band berdiri dari tahun 2006. berawal dari band komunitas yang ada di wilayah bandar lampung. prestasi nggak rocknroll band pernah menjuarai beberapa event music di bandar lampung dan pernah menjadi band pembuka konser band SLANK ..','Heavy Metal','facebook;instagram;','Jakarta',545,'2017-08-21 13:23:08','2017-08-21 13:23:08'),
	(257,'Detected overall','1503326999.jpg','Detected overall adalah sebuah band beraliran \"Disasterpunk\"\r\n\r\nBand ini terbentuk kurang lebih pada tahun 2008, yang di gawangi oleh 4 orang personil Dhiasta as vocal/guitar • emaipi as guitar/Vocaloid • Rian as drum • nay as bass ini adalah formasi terbaru kami setelah bongkar pasang personil, dan pada akhir tahun 2016 lalu album perdana kamu baru saja di release secara mandiri (D.I.Y)\r\nUntuk saat ini kami terus fokus promo album kami yang baru saja direlease akhir tahun lalu','Alternative Rock','guitar_plus;','Jakarta',525,'2017-08-21 13:49:59','2017-08-21 13:49:59'),
	(258,'REVICALBAND','1503328299.jpg','Revical terbentuk pada tanggal 01 Mei 2010, yang mengusung genre Pop Alternative. Kata Revical sendiri berasal dari gabungan kata \"Revival In Call\", yang berarti memanggil sebuah kebangkitan.\r\n\r\nRevical mengikuti kompetisi Band yang diadakan oleh Mall Emporium dan Oz Radio pada Oktober 2014. Dan Revical mendapat juara pertama dalam kompetisi tersebut.','Pop','guitar_plus;teman;','Jakarta',528,'2017-08-21 14:11:39','2017-08-21 14:11:39'),
	(259,'HUMANIMAL','1503328499.jpg','Masih dengan hardcore rap ala beastie boys, biohazard, bodycount, deez nuts dan cypress hills, masih dengan spirit dan kemarahan yang sama. Itulah yang bisa di simak dalam kesan pertama saat mendengarkan single perdana dari HUMANIMAL. Band ini masih sangat belia, baru didirikan pada 1 August 2016. Tiga dari empat personil humanimal adalah pelaku lama dalam skena music hardcore tanah air. Mereka adalah Ex-personil dari Bestiality yang pada 30 April 2016 menyatakan bubar setelah 19 tahun malang melintang di skena hardcore tanah air. Lepas dari Bestiality, Dika (Bass), Qubil (Guitar), dan Upi (Drum) ternyata tak bisa berdiak diri terlalu lama, mereka mengaja Mahesa untuk mengisi slot vokal saat tercetus ide mendirikan Humanimal. Kata Humanimal adalah gabungan dari Human Animal, yang menurut filosofi mereka adalah \"Think like human, Do like animal!\" dan mereka tetap mengusung musik hardcore ditambah dengan nuansa Rap/Hip Hop pada vokal.\r\nSebagai perkenalan, humanimal telah merilis dua buah single dengan judul \"Human Animal\", Single ini secara resmi d rilis eksklusif oleh Eastern Wolves Music.','Others','instagram;','Jakarta',546,'2017-08-21 14:14:59','2017-08-21 14:14:59'),
	(260,'SPJ','1503332211.jpg','Mengekspresikan nada - nada manis','Pop','teman;','Surabaya',549,'2017-08-21 15:16:51','2017-08-21 15:16:51'),
	(261,'SAVE MY STORY','1503335204.jpg','Save my story adalah salah satu band indie yang berdomisili di Gorontalo yang mengusung genre pop punk..band ini terbentuk di akhir tahun 2015..sampai saat ini band ini masih aktif di event-event musik indie yang ada di seputaran sulawesi','Pop','teman;lainnya;','Surabaya',550,'2017-08-21 16:06:44','2017-08-21 16:06:44'),
	(262,'Fever Blues Magic','1503374684.PNG','Semua berawal dari \"BLUES\" pada awalnya kami tidak saling mengenal karena masing-masing personil suka dengan musik Blues kami di pertemukan di salah satu komunitas Blues di Banten (Banten Blues Brother) sejak saat itu kami sepakat untuk membentuk group band yang kami namakan FEVER BLUES MAGIC, tekad kami adalah membawa nama baik musisi Blues Indonesia ke seluruh penjuru dunia, Aseek.. dengan karya kami yang bergenre Blues Alternative, kami yakin bahwa kami pasti bisa, Merdeka!!','Blues','guitar_plus;','Jakarta',556,'2017-08-22 03:04:44','2017-08-22 03:04:44'),
	(263,'ARASHEL','1503374748.jpg','ARASHEL adalah band yang berasal dari Purwakarta.\r\ndibentuk pada tahun 2014.\r\nArashel mengusung genre Pop - Alternative rock.\r\nnama ARASHEL memiliki arti kuat dan terlindungi, dengan harapan dapat memberikan kepercayaan dan keuatan kepada seluruh personil nya untuk berjuang menggapai cita - cita, yaitu karya ARASHEL dapat diterima dan dinikmati oleh masyarakat Indonesia.\r\nSampai saat ini ARASHEL sudah memiliki fanbase di Purwakarta dengan sebutan Kawan Arashel.','Pop','facebook;guitar_plus;teman;lainnya;','Jakarta',60,'2017-08-22 03:05:48','2017-08-22 03:05:48'),
