	(266,'NOVICE','1503385720.jpg','NOVICE : Jiwa baru yang satu tujuan bersatu dalam kesatuan ide dan kreative bermusik .\r\nPrestasi : Tamu undangan AMI AWARDS 2015\r\nGuest Star : Kick andy Metro Tv\r\nMusik kita TVRI Jateng','Pop','instagram;','Yogyakarta',560,'2017-08-22 06:08:40','2017-08-22 06:08:40'),
	(267,'Cobra','1503393825.jpg','Kami adalah sekumpulan saudara yang masih memiliki keterikatan darah. Dengan adanya sedikit bakat dan kemauan, kami membentuk band yang mengusung tema \"grindcore\". Di kota kelahiran kami, nama Cobra belumlah sempurna, namun untuk luar kota seperti Purwakarta, Subang, Tasik dan sekitarnya kami cukup dikenal. \r\nCobra sudah membuat EP Album berjudul \"Breaking News\" yang bisa didengarkan di link yang terserdia di bawah.\r\nSemoga berkenan, Terimakasih.\r\n#SalamOlahraga','Others','facebook;instagram;guitar_plus;umi;','Jakarta',562,'2017-08-22 08:23:45','2017-08-22 08:23:45'),
	(268,'Onewayband','1503399568.jpeg','Oneway terbentuk diJakarta tahun 2016, terdiri dari Morai (vocal), Ozzy (bass), Ryo (drum), dan Razak (gitar), yang berawal dari mengerjakan project musik bersama, lalu masing-masing personil memiliki kesamaan dari segi musikalitas dan visi misi yang sama.\r\n\r\nNama Oneway sendiri tidak mempunyai arti khusus dan spesifik. \r\n\r\nNama Oneway sendiri terinspirasi dari banyak kesamaan masing-masing personil.','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',565,'2017-08-22 09:59:28','2017-08-22 09:59:28'),
	(269,'Charicature','1503402739.jpg','Charicature berasal dari kota enrekang sulawesi selatan\r\nGitar 1: anchu anwar\r\nGitar 2: elhy parimba\r\nBass ;aldhy\r\nDrumer :jhono\r\nVocal :aris munandar','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',568,'2017-08-22 10:52:19','2017-08-22 10:52:19'),
	(270,'SHINE','1503404028.jpg','SHINE terbentuk pada 17 juli 2015, arti nama SHINE itu sendiri yaitu \"Bercahaya/Cahaya\". Untuk prestasi SHINE sendiri sudah banyak yang diikuti dari macam kegiatan acara festival, pagelaran, giggs, dan acara musik lainnya yang ada di bandar lampung, kami sangat berharap dari arti nama SHINE kami dapat menjadi band yang tetap bersinar di musik indonesia dan bisa berkarya dengan baik dan dapat di terima oleh seluruh masyarakat indonesia maupun luar.','Pop','instagram;umi;teman;','Jakarta',567,'2017-08-22 11:13:48','2017-08-22 11:13:48'),
	(271,'FAYO','1503411939.jpg','Fayo dibentuk sejak 1 juli 2014, \"fayo\" diambil dari bahasa nias yang berarti \"payung\", karena kami berharap musik kami dapat meneduhkan.\r\nFayo berkomitmen mengusung genre reggae dgn balutan tradisional nusantara,\r\n\r\nAdapun prestasi kami antara lain:\r\n- Juara 1 Festival Lagu Religi Ramadhan Fair \r\n Medan (2014)\r\n- Juara 2 Asian Beat Band Competition Regional Medan (2014)\r\n- Opening Act Soundsation Medan (2014)\r\n- Opening Act Soundsation 5 kota Medan, L.Pakam, Siantar, P.Sidempuan, Banda Aceh (2015)\r\n- Juara 1 Asian Beat Band Competition Regional Medan (2015)\r\n- Sepuluh Besar Asian Beat Band Competition National, Jakarta (2015)\r\n- Opening Act Suryanation Motorland Medan (2016)\r\n- Opening Act Soundsation Medan, Tebing Tinggi, Binjai, Lubuk Pakam, Sei Rampah (2016)\r\n- Opening Act Soundsation Binjai (2017)\r\n- Opening Act Soundsation Road To Soundrenaline Medan (2017)','Others','lainnya;','Medan',429,'2017-08-22 13:25:39','2017-08-22 13:25:39'),
	(272,'SNEAK BAND','1503412263.jpg','Sneak sebuah band pop/melodic punk, yang terbentuk di oktober 2016 lalu, band yang berasal dari Pematangsiantar (North Suamtera) berbasiskan oleh tiga orang pemuda yang sebenarnya mempunyai ketertarikan yang berbeda dalam hal genre musik. Setalah lama mendiskusikan akhirnya sepakat mendirikan SNEAK dengan have fun. Prestasi yang membanggakan adalah ketika kita membentuk band ini dan tidak membutuhkan waktu lama untuk mengerjakan meteri lagu, sepanjang perjalanan dari oktober tahun lalu sampai saat ini kami telah menyelesaikan 2 single,  berjudul \"Punk and Pain,  Out From My Depression\" dan 1 single recycle \"Punk and Pain\" menjadi versi akustik. Selain itu juga di Desember tahun 2016 sangat membanggakan ketika kita mendapat kesempatan untuk bermain di salah satu festival musik tahunan musik independent kota Pematangsiantar yakni Siantar Extreme Fest.','Others','guitar_plus;','Medan',513,'2017-08-22 13:31:04','2017-08-22 13:31:04'),
	(273,'TREA','1503415296.jpg','Berawal dari band yang berbeda - beda dan sering dipertemukan bahkan menjadi rival dalam event parade band, mereka pun saling kenal satu sama lain dan sering bertukar fikiran tentang musik serta saling berbagi job. febri berasal dari band  yang bernama unik, Fadil dan Rendi dari scarlett, lalu dzaky dari band shoulhunter. Pada tahun 2012 Dzaky mulai masuk menjadi additional dari band scarlett di karena kan drummer dari band scarlett berpindah domisili, dan pada tahun 2013 mreka dipertemuka dalam event kompilasi major eleven yg di selenggarakan oleh label asal Bekasi yaitu Naga Java, namun dalam event tersebut tidak ada hasil yang berarti mereka pun memutuskan untuk tidak melanjutkan project tersebut.\r\n\r\n Singkat cerita Band Scarlett dan Unik pun bubar jalan, hingga mereka semua sempat vacum dalam waktu yang cukup lama. Pada tahun 2014 fadil yang pada saat itu sedang melaksanakan kuliah kerja nyata (KKN) dalam perkuliahannya satu kelompok dengan sang vokalis yaitu febri. Dalam kegiatan KKN tersebut Fadil dan Febri sering kali mengisi waktu luangnya dengan iseng-iseng bermain alat music, dari situlah Fadil mulai punya keinginan untuk membentuk band lagi.\r\n\r\n Setelah beres kegiatan kuliah tersebut ada event salah satu brand roko menawarkan job kepada Fadil agar band yg terdahulunya mengisi acara tersebut, namun pada saat itu Fadil tidak memilik band dan mulai lah terfikir untuk membentuk suatu band. Mulai lah Fadil menghubungi kembali Rendi, Febri dan Dzaky untuk membuat sebuah band, dan bergabunglah mereka dalam satu band yang bernama B.O.O.T.S Band yang pada saat itu belum bernama Trea. Dalam jangka waktu 1 minggu band terbentuk merekapun langsung mengisi acara pada event brand rokok tersebut. Mulailah mreka sering mengisi event-event baik di dalam kota ataupun luar kota.\r\n\r\n namun dalam aransemen lagu-lagu mereka sering kali membutuhkan alunan keyboard maka merekapun menarik zody menjadi additional keyboard yg berasal dari band Scarlett. Seiring berjalannya waktu mereka pun terus maju bukan tanpa kendala, berbagai kendala sering kali menghampiri mereka. Masalah silih berganti namun setiap masalah selalu merka selesaikan tanpa berdampak negative pada band, justru dengan permasalahan tersebut menjadi pembleajaran yang sangat berarti sehingga membuat kekompakan terus meningkat dan semakin mematangkan mereka.\r\n\r\n\r\nSeiring waktu berjalan merekapun memutuskan untuk mengganti nama band mereka dikarnakan nama B.O.O.T.S Band diambil untuk nama sementara karena saat awal terbentuk mereka di hadapkan untuk langsung mengisi acara, bukan hal yang mudah untuk memutuskan suatu nama band merekapun masing masing mengumpulkan kandidat untuk penggantian nama B.O.O.T.S Band, setelah perundingan dan penyaringan maka muncul lah nama Tread dan Altar. Dan yang sebenarnya terpilih adalah Altar, namun pada satu event di saat pendataan band fadil salah menyebut nama malah Trea yang terdaftar. Namun semua personil menyepakati untuk membatalkan nama Altar dan setuju untuk meresmikan nama TREA yang di ambil dari kata Yunani yang bearti memiliki pengaruh. Dan harapan mereka Trea Bisa di terima oleh masyarakat Indonesia serta dapat membawa pengaruh positif pada industry music Nasional.','Pop','teman;','Jakarta',111,'2017-08-22 14:21:36','2017-08-22 14:21:36'),
	(274,'STEREA','1503420525.JPG','STEREA terbentuk pada awal 2010 dibekasi,berawal dari jam session distudio beberapa kali sampai menemukan kecocokan satu sama lainnya\r\nSetelah beberapa kali melakukan jam session maka terbentuklah band STEREA ,yang berarti SOLID\r\nDengan filosofi kita selalu solid / kompak disetiap keadaan\r\nDengan dukungan dari sahabat dan keluarga,sterea bisa mengikuti beberapa acara pensi dan Event-event yang ada di beberapa tempat\r\n \r\n	STEREA terdiri dari,UBAY (vocal),FAI (gitar),KEMAL (bass),PIPO (drum)\r\nStage experience :\r\n-	A mild soundsation bekasi\r\n-	Pro mild bekasi\r\n-	Giggs lumbung padi\r\n-	Event Liverpool café \r\n-	Yamaha road race (dawuan karawang)\r\n-       Rockin Battle','Alternative Rock','guitar_plus;','Yogyakarta',574,'2017-08-22 15:48:45','2017-08-22 15:48:45'),
	(275,'Alaskan Minority','1503424651.jpg','BIOGRHAPY\r\nAlaskan minority, Terbentuk pada tanggal  4 Maret 2016 dengan beranggotakan 4 personel,yaitu :\r\nMaulana (drum) , Gilang (lead guitar) , Yoga(ex Ryhtim) , Barra (bass and vocal).\r\n\r\nNama Alaskan minority tersebut memiliki filosofi yang diambil dari ALASKAN dan MINORITY atau\r\n\r\nMINORITAS.\r\n\r\n(alaskan)penduduk alaska yang dimana Alaska itu adalah suatu tempat yg jauh dan dingin serta tidak banyak terjamah oleh masyarakat,tetapi tempat yg sangat ingin dikunjungi. (minority) berartikan minoritas yang dimana sebagai masyarakat atau sekumpulan minoritas pada suatu tempat. Dengan demikian ALASKAN MINORITY sebagai tempat bagi orang orang minoritas yang sangat ingin dikunjungi (dikenal) meskipun hanya sebagai orang minoritas,tapi tetap bersikap “dingin”\r\n\r\nPada bulan Mei 2016 Alaskan Minority meluncurkan lagu pertama yang berjudul ‘flesh and bone’ lalu pada bulan Juli meluncurkan single kedua nya yaitu ‘oblivion’\r\n Seiring berjalan nya waktu alaskan minority bersepakat untuk menambah personel dengan mengisi pada bass.setelah sepakat untuk memustuskan siapa yang akan mengisi pada bass,akhirnya posisi bass diambil alih oleh Fachry (Baim).\r\n\r\nBanyaknya permintaan dari pendengar meminta lagu flesh and bone dibuat versi akustik,karena banyak pendengar dan “minoritas” yang meminta,maka kami setuju untuk membuat lagu ‘flesh and bone’ versi akustik.dan rating menunjukan bahwa flesh and bone versi akustik lebih banyak dinikmati.\r\n\r\nSetelah Baim bergabung bersama alaskan,tiba di penghujung cerita bahwa Yoga memutuskan untuk hengkang dari alaskan minority karena satu dan lain hal.bersamaan dengan hengkangnya yoga,bersamaan itu pula alaskan meluncurkan single ketiga nya yang berjudul ‘its not a good choice,but this is the best plan’\r\nDan hingga saat ini alaskan minority sedang mengerjakan lagu lagu yang akan dibuat dalam satu EP album yg bertajuk ‘CYCLE’, setelah meluncurkan lagu keempat yang berjudul ‘unbeaten’\r\n\r\n\r\nPerform Experience\r\n\r\nDies Natalis MIPA UNJANI (Maret 2016)\r\n\r\nMode Market (April 2016)\r\n\r\nKiara Condong (September 2016)\r\n\r\nInhoftank (Oktober 2016)\r\n\r\nDies Natalis INFORMATIKA UNJANI (Oktober 2016)\r\n\r\nGreen Foodcourt UNJANI –LACOMM ( Oktober 2016)\r\n\r\nSTOCKLOT-LACOMM (November 2016)\r\n\r\nEvolusi Genetik Party –Ciamis (Desember 2016)\r\n\r\nMINDSET - Cimahi (Desember 2016)\r\nSubang Bersatu Vol. 1 – Subang  (Februari 2017)\r\n\r\nPsycolor Glowing Run – Unjani Cimahi  (Februari 2017)\r\n\r\nBogor Metalcore – Bogor  (Februari 2017)\r\n\r\nFESSPPA – Cimahi  (Maret 2017)\r\n\r\nOne Tun – Bandung  (April 2017)\r\n\r\nApril Mosh – Cikalong Wetan  (April 2017)\r\n\r\nSuper Rawk – Bandung  (April 2017)\r\n\r\nJakcloth Summerfest 2017 – Jakarta  (Mei 2017)\r\n\r\nClothing Fastingval – Bogor  (Juni 2017)','Others','instagram;informasi_toko;guitar_plus;poster;teman;lainnya;','Jakarta',323,'2017-08-22 16:57:31','2017-08-22 16:57:31'),
	(276,'Eigengrau','1503428350.JPG','Where did we spot \"Eigengrau\"? The Germany has a saying for the light which creates its own gray color known as Eigengrau. How we would unify the meaning into the characters of our band is the way our music alters the ignition of a gray light knowing that the last hope is in the harmony we create. Our music is like an ocean shining through the reflection of a moonlight where gray clouds and narrowed breeze can still bring hope to another night and keeping us safe until the next morning. Let\'s talk about who we are. Eigengrau is the colliding of many different bands into one portion of a whole bowl. In this one enthusiastic bowl, you may find flesh and blood of our cultural Indonesian humanity pouring into the harmony of percussion. It is like a cinnamon in a bowl of creamy flavored ice cream where you get the highlight as well as the intriguing taste. Now, imagine having a bowl of us in the middle of a Mediterranean Sea under the galaxy of gray sparkles. Starting by the middle of 2016, we were formed by our very own ambitious vocalist a.k.a. The and guitarist a.k.a. Deden when they were spurting each others\' feelings about music and all those band talk. They both reconcile the true meaning of harmony and decided to hold each others\' hands in creating a song delightedly to be out of the box known as Only You as our single. Obviously, playing a track on live performances would not be what we had in mind in committing music. So we tagged along our significant others--we shall call them Fadjar as our drummer; Dio as our bassist; Bunga and Nold as our percussionist; and Sita as our synthesizer--who are passionate to enlighten music together in perpetual to Eigengrau.','Others','instagram;maliq;','Jakarta',578,'2017-08-22 17:59:10','2017-08-22 17:59:10'),
