	(288,'Manjakani','1503494549.jpg','MANJAKANI, berawal dari pertemuan Taufan dan Nabilla di sebuah institusi pendidikan yang sama. Ketertarikan sepasang kekasih ini kepada musik melahirkan kreativitas yang unik.Taufan dan Nabilla terus melanjutkan proyek musik dengan serius, hingga akhirnya terbentuklah nama MANJAKANI sebagai duo yang berasal dari Kota Pontianak. \r\nJuni 2015, MANJAKANI pun mulai memberanikan diri membawakan lagu-lagu ciptaan mereka sendiri ketika tampil sebagai pembuka dalam acara peluncuran mini album salah satu band indie Pontianak. Gayung bersambut, lagu-lagu MANJAKANI ternyata cukup bisa diterima pecinta musik. Kini MANJAKANI pun merilis lagu pertama yang mereka ciptakan berjudul \'ASMARAWEDA\'. Lagu tersebut mengawinkan harmonisasi yang manis dari permainan gitar akustik Taufan & Nabilla. Nabilla pun memberikan vokal yang penuh diiringin suara Taufan. \r\n\r\nBanyak terdapat pro dan kontra dalam pemilihan nama, Arti manjakani sendiri secara harfiah merupakan ramuan atau obat perapat yang biasa digunakan oleh wanita, sebagai filosofi musiknya, diharapkan pendengar merapatkan telinga dan pendengarannya pada kesyahduan musik manjakani yang mengusut genre folks pop dan secara visual memang begitu sunyi.\r\n\r\nMANJAKANI kini sudah melepas Single dan Music Video yang berjudul “Asmaraweda” dan dilanjutkan dengan proses penggarapan album pertama yang mencakupi beberapa lagu antara lain Asmaraweda, Asam Pedas,Hitam Putih dan lagu lainnya yang akan dirilis dalam waktu dekat.\r\n\r\nBerikut adalah beberapa link tentang karya Manjakani yang sudah didokumentasikan:\r\n\r\nLive Session “Bunyi Simpanan” #1\r\nhttps://www.youtube.com/watch?v=25m7dZ5GTIk\r\nManjakani – Asmaraweda Official Video Lyric\r\nhttps://www.youtube.com/watch?v=go3g45559bk\r\nManjakani – Asmaraweda Official Music Video\r\nhttps://www.youtube.com/watch?v=d5AoIgVsSHc\r\nManjakani – Hanyut (Live at Leks Mansion, Kuching Malaysia\r\nhttps://www.youtube.com/watch?v=FA661L9D6KA\r\nBanda Neira – Yang Patah Tumbuh Yang Hilang Berganti (Cover)\r\nhttps://www.youtube.com/watch?v=lzh_NgkqrrE\r\nInterview Qubicle\r\nhttps://qubicle.id/interest/7914\r\nReviewThedisplay.net (Video Music “Asmaraweda”)\r\nhttp://thedisplay.net/2017/05/03/manjakani-asmaraweda-music-video/\r\n\r\n\r\nPRESTASI \r\n1. Line Up Folk Music Festival 2017, Malang\r\n2. Urban Gigs Yogyakarta 2016\r\n3. Best Of Three  Sound Of Tri Jakarta 2017, Ecopark Ancol\r\n4. Juara 1 Pekan Inovasi RRI (Radio Republik Indonesia)','Folk','teman;','Jakarta',602,'2017-08-23 12:22:29','2017-08-23 12:22:29'),
