	(290,'Kalvari','1503501880.jpg','Cerita Band:\r\nKalvari terbentuk di Pamulang Tangsel pada 11 September 2014. Band yang mengusung rock sebagai warna dasar musik mereka ini beranggotakan Gogo (voc), Umbu (guitar), Baskoro (bass), Geo (drum). Lirik dan lagu yang Kalvari ciptakan itu sendiri tidak lepas dari isu kehidupan sehari-hari.\r\n\r\nVIVA KALVARI!\r\n\r\nPrestasi band:\r\n1. Teraskustik Chapter 48 Teraskota BSD;\r\n\r\n2. Anniversary 4th Squadward Jakarta;\r\n\r\n3. A3 We Are Back Again Event Ciledug;\r\n\r\n4. Tangerang Crowded Fest;','Rock','facebook;','Jakarta',558,'2017-08-23 14:24:40','2017-08-23 14:24:40'),
	(291,'Gos blues','1503505980.jpg','terdiri dari 3 personil yang berbera genre dan mengusung musik blues rock , hingga sampai saat ini masih terus berkarya  bermain dari panggung ke panggung di beberapa event yang ada di bandung, sekarang juga lagi proses pembuatan mini album ber isi  7 track dan pernah sekali menjuarai festival musik di salah satu universitas di bandung','Blues','facebook;instagram;','Jakarta',610,'2017-08-23 15:33:00','2017-08-23 15:33:00'),
	(292,'YELLOW JET CLUB','1503509115.jpg','Yellow Jet Club, Kuartet Semarang yang terbentuk pada awal 2016,  yang beranggotakan gabungan dari beberapa band kota semarang yaitu Isa \"santikarisma\" - (guitar/vokal)  Ari \"Redam\" - (drum), adit \"pyong pyong, weekenders a gogo\" (bass),  riky \"santikarisma\" (guitar lead ). bergenre indie rock dengan nuasa ala yellow jet club. Yellow jet club telah merilis debut single pertama pada tanggal 21 april bertepatan pata perhelatan record store day berjudul \"shake the world\". Lalu YJC Mengadakan tour sendiri bertajuk shake the world tour jawa timur dan bali pada tanggal 18 - 23 agustus2017. YELLOW JET CLUB sedang mempersiapkan EP album pertamanya dan akan di rilis secepatnya.','Alternative Rock','teman;','Yogyakarta',611,'2017-08-23 16:25:15','2017-08-23 16:25:15'),
	(293,'SANTIKARISMA','1503511404.jpg','Santikarisma, bergenre Rock Semarang terbentuk pada 2012,  yang beranggotakan  RioSu(Vokal), Isa (Gitar – Backing Vocal),  Riky ( gitar ) Okky tawon ( bass) Minyut Sofyan (Drum).  Santikarisma  telah mengeluarkan 1 lagu demo yaitu “kembalikan derajat\"  pada bulan agustus 2014 . Setelah mengerluarkan demo lagu, Santikarisma langsung merekam materi baru yang rencananya akan mereka rilis dalam bentuk Single lagu pada bulan april ini 2017.\r\nSingle tersebut akan dirilis  dalam bentuk fisik dan melalui kanal soudcloud berjudul \"sugestivisi\" yang menceritakan tentang ungkapan saran dan hasrat dalam bermusik. Setelah rilis nya single, santikarisma berencana merilis album debut pertamanya brtajuk serupa \"sugestivisi\". santikarisma akan merilis album debut pertamnya pada september 2017 ini yang di naungi oleh maternal disaster record','Rock','teman;','Yogyakarta',612,'2017-08-23 17:03:24','2017-08-23 17:03:24'),
