	(296,'Tetra','1503514462.jpg','Tetra berdiri sejak 2014 silam dengan latar belakang kesamaan persepsi tentang musik. Nama Tetra diambil dari gelombang \'theta\' yaitu gelombang otak yang dihasilkan manusia saat sedang bermimpi, meditasi, atau hypnosis. Sangat terpengaruh dengan musik era 70-an seperti Pink Floyd, The Beatles, King Crimson, The Doors, hingga Jimi Hendrix. Saat ini Tetra tengah mempersiapkan debut album nya secara indie. Tetra pernah terpilih menjadi 3 besar Bogor Local Heroes yang diselenggarakan RRI Radio. Juga terpilih untuk masuk album kompilasi ripstore.asia se Jabodetabek.','Others','guitar_plus;','Jakarta',613,'2017-08-23 17:54:22','2017-08-23 17:54:22'),
