	(301,'ID band #ickydedi','1503556594.jpg','ID iyaaa ID..\r\nkenapa namanya ID?\r\nID artinya identitas..\r\ndibaca inggris \"aiiiidiiii\"\r\nDibaca indonesianya \"iiideee\"\r\nKami anak muda yang ingin menciptakan \"iiideeee\" baru di musik indonesia agar musik indonesia come back seperti dulu.. Hehe amin?\r\nYang sebenarnya nama singkatan vocalis dan gitaris..?\r\nnama vocalisnya \"icky\" dan gitarisnya \"Dedi\" jadinya ID\r\n???\r\nSalam perkenalan semuanya..\r\nSemoga ID bisa menghibur dan meramaikan industri musik di negara kita yaitu INDONESIA?amin..\r\nDan bisa membawa nama negara INDONESIA di industri musik luar negri..\r\nMembawa harum nama negara kita di berbagai negara.. Amin?\r\nmateri lagu dari kami tentang kehidupan?\r\nkita hidup harus yakin!\r\ntanamkan dari hatimu keyakinan bahwa kita mampu berjuang demi kebahagia\'an.. Jangan pernah mengeluh..\r\nSemua akan indah pada akhirnya...??\r\nUntuk Materi lagu masih dalam proses pembuatan.. insya ALLAH kami juga akan membuat vedeo clip di hits lagu kami yang berjudul \"my decision\"\r\nNantikan ya guys?\r\nLove you all..\r\nMaju terus musik INDONESIA..?','Pop','facebook;instagram;','Jakarta',608,'2017-08-24 05:36:34','2017-08-24 05:36:34'),
