	(307,'Buddy Bully','1503567098.jpg','Berawal dari tahun 2007, kami dikenal dengan nama NATALIE (Negative Attitude Is Not A Little Effort) lalu di tahun 2015 kemarin kami menjadi Buddy Bully\r\n\r\nDi tahun 2016 kemarin kami sudah mengeluarkan mini album yang berjudul Buddy Bully EP dengan 5 lagu dengan lagu gatjoan berjudul \"Try To Be Cool\"','Rock','guitar_plus;','Jakarta',625,'2017-08-24 08:31:39','2017-08-24 08:31:39'),
	(308,'SECRET MEADOW','1503567247.JPG','Secret Meadow was formed in early 2016 and consists of Ricardo Tufano (Guitar/Vocal), Jaro Petang (Guitar/Synth), Arief R. Wijaya (Bass), and Mulyana A. Viqry (Drums).\r\n\r\nWorking at a record store together for almost 2 years made them eager to form a band, but couldn\'t be realized due to the lack of free time they can spent together.\r\nThe long awaited moment came out in their favor right after Edo\'s (Ricardo) resignation from the store, and Jaro, who had resign earlier.\r\n\r\nSecret Meadow played within the range of The Cure to Deerhunter, Nick Drake to Slowdive a blend between pop and alternative rock, even with the touch of folk music.\r\n\r\nTheir first single, Water in the Flowing River, talks about the simplified interpretation of the concept of time. How it described that time is like river without banks, a basic structure of the universe that  transcends everything. Time, is the cause of creation and destruction at once. \r\nThe Song itself is packaged in a pop kind of music with jangly guitar and a touch of ambient synth sound on the back, inviting those who listen to contemplate about everyday life.\r\n\r\nOn february, they finally released Same Old Fear, an extended play consists of 5 tracks, includes their previously released single. Just Like how the title sounds, they\'re talking about the fear of being twenty-something, singing out the anxiety of young adulthood.','Pop','facebook;informasi_toko;','Jakarta',621,'2017-08-24 08:34:07','2017-08-24 08:34:07'),
