	(311,'kebunku','1503580878.jpg','Biography\r\n\r\nKebunku adalah sebuah Band yang berdiri pada tahun 1999,\r\nyang saat itu ketiga personilnya sedang mendalami ilmu menggambar di Fakultas Seni Rupa Institut Kesenian Jakarta.\r\n\r\nSetelah menjalani dua tahun pendalaman ilmu menggambar,\r\nmereka mulai mengalami hal-hal yang berbenturan dengan apa yang mereka inginkan.\r\nbahwa ternyata semua tidak sesuai dengan apa yang digambarkan…\r\nbahwa ternyata kenyataan selalu membuat mereka merasa tertekan…\r\nuntuk menyuarakan keresahannya akhirnya Johan, Tombak, dan Oki sepakat untuk membentuk sebuah Band\r\ndengan nama KEBUNKU.\r\n\r\nNama Kebunku didapat karena Institut Kesenian Jakarta sebelum menjadi tempat menimba ilmu kesenian, yang dulunya merupakan kebun binatang.\r\ndan sampai sekarang masih banyak pohon-pohon besar yang hidup disana,\r\nmembuat para mahasiswa seperti tinggal di kebun.\r\n\r\nDengan musik PUNK ROCK yg mengusung tema keseharian,\r\nKEBUNKU mulai menciptakan lagu-lagu yang dianggap mampu mewakili perasaan mereka\r\ndan perasaan rekan-rekan senasib.\r\n\r\nPada awalnya formasi KEBUNKU (tahun 1999) adalah:\r\n\r\nGuitar/Vocal : Johan K\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nSetelah merasa letih dengan popularitas dan ingin meneruskan studinya,\r\nakhirnya Johan mengundurkan diri pada tahun 2004,\r\nyang akhirnya posisinya digantikan oleh Bobby dan ditambah Caesar.\r\nMaka formasi KEBUNKU saat itu menjadi :\r\n\r\nGuitar/Vokal : Bobby\r\nGuitar/Back Voc : Caesar\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nLalu setelah sekian lama kita bertahan dengan formasi tersebut,\r\ndengan sangat disayangkan harus merubah formasi kembali\r\ndan formasi final saat ini Kebunku (pada tahun 2009) berubah formasi menjadi :\r\nGuitar/Vokal : Bobby\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nsaat ini  2017 \r\nGuitar/Vokal : Bobby\r\nBass : tommy\r\nDrum : Tombak','Others','guitar_plus;teman;','Jakarta',627,'2017-08-24 12:21:18','2017-08-24 12:21:18'),
