	(313,'WEFLY','1503583064.JPG','Wefly adalah sebuah grup musik bergenre Pop/Rock Alternatif yang berasal dari Kota Yogyakarta, Indonesia. Grup musik ini dibentuk pada tahun 2015 dengan single pertama yang berjudul “Dengarkan Suara Hati”. Grup band ini terdiri dari 5 personil yaitu Vosta (Vocal), Yongky (Lead Guitar), Dani (Rhythm Guitar), Evan (Bass) dan Habibi (Drum). Grup musik ini juga mengenalkan lirik yang sederhana dan puitis, musik yang mudah di ingat dengan ciri khas suara sang vokalis Vosta. Wefly sendiri diambil dari kata we dan fly yang berarti kita terbang atau kita akan terbang. Sesuai dengan visinya, anggota grup musik ini menamakan dirinya wefly karena ingin membawa karya-karya mereka keberbagai kota di Indonesia bahkan keluar Negeri.\r\n\r\nAwal terbentuk:\r\nGroup band Wefly terbentuk berawal dari pertemuan Yongky (Guitar) dan Vosta (Vocal) yang kebetulan satu organisasi di salah satu kampus swasta di Yogyakarta. Kemudian pada Agustus 2015 keduanya sepakat untuk membentuk group band yang mereka namakan Wefly dengan menambah personil Hami sebagai Bassist dan Toni sebagai drummer. Namun pada awal Oktober 2015 band ini mengalami keretakan karena salah satu personil Wefly mendapat musibah yang berujung pada mangkraknya band ini disusul keluarnya Hami dan Toni dari band ini. Pada akhirnya band ini tetap jalan dengan mengajak Evan sebagai Bassist dan Habibi sebagai drummer yang kebetulan teman satu SMA dan teman satu kampung  Yongky. Dengan formasi seperti itulah, mereka mulai manggung dan memainkan musik beraliran Brits Alternatif. Perjalanan profesional Wefly dimulai tahun 2016 dengan merambah dari cafe ke cafe di Yogyakarta dengan membawakan lagu-lagu top 40, serta alternative rock seperti One Ok Rock, The Script, Coldplay, Radiohead, dll. Pada Februari 2016, mereka berempat mulai melakukan rekaman dan mengeluarkan single pertama yang berjudul \"Dengarkan Suara Hati\" disusul \"Khianat\" sebagai single kedua mereka. Pada 4 Mei 2017, Wefly mengubah formasi dengan menambah personil karena merasa kosong jika manggung hanya dengan satu gitar. Hingga kemudian mereka merekrut Dani sebagai Rhythm Guitar untuk mengisi kekosongan tersebut. Sejak band ini terbentuk dengan konsep Indie memang belum ada penghargaan secara resmi yang diraih. Namun lagu berjudul \"Dengarkan Suara Hati\" terpilih dan masuk kedalam enam besar dari 300 lebih lagu yang diseleksi dan dibawakan oleh salah satu penyanyi terbaik Indonesia dan disiarkan langsung disalah satu program TV swasta nasional pada bulan April 2016 lalu. Hingga saat ini Wefly sedang menyelesaikan proses rekaman untuk mini Album mereka yang akan segera diliris pada akhir tahun 2017 ini.','Pop','instagram;','Yogyakarta',633,'2017-08-24 12:57:44','2017-08-24 12:57:44'),
	(314,'Lingkaran Atmosfer','1503584388.jpg','Lingkaran Atmosfer adalah Band Independen yang berbasis di Kota Surabaya. Dengan mengusung genre Post-Rock, Lingkaran Atmosfer memberikan nuansa yang baru untuk menyampaikan emosi ke audience. Dibentuk pada tahun 2015 yang pada awalnya hanya sebatas cover lagu, Lingkaran Atmosfer memberanikan berkarya sendiri, karena keinginan untuk meluapkan ide-ide yang di garap kolektif tiap personil.\r\n\r\nFilosofi dari nama Lingkaran Atmosfer sendiri adalah lingkaran yang berarti tak bersudut dan atmosfer adalah lapisan yang melindungi bumi. Dari kedua penjabaran tersebut, Kami berharap musik kami dapat merangkul semua orang dengan nuansa yang kami berikan dan dapat diterima oleh semua orang.\r\n\r\nPrestasi : \r\n- Juara 2 Musicology Record Rising Up #2015\r\n- Juara 3 Road to Sound of Tri Region Malang','Others','instagram;informasi_toko;teman;','Surabaya',438,'2017-08-24 13:19:48','2017-08-24 13:19:48'),
	(315,'SOUND COUSTIK','1503587496.jpg','BAND indie berasal dari kota palopo,\r\nterbentuk tahun 2013..\r\nmenjuarai festival band di berbagai kota di sulawesi selatan\r\n\r\ndan ada beberapa konsep yang kami sudah \r\nciptakan sbb :\r\n* Berdendang anak jalanan\r\n* Bahagia bersamamu\r\n* arti sahabat\r\n* sepih\r\n* ku harus lalui\r\n* menangis karna kedua orang tua\r\n* jalan sedih.','Pop','facebook;instagram;lainnya;','Medan',639,'2017-08-24 14:11:36','2017-08-24 14:11:36'),
