	(317,'Arupadhatu','1503589139.jpg','juara favorit se keresidenan besuki/setapal kuda. probolinggo, lumajang, jember, bondowoso, situbondo. lagu kali ini aransemen arupadhatu dari lagu noah cobalah mengerti','Others','facebook;','Surabaya',640,'2017-08-24 14:38:59','2017-08-24 14:38:59'),
	(318,'THE MAXWEL','1503589873.JPG','The Maxwel adalah band yang berasal dari kota Kendal Indonesia . pada tanggal 11 desember 2013 lahirlah band tersebut yang mengusung genre POP . \r\n\r\nNama The Maxwel sendiri bermakna max yang artinya maximal dalam berfikir dan wel berasal dari kata well (baik) . jadi kesimpulanya adalah berfikir maksimal yang baik atau bermanfaat dalam bermusik .\r\n\r\nThe maxwel sendiri sudah menelurkan single-single seperti : Bintang Hatiku , Putih abu-abu , Bukan Seorang Penghibur , Tak Lagi Bersamamu , Jalani Hidup ini , Pergilah Jauh , Terima Kasih Semua , Tersenyum Letih , Kau Buatku Sempurna, Kuambilkan Bintangmu dan masih banyak lagi .\r\n\r\nHarapan bagi maxwel sendiri semoga karya-karyanya kami bisa diterima masyarakat luas mampu menembus industri musik nasional hingga internasional . mengharumkan nama kota kendal dan negara indonesia kita tercinta  . amin','Pop','facebook;instagram;teman;','Yogyakarta',130,'2017-08-24 14:51:14','2017-08-24 14:51:14'),
