	(320,'JBBlues','1503591910.jpg','“ Blues bukan hanya suatu genre menurut kami, blues adalah rasa, Blues adalah kepedulian \r\nBlues adalah Pelajaran kehidupan “.\r\n \r\n\r\nJBBlues, mungkin dari namanya saja sudah ketahuan bahwa kami mengkiblatkan musik apa, ya “Blues”.Kami memilih jalur musik blues bukan karena suatu hal yang mudah, kami melewati proses proses bermusik hingga akhirnya kami jatuh kedalam musik blues.\r\nJBBlues  dibentuk pada tanggal 27 januari 2017 beranggotakan moamar (gitar dan vocal), Riski B ( bass), Ricky G (drum), Aspasia (Tenor saxophone), Bimo S (Alto saxophone), Nasrullah G ( Trumpet ), dan Angga Hut ( Trombone ).\r\n\r\n    \r\n  \r\n \r\n    \r\nJBBlues, nama yang dibuat dan disetujui di dalam Kereta api yogyakarta – Blitar , karena memang Job main pertama kami adalah di Kota Blitar. Nama JBBlues sendiri diambil dari nama alamat basecamp kami atau lebih tepatnya alamat rumah yang menjadi tempat kami berproses . JB adalah singkatan dari Jeron Benteng, Jadi JBBlues adalah Jeron Benteng Blues. Tempat berkumpul kami beralamat di jalan suryoputran kecamatan kraton, disinilah para warga sekitar menyebutnya Jeron Benteng, Karena memang lokasinya di dalam lingkup benteng kraton Yogyakarta.\r\n \r\n\r\nMusik JBBlues Sangat dipengaruhi oleh musik Blues era lawas tahun 60an hingga 90an seperti era Blues dijaman Robert Johnson yang karyanya direkam ulang tahun 1961, muddy waters, albert king, BB king, eric Clapton, jimi Hendrix, Stevie Ray Vaughn. Tapi dalam karya karya kami, kami juga menyisipkan unsur unsur RnB dan Funk ala ala James Brown. Yang terpenting bagi kami adalah karya karya kami mempunyai taste tersendiri, ketika kami memainkan karya kami sendiri tanpa melihat siapa kami para pendengar sudah mengetahui bahwa itu musik dari JBBlues.\r\n\r\n\r\n\r\n\r\nBrass section yang digawangi Aspasia, Bimo s, Nasrullah G , Angga Hut adalah kekuatan utama bagi kami, dengan tambahan komposisi gitar yang liar dan groove Bass serta Drum yang menghentak menjadikan musik JBBlues  mempunyai warna tersendiri. \r\nKami juga disebut sebagai Blues kejut oleh pendengar karena menurut pendengar ketika JBBlues bermain diatas panggung selalu memberi kejutan kejutan baru di setiap penampilannya.\r\nCerah, single pertama kami yang berhasil membawa JBBlues sebagai 5 besar band yang terpilih untuk tampil di acara Radioshow TVone bulan maret 2017 yang diselenggarakan di alun alun utara Yogyakarta. Ini sebuah pencapaian yang tak terlupakan bagi kami, mengingat dari proses seleksi yang diikuti 120 Band dari Yogyakarta dan kami masih berumur 3 bulan di dalam naungan JBBlues, kami mendapat sebuah keberuntungan dari Tuhan YME, kami bukan terbaik dari 120 band tersebut hanya saja kami beruntung, karena menurut kami TIDAK ADA band yang tidak bagus di Yogyakarta.\r\n \r\n\r\n      \r\nLirik JBBlues sebagian besar mengarah kepada perjalanan kehidupan manusia, tentang sebuah kebebasan, kejujuran dalam hidup, hingga kematian. Kami memilih hal ini karena kami ingin karya karya kami bermanfaat bagi pendengar, karena kami sadar kami dan pendengar adalah manusia, yang mana manusia adalah tempat lupa dan akhirnya buta, lupa akan siapa kita sebenarnya, lupa darimana kita berasal, lupa akan segalanya dan akhirnya buta.\r\n\r\n     \r\nTujuan bermusik kami bukan hanya untuk sebuah ketenaran tetapi lebih ke manfaat musik kami untuk semua orang. Blues kami Blues yang menghibur, Blues kami Blues yang mendamaikan, Blues kami untuk sebuah kebaikan.\r\n\r\n\r\n\r\nPrestasi : \r\nJuara 3 RadioShow Tvone 2017 Yogyakarta\r\nJuara 2 Road To Soundrenaline 2017 Yogyakarta','Blues','instagram;lainnya;','Yogyakarta',642,'2017-08-24 15:25:10','2017-08-24 15:25:10'),
	(321,'Kraken','1503601019.jpg','-Press Rellease-\r\nSalah satu band asal bogor ini terbilang cukup sukses di usianya yang baru terbentuk sejak 6 juni 2016 mereka terdiri dari Borie (vocal), Ryan Boyan & Dhany Kinoy (guitar), Hilman (bass), Fahmi (drum).\r\n\r\nUntuk nama kraken sendiri berasal dari nama untuk monster laut berbentuk gurita yang besar, untuk filosofinya sendiri mereka mengartikan Kraken adalah monster yang berasal dari sekumpulan energi, yang artinya diharapkan kami ber-5 bisa menjadi satu kesatuan untuk memberikan energi yang besar untuk musik kami. (Ujar hilman)\r\n\r\nUntuk influence sendiri kraken sangat terinspirasi oleh musik lamb of god dan Kataklysm namun selain itu mereka sangat explore dengan warna musik musik di luar musik metalcore itu sendiri. \r\n\r\nSoal genre terserah pendapat para pendengar mendeskipsikannya. “Band kita basic musiknya metal, kenapa milih metal? Awalnya itu hanya ingin olahraga aja tiap minggu manggung atau latihan, musik metal kan hentakannya semangat tuh otomatis pada gerak minimal kepalanya, eh ternyata keterusan ampe sekarang di hellprint,” ujar Hilman, salah satu personil Band KRAKEN saat dihubungi di tengah kesibukan KRAKEN.\r\n\r\nBand yang merilis single bertajuk \"Lawan\" yaitu lagu yang bercerita tentang perlawanan terhadap kemalasan diri, dan album Kraken sendiri akan dirilis setelah event hellprint united V tepatnya di akhir tahun ini. Untuk materi lagu dari kraken sendiri berpesankan tentang kehidupan sehari-hari yang sangat kompleks.\r\n\r\nYang di rasakan para awak kraken ketika mereka berdiri atas nama kraken, mereka merasa harus lebih dewasa bukan hanya untuk materi lagu saja seperti hal hal yang kecil ga ngaret latihan dan komitmen yang kuat untuk ngeband tanpa harus mengorbankan seperti pekerjaan. \r\nResolusi ke depan, kraken berharap musik mereka bisa diterima oleh semua orang dan memberikan warna musik yang baik kepada penikmat metal dan berencana untuk dapat memiliki kesempatan mengenalkan musik mereka ke seluruh Indonesia.\r\n\r\nDalam perjalanan kraken mereka sangat berterima kasih kepada semua pihak yang mendukung seperti bharata (outright) yang memberikan masukan selama proses road to hellprint, Manager Kraken Ishak Rachman, Road Manager Kraken Tyo, Seluruh Metalhead Bogor, Seluruh Band di Bogor yang mensupport kami, komunitas solo guitar BGF, R9 Community, Bogor Metal Community, Bogor Total Metal Community, Indonesianmetalcore dan lain lain. \r\n\r\nnb : (dilansir dari berbagai wawancara terhadap Kraken)\r\n\r\nMedia Sosial :\r\n•	Instagram : @officialkrakenbogor\r\n•	Facebook : Kraken Bogor\r\n•	Twitter : @kraken_bogor\r\n•	Youtube : Kraken Core Official','Others','instagram;guitar_plus;umi;teman;','Jakarta',645,'2017-08-24 17:56:59','2017-08-24 17:56:59');

Semua terkumpul menjadi satu membentuk sebuah mental bermusik yang kuat dan musik\r\nbernuansa  Metal & Hardcore menjadikan pilihan nada yang kami mainkan.\r\n\r\nTerbentuk pada bulan Mei 2010, sempat mengalami pergantian personil & sedikit perubahan genre musik.\r\n\r\nAlbum “Revolusi” merupakan album perdana kami yang direlease pada pertengahan tahun 2014.\r\nPemenang planetrox envol et macadam 2016 yang diberangkatkan ke Quebec, Canada','Heavy Metal','lainnya;','Jakarta',661,'2017-08-25 09:28:36','2017-08-25 09:28:36'),
	(343,'Native','1503658647.JPG','Native terbentuk pada awal tahun 2015 dengan genre alternative rock , beranggotakan 5 orang personil terdiri dari 1 gitar , 1 bass , 1 vokal , 1 drum dan 1 keyboard. Namun pada tahun 2016 , 2 personil kita yaitu bassist dan keyboardist kita mengundurkan diri dikarenakan ada masalah internal. Dan di gantikan dengan bassist baru dan diperkuat dengan rythm gitar. Materi lagu Native sendiri mayoritas menceritakan masalah yang terjadi pada anak muda sekarang masalah kehidupan, Cinta , Pertemanan , dsb. Beberapa prestasi yang pernah kita peroleh antara lain adalah : juara 1 deteksi band 2k15 , Juara 2 piala bupati sidoarjo 2k15 , juara 3 uph highschool band competion 2k15 , Juara 1 elvest band competion dan juara 1 soundsation live audition Sidoarjo 2k17.','Alternative Rock','instagram;','Surabaya',687,'2017-08-25 09:57:27','2017-08-25 09:57:27'),
	(344,'Remaja Senyum','1503658702.jpg','Remaja Senyum terbentuk pada tanggal 7 November 2015. Remaja Senyum bergenre Progressive, diantaranya memadukan unsur musik rock, funk, etnik, dan jazz. Ditengah naiknya musik EDM (Electronic Dance Music) atau sejenisnya, kami masih tetap mempertahankan musik Progressive.\r\nRemaja Senyum memiliki filosofi yaitu, Remaja yang berarti berusia 11 tahun hingga 21 tahun. Karena pada saat pembentukan Remaja Senyum, usia kami dibawah 21 tahun. Senyum yang berarti ekspresi wajah yang menampilkan kebahagiaan dan rasa senang. Jadi pada intinya, Remaja Senyum adalah anak yang berusia dibawah 21 tahun yang menyajikan musik dengan rasa kebahagiaan dan kesenangan.\r\nAwal mula, personil kami terdiri dari 1 Vocal (Putri), 2 Gitar (Gredy & Bob), 1 Bass (Boy), dan 1 Drum (Pandji). Namun seiring berjalannya waktu, Remaja Senyum menambahkan instrument Keyboard (Elika Mukti) kedalam grupnya, dan total 6 personil. Namun, pada nyatanya, bertahan lebih sulit ketimbang menambahkan. Bob & Elika memilih mundur, dan lebih memilih pendidikannya. Ketika saat itu pula, kami mengajak Erwin yang merupakan Keyboardist untuk bergabung dengan Remaja Senyum hingga saat ini. Namun, tidak hanya ajang perlombaan band yang diikuti. Remaja Senyum, juga mengikuti acara gigs, wedding, dan acara-acara musik lainnya.\r\n\r\nPrestasi \r\n1. Juara 1 Festival band desa seni TMII November 2015\r\n2. Juara 2 Indie kota tua Januari 2016\r\n3. Juara 2 SMANU Thamrin Februari 2016\r\n4. Juara 1 Mall Balekota Tangerang Maret 2016\r\n5. Juara 1 Mutiara Gading Bekasi April 2016\r\n6. Juara 1 Univ. Thamrin Jaksel April 2016\r\n7. Juara 1 Encarnation UI April 2016\r\n8. Juara 2 Mall metro cipulir Mei 2016\r\n9. Juara 1 Univ Pancasila Mei 2016\r\n10. Juara 2 Falms UKM Rangkasbitung Mei 2016\r\n11. Juara 1 Festival Cisadane Juli 2016\r\n12. Juara 1 SMA Pusaka Abadi Agustus 2016\r\n13. Juara 1 UPJ Bintaro 13 Agustus 2016\r\n14. Juara 1 Istana Anak-anak TMII Agustus 2016\r\n15. Juara 1 Gor cempaka putih September 2016\r\n16. Juara 2 Snowbay TMII September 2016\r\n17. Juara 1 Gor Otista September 2016\r\n18. Juara 1 SMA Don Bosco 1 Jakarta November 2016\r\n19. Juara 1 Manajemen UNJ November 2016\r\n20. Juara 1 Univ. Binus Novmber 2016\r\n21. Juara 1 SMAK Penabur 4 November 2016\r\n22. Juara 1 Youth Festival DKI November 2016\r\n23. Juara 2 KMM UIN Desember 2016\r\n24. Juara 1 Artfest Poltek Kelapa sawit Desember 2016\r\n25. Juara 1 One Bell Park Mall Desember 2016\r\n26. Juara 1 Alseace BSD Februari 2017\r\n27. Juara 1 SMANU Thamrin Februari 2017\r\n28. Juara 1 Festivaganza Bogor Februari 2017\r\n29. Juara 1 Eclipse April 2017\r\n30. Juara 2 SQ dome April 2017\r\n31. Juara 2 Parta Perindo April 2017\r\n32. Juara 1 Musco UNJ Mei 2017\r\n33. Juara 2 Festival Palang pintu Mei 2017\r\n34. Juara 2 Lagoon Kamala Bekasi Mei 2017\r\n35. Juara 3 Tasikmalaya Mei 2017\r\n36. Juara 2 LSPR Juni 2017\r\n37. Juara 2 Religi Perindo Juni 2017\r\n38. Juara 3 Boyolali Rock Festival Juli 2017','Others','guitar_plus;','Jakarta',692,'2017-08-25 09:58:22','2017-08-25 09:58:22'),
	(345,'Rain & The Romance','1503662903.png','kami belum ada pengalaman tampil live di panggung. tapi kami pernah meraih juara 1 lomba cover yang diadakan oleh Melodi Alam, pada saat itu band ini belum mempunyai nama','Pop','guitar_plus;','Jakarta',698,'2017-08-25 11:08:23','2017-08-25 11:08:23'),
	(346,'VELLA BAND','1503663608.jpg','Tergabung didalam sebuah ekstrakulikuler musik di Sekolah Menegah Atas (SMA), Zena (vokal), Adam (gitar), Leon (bass) dan Sandi (drum) sering mengikuti festival-festival band tingkat SMA ataupun umum. Salah satu prestasi yang pernah didapat oleh Vella adalah juara 1 festival band tingkat SMA se-DKI Jakarta dengan tema \"NEXT GENERATION\" di kampus STEI rawamangun Jakarta Timur pada tahun 2009 akhir.\r\nVella sempat mengalami pasang surut eksistensi dalam bermusik dikarenakan saat itu semua personil melanjutkan pendidikan ke tingkat perguruan tinggi. Namun begitu, di tahun 2015 awal, Adam yang menjadi leader di Vella mencoba menyatukan Vella kembali dengan semangat yang baru.\r\nDan terus membuat karya-karya baru yang lebih fresh dan easy listening.','Rock','instagram;','Jakarta',696,'2017-08-25 11:20:08','2017-08-25 11:20:08'),
