	(356,'SIFBOH BAND','1503680146.jpg','WE ARE SIFABOH :\r\nSifaboh Terbentuk Di Tahun 2008 , Sifaboh Berasal Dari Penyingkatan Kata Yaitu Sipandai Belajar Bodoh, Sudah Berulang Kali Berganti Personil Tapi Hanya 2 Orang Yang Tetap Bertahan Sampai Sekarang, Pada Tahun 2009 Berkat Adanya Perkenalan Dari Teman Ke Teman Kami Berkumpul Berempat Untuk Mengatakan Sesuatu Yaitu Tentang Perjuangan Musik Rock Untuk Masa Depan  Dan Akhirnya Kami Sepakat Untuk Melajudkan Band Ini. \r\nSIFABOH Member Since 2016\r\nVox : Rendi Ananda Putra (RenThinkers)\r\nGuitar Player : Rabiul Sidiq (LekwaBenefit)\r\nBass Player : Rian M Ikbal (WaknomNicholay)\r\nDrum : M.Yulion (JulyonSullivan)\r\nAdd.Player : Adhe Syanda (BGF)\r\n\r\nPrestasi Dari Tahun 2008 Sampai Akhir 2016 :\r\n-juara 1 festival pasar seni pelajar 30 september 2008(the best guitar)\r\n-juara 3 festival grand opening smect centre music school 27 juni 2008\r\n-juara 3 festival music tanah air 15 september 2009(the best drum)\r\n-juara 1 festival band pelajar 8-18 oktober 2009(the best drum)\r\n-juara 1 festival music spirit for survival 7-8 november 2009(the best vocal)+(the best guitar)+(the best bass)+(the best drum)\r\n-juara 2 festival pagelaran panggung pemuda 28 oktober 2009\r\n-juara 3 festival pagelaran panggung pemuda 28 oktober 2010\r\n-juara 1 festival final countdown 31 desember 2010(the best drum)\r\n-juara 1  funtastic Yamaha semakin didepan band competition 24 juli 2011\r\n-the best band kepri international expo 30 juni-31 juli 2011 \r\n-juara 2 festival band UNIBA 9-11 september 2011 (the best drum)\r\n-juara 3 festival pagelaran panggung pemuda 28 oktober 2011\r\n-juara 1 band competition festival yamaha matic road music 30 oktober 2011 (the best guitar)+(the best drum)\r\n-juara 2 band competition festival Yamaha matic road music 3 desember 2011 (MEDAN)\r\n-juara 2 band competition launching mio fino 23-25 februari 2012 \r\n-juara 3 cardinal awards – mei 2012\r\n-juara 1 festival indie a mild soundsation 13 juli 2012\r\n-juara 1 festival pagelaran panggung pemuda 28 oktober 2012\r\n-juara 2 band indie Radio RRI 9 desember 2012 (the best drum)\r\n-juara 1 festival band batam trade expo 21 - 24 maret 2013 (the best guitar)+(the best bass)+(the best drum)\r\n-juara 2 band competition a mild soundsation 11-12 mei 2013\r\n\r\n-juara 1 festival yamaha semakin didepan 13 mei 2013\r\n-juara 1 festival band yamaha motor show 23-24 juli 2013\r\n-juara 1 festival pagelaran panggung pemuda 28 oktober 2013\r\n-juara 3 pekan kreatif radio RRI cipta lagu 2 desember 2013\r\n-juara 1 festival yamaha semakin didepan 23 mei 2014\r\n-juara 3 festival galaxy zone 29-30-31 agustus 2014\r\n-juara 1 festival pagelaran panggung pemuda 28 oktober 2014\r\n-juara 1 festival band yamaha motor show 23-24 mei 2015 (the best vocal)+(the best guitar)+(the best bass)+(the best drum)\r\n-juara 2 festival unrika all-kepri 5-7 juni 2015(the best drum)\r\n-juara 1 festival all-kepri keprimall 24-25 september 2015 (thebestguitar+thebestdrum)\r\n-juara 1 festival all-kepri 20 november 2016\r\n(thebestvocal+thebestguitar+thebestbass+thebestdrum)\r\n\r\n\r\n\r\n\r\n\r\n\r\nOPENING ACT ARTIST : \r\n\r\n- A Mild Soundrenaline 2008\r\n-The Rock - FSPMI 2008\r\n-Netral Club Xpresation 2008\r\n- Sahara –Pesta Kembang Api 2009\r\n- Lobow - IM3 2009\r\n- PeterPan U Mild Biker 2010\r\n- Blackout - Yamaha matic road show 2011(Medan)\r\n- J-Rock’s IM3 2012\r\n- The Virgin Class Sound Sation 2012\r\n- Radja – Waterboom 2012\r\n- Rif – Waterboom 2012\r\n- The Virgin – Waterboom 2012\r\n- Geisha A Mild SounSation 2013\r\n- Andra & The Backbone 2013\r\n- Slank – FSPMI 2014\r\n- Naff A Mild Sounsation 2015\r\n- Kotak A Mild Soundsation 2015\r\n\r\nTahun 2013 Lagu Karya Kami Terpilih Dalam Sountrack Film True Heart, Yang Diputar Diseluruh Indonesia Yang Berjudul Langkah Baru .\r\n\r\nVideo Link YouTube : \r\nhttps://www.youtube.com/watch?v=b2L6JRw_JbU\r\nhttps://www.youtube.com/watch?v=7LV3JmpN-3k\r\nhttps://www.youtube.com/watch?v=su6J4_9QYPM\r\nhttps://www.youtube.com/watch?v=PLChNt-0Pfc','Rock','instagram;guitar_plus;teman;lainnya;','Jakarta',710,'2017-08-25 15:55:46','2017-08-25 15:55:46'),
	(357,'Hexa','1503680834.jpg','Hexa merupakan sebuah band yang berasal dari kota Bandung, yang terbentuk pada tanggal 24 Agustus 2012 dan mengusung genre Alternative. Arti kata Hexa itu sendiri berasal dari bilangan kimia yang berarti enam (6). Arti Hexa sendiri adalah keterkaitan hati antara 5 personil Hexa dengan penikmat musik Hexa dan orang – orang yang mendukung juga orang - orang di balik Hexa yang dianggap menjadi personil ke 6 di band Hexa ini. Hexa juga merupakan singkatan dari ‘Hope Ex Alrisemusic’, yang memiliki arti harapan yang lebih baik untuk band ini dari para personil, karena sebelum nama Hexa ada, band ini bernama Alrisemusic. Hexa dibentuk karena latar belakang pertemanan sejak SMP, yang memiliki hobi yang sama yaitu bermusik dan memiliki mimpi yang sama untuk bisa berkarya dan berkembang juga berkontribusi bagi industri musik Indonesia. Personil Hexa yaitu : Ghina (Vokal), Garin (Gitar), Ridwan (Gitar), Harry (Bass), dan Ari (Drum).\r\nHexa sudah banyak memiliki jam terbang dan pengalaman tampil diantaranya : Tampil di pentas seni SMP, SMA, dan Univesitas yang ada di kota Bandung dan Jatinangor. Tampil di event - event yang ada di kota Bandung. Mengikuti dan menjuarai lomba dan festival - festival musik yang diselenggarakan di kota Bandung. Juga pernah menjadi home band untuk beberapa cafe yang ada di Kota Bandung. Hingga saat ini Hexa baru mempunyai satu lagu, yang berjudul “Langkah Baru”. Semoga lagu ini bisa menjadi awal yang baik, baru, juga cerah bagi Hexa untuk menempuh perjalanan dalam kancah industri musik Indonesia, dan karya - karya Hexa bisa dinikmati juga menjadi inspirasi bagi banyak orang.','Alternative Rock','instagram;guitar_plus;','Jakarta',713,'2017-08-25 16:07:14','2017-08-25 16:07:14'),
