	(359,'MURDER','1503714941.jpg','Murder is a death metal band from the Indonesia formed in 2010. Murder started in the Boyolali, Central Java, Indonesia in October 13, 2010 as a death metal band. The group was founded by vocalist Hestu Dharmawan Putra and guitarist Syaiful Iwan. In early years, Murder settled on three members of more than 3 years: Hestu Dharmawan Putra, Syaiful Iwan, and Ardhina (as a drummer). To fill the bassist position, Hestu was decided to invite his brother to fill these position. Basically, he had been a bassist in several metal bands in Boyolali, which is Hide the Last and Sadistic Torture.\r\nAfter several years, Ardhina departed from the band on July 2014 for occupation reasons. Ardhina replaced by Fian Parcil as a substitute drummer, and he has been involved in several events.\r\nIn October 2013, we focus to work on making the first album, after before the 2 demos was released in 2010 and 2012. And it reduces the intensity of us to perform in gigs.\r\nIn the middle of making the album, Fian are focusing on his (punk) band and could not help us anymore. In October 2013, we focus to work on making the debut album. In the making of the album, Hestu was focus on making lyric, Syaiful focus on the making the overall rhythm and lead, and Tikko focus on the idea of Syaiful arrangements, bass line arrangements and drum beats.\r\nThe album was produced at home. From recording guitar, bass, drums, mixing, and mastering all completely done at home, but not for the vocal sessions. Vocals were recorded in Enlabz Studio. In Mei 2015, we are in the process of making a promo album with pre-release albums. Therein contains 4 songs from a total of 8 songs that will be released on Murder debut album.','Heavy Metal','instagram;','Yogyakarta',582,'2017-08-26 01:35:41','2017-08-26 01:35:41'),
	(360,'Cosmic Mind','1503728696.jpg','Meskipun kita hanya sebuah band yang masih seumur jagung, namun pemainnya bukanlah para pemain baru. Memiliki mimpi dan visi yang jelas terhadap karir bermusik kedepannya. Terus menciptakan karya-karya yang tentunya inovatif meski masih sebatas mengikuti kata hati. Telah menciptakan sebuah klip dengan budget minimalis. Sedang merekam beberapa lagu baru. Terus tampil dipanggung-panggung besar maupun kecil hampir ditiap minggunya. Menjadi 7 besar dari 66 band Rock yang ikut partisipasi dalam pagelaran Konser Rock Nasional 66 Band dalam 12 jam di TMII dan akan segera ikut serta dalam pagelaran finalnya pada Desember nanti.','Pop','guitar_plus;','Jakarta',725,'2017-08-26 05:24:56','2017-08-26 05:24:56'),
	(361,'The Tombstones','1503732575.jpg','The Tombstones, band beraliran Garagerock asal Yogyakarta yang telah terbentuk pada tahun 2013.Lagu-lagu The Tombstones tereksploitasi dari beberapa\r\ngenre seperti Rocknroll, Garagerock, Blues, Grunge, dan Punkrock sehingga memberikan warna baru di musik tanah air. Diracik menjadi satu hingga terdengar lebih powerfull dan high energy yang siap memuaskan pecinta music rock. The Tombstones telah mengisi di salah satu acara TV Nasional dengan nama acara DCDC Musik Kita Eps.9 Koil x The Tombstones, dan menjadi salah satu finalis di acara Rockin To Rockin Battle dan Radio Show 2017. Ig :tombstonesquad','Rock','instagram;poster;teman;','Yogyakarta',690,'2017-08-26 06:29:35','2017-08-26 06:29:35'),
	(362,'JC BAND','1503744676.jpg','JC band, bAND indie berasal dari sul-sel tepatnya di Luwu timur kota Wawondula. sering menjuarai festival band di berbagai daera di sulawesi dan pernah menjuarai evand festival band tingkat nasional.\r\n                  \r\n                Contack :\r\n                          ig : @jc_band\r\n                          fb : JC BAND','Pop','facebook;instagram;lainnya;','Medan',634,'2017-08-26 09:51:16','2017-08-26 09:51:16'),
	(363,'Superego','1503750481.jpg','Superego adalah unit Alternative Rock asal Bandung. Band ini beranggotakan Jeremy Jonathan (Guitar & Vocal), Yoendo Nebriko (Guitar), Talia Thaib (Bass) dan Rifqi Hidayat (Drum). Terbentuk pada pertengahan bulan April 2015, lagu – lagu mereka banyak terinspirasi oleh band – band yang  jaya pada era 90-an seperti Nirvana, Sonic Youth dan My Bloody Valentine. Permainan gitar berbalut overdrive dan lead harmonik, petikan bass yang kasar serta dentuman drum bertempo cepat dan keras menjadi karakter dari permainan musik Superego sendiri. \r\n\r\nPrestasi :\r\nJuara 3 lomba band FORSI Universitas Padjadjaran (2015)\r\nJuara 2 lomba band FORSI Universitas Padjadjaran (2016)','Alternative Rock','instagram;','Jakarta',730,'2017-08-26 11:28:01','2017-08-26 11:28:01'),
	(364,'Undersixteen','1503762540.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;umi;teman;','Yogyakarta',732,'2017-08-26 14:49:00','2017-08-26 14:49:00'),
