	(371,'SIVA','1503765144.jpg','Band yang berdiri pada tahun 2012 akhir ini mengusung konsep genre pop, terdiri dari Yudi, Darma, Beni, dan Yuda berasal dari kota Palembang, bermimpi untuk jadi band go nasional dari panggung ke panggung baik itu event wedding, sebagai band pembuka artis ibu kota dan pemerintah setempat. Dengan niat bermusik sepenuh hati, itulah moto kami untuk bermusik untuk meramaikan kancah musik nasional.','Pop','instagram;','Jakarta',726,'2017-08-26 15:32:24','2017-08-26 15:32:24'),
