	(375,'Day For Uncle Sam (DFUS)','1503770208.jpg','Day For Uncle Sam (DFUS) berdiri pada bulan Maret 2011 , dengan formasi awal 5 orang sampai 2017 sekarang. Telah meluncurkan Debut Album pada 2016 kemarin , dan merilis video Clip pada bulan Sepetember 2017 ini. Portfolio prestasi Day For Uncle Sam adalah pemenang Juara 1 pada Event JakCloth Goes To Jember 2016 dan menjadi talent pengisi acara di beberapa event JakCloth. Pada 2018 akan merilis Album ke dua dalam format EP.','Alternative Rock','instagram;umi;poster;','Surabaya',737,'2017-08-26 16:56:48','2017-08-26 16:56:48'),
	(376,'THE ViCSKA','1503770226.jpg','THE VICSKA adalah band asal majalengka selatan yang didirikan pada tahun 2011, dan nama THE VICSKA sendiri diambil dari nama band sebelumnya yaitu VICTORY dan digabungkan dg nama kampungnya yaitu SUKAMULYA dan terbentuklah nama THE VICSKA pada awal th 2011. THE VICSKA  beranggotakan 4-personiel yang terdiri dari :\r\n\r\nAris-Vocal\r\nKiki-Gitar\r\nTyan-Bass\r\nRyan-Drum\r\n\r\n-Prestasi yang pernah diraih yaitu pernah menjadi juara 1 di acara parade musik jagamulya yang bertempat di malausma dan kami juga pernah meraih juara 2 di acara memperingati hari kemerdekaan pd tgl 16agt 2016 selain itu juga gitaris kami pernah meraih gelar gitaris terbaik dua kali yang pertama pada event 17an dan yang ke dua pada event tahun baru dan vokalis kami juga mendapatkan gelar vokalis terbaik dalam event music kemerdekaan yg diselenggarakan pd tgl 15agt 2017 bertempatan di talaga','Alternative Rock','facebook;','Jakarta',643,'2017-08-26 16:57:06','2017-08-26 16:57:06'),
	(377,'hitam polos','1503774832.jpg','Band alternatif-rock yang terbentuk pada akhir tahun 2016 ini beranggotakan juno (vocal), gregorio (gitar, dan radin (gitar). Ide untuk membentuk band ini awalnya dari pertemanan gregorio dan radin, yang menyukai genre musik yang sama (alternatif-rock/western rock/blues/country). Sering manggung/event reguler bersama di cafe-cafe ternama ibukota jakarta, mereka bertemu dengan juno vocalis yang kebetulan cocok dengan warna musik yang sedang mereka garap. Saat ini lagu berjudul \"don\'t go\" merupakan debut lagu yang sedang mereka garap. Dengan tema lirik berbahasa inggris yang komersil mereka berupaya untuk mencoba mendapatkan perhatian para pendengarnya, lirik sentimentil berbau cinta diharapkan dapat menjadi senjata andalan mereka untuk memulai debut single di tahun 2017. Hitam polos, gregorio sepakat bersama teman-teman yang lain untuk memakai nama itu. Tak ada makna spesial dari nama itu, hanya karena sering memakai kaos berwarna hitam polos gregorio mengusulkan untuk memakai nama tersebut. Harapannya ialah warna hitam polos tersebut bisa bersanding dengan warna-warna (musik) lainnya. Saat ini mereka menjadi salah satu band reguler di cafe ternama jakarta.','Alternative Rock','instagram;guitar_plus;','Jakarta',686,'2017-08-26 18:13:52','2017-08-26 18:13:52'),
	(378,'Tuan Muda','1503790780.jpg','Tuan Muda adalah sebuah grup musik di Indonesia yang berasal dari daerah Bengkulu. Dibentuk atas ketidak sengajaan oleh willy Gegem pada 17 Juli 2011 karena ingin mengikuti sebuah kompetisi Musik dan punya keinginan yang kuat untuk meng-Cover lagu dengan karya sendiri di genre musik yang berbeda. Dan berhasil menjadi salah satu band ternama dan menjadi sebuah trandcenter di kalangan musisi (band) umum propinsi Bengkulu .yang juga berkeinginan menjadi band bersejarah dan dikenang serta berpengaruh untuk seluruh pecinta musik di Bengkulu hingga cakupan nasional. Dengan seringnya berganti personil dari awal berdirinya Tuan Muda,dan akhirnya Tuan Muda telah menemukan pilihan formasi yang kokoh dengan personil :\r\n•	Agung Dwi Prayugo (vocal 1)\r\n•	Ophi krisna (vocal 2)\r\n•	M.Aditya (guitar)\r\n•	M.Lophy (bass)\r\n•	Willy Gegem (drum) \r\n\r\n\r\n\r\n-	2013 Tuan Muda juara 1 ulang tahun Akutansi UNIB \r\n-	2013 Tuan Muda juara 1 ulang tahun manajemen UNIB\r\n-	2013 perfom Tuan Muda sebagai opening band RIF di Suport center Bengkulu\r\n-	2014  mengikuti festival band bersama Tuan Muda\r\n•	Juara 1 acara HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1 acara HONDA di Lap.parkir Bencoolen Mall Bengkulu\r\n•	juara 1 HUT Akutansi UNIB \r\n•	Juara 1 HUT Manajemen UNIB \r\n•	Juara 2 acara YAMAHA di Lap.parkir Bencoolen Mall Bengkulu\r\n•	Juara 2 acara HPN di Sport Center Bengkulu\r\n•	Juara 1 HUT UKM seni Dehasen Bengkulu\r\n•	Juara 1 HUT Kepahyang \r\n•	Juara 2 acara Honda di Lap.parkir Bencoolen Mall Bengkulu\r\n•	Juara 3 acara HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1  acara GG MILD di Bencoolen Mall Bengkulu\r\n•	Guest Star karnaval 3 GSG UNIB\r\n•	Opening vocalis marvel band di Rainbow Café Bengkulu\r\n•	Opening dj yasmin di Rainbow Café Bengkulu\r\n•	Opening mahadewa band di Sport Center Bengkulu\r\n•	Guest Star launching motor Honda di Bencoolen Mall Bengkulu\r\n•	Opening jambrud band di Kepahyang\r\n•	Ultah KMK kepahyang\r\n•	Perfo