	(379,'KREATIC','1503800012.jpeg','kreatic : kreasi gitink dan coik . sebuah band bentukan dri 2000an yg cuma bs menghibur temen2 doang :D jrg bgt ikut acara formal karena krg pede :D pernah sekali maksain akhirnya demam panggung dan gagal hingga waktu yg membuat smw personil terpisah .walaupun gagal bae :D ... band udh gak lengkap ... saya masih berjuang untuk mimpi .gitu aja dh . thx u?','Pop','instagram;guitar_plus;','Jakarta',704,'2017-08-27 01:13:32','2017-08-27 01:13:32'),
	(380,'Javania','1503808898.jpg','javania adalah grup musik dari 2007. meskipun baru 2009 baru resmi menngunakan nama \"javania\" kumpulan dari beberapa musisi band jogja. kami tidak terikat label ataupun promotor manapun. untuk karya baru 10 lagu kami baru sempat record secara home recording saat ini. untuk jogja mungkin sudah tidak asing lagi karena sedari 2007 sudah sering tampil baik event sekolah, instansi sampai event konser amal beberapa tahunlalu. kami ada untuk berkarya, dengan mengusung genre all around, dari pop rock sampai blues kami rangkum menjadi 1 aransment di setiap lagu kami.','Others','instagram;','Yogyakarta',744,'2017-08-27 03:41:38','2017-08-27 03:41:38'),
	(381,'Revolper63','1503821764.jpg','Awal terbentuknya band ini,yaitu 2 tahun yg lalu. Awalnya kami hanya sekumpulan teman nongkrong . Lalu kami punya inisiatif,karna kami semuanya suka dengan musik terutama Musik rock.lalu muncullah ide kami untuk membentuk band yaitu Revolper63 .kami belum mendapat prestasi selama 2 tahun ini.','Alternative Rock','instagram;poster;teman;lainnya;','Medan',664,'2017-08-27 07:16:04','2017-08-27 07:16:04'),
	(382,'HUNTINGHOUSE','1503822193.jpg','mengikuti audisi band djarum super di bogor','Alternative Rock','lainnya;','Jakarta',750,'2017-08-27 07:23:13','2017-08-27 07:23:13'),
	(383,'Lollypop Monster','1503822876.jpg','Lollypop Monster terbentuk pada akhir tahun 2009. \r\npada tahun 2012 Lollypop berhasil menjadi juara online audisi Indie Meet The Label dan mengikuti  babak penyisihan di Surabaya, namun keberuntungan belum berpihak pada LPM, sehingga kami harus cukup bangga isa lolos sampai 10 besar.\r\n\r\nberjalannya tahun terjadilah 2 pergantian personil pada posisi drum & Lady Vocal.\r\n\r\ntujuan kami ikut Levi\'s band hunt, kami ingin memperbanyak pengalaman kami dan kami ingin terus bermusik.\r\n\r\n\"From one stage to another stage! To achieve our hope, together!\"','Electro','guitar_plus;','Jakarta',749,'2017-08-27 07:34:36','2017-08-27 07:34:36'),
	(384,'Mafia','1503828915.JPG','Terbentuk pada tanggal 1 juli 2017 oleh Wahyu (Drum), Bobby (Guitar), Rio (Bass), Rebecca (Vocal), dan Fajar (Keyboard). Di awali oleh Wahyu dan Bobby yang pada saat itu sedang ingin mencoba meng’explorasi’ music Rock dengan nuansa Jazz dan brass section. Akhirnya tercetuslah ide untuk membuat sebuah band dengan image Mafia. Pada saat itu Bobby masih tergabung di sebuah Band Progresif Rock asal Karawaci Tangerang yang bernama “Waluku” (Finalis gudang garam rock fest 2006), Sedangkan Rio mempunyai Band bergenre Power Pop yang bernama “Reto”, begitu juga dengan Wahyu yang pada saat itu masih tergabung di Band Modern Rock asal Tangerang yang bernama “deSound”(band yg sempat mengeluarkan album “page one” pada 2009). Akan tetapi keinginan untuk membuat sebuah band dengan genre yang ‘berbeda’ dan kevakuman band mereka masing-masing membuat mereka sepakat membentuk sebuah band dengan nama “Mafia”, yang bisa disebut sebagai salah satu simbol “pemberontakan”. Nama ini tercetus begitu saja dan berkesinambungan dengan Visi-Misi para personel yang ingin membuat suatu musik yang berbeda dan melawan ‘aturan’, serta simple dan “ear catching”.Pengerjaan Materi lagu digarap dengan serius di Nm studio di Kawasan Tangerang, diawali dengan lagu “Jiwa benalu”, berikutnya “Hedonis”, karya-karya berikutnya pun mengalir dengan bebas namun bisa dipertanggung jawabkan.\r\nMusic Mafia banyak dipengaruhi oleh band-band seperti Foo Fighters, Incubus, Paramore serta lagu-lagu dari big band/orchestra, yang sarat dengan karakter Rock dibalut dengan latar nuansa Swing dan Orchestra ala film-film Mafia.\r\nCP : 089609781983 (wahyu','Alternative Rock','poster;teman;','Jakarta',752,'2017-08-27 09:15:15','2017-08-27 09:15:15'),
	(385,'The Drummer\'s','1503841492.jpg','The drummers terbentuk dari satu komunitas drum di cianjur (rdc) riungan drummer cianjur, dengan semua personil nya adalah drummer profesional asa cianjur,  maka terbentuk lah the drummer\'s untuk lagu pun kita lebih ke hal hal kehidupan sehari hari dan lebih jenaka mungkin unik dengan semua personil nya memakai topeng.','Rock','facebook;','Jakarta',759,'2017-08-27 12:44:52','2017-08-27 12:44:52'),
	(386,'Throne','1503841725.jpg','Band terbentuk pada tanggal 04 oktober 2015 yang beranggotakan 5 orang, band ini beraliran progressive rock. Sudah beberapa prestasi yang kami raih salah satunya juara favorit pada acara pensi fair global tv 2015, juara 1 binus festival, juara 1 festival panggung budaya jiexpo, dan mengisi acara di beberapa pensi sekolah.','Rock','instagram;guitar_plus;teman;','Jakarta',498,'2017-08-27 12:48:45','2017-08-27 12:48:45'),
