	(388,'Brain Disorder','1503842866.jpg','Brain Disorder yang biasa disebut BD ini adalah band Slamming Death Metal asal Kota Bengkulu, Sumatera - Indonesia. Band yang sudah berdiri sejak 2005 ini sudah banyak mengalami evolusi. Hingga saat ini telah banyak Single lagu yang sudah dimuntahkan.','Others','instagram;','Jakarta',763,'2017-08-27 13:07:46','2017-08-27 13:07:46'),
	(389,'Scream Against Time','1503847687.JPG','Awal mula band ini bermula dari sebuah mimpi dan hasrat tersembunyi seorang Joe  yang ingin bermain musik keras danmengembangkannya di Indonesia. Saat itu Joe sedang belajar bermain gitar dan ingin merekam-rekam iseng di studio. Berhubung dia pernah bertemu dengan Khesa, drummer dari band lain, dan langsung diajak bertemu dan rekaman. Karena butuh seorang vokalis, Joe mengajak sahabat nya dari satu sekolah, Edel untuk bernyanyi. Seiring waktu berjalan, Joe tidak mau cuman sekedar berproduksi di studio, maka dari itu dia ingin mencari gitaris kedua, bassist dan seorang vokalis scream. Khesa memiliki teman tetangga yaitu Yudit yang bisa bermain gitar, dan meng-snowball kan ke Daniel, yang sedang belajar untuk berteriak, dan akhirnya Raihan, yang bermain bass. Setelah panggung mereka pertama, mereka langsung merekam EP pertama mereka berjudul Motionless dan release tanggal 14 Juli 2017 di Spotify, iTunes, Amazon dll dan juga bentuk fisik yaitu CD. Berhubung Yudit & Daniel sedang sibuk dengan urusan pribadi nya, sekarang datang lah member pengganti gitaris yaitu Joshua, yang sudah berpengalaman juga. Scream Against Time adalah sekelompok band orang-orang muda tapi itu tidak menghalangi mereka untuk berserius dan berkarya di industri musik.\r\n\r\nPrestasi:\r\n\r\n• Pernah tampil di panggung gede seperti Tosca 2017, Tangfest 2017 dll.\r\n• Telah release EP berjudul Motionless di bulan Maret.\r\n• Telah release 2 musik video di youtube berjudul \"You May\" dan \"Rise\"','Others','poster;teman;','Jakarta',745,'2017-08-27 14:28:07','2017-08-27 14:28:07'),
	(390,'Black Wine Grandpa','1503851455.jpg','Berdiri tahun 2014','Alternative Rock','guitar_plus;','Jakarta',477,'2017-08-27 15:30:55','2017-08-27 15:30:55'),
	(391,'A.M.O Project','1503851666.jpg','Dibentuk Tahun 2016 di Bandung\r\nAmo project adalah project solo guitar instrumental oleh Gitarisnya sendiri, Amo. Beranggota  4 orang, 2 Gitaris, (Amo dan Hadi) Drummer (Andi) dan Bassis (Robert) Merekam, mendanai dan merilis sendiri EP yang berjudul \"My Guitar and Me\" yang memiliki genre yang luas dari heavy metal sampai jazz fusion pada September 2016. Dan akan terus maju berharap musik instrumental dapat menembus pasar musik Indonesia.','Others','guitar_plus;','Jakarta',669,'2017-08-27 15:34:26','2017-08-27 15:34:26'),
	(392,'DIANDRAS','1503854399.jpg','Berawal dari keinginan Rezza Verdant dan Raga Pratama yang ingin membentuk sebuah band dengan mengusung musikalitas rock, dibalut dengan konsep dan musik ala \"DIANDRAS\" yang akhirnya sepakat menamakan genre Rythm Rock. Mereka pun mencari personil.\r\nHingga akhirnya mereka menghubungi Azka Adiba untuk mengisi posisi sebagai Bassist. Dan tak sampai disitu, mereka pun bertemu Aditya di salah satu event lalu mengajaknya bergabung dalam sinergitas bermusik ini pada tanggal 15 September 2015.\r\nLangkah demi langkah lurus tertanam dan panggung demi panggung pun terjajaki. Hingga lahirlah satu buah karya melalui proses dialektis yang ada berjudul \"Insecure\" yang kini bisa dinikmati di iTunes, Spotify, etc.\r\nNamun, belum genap 2 tahun DIANDRAS (formerly known as Diandra\'s Evening). Tepat pada tanggal 27 Mei 2017, Aditya mengundurkan diri. Setelah menyelesaikan Tour Lombok - Sumbawa (24 Sept - 7 Oct 2016) dan Tour Malaysia (11 - 13 Feb 2017).\r\nProduktifitas karya tidak terhenti sampai disini. Progress demi progress terus diupayakan. Alhasil panggung Jakarta Fair pun berhasil dijajaki. Dan saat ini sedang dalam proses penggarapan single kedua yang akan diluncurkan pada akhir September 2017.','Alternative Rock','instagram;umi;teman;','Yogyakarta',766,'2017-08-27 16:19:59','2017-08-27 16:19:59'),
	(393,'HYSTERIA','1503859687.jpg','NAMA BAND		        : H Y S T E R I A\r\nTAHUN TERBENTUK	: 2013 (Dengan formasi awal), hanya saja formasi awal tidak bertahan cukup lama, sehingga terjadilah kefakuman di dalam Band. Para personil sibuk dengan karir masing-masing, ada yang bersolo karir dan ada juga yang menjadi session player di band lain. Hysteria dengan formasi baru terbentuk sekitar pertengahan April 2017, dengan niat awal adalah sebagai band project an, dikarenakan masing-masing personil memiliki kesibukan masing-masing di band mereka ataupun bersolo karir sebagai session player. Berikut uraian personil-personil Hysteria beserta dengan achievment di bidang musik.\r\nPERSONIL 	:  1. ANDRI DHARMA ( VOCAL )\r\n			   2. IVAN MAHYA DEVA ( GUITAR )\r\n			   3. IBNU ALDIAN ( BASS )\r\n			   4. FUADI ARMAN ( DRUM )\r\n			   5. ASEP IMAN PERMANA ( KEYBOARD )\r\n\r\nPRESTASI 		: Prestasi secara band memang belum banyak dikarenakan Hysteria dengan formasi baru ini baru saja terbentuk namun prestasi secara individual anggota personil termasuk sangat membanggakan, baik itu prestasi secara nasional maupun secara internasional.\r\n\r\n\r\n\r\nDAFTAR PRESTASI \r\n\r\nIVAN MAHYA DEVA (GUITARIST) :\r\n- 2nd Place Ibanez Flying Finger Indonesia 2017\r\n- TOP 30 Kiesel Guitar Contest 2017 (Internasional)\r\n- The 1st Winner Of Band Competition JAMSIKA UNAND (Jumpa Musik Kampus) 2004 \r\n-	The 1st Winner Of Yamaha Free Your Soul (Band Competition-Nasional) on 2006 \r\n-	The 1st Winner of Sastrakustik Band Competition on 2006 \r\n-	Welcoming Stage of Jakarta Jam in Tennis Indoor Senayan Jakarta on 2007, Simple Plan, One Republic, Lost Prophet International Concert. \r\n-	The 2nd Winner of Jakarta Guitar Competition (International) on 2013 \r\n-	The 3rd Winner of Waves Of Shred Guitar Competition (International) 2013 \r\n-	The 3rd Winner of Riffs Contest (Guitar Competition) – International 2013 \r\n-	TOP 30 Guitarists out of 1.256 contestants in French Guitar Contest II (International) 0n 2013. \r\n-	TOP 10 Flying With Ibanez Indonesian Guitar Challenge 2015 (Nasional)\r\n-	TOP 50 Jamtrack Central Guitar Competition 2015 (Internasional)\r\n-	2nd Winner Hari Hari Music Shred Guitar Competition 2017 (Nasional)\r\n-	Visit my Youtube Channel for further references (http://www.youtube.com/user/ivanxmahya ) \r\n\r\nANDRI DHARMA (VOCALIST)\r\n-	Opening Concert Triad  Padang Yamaha Stage 2010\r\n-	GuessStar Yamaha Dari tahun 2010 sampai 2015\r\n-	Opening Concert Anji 2013 Teluk Kuantan Riau\r\n-	Opening Concert Rif soundrenaline 2015\r\n-	The Best Vokal Festival Band Se-Sumbar piala Dinas Kebudayaan dan Parawisata Pasaman tahun 2015/2016\r\n-	Top 2 Online Audition Rising Star 2014\r\n-	Juri Festival band indie/solo Song Dll\r\n-	Pencipta Lagu dan Arranger\r\n-	Instruktur Vokal dan Musik di SMA N 6 PADANG dan SMA N 1 Sitiung Kabupaten Dharmasraya \r\n-	Utusan Sumbar Dalam Acara Gita Permata Nusantara Di TMII 2015/2016 Jakarta\r\n\r\nIBNU ALDIAN ( BASS PLAYER) \r\n-	The Best Bass Player Next Level Pensi Fair Global TV 2016\r\n-	2. Brand Ambassador ExtraJoss Blend 2016 - 2017\r\n-	3. Artist (Bass Player) iklan Extrajoss Blend Next Level\r\n-	4. Juri Festival Band Indie, Akustik, dll\r\n-	5. Session Player (Bass) untuk Band Pembuka Artis\r\n\r\nFUADI ARMAN (DRUMMER) :\r\n-	Peserta pesta gendang di malaka\r\n-	Sesion player drum orchestra isi padang panjang\r\n-	Sesion player drum di acara asean jazz with M.Halim @batam\r\n-	Sesion player drum with minangapentagong @sawah lunto internasional music festival\r\n-	Peserta indonesian drum and percussion @bentara budaya jakarta with indojati\r\n-	Sesion player drum di acara final hardrock rising star @bali with A gift from anita band\r\n-	Instruktur drum @GRSB padang dan PURWACARAKA padang\r\n-	Sesion drum player pengiring konser artis di padang alex rudiart,ressa herrlambang,nita thalia,iis dahlia \r\n\r\nASEP IMAN PERMANA (KEYBOARDIST)\r\n\r\n-	Session Player \r\n-	Arranger\r\n-	 Best Keyboardist\r\n-       Artist Home Band\r\n-       Piano/Keyboard Teacher at GRSB','Alternative Rock','guitar_plus;poster;teman;lainnya;','Medan',593,'2017-08-27 17:48:07','2017-08-27 17:48:07'),
	(394,'Mahesh','1503864841.jpg','Mahesh merupakan plesetan nama dari nama awal Mahesa. Mahesa terbentuk pertengahan 2014 ketika sekumpulan mahasiswa tingkat akhir di Unsoed Purwokerto mengikuti audisi sebuah acara kampus bertajuk Dentistry Perforation. Acara tersebut memberikan kesempatan kepada band yang lolos audisi untuk tampil sebagai opening band special guest star. Saat itu, Sheila on 7 menjadi special guest star. Mahesa berhasil lolos audisi menjadi satu dari tiga band yang tampil untuk opening band Sheila on 7. \r\n\r\nPasca acara Dentistry Perforation, Mahesa sempat vakum 6 bulan karena masing-masing personil kembali disibukkan oleh tugas akhir perkuliahan. Dua personil utama Mahesh yakni Panji dan Haidar berinisiatif untuk mulai kumpul untuk jamming dan membuat materi lagu. Kebetulan pula Haidar sudah punya satu materi lagu yang saat itu baru liriknya saja. Setelah beberapa kali jamming unplugged, jadilah lagu pertama Mahesa yaitu Udara. \r\n\r\nAkhir 2015, Mahesa meminta bantuan seorang kawan yang bernama Ridho untuk membuat live session lagu Udara. Kebetulan pula Ridho sedang menggarap rintisan project video live bernama Rid\'s Creative. \r\n\r\nSelepas live session Udara, Haidar ingin lepas dari bayang-bayang Mahesa yang tampil di Dentistry Perforation. Akhirnya nama Mahesh lah yang dipilih. Panji dan Haidar mulai menyicil beberapa materi lagu untuk tabungan rekaman yang nantinya bisa digarap setelah lulus. Munculah beberapa lagu yang terinspirasi dari kehidupan sehari-hari Panji dan Haidar seperti, Pagi, Awan, Kantin, Kipas, hingga Lagu Dini Hari. Selain itu Mahesh menyiapkan lagu berlirik bahasa Inggris seperti Save Heart dan Bad Value.\r\n\r\nJamming hanya berdua membuat Mahesh membutuhkan tambahan sound rhytm yang lebih padat lagi untuk aransemen lagu-lagu setelah udara. Dimas sebagai gitaris semasa Panji SMA pun direkrut sebagai gitaris utama. Dimas pun menyumbang materi lagu yang juga terinspirasi dari kehidupan sehari-hari berjudul Ku Akan Pulang.\r\n\r\nPasca lulus kuliah hingga kini, Mahesh masih merutinkan latihan untuk mematangkan aransemen lagu-lagu persiapan untuk album debut.','Pop','maliq;','Jakarta',222,'2017-08-27 19:14:01','2017-08-27 19:14:01'),
