	(399,'SYAHINSOMNIA','1503900862.jpg','Sebuah band yang berasal dari Tangerang. Nama SYAHINSOMNIA di ambil dari salah satu personil sang vocalis arti dari nama kepanjangannya AndianSyah dan ditambahkan Insomnia yg arti nya Tidak bisa tidur / Tidak pernah tidur cepat. Selalu bermain musik dan menulis lagu setiap malam. Di sisi lain Syahinsomnia pun mempunyai arti dan makna tersendiri yaitu , kita ingin mencoba mewarnai musik Indonesia / nasional. Tidak jauh dari kata Insom , Syahinsomnia bergenre NEO POP AND JAZZ , dengan mengusung Konsep yg agak sedikit berbeda . Tapi orang2 bilang musik kita lebih menonjol ke Jazz :D SYAHINSOMNIA Terbentuk pada pertengahan tahun yaitu bulan Juli 2016 , dan hingga saat ini Syahinsomnia memiliki 5 Pemuda yg keren dan Gagah : 1. Kudill - Vocal 2. Hadi Godil - Guitar / back vocal 3. Aceng - Lead Guitar 4. Shiba - Bassist 5. Timbil - Drum Dan kami baru saja merelease sebuah Single pertama yaitu \' Kan Ku Jaga \' Sudah tersedia di Digital Store Music! Kalian bisa streaming di Apple music, Joox, Spotify, Dezeer etc! Semoga kita bisa manggung sekaligus dapat bonus jajan:D Di kota-kota lain, seperti NASIONAL bahkan INTERNASIONAL','Jazz','facebook;instagram;teman;lainnya;','Jakarta',787,'2017-08-28 05:14:22','2017-08-28 05:14:22'),
	(400,'Egg Eyes Cow (E.E.C.)','1503901209.JPG','Terbentuk di sebuah cafe di Denpasar, Bali pada tahun 2009. Dimotori oleh Sayang (vocal), bersama ketiga personil lainnya pun sepakat membentuk band dengan nama Egg Eyes Cow dengan cita-cita menjadi band major label yang bisa mewarnai dunia musik Indonesia. Pada pertengahan tahun 2009, E.E.C. mulai rekaman di studio home recording milik seorang teman, dan berhasil merampungkan 6 lagu. Pada tahun 2009 juga, E.E.C. berhasil tampil pada segmen band Indie yang diadakan oleh Blue Eyes Cafe, Bali. Sayangnya, pada bulan September 2009, Indra (gitar) harus bekerja di luar pulau Bali, sehingga E.E.C. vakum untuk sementara. Pada kisaran tahun 2010-2011 ditengah kesibukan masing-masing personil band, E.E.C. berhasil membuat 2 video klip amatir. Pada tahun 2012, Wahyu (drum) melanjutkan pendidikan ke jenjang S2 di Semarang, sehingga E.E.C. benar-benar vakum total. Pada akhir tahun 2015, Indra (gitar) dan Wahyu (drum) sudah kembali berdomisili di Bali, dan keempat personil asli E.E.C. sepakat untuk kembali melanjutkan passion dalam bermusik bersama.','Pop','guitar_plus;','Surabaya',780,'2017-08-28 05:20:09','2017-08-28 05:20:09'),
	(401,'Jendela Kamar','1503906233.jpg','kita baru saja terbentuk dan mulai awal nya sering ketemu reguleran di cafe2.\r\ndan berencana membentuk band dan mencoba memberanikan diri untuk membuat karya\r\ndan membuat nama band nya jendela kamar :]','Pop','instagram;guitar_plus;','Medan',788,'2017-08-28 06:43:53','2017-08-28 06:43:53'),
	(402,'Forme!','1503908286.png','Terlahir di kota pelajar Yogyakarta pada tahun 2012,\r\nForme! adalah sebuah grup musik beraliran pop-blues yang mencoba\r\nmenunjukkan penampilan terbaik untuk setiap panggungnya.\r\nSuara khas sang vokalis (Zaky), berpadu dengan gitaris (Taufik),\r\nbassis (Dana), keyboard (Yudis) dan drummer (Yosi) yang telah malang\r\nmelintang di dunia musik Yogyakarta mampu memberikan suguhan\r\nsegar dengan menggabungkan musik pop-blues dari mulai lagu dengan\r\ntempo rendah hingga tinggi dengan referensi musik dari musisi dalam\r\ndan luar negeri seperti John Mayer, Jason Mraz, BB King, Jimi Hendrix,\r\nStevie Ray Vaughan, Gugun Blues Shelter, Ginda and The White Flowers\r\ndan beberapa musisi lainnya.\r\n\r\nLive Performance:\r\n2016\r\nNgamal Kuy, Kuy Creative, Ex-Matchamu Pogung, Yogyakarta\r\nTottaly Blues, Rock \'N Real, Terrace Cafe and Karaoke Yogyakarta\r\n\r\n2015\r\n“Fesbuker 2015”, Universitas Islam Indonesia.\r\n“Jambore Siaran Nasional IV”, Radio Republik Indonesia,\r\nMuseum Vredeburg, Yogyakarta.\r\n“Seger-segeran Sansekerta 2015” Fakultas Pertanian UGM\r\n“Jazz Mben Senen, Bentara Budaya, Yogyakarta.\r\n“Chareaty Analog Coffee Barz X Meat & Great”\r\n“Inagurasi Mahasiswa Baru Fisip” Universitas Atma Jaya\r\nYogyakarta.\r\n“Gelanggang Expo 2015” Universitas Gadjah Mada.\r\n“Business Festival 2015” Universitas Kristen Duta Wacana.\r\n“Employement Gathering Bank Indonesia Purwokerto”,\r\nQueen of The South Beach Resort, Yogyakarta.\r\n\r\n2014\r\nPameran Keramik “Vacuum Learning” ,Bentara Budaya\r\n“USAID Disaster conference, Yogyakarta\r\nWelcoming Dinner “LBD 5,” BNI Foodpark\r\nHalal bi halal PT MIROTA KSM 2014\r\n“Festival Museum” Pendopo Taman Siswa\r\nPengisi Acara“Farewell Party” IUP FEB UGM at Dafam Hotel\r\nClosing Party “Looking Beyond Disaster 5” Grand Aston,\r\n\r\n2013\r\nNew Year Party, Kalimilk Seturan\r\n“Sarasehan” Budaya Papua Barat, Purna Budaya UGM\r\nMIPA Charity Concert Fakultas MIPA UGM\r\nLooking Beyond Disaster Charity Concert, UGM\r\nMalam minggu at KFC”, KFC Soedirman\r\nEarth Hour event, 2013\r\n“Go Shopping” Balai Utari Wanitatama\r\nHarmony #3 Bazaar & Garage Sale, Balai Utari Wanitatama\r\nISAP 2013, Yogyakarta\r\n\r\nContact Info :\r\nEmail : itsformeofficial@gmail.com\r\nPhone : +62 852 6893 4359 (Dana)\r\nInstagram : @itsformeofficial\r\nFacebook : facebook.com/itsformeofficial\r\nSoundcloud : itsformeofficial\r\nTwitter : formeofficial\r\nYoutube : Forme Official\r\nReverbnation : reverbnation.com/formeofficial','Blues','instagram;guitar_plus;teman;','Yogyakarta',740,'2017-08-28 07:18:06','2017-08-28 07:18:06'),
	(403,'Fialova','1503912098.jpg','Fialova merupakan Sebuah Band beraliran pop alternative. Dibuat mengikuti idealisme para personilnya yang ingin agar karyanya masuk dalam industri musik komersil. Sebelumnya para personil Fialova merupakan anggota dari Band Columbus Reborn yang sudah menelurkan satu album dan berkolaborasi dengan musisi musisi nasional.','Pop','umi;teman;','Jakarta',792,'2017-08-28 08:21:38','2017-08-28 08:21:38'),
	(404,'COSMOGONY','1503916474.JPG','Cosmogony adalah sebuah band pop punk/Punk rock/ alternative yang dibentuk di Palu, Sulawesi Tengah, pada tahun 2013. Band Beranggotakan Oki (drum), Iwin (bass/vox) dan yoga (gitar/vox) Saat ini sudah merilis EP Album yang bertajuk ‘NYATA’ yang berisikan 6 buah lagu yang direkam di sebuah studio di Palu yang bernama Velo record.\r\n\r\nSejarah terbentuknya band ini berawal dari perkenalan oki dan yoga yang kebetulan bersekolah di sekolah yang sama, yang kemudian memutuskan untuk memulai sebuah band.\r\n\r\nTidak ingin menjadi duo racun, oki dan yoga mencari seseorang yang pas untuk mengisi posisi bass/vox. Setelah melalui masa PDKT yang cukup lama, akhirnya agung resmi mengisi posisi bass/vox. Pada hari itu setelah solat jum’at band ini resmi terbentuk dengan nama Cosmogony dan perjalanan pun dimulai.\r\n\r\nPenampilan pertama Cosmogony yaitu pada Festival Teluk Palu dan cosmogony terus menjajal gigs-gigs local yang ada di kota palu, hingga akhirnya Cosmogony memutuskan untuk merekam single pertama mereka yang berjudul ‘Terdiam dan Terbakar’. Tidak lama setelah merilis single tersebut Posisi bass/vox yang sebelumnya di isi oleh agung harus di gantikan oleh Irwin Zaenong. Masuknya Iwin kedalam formasi band ternyata membawa angin segar untuk Cosmogony. Tidak butuh waktu lama untuk penyesuaian setelah pergantian personil Cosmogony merilis debut EP album pertama yang bertajuk ‘NYATA’ , ini menjadi bukti keseriusan dan totalitas Cosmogony sebagai sebuah band yang berkarya di jalur independen.\r\n\r\nSaat ini Cosmogony sedang dalam proses pengerjaaan Album terbaru yang bertajuk ‘HIBERNASI’ yang baru saja di rilis tepat pada tanggal 24 April 2017.','Others','teman;','Jakarta',794,'2017-08-28 09:34:34','2017-08-28 09:34:34'),
	(405,'Cosmo','1503918815.jpg','terbentuk tahun 2010 di sulawesi selatan, dan telah beberapa kali berganti personil membuat robi vokalis Cosmo tetap yakin bahwa musik Cosmo bisa diterima oleh penikmat musik tanah air. Dengan formasi sekarang kami berharap dengan adanya levis band hunt ini bisa menjadi salah satu jalan Musik Cosmo agar sampai ketelinga penikmat musik Indonesia.','Pop','facebook;maliq;','Jakarta',723,'2017-08-28 10:13:35','2017-08-28 10:13:35'),
	(406,'Larina','1503918909.jpg','Menjadi 15 Besar Finalis Indonesian Sound Festival 2015','Pop','teman;','Jakarta',795,'2017-08-28 10:15:09','2017-08-28 10:15:09'),
	(407,'April Lost Marrie','1503919067.jpg','APRIL LOST MARRIE adalah band metalcore dari Yogyakarta yang terbentuk pada tanggal 4 april 2011. Awal mula band ini merupakan gagasan dari Yayas (vokal) dan Joe (gitar) untukmembuat sebuah band dengan genre post-hardcore. Kemudian mereka berdua mengajak Rinenggar (gitar), Terra (bass) dan Ressa (drum) untuk bergabung dengan band. Seiring berjalannya waktu pada awal tahun 2015 member band ini mulai keluar satu persatu meninggalkan band karena kesibukan masing-masing. Setelah sempat vakum beberapa bulan akhirnya pada awal tahun 2016 Yayas mulai membangkitkan lagi April Lost Marrie dengan mengajak Ajik (gitar), Fanda (drum), Yuga (bass) untuk bergabung dengan band dan merubah genre band menjadi metalcore.','Others','teman;','Yogyakarta',769,'2017-08-28 10:17:47','2017-08-28 10:17:47'),
	(408,'STICK UP','1503919155.jpg','Stick up berasal dari kota tasikmalaya pada tahun 2013\r\nSetick up terdiri dari 5 orang personil dengan posisi :\r\nAdut : gitar\r\nDena : vocal\r\nLukman : bass\r\nRaufik : gitar\r\nAngga : drum\r\nStick up beraliran pop punk / alternatif rock. \r\nPrestasi :\r\n- Juara 3 di tasikmalaya motekart pestival pada tahun 2015\r\n- juara 1 di pro mild protections musik pestival pada tahun 2016\r\n- juara 3 di festival music instinct pada tahun 2016','Alternative Rock','guitar_plus;','Jakarta',600,'2017-08-28 10:19:15','2017-08-28 10:19:15'),
	(409,'The Good Listener','1503919572.jpg','The Good Listener lahir pada tanggal 24 April 2011 di Yogyakarta. Sampai saat ini kami memiliki mini album bertajuk \"Partikel Emosi\" berisi 5 lagu yang telah di launching pada tahun 2013.','Rock','poster;teman;','Yogyakarta',742,'2017-08-28 10:26:12','2017-08-28 10:26:12'),
	(410,'Defodio Band','1503920038.jpg','Defodio Band terbentuk dari Kumpulan UKM Band Bina Nusantara yang bergenre Rock, yang terinspirasi dari black sabbath, iron maiden, gun n roses, led zeppelin, dan Band rock dunia lainnya. Band kami pernah Lolos audisi B-Voice Anniversary yang bintang tamunya Maliq & D\' essential, Teddy Aditya, dan Lain-lain. Kami pernah nge-gigs di rockgasm supermusic id, manggung di acara B-Fest (Binus Festival Band) Raise your sound, dan acara band lainnya. Kami mempunyai album yang berjudul \" Sanity \" tapi baru 3 lagu yang sudah di record.','Rock','instagram;teman;','Jakarta',790,'2017-08-28 10:33:58','2017-08-28 10:33:58'),
	(411,'Backspace','1503925163.jpg','Backspace adalah band punk asal kota medan yang terbentuk pada Desember 2016 yang beranggotakan 3 orang dan 1 orang additional. Sejauh ini Backspace sudah mengeluarkan 4 single yaitu \"All Goes Down,\"Screaming To The World\",\"Tanpa Kata\", dan \"Walking\" yang sudah bisa di dapatkan di berbagai platform seperti iTunes, Spotify, Youtube, dan lainnya. @Officialbackspace adalah username Backspace di Youtube dan Instagram. Backspace berencana mengeluarkan Album yg berisi 9 lagu (termasuk 4 lagu diatas) di akhir tahun ini.','Others','teman;','Medan',801,'2017-08-28 11:59:23','2017-08-28 11:59:23'),
	(412,'RocBuc','1503926122.jpg','Terbentuk awal tahun 2016.','Others','facebook;instagram;teman;lainnya;','Yogyakarta',803,'2017-08-28 12:15:22','2017-08-28 12:15:22'),
	(413,'Fill Me Out','1503926733.JPG','Hello, we are Fill Me Out a pop punk band from south jakarta, kita terdiri dari 4 orang personil, band ini terbentuk 2 tahun yang lalu yang ber influance terhadap All Time Low dan pee wee gaskins. prestasi yang sudah kita sudah capai antara lain : \r\n1. kita sudah mempunyai album yang berisi 7 lagu dan sudah bisa didengar di spotify, i tunes music, youtube dan soundcloud.\r\n2. kita sudah launching album kita di JK7 kemang pada tanggal 31 maret 2017.\r\n3. kita sudah bermain di berbagai tempat dan acara besar nya antara lain jakcloth, rolling stone, dan acara tahunan BPJS, dan bermain di warner music indonesia sebagai guest star,  All Time Low  tribute yang diselenggarakan oleh All Time Low Indonesia.\r\n4. salah satu gitaris kami lolos dalam audisi peavey gitar show down.\r\n5. kita sering bermain di berbagai acara musik kampus sebagai spesial performance.','Others','instagram;guitar_plus;','Jakarta',802,'2017-08-28 12:25:33','2017-08-28 12:25:33'),
	(414,'Nitya Band','1503929097.JPG','Nitya band, terbentuk pada 09-November-2015\r\nmemulai karir bermusik dengan mengikuti festival accoustic local di bali, dan sampan menjuarai ( Juara 1 ) festival band di Bali pada Maret 2016 lalu, hingga sini Nitya sudah memiliki 5 buah lagu yg sudah bisa di dengarkan di Soundcloud , Youtube dan media lain nya, mempunyai satu video klip yg berjudul Harapan. Nitya memiliki hingga kini memiliki 5 personil diantarnaya, MellyNia ( Vocal ) Gustraa ( Melody) Ariana ( Rhythm) Ferdinand ( Bass ) Dedha ( Cajon ). Nitya sempat mengukuti roadshow di beberapa kota di Bali ada bulan September 2016 lalu. Berjalan telama hempir 2 tabun dan aktif dalam kegiatan musik di bali, mengisi acara di beberapa event besar di kota Denpasar, sempat di undang undang di stasiun radio swasta di bali dan di liput oleh salah satu media cetak. Sekian perkenalan dari Nitya band, maaf jika ada kata-kata yang kurang berkenan. Terima Kasih.','Others','facebook;instagram;teman;lainnya;','Surabaya',806,'2017-08-28 13:04:57','2017-08-28 13:04:57'),
	(415,'afif and friend','1503930635.JPG','lagu tentang persahabatan lagu sudah sangat tenar di sulawesi selatan asal dari makassar','Pop','facebook;instagram;informasi_toko;','Yogyakarta',808,'2017-08-28 13:30:35','2017-08-28 13:30:35'),
	(416,'GVM. (GIVE ME SOME ADVICE)','1503933245.jpg','GVM. (Alternative Pop/Rock) terbentuk pada tahun 2009 di Jepara, Nama GVM berasal dari “Give Me Some Advice” yang berarti “Beri Aku Nasihat” Supaya lebih mudah diingat, kemdian band ini dinamakan GVM. Filosofinya adalah GVM. Ingin terus berkembang melalui nasehat/saran dari pendengarnya. Band ini beranggotakan 5 personil yaitu Bryan, Dhimas, Alfian, Andra, dan Bowok. Namun di akhir tahun 2016 Bryan (Vokal) pergi ke Australia untuk urusan pekerjaan kemudian posisi Vokal dirangkap oleh Dhimas (Gitar, Vokal). Tahun 2011 GVM. Merilis single “Jangan Berhenti” dan “Guilty Of” di tahun 2013. Kemudian pada tahun 2015 GVM. Mulai produksi Extended Play yang bertajuk “2015” dengan enam lagu dan di launch pada 25 February di Stasiun TV lokal “Semarang TV”.','Alternative Rock','instagram;teman;','Yogyakarta',652,'2017-08-28 14:14:05','2017-08-28 14:14:05'),
	(417,'Enzil','1503934658.jpg','Enzil berasal dari bahasa Belanda yang artinya Satu Jiwa, kami terdiri dari 4 personil dan 1 additional player, kami sering mengikuti festival festival musik di jakarta, sampai akhirnya kami berhasil menjadi runner up di salah satu festival musik tersebut','Others','guitar_plus;','Jakarta',719,'2017-08-28 14:37:38','2017-08-28 14:37:38'),
	(418,'Sakarat getih','1503935276.jpg','Kami terlahir sebagai masyarakat biasa dsri satu kampung kecil di garut, kami yg sama sama hobi akan musik ingin mengembangkan kemampuan kami, berharap bisa di sukai dan d terima di masyarakat','Heavy Metal','facebook;instagram;','Jakarta',811,'2017-08-28 14:47:56','2017-08-28 14:47:56'),
	(419,'Muco Gusto','1503936678.jpg','Berawal dari satu tongkrongan di Institusi musik bilangan Jakarta, Singkatnya Muco Gusto terbentuk pada 15 Januari 2012 yang berasal dari Jakarta Timur.\r\nMuco Gusto diambil dari bahasa Spanyol yang memiliki arti \"Senang berkenalan dengan anda\" dan semoga dari nama itu, Muco Gusto bisa menyuguhkan musik yang menyenangkan di hati para pendengar.\r\nMuco Gusto mengusung genre Rock Alternative, yang diisi oleh Gema (vocals) Willy (Bass) Putra (Guitars) Yosi (drums).\r\nTelah mengeluarkan 2 single yang berjudul ANJING BESAR & MATI SURI DI KERAMAIAN, yang juga sudah bisa dinikmati di gerai musik digital; Spotify, iTunes, Apple Music, dll. \r\nDan untuk Mati Suri di Keramaian, Muco Gusto juga sudah merilis Official Music Video di kanal YouTube \"mucogustoband\". \r\nMati Suri di Keramaian juga dijadikan sebagai OST. \"Saksi Jingga\", untuk Festival film pendek independent di Jepang & Korea. \r\nMati Suri di Keramaian juga masuk 10 besar finalis Digilive Band Festival yang diadakan di Guitar Freaks, Jakarta.\r\nTahun ini Muco  Gusto sudah merampungkan materi-materi untuk full album yang betajuk, \"CATATAN\" yang akan segera dirilis.\r\n\r\nBerbagai panggung dalam kota maupun luar kota sudah mulai kita sambangi. Diantara lain;\r\n- Live at IMI SOCA Hall, Senior Recital.\r\n- Live at DeHoii, Pondok Indah, Jakarta Selatan.\r\n- 4Ever Indie, at JK7 Bar&Club, Jakarta Selatan.\r\n- 5 besar finalis Digilive Band Fest 2016.\r\n- Jakarta Creative Week, Kokas 2016.\r\n- Boys Market, Gandaria City 2016.\r\n- Fusion Jungle, Rolling Stone Cafe, Jakarta.\r\n- Bandung Creative Week, TSM, Bandung 2016.\r\n- Fisip Folk Fest, UNPAD, Jatinangor 2016.\r\n- Pucuk Cool Jam SMAN 112, Jakarta Barat.\r\n- Konser 1000 Band, Ice BSD Tangerang.\r\n- DCDC Shoutout, Global TV.\r\n- Radionet Show, Binus TV.\r\n- 8th Himmarcomm Anniversary, Binus 2016.\r\n- Rocket 88 Faceless at XabiSpace, JakSel.\r\n- Pamulang Festival 2016\r\n- Show Case at Dreamers Radio\r\n- Show Case at Pavilliun 28.\r\n- Kulfaspro 2016, Medan, Sumatera Utara.','Alternative Rock','guitar_plus;','Jakarta',553,'2017-08-28 15:11:18','2017-08-28 15:11:18'),
	(420,'Senandung','1503936888.JPG','Berawal dari sering ngumpul bareng akhir nya 5 pemuda tanah daeng membentuk Senandung mengusung tema pop jazz senandung berusaha agar bisa mendapatkan kesempatan diajang levis band hunt','Jazz','instagram;','Surabaya',322,'2017-08-28 15:14:48','2017-08-28 15:14:48'),
	(421,'HALIMUN','1503937423.JPG','Unit Punk / Rock Alternative yang berlokasi di Bogor, Jawa Barat bagian selatan, beranggotakan 4 orang. Berdiri tahun 2012 dengan nama HEROES OF OVER. Sempat merilis mini album (EP) di tahun 2015 yang berisi 4 track.\r\nDan akhir tahun 2016 menyisakan 3 personil, kemudian memutuskan merubah nama menjadi HALIMUN.','Rock','guitar_plus;','Jakarta',441,'2017-08-28 15:23:43','2017-08-28 15:23:43'),
	(422,'ONE NIGHT IN ALCATRAZ','1503937458.jpg','ONE NIGHT IN ALCATRAZ (ONIA)\r\nInstagram: @onia_rawk\r\nfacebook.com/onenightinalcatraz\r\n---\r\nBand yang mengusung musik Alternative Rock, spesifik pendekatan lebih kepada grunge. Mengusung musik grunge yang anti-vandal, emosional yang elegan, dengan nuansa sound modern dan lirik yang intens pada tema keseharian manusia dalam rumitnya proses interaksi sosial. Kami biasanya menyebut ini sebagai aliran \"Dark Pop Raw Rock\". Mengajak untuk melawan lemah, penguatan karakter diri dan berani meMANUSIAkan manusia. Menjadikan musik sebagai media pengantar pesan dan menyampaikan gagasan melalui getir syair syatir.\r\n---\r\nKami banyak main di gigs lokal komunitas maupun berbagai event musik lintas genre.  Sering pula terlibat pada event bernuansa humanisme dan charity. Sedikit cerita, kami tumbuh dalam lingkup sederhana dengan banyak keresahan yang menjadi amunisi dalam memproduksi karya ke ranah nyata :)','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',812,'2017-08-28 15:24:18','2017-08-28 15:24:18'),
	(423,'Basih','1503938176.jpg','Basih berdiri tahun 2004 pada waktu itu bernama dimensi, kemudian tahun 2017 berganti nama menjadi Basih.\r\nPrestasi :\r\n1. Juara 1 festival band se karasidenan banyumas STAIN Purwokerto tahun 2006.\r\n2. Juara 1 Festival band laskar independent tahun 2011 Purbalingga.\r\n3. Juara 1 festival band Pringgading jengkar Purbalingga, tahun 2011.\r\n4. Juara 2 festival band Malibu entertaintment tahun 2011 taman kota Purbalingga.\r\n5. dan lain - lain','Rock','guitar_plus;','Yogyakarta',813,'2017-08-28 15:36:16','2017-08-28 15:36:16'),
	(424,'THE BUNGSU','1503938376.jpg','THE BUNGSU ( Japanese Pop )\r\n\r\nSebuah band yang terbentuk tanggal 10 oktober 2005, Kami membentuk band ini dengan ambisi besar, memberikan warna baru di blantika musik Indonesia. Menjadi inspirator menghasilkan gabungan kata dan nada yang harmonis dengan ciri khas di telinga penndengar.\r\n\r\nSesuatu yang baru lahir dari band baru, dan akan menjadi nuansa baru, sehingga menjadi harapan baru.\r\n\r\n“The Bungsu” mempunyai kesamaan visi dan misi dalam bermusik dengan Japanese pop. Namun demi memuaskan penggemar musik, khususnya kaula muda yang dinamis dan progresif. Dan dengan tanpa meniggalkan ciri khas, serta idealisme kami, segala warna musik konsumsi anak muda dan penikmat musik\r\n\r\nTetap sederhana dalam bermusik namun cermat dalam mengikuti atmosfir musik Indonesia dan akan menjadi trendsetter di kalangan muda adalah paradigma kami, kebersamaan adalah pondasi kami, persahabatan adalah tujuan kami para personil “The Bungsu”.','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;','Jakarta',585,'2017-08-28 15:39:37','2017-08-28 15:39:37'),
