	(430,'Jakasonic','1503943712.JPG','Jakasonic band yang terlahir tahun 2017\r\nsebelumnya vokalis jakasonic (katon) merupakan vokalis dari band kolken, pernah ikut konser 1000 band. terakhir manggung kemarin di thamrin city mall hari minggu 27-07-2017','Alternative Rock','facebook;instagram;teman;','Jakarta',514,'2017-08-28 17:08:32','2017-08-28 17:08:32'),
	(431,'CRY-ON','1503944418.jpg','CRY-ON merupakan sebuah band Britpop Alternative Techno yang terbentuk 15 Januari tahun 2011, awalnya kami teridiri dari empat personil tetapi karena dengan berbagai kisah perjalanan akhirnya kami memutuskan untuk melakukan pergerakan band ini dengan dua personil, yaitu Black (Guitar dan Sequencer) dan Nyouw (Midipad dan Vocal).\r\nPada pergerakan awal, kami telah menyelesaikan satu album yang berjudul “BERAWAL DARI”. Album ini direlease secara digital dan gratis, bisa didownload di akun Reverbnation serta Souncloud kami. Pada pergerakan selanjutnya CRY-ON merilis album kedua yang berjudul “ANKH”. Album “ANKH” ini menceritakan tentang semua masalah kehidupan, bukan hanya cinta tapi hidup bercerita tentang manusia dan penciptanya, manusia dengan sesamanya dan manusia dengan dirinya sendiri. “ANKH” adalah simbol dari mesir kuno yang berbentuk kunci, artinya setiap kehidupan kita sebenanya hanya menyelesaikan masalah dan itu adalah tugas kita untuk hidup. Pada album kedua ini, kami mendistribusikan tidak hanya berupa album digital, tetapi diproduksi dalam bentuk fisik.\r\n\r\nPendistribusian untuk album kedua dikemas dalam bentuk boxset yang terdiri dari CD dan juga merchandise. Dalam pendistribusian album kedua ini, kami merambah pasar indie kebeberapa kota tidak hanya di Jawa Timur saja melainkan ke Jawa tengah dan Bali. Pengalaman kami selama lima tahun terakhir ini telah memberikan banyak pengalaman yaitu ,\r\n1. The Best Peform Parade Band Indie di Radar Jember dan Kolektif Indie Group Jember (FINGER) tahun 2012;\r\n2. The Best Perform Festival Cipta Lagu hari AIDS sedunia se-Nasional yang diadakan oleh Universitas Negeri Jember lagu yang berjudul “BERJALAN” tahun 2013;\r\n3. Road To Soundrenaline di Surabaya pada tahun 2014;\r\n4. Jember Indie Cloth pada tahun 2015 - 2016 ;\r\n5. Jember Fashion Carnival Music Exibition di Alun-Alun Jember pada tahun 2015-2016;\r\n6. Launching 2nd Album Cry-On “ANKH” pada tahun 2016;\r\n7.Jakcloth goes to Jember 2017\r\n8. Dan event gigs lainnya menjadi Guest Star dibeberapa tempat di Kota','Alternative Rock','facebook;instagram;teman;lainnya;','Surabaya',817,'2017-08-28 17:20:18','2017-08-28 17:20:18'),
	(432,'A R P','1503963643.jpg','ARP is an Indonesian Rock Band originated from Jakarta City. The group consists of Ardika as lead vocal & guitarist, Ivan as rapper and Naufal as drummer. The band formed by Ardika in 2012 named ARP Project. ARP project had a unique concept. It was only had one personnel as songwriter and guitarist. Those positions were filled by Ardika himself and the other positions were filled by additional players. Their first single released on August 2012 titled \"Hilang\" and air-played in Radio Republik Indonesia (RRI) by RRI\'s radio broadcaster - Fajar Pramana Putra. The song was reaching number one in RRI Indie Chart for 5 months. Before Ardika formed ARP Project, he was the guitarist of 3 bands; POLYCHROMATIC was his first band on High School, the single was air-played on Sunset Island Music Online Radio on the USA and the other band is NEON. But the bands was taking their break because of personnel’s other business. On 2017, Ardika met Ivan and Naufal. They committed to make a new project leaded by Ardika also and the already released their first single named “Ran”','Rock','teman;','Jakarta',269,'2017-08-28 22:40:43','2017-08-28 22:40:43'),
