	(435,'Dupsivision','1503990060.jpg','-Juara 3 dan Best Bassist Lomba Band \"ESCALADES REVINESIA\" 2014 SMAK 5 BPK Penabur\r\n-Juara 3 dan Best Bassist, Lomba Band \"JUKEBOX 2014\" SMAK 1 BPK Penabur\r\n-Juara 2 Sound of School Band Competition \"REGENERATION\" Hai! Day 2014 (Kalo nggak salah ada yg dapet best disini)\r\n-1st Winner, Best Bassist, Best Drummer, Best Keyboardist at Band Competition \"VIBE 2014\" SPH Sentul City\r\n-Juara 2 Band Competition Provoke! Day 2014 at Gandaria City\r\n-Juara 1 Sound of School Band Competition Hai! Day 2015\r\n-Juara 2, Best Bassist, Best Guitarist, Best Drummer, Best Keyboardist Lomba Band \"TWENTY 2015\" SMAK 1 BPK Penabur','Jazz','guitar_plus;poster;','Jakarta',783,'2017-08-29 06:01:00','2017-08-29 06:01:00'),
	(436,'Arya novanda Band','1503990758.jpg','featuring bersama kelompok penerbang roket di padang, surabaya (2016) dan\r\njakarta pada awal 2017 (arya sebagai additional menggantikan rey gitaris\r\nKPR yang berhalangan pada saat itu),\r\n\r\n Rising blues group Jazz n Blues Club 2016,\r\n\r\nArya Gitaris blues termuda yang dikatakan memiliki soul ter langka no.3 di\r\nIndonesia oleh legenda blues Rama Satria Claproth\r\n\r\nArya Novanda diakui memiliki skill sangat bagus dan masa depan cerah oleh\r\nmusisi blues idolanya Gugun dari Gugun Blues Shelter yang telah melewati\r\nmasa lalu seperti yang Arya alami sekarang..(perjuangan)','Blues','poster;','Jakarta',836,'2017-08-29 06:12:38','2017-08-29 06:12:38'),
	(437,'Every Brains','1503994470.jpg','Every Brains adalah band Rock asal Jakarta yang terbentuk sejak 2009. Nama Every Brains sendiri berarti \"Setiap Otak\" kami pilih sebagai nama band ini, karena setiap karya yang diciptakan berasal dari pemikiran masing - masing dari personil. Dan kami memiliki misi untuk membangkitkan kembali musik rock di Indonesia.\r\nUntuk prestassi sendiri sudah banyak acara yang kami isi untuk menghibur pecinta musik di Jakarta.','Rock','instagram;','Jakarta',835,'2017-08-29 07:14:30','2017-08-29 07:14:30'),
