	(439,'Scenario','1503999444.jpg','20 april 2016 dari sudut utara kota yogyakarta tersebutlah satu nama \"SCENARIO\". buah pikiran dari Aji (vocal),Aik (gitar),Fx.Septian (bass),Aditya (Drum) untuk membangun suatu wadah menularkan berbagai macam pikiran. menumpahkan berbagai macam keresahan  kemudian dirangkai menjadi satu tujuan kedalam musik. merangkai setiap kejadian yang terjadi di kehidupan lalu disusun dalam rangkaian cerita yang diinginkan dan dibutuhkan semua pendengar adalah alasan dibalik nama scenario. dalam setiap karyanya scenario mencoba melihat sesuatu dari sudut pandang yang berbeda dari kebanyakan orang. lirik yang ditulis bersifat puitis dengan diksi-diksi yang unik. tema lagu yang dibawakan bercerita tentang kemanusiaan,isu lingkungan dan cinta. dengan sentuhan sound yang syahdu mencoba membawa pendengar berkhayal menuju imajinasinya.\r\nPrestasi\r\n1.Opening act ADERA (accountingphoria Univ.Sanata Dharma)\r\n2.Finalis boshe vvip club band competition with Rocket Rockers\r\n3.Live recording Jogja Audio School\r\n4.Torabika Goes to campus Univ. Muhammadiyah Yogyakarta\r\n5.Pensi SMA N 2 Kebumen\r\n6.Pensi SMK Yapek Gombong\r\n7.Pensi SMK N 1 Kebumen\r\n8.FKY (festival kesenian yogyakarta)','Pop','poster;','Yogyakarta',814,'2017-08-29 08:37:24','2017-08-29 08:37:24'),
	(440,'SONIC BAND','1503999826.jpg','UI-ADM Cup Festival Band, 1st position\r\nUI-FKM SPARE8 Cup Festival Band, first position\r\nFestival Band Bekasi Margahayu Sejabodetabek. 60 participants, 4th position\r\nBifest (Binus Festival), 2nd position\r\nHANI (Hari Anti Narkoba seIndonesia) 2013, as Guest star\r\nVOTE @UI Fisip 2013, As Guest Star\r\nFakultas Ilmu Pengetahuan Budaya UI Festival, As Guest Star 2014\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nCylophonic LabSchool@Gedung Perfilman Usmar Ismail 2015, Ass Guest Star\r\nPRJ Panggung Budaya 2017, Ass Guest Star\r\nMusic Corner @UNJ, Fak. Seni Musik, Ass Guest Star','Jazz','instagram;teman;','Jakarta',844,'2017-08-29 08:43:46','2017-08-29 08:43:46'),
	(441,'Lini Masa Trio','1504001002.jpg','Band asal Medan ini terbentuk atas dasar keinginan untuk berekspresi lebih liar dalam berkarya. Ide awal terbentuknya berasal dari Elmo dan Rio yang merasa jenuh memainkan musik pop yang dirasa sangat jauh dari jiwa mereka. Mereka sepakat membentuk sebuah band yang memainkan musik rock yang disusupi unsur blues dan soul. Seiring waktu berjalan, pergantian personel pun terjadi di posisi drum. Perbedaan visi dan karakter menjadi beberapa penyebab hengkangnya pemain drum. Setelah proses pencarian yang panjang, mereka akhirnya mengajak Anggi untuk bergabung  mengisi pilar kosong di band ini. Sejauh ini mereka sudah menghasilkan dua single yaitu \"Beauty\" dan \"Orang pinggiran\". \"Beauty\" bercerita tentang bagaimana usaha manusia untuk mencapai impian nya dan single yang kedua \"Orang Pinggiran\" bercerita tentang masyarakat pinggiran kota yang selalu menjadi korban umbar janji para elit politik. Gigs indie, kolektif, dan beberapa event besar sudah dijajal band ini. Prestasi yang dirasa sangat berkesan  oleh mereka adalah menjadi opening act  band Indie asal Perancis \"kokomo\" ketika tour di kota Medan. \r\n\r\nKeinginan kami mengikuti Levi\'s Band Hunt untuk menunjukkan bahwa musisi Tanah Sumatera khususnya kota Medan memiliki taji yang tak kalah dari musisi kota yang lain. Terima Kasih, Assalamualikum, Syalom, Om Swatyastu','Rock','facebook;instagram;','Medan',839,'2017-08-29 09:03:22','2017-08-29 09:03:22'),
