	(449,'The Connect','1504010058.JPG','The Connect berawal dari pertemanan pada masa sekolah (SMA). Sebelumnya band ini dibentuk untuk mengikuti festival musik band antar sekolah. Seiring berjalannya waktu, The Connect mengalami bongkar pasang personil. Sampai pada akhirnya personil tetap beranggotakan 4 orang, yakni: Pandhika (Vocal), Mico (Guitar), Ade (Drum) dan Endy (Bass). Dengan mengusung genre Alternatif Rock, The Connect berharap bisa memberikan warna yang berbeda di blantika musik Indonesia dan terus memberikan karya terbaik kami untuk semua pecinta musik Indonesia.\r\n\r\nExperience:\r\n- Juara 1, Kosgoro EXPO (2005)\r\n- Best Performance, Class Mild Festival (2005)\r\n- Yamaha Event (2011)\r\n- Plaza Cibubur Event (2011)\r\n- Jiexpo PRJ, Booth Kopi Pak Belalang (2017)\r\n- Full Respect Movement, Jakarta Garden City (2017)\r\n- Pekan Raya Kabupaten Bekasi 2017\r\n- IndiePendence, Jungle Land (Soon at 2 Sept 2017)','Alternative Rock','instagram;guitar_plus;lainnya;','Jakarta',571,'2017-08-29 11:34:18','2017-08-29 11:34:18'),
