	(452,'Vistakita','1504017389.jpg','Cerita ;\r\nVistakita didirikan tanggal 12 Desember 2012 oleh beberapa pecahan personil band lokal Kota Payakumbuh yang sebelumnya dari band yang berbeda.\r\nPrestasi ;\r\n1. Juara 1 A Zone Sumatera Barat ( 2016 )\r\n\r\n2. Juara III Festival Indie Pop Progress Payakumbuh ( 2013 )\r\n\r\n3. Juara III Festival Guguak Indie Performance (2013 \r\n\r\n4. Juara III Festival Acoustic Politani Unand ( 2013 )\r\n\r\n5. Juara Favourite Festival G-Stern Part II ( 2013 )\r\n\r\n6. Guest Stars at Jumpa Musisi tiga Dekade ( 2013 )\r\n\r\n7. Guest Stars at SMA N 1 Kec. Lintau ( 2014 )\r\n\r\n8. Guest Stars at SMA N 1 Kec. Payakumbuh (2014 )\r\n\r\n9. Guest Stars at SMA N 1 Kec. Guguak ( 2014 )\r\n\r\n10. Guest Stars at SMP N 1 Kec. Guguak ( 2014 )\r\n\r\n11. Finalis Indie On Radio On Air Lagu Ciptaan Se-Sumatera Barat ( 2014 )\r\n\r\n12. Juara III Festival Acoustic KSN - GLK ( 2014 )','Alternative Rock','teman;lainnya;','Jakarta',537,'2017-08-29 13:36:29','2017-08-29 13:36:29'),
	(453,'huhu dan popo','1504019860.JPG','huhu dan popo adalah nama kucing peliharan milik dayat. kami pernah membuat sebuah gig kecil dimana yang hadir harus membayar dengan menggunakan puisi. kami menyebutnya \"nonton musik bayar dengan puisi\". gagasannya adalah dimana karya tidak selalu harus dibayar dengan uang.','Folk','facebook;','Jakarta',771,'2017-08-29 14:17:40','2017-08-29 14:17:40'),
	(454,'Werewolf','1504021994.jpg','di tahun 2012 band WEREWOLF terbentuk dengan mengusung genre THRASH METAL yang berasal dari Kota Bandung .\r\ndan Telah merilis 1 E.P Album yang bertajuk \"In Thrash We Trust\" dengan 5 Songlist di E.P Album , dan telah merilis juga beberapa videoclip yang berjudul Judge,Welcome To The Jungle (GNR Cover), dan Moon Of Death sekaligus menjadi Single Di tahun 2017 .','Heavy Metal','poster;teman;lainnya;','Jakarta',858,'2017-08-29 14:53:14','2017-08-29 14:53:14'),
	(455,'JUSTKIDDING','1504024375.JPG','JUST KIDDING lahir pada tahun 1999 berawal dari tongkrongan di gang rumah dan teman sekolah. \r\nPrestasi dari tingkat kabupaten hingga provinsi sudah diikuti dan alhamdulilah 3 besar yang kita raih sampai best vocal. Namun, Kami lebih bangga bahwa saat ini masih bertahan untuk berkarya.','Others','instagram;guitar_plus;teman;','Surabaya',857,'2017-08-29 15:32:55','2017-08-29 15:32:55'),
	(456,'ELKA','1504025967.jpg','ELKA terbentuk tgl 22 juli 2014 di lampung, tepatnya di bandar lampung, Nama ELKA sendiri kami pilih karena mudah diucapkan dan mudah diingat.\r\nDemikian prestasi ELKA hingga saat ini.\r\n-Opening LYLA BAND diLAMPUNG TENGAH\r\n-Opening CITA CITATA PANGGUNG BINTANG TOJOE diLAMPUNG TENGAH\r\n-Opening GEISHA diLAMPUNG UTARA\r\n-Opening NIDJI diPRINGSEWU\r\n-Opening D\'MASIVE KOTA METRO\r\n-Opening D\'VIRGIN PRINGSEWU\r\n-GG MILD TOUR PRINGSEWU\r\n-GG MILD TOUR TALANG PADANG\r\n-GG MILD TOUR PKOR BANDAR LAMPUNG\r\n-GG MILD TOUR KOTA METRO\r\n-GG (PRO JAM) LAMPUNG BARAT\r\n-AZONE SAMPOERNA MILD LAMPUNG TENGAH\r\n-AZONE SAMPOERNA MILD KOTA METRO\r\n-AZONE SAMPOERNA MILD BANDAR LAMPUNG\r\n-AZONE SAMPOERNA MILD LAMPUNG UTARA','Pop','facebook;instagram;guitar_plus;','Jakarta',840,'2017-08-29 15:59:27','2017-08-29 15:59:27'),
	(457,'nea metra band','1504029757.jpg','Tiada cerita yang paling indah selain cerita kita dapat dipertemukan dalam sebuah keluarga besar nea metra, dan tiada prestasi yang paling berkesan selain kita masih berdiri saling bergandengan tangan bersama di nea metra.','Others','lainnya;','Jakarta',841,'2017-08-29 17:02:37','2017-08-29 17:02:37'),
	(458,'Paint in Black','1504031230.JPG','Paint In Black, band yang terbentuk sejak tahun 2008 ini mengusung genre Nu Heavy Metal,  beranggotakan Rio (vocal), Dedi (bass), Pebi (Guitar), Amar (Lead Guitar), dan Wawunk (Drummer). Formasi inilah yang mengantar Paint In Black menjadi salah satu band yang cukup diperhitungkan dikancah skena musik Lampung.\r\nPrestasi dan Penghargaan: \r\n-Penghargaan dari semua senior Metalhead Lampung\r\n-Asquad Pemenang Goaheadpeoplechalange 2017\r\n-Penghargaan Dari Ngehits Tribalpride 2017, Sebagai Band Metal Lampung Terbaik 2017\r\n-Satu panggung Bersama Burgerkill,Seringai,Beside,Siksakubur','Heavy Metal','guitar_plus;','Jakarta',727,'2017-08-29 17:27:10','2017-08-29 17:27:10'),
	(459,'CLASSMATE','1504033755.JPG','CLASSMATE berasal dari kota Subang (Jawa-Barat) yang beranggotakan 6 personil diantaranya Alfian(Vokal),Ari(Bass),Donny(Gitar),Yusuf(Gitar),Debi(Drum) & Asep(Keyboard/Synthesizer). Kami terbentuk pada tanggal 1 April 2013 dan sudah mengeluarkan beberapa single serta EP Album. Classmate bergenre Alternative Rock. Dan Kami pun sudah pernah menggelarkan Indie Tour dibeberapa kota di Jawa-Barat diantaranya (Subang,Bandung,Bogor,Jakarta,Bekasi & Karawang). Prestasi yang sudah kami capai diantaranya : 40 besar semifinal Rockinbattle (Supermusic id regional Bandung) , Semifinal Sound of tri (regional Bandung) , Juara 1 The best Band performance di kampus STKIP subang , Juara 1 The best band performance di kampus UNSUB subang & Juara 2 The best band Performance di Laskar indonesia. Kami pun sering diundang diberbagai acara diantaranya acara kampus dan beberapa acara Sponsor Rokok untuk menjadi band Local pembuka guest star.. Kampus yang kami pernah singgahi yaitu (UNPAD,UPI,UNJANI,UNPAS,UNJ & IPB). Semoga harapan kami mengikuti kompetisi yang diselenggarakan oleh pihak PT Levi\'s bertajuk Levi\'s Band Hunt ini dapat menjadi jembatan menuju impian kami dalam berkarir dimusik yaitu ingin menjadi pencetus Band dari INDONESIA yang lagunya bisa terkenal di dalam negeri maupun luar negeri serta bisa kontrak kerja sama dengan pihak Label Universal Music Indonesia demi mewujudkan mimpi mimpi kami bisa membawa nama INDONESIA ke manca negara tentunya sangat berharap kami bisa lolos dalam tahap tahap audisi ini dan menjadi juara Levi\'s Band Hunt. Aamiin yaroball alamin','Alternative Rock','instagram;','Jakarta',865,'2017-08-29 18:09:15','2017-08-29 18:09:15'),
