	(463,'White Rose','1504061823.JPG','WHITE ROSE merupakan salah satu band profesional kebanggaan Bali dengan menawarkan genre musik Pop Punk berkelas sejak 2014 dan layak mendapatkan perhatian publik. \r\n\r\nBRIEF FACTS:\r\n→ Merilis album perdana pada tahun 2015 bertajuk \'Buka Mata Mereka\' di bawah naungan Heartless Records dan sukses melaksanakan tur swadaya ke-10 kota di Jawa Timur dan Jawa Tengah.\r\n→ Tidak hanya di kandang sendiri, White Rose kerap diundang dari event pensi hingga sponsor raksasa di luar Bali seperti Soundsation, Road To Soundrenaline, Jakcloth, ProJam, Showcase ICC. \r\n→ Kota-kota yang pernah disinggahi White Rose untuk perform antara lain: Jakarta, Semarang, Jogja, Malang, Surabaya, Purwokerto, dan masih banyak kota-kota di Jawa dan Bali yang telah mereka kunjungi. \r\n→ Memiliki basis massa yang sedang berkembang bernama WHITE ROSE FAMILY (WRF), dan WRF tersebar di beberapa kota di Indonesia, meski belum sebesar basis massa SID, namun basis massa WRF cukup loyal dan menunjukkan progress untuk bertambah lebih banyak lagi. \r\n→ Juara 2 Hard Rock Rising 2017 Regional Bali. Prestasi yang cukup memukau untuk seukuran band Pop Punk yang notabene bukan termasuk genre yang cukup populer baik di kalangan Underground ataupun mainstream. \r\n→ White Rose juga termasuk band yang cukup  \'advanced\' dan selalu menjadi penggagas ide-ide baru modern sehingga cara promosinya banyak ditiru menjadi referensi dan inspirasi band-band indie yang ada di Bali. \r\n→ Band internasional seperti Fall Out Boy dan All Time Low bisa dibilang menjadi band terdekat yang bisa dikaitkan dengan tampilan White Rose secara keseluruhan meski masing-masing personil memiliki taste dan inspirasi musik yang berbeda-beda.','Alternative Rock','guitar_plus;','Surabaya',876,'2017-08-30 01:57:03','2017-08-30 01:57:03'),
