	(468,'KEISHA BAND','1504070779.jpg','Juara 3 islamic band sidoarjo,  vokalis juara 2 singing contest happy laraku','Pop','teman;','Surabaya',890,'2017-08-30 04:26:19','2017-08-30 04:26:19'),
	(469,'Jangar','1504070880.jpg','Award :\r\nBreakthrough Artist of The Year\r\nPICA Magazine Editor Choice Award 2016\r\n\r\nReceive 3 Stars Review for \"Self Titled EP\"\r\nby Rolling Stone Indonesia Magazine\r\nEdisi 137 - September 2016 \r\n\r\nBiography:\r\nJangar is a hard rock band from Bali which has received national attention by releasing their EP album online and numerous tour to Java island. Since its debut performance in mid 2015, Jangar have gained a lot appretiation through its critics of Indonesian social situation and its powerful stage performance.\r\n\r\nThe name Jangar was taken from Sundanese word means \"Headache\". Jangar is an uncontrollable pain inside the head which could bring the sufferer trough an anger state.\r\n\r\nJangar\'s music is influenced by alternative 90\'s to 2000\'s rock, through bands such as Clutch, The Sword, Red Fang and Kyuss.\r\n\r\nJangar\'s music has a hard rock undertone, but is combined with many other genres of sound, such as stoner rock, blues, heavy metal, and doom metal.\r\n\r\nJangar has released 1 EP album and 1 split album along side with Piston from Jakarta and Terapi Urine from Bandung. Jangar also collaborate in various music compilation.\r\n\r\nJangar \"Self Titled EP\" can be found in various digital music platform such as Spotify, Apple Music, Dezeer, etc.','Rock','instagram;','Jakarta',880,'2017-08-30 04:28:00','2017-08-30 04:28:00'),
	(470,'Arberi Band','1504071085.jpg','Arberic Band , adalah band ber-genre Pop Melayu asal SUMEDANG JAWAB BARAT-Indonesia. Yang terbentuk 03 Juli 2014, Dari kata ARBERIC yaitu \"AyoBERmusIC\" . Yang dinaungi 3 personil Diantarnya Reval(Vokalis) , Sultan(Gitaris) Dan Dadan(Drummer). dan mengeluarkan Single Perdana yang berjudulLUKISAN LUKA','Others','facebook;instagram;teman;','Jakarta',891,'2017-08-30 04:31:25','2017-08-30 04:31:25'),
	(471,'Samsara','1504074363.jpg','This music might be characterized most easily by what it isn\'t. It\'s rarely simple enough in structure and instrumentation to be called rock (and certainly retains enough of a sense of humor to be disqualified as art rock). It\'s not serious or straightforward enough to be called jazz. It\'s often too esoteric or extreme to be called pop. It\'s in some middle ground between all of these, which means it\'s populated with the outcasts from other well-established genres. As a result, Space Age Pop is full of brilliant, bizarre, and exciting sounds, which are particularly striking to ears accustomed to the stereotypes that populate the more familiar genres.\r\n\r\n\r\nHailing from the southern corner of Jakarta which famous for its hustle and bustle, Consisting of 5 childhood mates who used to gathering around in a small dusty padded room. When a small chatter over the phone turned to be a seemingly enthusiastic call. In the 2015\'s the band\'s project was formed under the name Samsara that fronted by Rerez (synthesizer, keyboards, vocals), Ardana (guitar), Arya (guitar, vocals), Reygi (bass) and Widan (drums). Meaning of Samsara itself in Buddhism is the beginning-less cycle of repeated birth, mundane existence and dying again.','Alternative Rock','facebook;instagram;','Jakarta',797,'2017-08-30 05:26:03','2017-08-30 05:26:03'),
	(472,'Valgus Band','1504076539.JPG','- JUARA 2 BAND IN BANDUNG -\r\nValgus sendiri diambil dari bahasa Estonia yang artinya Cahaya...Banyak nama-nama yang kita pakai untuk nama band ini, dan akhirnya kita terfokus untuk memakai nama Valgus.\r\nValgus Band adalah sebuah group band yang terbentuk di Bandung pada tanggal 11 Februari 2012, yang  beranggotakan Cikal ( Vocal ), Dapenk ( Gitar ), Yogie ( Bass ), Joe ( Drum ) - Nukuz ( Drum ), Ariess ( Keyboard ).Dikarenakan Joe Drumer sebelumnya pindah domisili ke Yogyakarta maka posisi drumer di gantikan oleh Nukuz dan ada penambahan personil Ariess di Keyboard.','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',824,'2017-08-30 06:02:19','2017-08-30 06:02:19'),
