	(477,'Jionara','1504081341.jpg','Pada tanggal 7 bulan 10, tepat pada tahun 2014 lima pria dipertemukan. Terdiri dari Alan(vocal), Eggy(gitar), Rizal(gitar) Aby(bass) dan Dimas(drum). Seiring dengan tanggal tersebut disebutlah JIONARA. Penggabungan semiotika lambang 7 dan 10 serta penyertaan nama “Nara”. Membuat mereka selalu mengingat angka sejarah yang akan membuat mereka menjadi besar, Nara yang bersifat selalu setia dan bersahabat membuat mereka terikat dengan sifat tersebut.\r\n\r\nAkhir tahun 2014 lalu Jionara band asal bandung yang terdiri dari 5 orang pria ini menghadiahi tahun baru dengan meluncurkan single yang berjudul “Kelakuan Hujan”. \r\nDan pada pertengahan tahun 2015, kami juga meluncurkan single kedua yang berjudul \"Pelepasan Adalah Pertahanan Terbaik\".','Pop','guitar_plus;','Jakarta',870,'2017-08-30 07:22:21','2017-08-30 07:22:21'),
	(478,'BRIGEZTREGGAE','1504084547.jpg','Brigeztreggae dibentuk di Ciputat pada tanggal 28 Oktober 2016. Yang mengusung aliran Reggae, dengan sentuhan Pop, Rock.\r\n\r\n* Finalis Sound Of Tri (perwakilan Banten)\r\n* Guest Star at Anniversary Kelurahan Mekar Jaya, Tangsel\r\n* Peserta Competition at Starlight, Jakarta Timur\r\n* Guest Star Pensi SMK Puspita Bangsa, Tangsel\r\n* Guest Star at HERO Terogong New Year Party, Jakarta Selatan\r\n* Guest Star at Pilar Ciputat Sumpah Pemuda, Tangsel','Others','instagram;guitar_plus;','Jakarta',901,'2017-08-30 08:15:47','2017-08-30 08:15:47'),
	(479,'MY STEREO ILL','1504085216.JPG','Band asal selatan jakarta yang terbentuk pada 12-12-2012.Juara pertama regional bandung dan juga sekaligus juara utama/nasional dalam FESTIVAL SUARA ANTIKORUPSI 2016 yang diselenggarakan oleh KPK RI,menjadi band pembuka konser SLANK di JAKARTA FAIR 2017','Alternative Rock','facebook;instagram;','Jakarta',898,'2017-08-30 08:26:56','2017-08-30 08:26:56'),
	(480,'story burn to ashes','1504085745.jpg','2004 terlahir karena perpecahan beberapa band dari masing2 personil yang diprakarsai oleh ipoet (vocal) dan mance (guitar) yang bermaksud membuat sebuah band dan akhirnya menemukan jimmy (bass) dan isal (drum). terbentuklah band yang bernama story burn to ashes yang menjadi simbol dari mereka sampai saat ini. nama yang berasal dari lirik lagu alone at last (bdg) dengan judul remembering never telah mereka usung selama 2 tahun lebih sampai masuknya kill atau tirta story burn (guitar) dan keluarnya isal sang penggebuk drum yang di gantikan oleh ichan aka kucluk racy yang akhirnya kami membawakan lagu2 yang bernuansa death metal dan metalcore dengan influence (walls of jericho, lamb of god, black dahlia murder, dan suicide silence etc) we are... ipoet story burn as vocal Chakill aka tirta story burn as guitar jimmy story burn as bass mance aka rahman savanty as guitar ichan aka kucluk racy as drum seiring berjalanya waktu trjadi perpecahan ichan dan mance kluar dan kini SBTA hanya tinggal menyisakan Iput,Cakil & Jimmy,namun itu tidak menjadikan kami berhenti untuk berkarya dan terus bergentayangan di Gigs tanah air.. SBTA telah menelurkan beberapa karya di antaranya: 1. takkan ku dengar lagi 2. lost (available @ sound of calours compilation; home made record) 3. stuck 4. love is suicide (available @ liburan di bulan compilation;mata angin production) 5. about the pain and die 6. takkan diam (available @ couplelicious compilation; copuplelicious production) 7. mati rasa sampai saat ini, sampai saatnya nanti STORY BURN TO ASHES takkan diam ku teriak teriak ku takkan diam !!!','Heavy Metal','instagram;','Jakarta',904,'2017-08-30 08:35:45','2017-08-30 08:35:45'),
	(481,'QIA BAND','1504086389.jpg','Band kami terbentuk awal januari 2017, personil band kami hanya 3 saja dari yang sebelumnya 5 personil mungkin sudah pada sibuk kerjaan dan kegiatan masing\" ,,hehehe\r\nuntuk prestasi kami pernah mengikuti ajang festival musik sprite d plong lolos sampai finalis 5 besar dari 40 peserta band n 1 panggung dengan band ternama pernah juga mengikuti ajang festival di UIN tangsel menang juara 1 dari 5 peserta ,, untuk kegiatan kami setiap malem minggu kita ngisi acara band di salah satu kedai di tangerang selatan belum lama sempat kita promo lagu di salah satu stasiun TV ,,\r\nTerimakasih :-) Salam QIA','Pop','facebook;guitar_plus;lainnya;','Jakarta',838,'2017-08-30 08:46:29','2017-08-30 08:46:29'),
