	(483,'WANWE','1504089628.jpg','WANWE adalah grup musik Indonesia yang berdiri pada 25 Mei 2016 di Jakarta. Grup band ini  adalah sekumpulan anak-anak muda. 5 Anggota berdirinya adalah Ali (vokal), Budhi (bass), Akay (gitar), Fabry (gitar), dan Riyan (drum). WANWE juga telah mengikuti ajang musik Indie di Caffe-caffe jakarta dan Festival musik, dan memiliki 1 lagu andalan berjudul \"Samakan Langkah\"','Alternative Rock','teman;','Jakarta',566,'2017-08-30 09:40:28','2017-08-30 09:40:28'),
	(484,'Octave Band','1504095071.jpg','octave band belum pernah mengikuti ajang festival jenis apapun , selama ini hanya membuat demo track dan manggung secara off air di acara acara seperti djarum black , L.a light , Honda , Hut Kota Tangerang , Beer house , dan acara music lain nya.','Pop','teman;','Jakarta',714,'2017-08-30 11:11:11','2017-08-30 11:11:11'),
	(485,'Forthemoment','1504095083.jpg','Band ini berawal dari beberapa anak rantau di jogja yang tinggal di kos yang sama dan memiliki hobi yang sama pula yaitu bermusik. Mereka sepakat untuk membentuk sebuah band dan diberi nama FORTHEMOMENT(biasa disingkat FTM untuk mempermudah pengucapan), karena ingin selalu memberikan moment-moment berharga bagi para penikmat musik nya. Perjalanan  pun dimulai, dimulai dari ngamen- ngamen dengan hanya dibayar makan ,ngamen di nikahan, ikut festival musik , sampai akhirnya bisa ngamen reguler/event di cafe-cafe,hotel-hotel, dan tempat-tempat ternama di jogja maupun luar daerah jogja. Pasang surut gonta ganti personil sempat dirasakan band ini. Karena kebutuhan lagu-lagu yang diciptakan oleh FTM, Okky, personil terakhir yang bergabung, di daulat sebagai vocal female leader setelah sebelum nya Ari(gitaris) dan Lanang (bassis) juga merangkap sebagai vocalis. Dan dengan Rinto sebagai penjaga beat alias drummer, maka FORTHEMOMENT siap memberikan karya- karya terbaiknya.','Pop','guitar_plus;','Yogyakarta',852,'2017-08-30 11:11:23','2017-08-30 11:11:23'),
	(486,'EKSTRAVERSI','1504101247.jpg','Ekstraversi terbentuk di tahun 2016, walaupun sebenarnya keenam personil ini sudah saling kenal sejak tahun 2015. Pada awalnya, mereka bertemu di komunitas lokal yaitu SoundCloud Malang.\r\n\r\nDi bulan Oktober, 2015, keenam personil ini mendapatkan kesempatan untuk tampil di sebuah panggung mewakili komunitasnya. Mendapatkan respon yang sangat baik dari audiens, mereka akhirnya sepakat untuk membawa band yang telah terbentuk ini ke arah yang lebih serius. Nama Ekstraversi terinspirasi dari panggung pertama, yaitu acara yang dipanitiakan oleh mahasiswa Psikologi Universitas Brawijaya. Maka dari itu, Ekstraversi diambil dari istilah psikologi.\r\n\r\nSampai sekarang Ekstraversi telah tampil di panggung-panggung di Malang dan menciptakan lagu-lagu untuk materi album mereka. \r\n\r\nMusik Ekstraversi banyak terpengaruh dari band-band seperti The Groove, RAN, Maliq & D\'Essentials, Barry Likumahuwa Project, Dll.','Pop','instagram;guitar_plus;maliq;teman;','Surabaya',912,'2017-08-30 12:54:07','2017-08-30 12:54:07'),
	(487,'flame heart','1504103815.jpg','terbentuknya ketika dahulu kala kami sedang berkumpul bersama ketika itu \" LUTFI, HELMY, dan UUT(old bassis) sedang berbincang bagaimana jikalau kita membentuk sebuah band.. terpikir dan terbesit bermacam aliran, dan memang jiwa kami semua berbeda, tapi bagaimana kita mengemas dalam satu komposisi yg tepat yaitu PUNKROCK..\r\nketika itu kami tersentak dengan formasi 3 anggota ini, untuk menambahkan sebuah getaran pada band ini, kami menambahkan 1 personil yaitu ROBBY pada vocal/guitar,,\r\ndidalam perjalanan band ini kami menemukan kendala dengan bertolak belakang visi,, dan akhirnya kami kembali terbentuk rampung dengan 3 anggota,, ketika itu UUT lah yg resign..\r\nkami tetap bangkit dengan formasi ROBBY,LUTFI,dan HELMY.. dalam bangkitnya itu kami menemukan sebuah personil baru untuk mengisi kekosongan dalam formasi ini,, dan dia ADIE seorang bassis yg akan mengisi formasi ini agar lengkap kembali...\r\ndan sampai sekarang alhamdulillah kami masih stay dengan formasi ini,,, walaupun disini kami semua berbeda aliran dan genre,,,\r\ntetapi visi dan misi kita terus berkobar dan terus mencapai rawk !!!!!\r\nFOR ALL FLAMES GET CMON F**KING RAWK !!!!!\r\n\r\nwe have 7 songs already released :\r\n1. Hilang\r\n2. Goodbye Penguin\r\n3. Kenangan\r\n4. Harapan Terakhir ( Padamkan Mimpi )\r\n5. Bad Feeling ( Broken Heart )\r\n6. Horny Tonight\r\n7. Buried\r\n8. Merah Putih ( Meraih Mimpi )\r\n9.  Goodbye Penguin feat Lulu ( Accoustic )','Rock','facebook;guitar_plus;','Jakarta',886,'2017-08-30 13:36:55','2017-08-30 13:36:55'),
	(488,'flame heart','1504103867.jpg','terbentuknya ketika dahulu kala kami sedang berkumpul bersama ketika itu \" LUTFI, HELMY, dan UUT(old bassis) sedang berbincang bagaimana jikalau kita membentuk sebuah band.. terpikir dan terbesit bermacam aliran, dan memang jiwa kami semua berbeda, tapi bagaimana kita mengemas dalam satu komposisi yg tepat yaitu PUNKROCK..\r\nketika itu kami tersentak dengan formasi 3 anggota ini, untuk menambahkan sebuah getaran pada band ini, kami menambahkan 1 personil yaitu ROBBY pada vocal/guitar,,\r\ndidalam perjalanan band ini kami menemukan kendala dengan bertolak belakang visi,, dan akhirnya kami kembali terbentuk rampung dengan 3 anggota,, ketika itu UUT lah yg resign..\r\nkami tetap bangkit dengan formasi ROBBY,LUTFI,dan HELMY.. dalam bangkitnya itu kami menemukan sebuah personil baru untuk mengisi kekosongan dalam formasi ini,, dan dia ADIE seorang bassis yg akan mengisi formasi ini agar lengkap kembali...\r\ndan sampai sekarang alhamdulillah kami masih stay dengan formasi ini,,, walaupun disini kami semua berbeda aliran dan genre,,,\r\ntetapi visi dan misi kita terus berkobar dan terus mencapai rawk !!!!!\r\nFOR ALL FLAMES GET CMON F**KING RAWK !!!!!\r\n\r\nwe have 7 songs already released :\r\n1. Hilang\r\n2. Goodbye Penguin\r\n3. Kenangan\r\n4. Harapan Terakhir ( Padamkan Mimpi )\r\n5. Bad Feeling ( Broken Heart )\r\n6. Horny Tonight\r\n7. Buried\r\n8. Merah Putih ( Meraih Mimpi )\r\n9.  Goodbye Penguin feat Lulu ( Accoustic )','Rock','facebook;guitar_plus;','Jakarta',886,'2017-08-30 13:37:47','2017-08-30 13:37:47'),
