	(496,'Zimoutha\'CLAN','1504117907.jpg','Kami adalah sekelompok group musik yang berdo,isili di suatu komunitas pecinta japan di surakarta.\r\nkami mulai terbentuk pada 12 agustus 2016.\r\n\r\nPRESTASI :\r\n\r\n- JUARA II , BAND KOMPETISI KEIRAN FEST SMA7 SURAKARTA (21 AGUSTUS 2016)\r\n\r\n- JUARA HARAPAN , BAND KOMPETISI NIKI JAPAN , PRPP SEMARANG (27 AGUSTUS 2016)\r\n\r\n- JUARA II, BAND KOMPETISI JAPAN EXPO UNISRI SURAKARTA (28 NOVEMBER 2016)\r\n\r\n- GUESTAR , SOLO IMLEK FESTIVAL\r\n (BALAIKOTA SURAKARTA 27 JANUARI 2017)\r\n\r\n- GUESTAR, TRIBUTE L\'ARC~EN~CIEL & ONE OK ROCK  ( HARTONO TRADE CENTER 5 FEB 2017)\r\n\r\n- GUESTAR, J-KAI FESTIVAL UMS SURAKARTA ( 11 MARET 2017 )\r\n\r\n- GUESTAR, SHINSOKU  GATEHRING JAPAN MUSIC PERFORMER ( 20 FEBRUARY 2017\r\n\r\n- GUESTAR, DIEST NATALIST KAMPUS ISTIBANK SOLO ( 23 MARET 2017 )\r\n\r\nDan pada tanggal 6 agustus 2017 kami mengadakan sebuah event \"Mini Japan festival\" untuk memperingati 1st anniversary zimoutha\'clan sekaligus merealist single perdana kami yang di selenggarakan di Hartono Trade Center.\r\nMore info :\r\nFacebook : https://www.facebook.com/profile.php?id=100020138867975&fref=ts\r\nGmail        : zimouthaclan@gmail.com\r\n-----------------------------------------------------------\r\nMore Media Promo :\r\n\r\nFanspage : https://www.facebook.com/ZimouthaClan/?fref=ts\r\nInstagram : @zimouthaclan\r\nReverbnation : www.reverbnation.com/zimouthaclan\r\nSound Cloud : https://soundcloud.com/zimoutha-cian','Alternative Rock','facebook;instagram;guitar_plus;teman;','Yogyakarta',399,'2017-08-30 17:31:47','2017-08-30 17:31:47'),
