	(502,'JAKARTA BOMB BLAST','1504154861.jpg','Tepat pada tanggal 17 Juli 2009, bersamaan dengan tragedi pemboman JW Marriot dan Ritz Carlton yang dilakukan oleh Nurdin M. Top cs, dengan dipenuhi rasa optimis yang begitu tinggi, Raxel mencoba membangun sebuah band. Ditemani oleh Helmy (Musthafa Helmy) pada Bass/Back Vox, Cornel (Cornelius Endriarto) pada Loop/Moog/Synth, dan Aris (Aris Maulana) pada Drum maka terbentuklah JAKARTA BOMB BLAST. Nama “Jakarta Bomb Blast” ini dilatarbelakangi oleh filosofi yang begitu mendalam dan penuh harapan. “Jakarta Bomb Blast” kami artikan sebagai sebutan untuk mengenang tragedi bom Kuningan yang membuat perhatian seluruh masyarakat Indonesia maupun Dunia tertuju secara serentak dan selalu memperbincangkan kejadian tersebut dimanapun mereka berada. Maka, dengan mengusung nama ini kami pun berharap melalui karya-karya yang kami ciptakan, dapat membunuh perhatian orang banyak, baik di negara sendiri maupun sampai ke Manca Negara.\r\n\r\n- im3 unsigned group competition finalist (2010)\r\n- festival & parade musik 1001 band road to MURI at Taman mini indonesia indah. Big 10 melodic category finalist (2010)\r\n- dimuat HAI MAGAZINE vol.27 rubrik Demos hal88\r\n- festival & parade musik 1001 band jilid 2 at kemenpora senayan #1 winner on modern rock genre category (2011)\r\n- we are pop punk java tour 14 kota se pulau jawa (2014)\r\n- buka bersama 7 halal bihalal tour with MAHADEWI bogor - Bandung - Jakarta (2014)\r\n- chart #1 national & #7 international \"electronica\" category at www,reverbnation.com (periode september 2013 - may 2014)\r\n- Love Heart Tour with Pee wee gaskin , Killing Me inside, Jakarta bomb blast (5 kota jawa tengah 2016)','Alternative Rock','facebook;instagram;poster;lainnya;','Jakarta',932,'2017-08-31 03:47:41','2017-08-31 03:47:41'),
	(503,'sepedamini.','1504156697.jpg','Sepedamini adalah Band yang ber-genre Grunge/Alternative Rock asal Bandar Lampung, Indonsia, terdiri dari : Angga Martha (Vokal), Hari ‘kmx’ (Lead Gitar), Rachmat Anto (Gitar), Welly (Bass), Fyan Gigih (Drum), Berdiri pada November 2015 dan sudah menghasilkan satu buah album (indie) yang bertajuk ‘mukadua’ pada Agustus 2016.\r\nPrestasi :\r\n- BIG 40 Nasional (big 10 Regional Jakarta) Supermusic Rockin\' Battle 2017\r\n- Juara 1 Festival Akbar UKMBS Musik IBI Darmajaya Lampung (Tingkat Sumbagsel) 2017.\r\n- Juara 1 Festival Band Piala Walikota Bandar Lampung 2016.\r\n- Opening Act. Burgerkill & Siksakubur @Tribal Pride Lampung 2017\r\n- Opening Act. PAS Band & Endank Soekamti @Suryanation Motorland Lampung 2017.\r\n- Opening Act. Revenge The Fate @Gitarplus Lampung 2016.\r\n- Opening Act. EDANE @Gitarplus Gitaransore Lampung 2016.\r\nDLL','Alternative Rock','guitar_plus;','Jakarta',342,'2017-08-31 04:18:17','2017-08-31 04:18:17'),
	(504,'After Midnight','1504157148.jpg','After Midnight adalah sebuah band yang didirikan pada 21 April 2016 bergenre pop punk','Others','guitar_plus;','Jakarta',937,'2017-08-31 04:25:49','2017-08-31 04:25:49'),
	(505,'51ST AVENUE','1504168533.jpg','51st Avenue adalah sebuah band yang berasal dari Makassar. Band ini terbentuk dari pertemanan semasa SMA kemudian berkembang hingga kini sudah 8 tahun bersama bermain musik. Walaupun sudah mengalami beberapa kali pergantian personil tapi band ini masih bisa tetap berjalan dan tetap berkarya.\r\n\r\n51st Avenue juga mengalami proses yang sulit untuk bisa tetap bertahan hingga kini, proses melawan ego dan ambisi masing-masing personil, bahkan hingga perjuangan awal kami yang berjuang keras melalui beberapa tahap audisi agar kami bisa mendapatkan kesempatan untuk bisa perform di beberapa event di kota makassar dan hingga kini 51st Avenue sudah memiliki cukup tempat di hati publik Makassar.','Jazz','teman;','Surabaya',866,'2017-08-31 07:35:33','2017-08-31 07:35:33'),
	(506,'MEMOUS','1504169367.jpg','Band bergenre Alternative rock / Culture rock yang berdiri tahun 2009 tetapi mulai aktif lagi tahun 2014 sejak lulus sma. Sampai saat ini sudah manggung di acara acara kampus, bazar, pensi, graduation, tv kampus, grand/soft opening cafe dan yang lainnya. Kenapa dinamakan Culture Rock : Culture Rock adalah perpaduan antara kultur/budaya dan rock, jadi kita mencapurkan alat tradisional ( Angklung ) ke dalam genre musik Rock. Dan juga ada beberapa lagu dari MEMOUS / lagu cover an dari MEMOUS yang memakai Angklung sebagai contoh, MEMOUS meng-cover lagu BIMBANG dari MELLY GOESLAW dengan kemasan yang sangat berbeda. https://soundcloud.com/memousband/memous-band-bimbang-medley Sudah punya beberapa SINGLE dan VIDEO CLIP (di YouTube) juga sedang mempersiapkan untuk MINI ALBUM. Single dan Video Clip ( MEMOUS - IF Music Video ) : https://www.youtube.com/watch?v=2Aae7jcSrKg','Rock','teman;','Jakarta',945,'2017-08-31 07:49:28','2017-08-31 07:49:28'),
	(507,'ARFF','1504170777.jpg','ceritanya sikh dulu waktu pas kita masih sekolah\r\ndengan hoby maen musik , karna dukungan temen2 alhamdulilah kita bisa','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',946,'2017-08-31 08:12:57','2017-08-31 08:12:57'),
	(508,'ACTEON BAND','1504171032.jpg','juara 1 festival FIF safari, pembuka opening RAN, juara 1 festival religi, mendapatkan golden tiket INDIGITAL FEST 2017','Pop','guitar_plus;teman;lainnya;','Jakarta',936,'2017-08-31 08:17:12','2017-08-31 08:17:12'),
	(510,'Footprints','1504179235.jpg','Rekam Jejak\r\n----------------------------------------\r\n- Music Line up @Fisiphoria UNDIP (2016)\r\n- Big 40 Rockin\' Battle Super Music (2017)\r\n- Big 10 Regional Malang MLD Jazz Band Wanted (2017)\r\n- Music Line up @Land of Leisures (2017)\r\n\r\nStory\r\n----------------------------------------\r\nPada tahun 2015 Anak Chakti membentuk band yang saat itu bernama Mom’s Kitchen dengan formasi utama Anak Chakti (Keyboard), Yusuf (Bass), Fahmi (Vocal), dan Garin (Guitar). Posisi drummer saat itu fleksibel, dapat berupa additional atau tanpa drum. Seluruh personil berangkat dari latar belakang musik yang berbeda, Anak Chakti berangkat dari musik Pop dan Jazz, Yusuf yang berangkat dari seorang gitaris metal, Fahmi biasa mengisi jam session dalam acara komunitas Jazz setempat, dan Garin berangkat dari musik Rock. Saat itu Mom’s Kitchen sempat mengisi beberapa event dengan membawakan beberapa lagu jazz dengan sentuhan rock, lagu rock dengan beberapa lick jazz dan bebop, ataupun lagu pop yang dibawakan dengan sedikit sentuhan jazz atau rock. Berjalan beberapa waktu, lalu munculah ide konsep band “Story Telling” dimana setiap lagu memiliki cerita, dan memiliki hubungan antara lagu satu dengan lainnya baik dari lirik dan ilustrasi musiknya. Penekanan dari konsep band tersebut adalah bahwa setiap karya band yang dibuat dapat se-epic mungkin, memiliki cerita berkesinambungan seperti novel atau cerita pendek sehingga penikmat musik disuguhi karya “Hibrid” antara lagu dan cerita. Juli 2016 Sandi masuk ke dalam band member mengisi posisi drummer. Sandi satu pemikiran dengan konsep band yang demikian. Yogyakarta, 3 September 2016 beranggotakan Anak Chakti, Yusuf, Garin, Sandi, dan Fahmi sebagai vokalis, sebuah band bernama Footprints berdiri sekaligus menyudahi Mom’s Kitchen. Semua personil memiliki pandangan yang sama, yaitu Go International. Nama ”Footprints” dipilih dengan filosofi agar setiap karya yang kami suguhkan bisa meninggalkan jejak di benak para audience, dan yang pasti lebih mudah disebut di kancah international. Pada bulan Maret 2017, Sandi memutuskan untuk keluar dari Footprints dengan alasan perbedaan sudut pandang dalam bermusik. Kemudian pada bulan Mei Tanzil masuk untuk mengisi posisi drum. Salah satu karya yang telah selesai digarap adalah Let\'s Fly. Lagu tersebut bercerita tentang seseorang yang telah siap menggapai impiannya bersama seseorang/sejumlah orang yang ada dalam hidupnya. Let\'s Fly dapat dinikmati melalui 2 cara, yaitu dari cerita lagu itu sendiri, atau dengan menghubungkan cerita dalam Let\'s Fly dengan lagu lainnya. Selain itu kami telah merencanakan beberapa konsep cerita untuk karya kedepan.','Rock','guitar_plus;poster;teman;','Yogyakarta',949,'2017-08-31 10:33:55','2017-08-31 10:33:55'),
