	(512,'MANLY DANCY','1504184217.jpg','Manly Dancy merupakan  band bergenre musik pop yang berasal dari kota Subang Jawa Barat. Manly Dancy berdiri pada tanggal 20 September 2016. Band ini di bentuk karena visi dan misi bermusik yang sama antar personil dan menyuguhkan warna musik yang fresh.  \r\nKami pernah menjadi juara festival band yang diselenggarakan oleh salah satu perusahaan rokok dikota kami.\r\nKami pernah menjadi opening Vieratale\r\nKami pernah menjadi opening Payung Teduh.\r\nDan masih banyak lainnya.','Pop','facebook;instagram;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',954,'2017-08-31 11:56:57','2017-08-31 11:56:57'),
