	(517,'JAGERMONSTER','1504193198.PNG','.CERITA\r\nJagermonster di bentuk pada tahun 2009 dengan nama awal MASTERPLAN HIPMETAL. Pada tahun 2013 kami berhasil membuat Album perdana yang berjudul \"YESTERDAY, TODAY, TOMORROW, AND FOREVER\" dan Album kompilasi yang berjudul \"MEDAN TERIAK\".\r\n\r\n.PRESTASI\r\n- Menjajah puluhan bahkan ratusan panggung di kota medan dan luar kota\r\n- Menjadi Finalist asal kota Medan di acara Penghargaan salah satu Brand Fashion yang di selenggarakan di Kuta, Bali.\r\n- Dan Masih Lagi','Others','guitar_plus;teman;','Medan',618,'2017-08-31 14:26:38','2017-08-31 14:26:38'),
	(518,'UbanProject','1504194530.JPG','2015 adalah tahun terbentuknya uban project.tahun emas untuk boi uban,indra batara,sandy arfian,ari rizky mengembang segala kreatifitas bermusik dlm 1 tujuan yg pasti,sukses!!','Funk','facebook;teman;','Jakarta',470,'2017-08-31 14:48:50','2017-08-31 14:48:50'),
	(519,'soerjakanta','1504194785.jpg','soerjakanta berasal dari nama ejaan kosa kata yang belom di sempurna yaitu artinya kaca pembesar. dan berdiri dari tahun 2015 \r\n\r\nband ini berkonsep mengarah swing and roll yang perpaduan antara swing dan rock n roll yang mengalir ke arah suasana vintage \r\n\r\nprestasi yang dimiliki yaitu\r\n- pernah Dapat Peringkat 3 besar radio di medan\r\n- lalu bintang tamu di PRSU 2016\r\n- Bintang Tamu di Festival Amaliun Foodcourt 19 Agustus 2016\r\n- 2015 Akustar i - radio\r\n- bintang tamu indie mami vol v\r\n- pernah bermain di swarloka vintage jazzy night\r\n- dan di jazzy night di sorry grandma','Others','lainnya;','Medan',967,'2017-08-31 14:53:05','2017-08-31 14:53:05'),
	(520,'Duende','1504194899.png','Sebuah kolaborasi amatir musisi gadungan.ngeband karena warung kopinya sepi. niatnya menghibur diri sendiri. Hanya bertanggung jawab atas pembuatan karya sendiri, tanpa bertanggung jawab atas kenikmatan pendengar. Grazie, El Duende!','Alternative Rock','facebook;instagram;lainnya;','Jakarta',958,'2017-08-31 14:54:59','2017-08-31 14:54:59'),
	(521,'Basic Evolution','1504194993.JPG','Basic Evolution adalah band yang berasal dari kota Depok, Indonesia.\r\nBand ini digawangi oleh 5 orang :\r\n- Ichsan Septian : Vocal / Rythm\r\n- Fachri Ghozali : Lead Guitar\r\n- Dien Galuh Ekananda : Bass\r\n- M. Dinda Nugroho : Midi Controller / Vocal\r\n- Ludfi Satria Nugraha : Drum\r\n\r\nBasic Evolution mengusung genre musik yang bertajuk \"Pop Sweet Punk\". Band ini terbentuk pada Agustus 2012, dan telah menyelesaikan Extended Play atau yang sering disebut dengan Mini Album pertama mereka pada pertengahan tahun 2016 lalu. Berikut 5 daftar lagu yang berada pada E.P pertama Basic Evolution yang berjudul \"Monologue\" :\r\n- Aku Bukan Mereka\r\n- Mellisa\r\n- Running Out Of Time\r\n- Lost In Wonderland\r\n- The Night Is Alright\r\n\r\nBasic Evolution juga baru saja menyelesaikan sebuah film pendek yang dikembangkan dari judul lagu andalan mereka yaitu \"Aku Bukan Mereka\". Di akhir tahun ini, Basic Evolution juga sedang merencanakan secara matang untuk menggarap video clip pertama mereka. Basic Evolution juga sering melakukan banyak performance di pensi-pensi sekolah dan beberapa konser di Jabodetabek.','Others','guitar_plus;','Jakarta',928,'2017-08-31 14:56:33','2017-08-31 14:56:33'),
	(522,'Plural','1504197067.jpg','Plural is a Psychedelic pop band that was formed in 2014. The band was originally formed by Andara ( Vocal/guitar) and Hizrian (Guitar) as the founder of Plural. then they added more personnel Jicho(Drums), Nugi ( Bass) and Ravi (Synth/keys) to complete the formation of Plural.','Others','instagram;','Jakarta',972,'2017-08-31 15:31:07','2017-08-31 15:31:07'),
