	(524,'TABS','1504197907.jpg','berdiri tahun 2014 tanggal 20 bulan april\r\nmemilih format trio yang diisi oleh\r\nPanji : voc, cajon, harmonica\r\npandu : gitar, voc\r\nmanda : gitar, voc\r\nkami bertiga mengusung genre FOLK - kontempoler\r\n\r\nprestasi : juara 1 band akustik di kickparade Yogyakarta tahun2015\r\ndan banyak mengisi gigs gigs indie di Yogyakarta, diantaranya heavensound vol 1 dan 2.  brithis invation di Yogyakarta, dan acara Lennon days di Yogyakarta\r\n\r\nTABS sekarang berdomisili di provinsi Lampung, tepatnya di Kota Bandar Lampung','Others','instagram;','Jakarta',974,'2017-08-31 15:45:07','2017-08-31 15:45:07'),
	(525,'justkidding band','1504202331.jpeg','Assalamualakum... perkenalkan kami anak band dari kota kecil yg ada di jawabarat tepat di kab.subang. kami punya sedikit cerita tentang band kami yg didirikan awal thn 2000 an. Alhmd sampai sekarang masih tetep exsist mesti beberapa kali gonta ganti personil. Kami sekumpulan anak gang yg hobi bermain musik walau cuma dgn bakat yg pas pas an dan otodidak semuanya soalnya kita mempunyai motto yaitu berani malu gak norak yang penting punya cinta dan cita cita. \r\nDengan prestasi yg kita capai walaupun gak di dokumentasikan alhmd sampai skg kita sudah memiliki lagu ciptaan sendiri atau karya sendiri yg sudah direcording walaupun dgn hasil yg pas2an juga. Sementara hasil prestasi yg paling berkesan yaitu ketika kita jadi juara di acara sound of indie-pendence. Dari situlah kita selalu di jadikan sebagai band opening artis ibukota. Mudah2an dengan adanya kompetisi ini kita yg jadi band ibukotanya amin... terima kasih byk buat levis band hunt yg udah memberikan solusi agar lagu kita bisa di dengar dan diterima oleh para pecinta musik tanah air.. amin ya robbalalamin.','Alternative Rock','teman;','Jakarta',877,'2017-08-31 16:58:51','2017-08-31 16:58:51'),
	(526,'Sin-Thing','1504206026.jpg','Band yang terbentuk pada tanggal 28 Juni 2016 yang mengusung genre punk rock dan membawa misi bermusik guna merawat persatuan dan kesatuan Indonesia.','Others','facebook;instagram;guitar_plus;','Jakarta',978,'2017-08-31 18:00:26','2017-08-31 18:00:26'),
	(527,'SINTHINK','1504231465.jpg','Band yang terbentuk 14 oktober 2014 ini. terdiri dari lima anak muda yang memiliki tujuan yang sama dalam bermusik. sudah banyak prestasi yang di raih oleh band ini.dan kali ini akan ditunjukan di ajang bergengsi LEVI\'S BAND HUNT.','Rock','instagram;teman;','Surabaya',985,'2017-09-01 01:04:25','2017-09-01 01:04:25'),
	(528,'Black drama','1504237441.JPG','Black drama ada perubahan nama dari gazita , setela pergantian 2 orang personil drum dan bass, asal kami juga lumayan jauh dari sini, ya kami berasal dari timur indonesi , sulawesi dan papua, datang ke ibu kota awal 2011 untuk mengadu nasip dengan bermain musik,di ibukota kita suda bermain di berbagai macam acara mulai reguler sampai event seperti \"jakarta fair kemayoran,acara2 indie,japex,miss eart,dan masi banyak event2 sederhana yang kami ikuti, saat ini juga kami suda mempunyai lagu2 demo yg kami rekam di best camp kami ( walaupun sederhana si )','Alternative Rock','instagram;guitar_plus;','Jakarta',988,'2017-09-01 02:44:01','2017-09-01 02:44:01'),
