	(530,'TABS','1504245329.jpg','tabs berdiri di Yogyakarta tanggal 20 bulan april 2014\r\nsekarang Tabs berdomisili di Bandar Lampung, karna telah menyelesaikan tugas di Yogyakrta (kuliah)\r\n\r\nprestasi : juara 1 akustik festifal di KICKPARADE 2015,di Yogyakarta\r\ndan banyak mengisi gigs gigs indie di yogyakarta, diantaranya\r\n1. heavensound vol 1 dan 2\r\n2. brithis invation\r\n3. lennon days\r\n4. tributte to the beatles','Folk','instagram;','Jakarta',990,'2017-09-01 04:55:29','2017-09-01 04:55:29'),
