	(534,'unity for the respect','1504250571.jpg','Unity for the respect\r\nBerasal dari Bogor beranggota 5 orang personil.  \r\nKami terbentuk di tahun 2012 kami sering mengikuti ivent ivent musik di daerah jabodetabek .dan sekitar nya memiliki 1 mini album berjumlah 6 lagu di dalam nya.  \r\nKami memilih genre musik rock karna kami ber5 suka ber improvisasi atau mengembangkan genre rock tersebut menjadi banyak bagian. \r\nDi kesempatan kali ini .kami meng-upload salah satu single di mini album kami yang berjudul.\r\n\'takan terhenti\' kenapa kami memilih lagu tersebut.  \r\nKarna lagu ini berisi tentang 5 semangat dari semua anggota personil kami yang melebur manjadi satu.  \r\nSemoga salah satu single lagu kami ini bisa mewakili semangat kami.  Untuk terus selalu bermusik.','Rock','instagram;','Jakarta',941,'2017-09-01 06:22:51','2017-09-01 06:22:51'),
