	(565,'Mr. Bones','1504343707.jpg','Kami Mr. Bones adalah band yang bergenre reggae berasal dari kota Nganjuk, terbentuk pada tahun 2013 lalu yang sudah sempat merilis single pertama yaitu \" Try To Forget \" dan sudah sampai tahap video clip.\r\ndan sekarang ini kita mengikuti audis \" Levis Band Hunt dengan single kedua kami yang judulnya Gadis SMA.','Others','facebook;instagram;poster;','Surabaya',1048,'2017-09-02 08:15:07','2017-09-02 08:15:07'),
