	(567,'VARD HOLI','1504348775.jpg','VARD HOLI Band ini berawal dari sekumpulan anak pindahan di beberapa daerah ke Sekolah Menengah Atas Negeri 1 di Kecamatan V Koto Timur Kabupaten Padang Pariaman Sumatera Barat. Mereka pindahan Ari/Drumer dari Padang, Yatna/Gitaris dari Bogor, Doni/Bassis dari Jakarta dan Riandi/Vokalis dari Bekasi. Mereka berkumpul di sebuah lokal atau kelas yang menyatukan mereka bermula dari mp3 dihp masing-masing yang satu genre dengan mereka. Berlanjut mencoba latihan ke studio dan mencari lagu yang sesuai dengan aliran mereka. \r\nSeiring berjalannya waktu Vard Holi Mengulik satu lagu pertama mereka yang berjudul Hadapilah ciptaan Ari dan Yatna. Dan terjadilah Musibah di SumBar Pada Tanggal 29 September 2009 merobohkan semua bangunan di Sumbar umumnya, Yatna di panggil balik oleh orang tuanya ke Bogor. Semenjak kepergian yatna kebogor VH mencari pengganti Gitaris baru yaitu Vicky yang juga siswa dari SMA tersebut. Riandi Keluar Karena pindah SMA tidak Berkomitmen. \r\nBerlanjut pada lagu pertama Mereka yang berjudul Hadapilah mereka akan rekaman yang mengisi Vokal yaitu Ari. VH akan mencari Vokalis Baru yaitu Adit yang juga merupakan Siswa SMA tersebut menjadi Formasi Baru Ari/drumer, Doni/Basis, Vicky/Gitar dan Adit yang baru pada Vokal. Tidak lama pada formasi tersebut mereka mengeluarkan rekaman lagu kedua dan ketiga yang berjudul yaitu Takkan Pernah Bisa ciptaan : Ari dan Anggun, lagu Waktu Khusus Ciptaan Ari dan Doni.\r\nVard Holi juga Aktif dalam mengikuti Event di Pariaman Festival Band dan Sebagainya. Setelah mereka menyelesaikan Sekolah Mereka pada tahun 2011 Doni kembali Ke Daerahnya meninggalkan VH. Beranjak Kepadang mereka kuliah, VH juga mencari personil baru pada Bass Yang bernama Andre dari padang, di Padang VH juga aktif mengikuti On Air di radio Kota Padang, dan Guestar Pada acara SMA di Kota Padang. Tidak lama kemudian Adit Hengkang keluar dari VH melakukan Ber-Solo Karir mengeluarkan Album Solo. Vicky sibuk Kuliah di Padang Panjang diam tidak merespon dengan VH sampai saat ini. \r\nPada tahun awal 2017 Ari dan Andre berkomitmen mencari gitaris yang bisa langsung vokal  ketemu dengan Dhika mereka melangsungkan rekaman pada bulan Mei 2017 mengeluarkan Single yang Berjudul “Kawan”. mereka akan bertekad niat akan men-sukseskan, berkarya dengan VH kedepannya untuk daerah, nasional dan internasional.','Alternative Rock','facebook;instagram;lainnya;','Jakarta',923,'2017-09-02 09:39:35','2017-09-02 09:39:35'),
