	(569,'Stand by me kidz','1504357059.jpg','Stand by me kidz berasal dari kota tasikmalaya yg beraliran alternatip rock / poppunk\r\nStand by me kidz terdiri dari empat orang peraonil,  di antaranya \r\nNewin : vocal / bass\r\nAgung : gitar\r\nEful : gitar\r\nHerman : drum','Alternative Rock','instagram;guitar_plus;','Jakarta',1068,'2017-09-02 11:57:39','2017-09-02 11:57:39'),
	(570,'Laika ID','1504358863.jpg','Laika ID terbentuk sejak Maret 2013 di Kota Bekasi, dimana Arendo Sineas sebagai vokalis dan Rio Kalvari sebagai gitaris ingin membuat sebuah projek musik baru yang fresh dan tidak membawa bayang-bayang musik mereka di band sebelumnya, dimana Arendo mencari jati diri dengan musik Punk sedangkan Rio bertumbuh dewasa dengan Rock and Roll. Pemilihan nama pun dimulai, dan ketika itu tercetuslah nama Laika yang terinspirasi dari seekor anjing husky kepunyaan Uni Soviet yang menjadi makhluk hidup pertama yang terbang ke bulan didalam sebuah kapal bernama Sputnik. Karena menurut mereka berdua namanya cukup filosofis untuk dijadikan sebuah nama band, Laika digambarkan adalah personil yang tergabung didalam Laika ID sendiri, Kapal Sputnik merupakan alat dimana itu adalah sebuah karya musik yang mereka mainkan, dan bulan menjadi mimpi Laika ID dalam bermusik atau pencapaian yang akan dituju oleh Laika ID sendiri. \r\nSaat itu Arendo dan Rio mengajak beberapa teman untuk menjadi personil yang dirasa cocok untuk bergabung, sampai mereka bertemu dengan bocah konservatorium, Reindhardt Yobel yang bekerja sama dengan mereka dari tahun 2014 dan menjadi drummer tetap hingga sekarang. 1 Tahun berikutnya Laika ID mendapatkan bassist bernama Pierre Saselah, di pertengahan 2016 Bintang bergabung sebagai gitaris. Kini Laika ID adalah Arendo, Rio, Reindhardt, Pierre, dan Bintang dan sepakat mengusung aliran pop yang bergizi. 5 orang dengan visi misi yang sama dan satu tujuan yang sama bersama Laika ID. Sejauh ini Laika ID telah menciptakan 6 lagu salah satunya adalah VANATIQUE yang sudah beredar dan dapat disaksikan di Youtube sejak  23 Agustus 2017. Lagu yang ditulis oleh Arendo ini merepresentasikan kegundahan dan kekesalan dengan apa yang terjadi di kehidupan sosial masyarakat yang mudah terprovokasi dan terpecah-belah.\r\n\r\nRunner Up Lee Cooper Band Invansion 2015','Others','facebook;','Jakarta',1069,'2017-09-02 12:27:43','2017-09-02 12:27:43'),
