	(574,'Jeans Roek','1504361839.jpg','Sudah meluncurkan 2nd Album\r\n1. Bangkit Dari Kubur (2015)\r\nLauching di Jakcloth Store Bogor 24 Maret 2016.\r\nKompilasi Manajemen Artis Indonesia Lagu \"Palkon\" 2016.\r\n2. Here We Are Shut Your Mouth (2016)\r\nLaunching di RRI Bogor 26 Maret 2017.\r\nKompilasi Album Proganizer Lagu \"Indahnya Perbedaan & Lapor Polisi\" 2017.\r\n\r\nSalah satu single di Album ke-2 kami yang berjudul \"Indahnya Perbedaan\" menjadi soundtrack Hari Perdamaian Dunia di Universitas Negeri Jakarta.\r\n\r\nPanggung-panggung yang pernah kita nodai\r\n-Soundsation Gunung Putri Bogor 2016\r\n-Bogor Clothing Market 2016\r\n-Hari Jadi Bogor 2016\r\n-Jakcloth Summer Fest Kemayoran 2017\r\n-Jakcloth Lebaran Lippo Cikarang 2017\r\n-Jakcloth Lebaran Parkir Timur Senayan 2017\r\n-Pekan Raya Jakarta 2017\r\n-Bogor Clothing Fastingval Gor Padjajaran 2017\r\n-Bogor Clothing Fest Braja Mustika 2017','Rock','guitar_plus;','Jakarta',1073,'2017-09-02 13:17:19','2017-09-02 13:17:19'),
