	(579,'Fletch','1504375667.jpg','Fletch merupakan band indie pop asal kota Malang yang berdiri pada tahun 2015. Sejauh ini Fletch telah merilis 3 single yang berjudul It Sparked It Rained, Tiga Pagi,  dan Sadajiwa. Khusus 2 single terakhir sudah dapat didengarkan di Spotify. Tiga Pagi dirilis pada tanggal 28 Mei 2017 sedangkan Sadajiwa dirilis tepat pada hari kemerdekaan yaitu tanggal 17 Agustus 2017. Untuk lagu Tiga Pagi sendiri sudah masuk ke dalam 2 playlist Spotify yaitu Indienesia dan Pojok Akustik. Sampai saat ini, lagu Tiga Pagi sudah didengarkan lebih dari 100.000 kali di Spotify. Lagu Tiga Pagi ini juga masuk ke dalam album kompilasi Cassette Store Day Malang 2017 yang akan dirilis pada bulan Oktober mendatang. Untuk prestasi lainnya, Fletch juga sudah bermain di beberapa event musik besar seperti, Urbangigs dan Kickfest.','Others','informasi_toko;teman;','Surabaya',1084,'2017-09-02 17:07:47','2017-09-02 17:07:47'),
