	(581,'ELENA','1504404462.jpg','kita bertemu dari jaman sekolah\r\nsepakat untuk membentuk band ,,dan kita semua mempunyai kesukaan genre musik yang sama yaitu electronic \r\n\r\nprestasi \r\nkita sering manggung di pensi-pensi di kota kita maupun  di luar kota\r\nmenjadi opening artis','Electro','facebook;instagram;guitar_plus;poster;teman;lainnya;','Jakarta',1090,'2017-09-03 01:07:42','2017-09-03 01:07:42'),
	(582,'Jellyfish','1504405186.jpg','Band ini terbentuk pada tanggal 24 Januari 2016 lalu di Surabaya, terdiri dari Nesa (vokal), Faiz (Gitar), Wira (Bass), Zulvian (Drum), dan Amik (Keyboard). Saat ini, Jellyfish telah merilis sebuah single berjudul \"Dengarkan Aku\".','Pop','teman;','Surabaya',1042,'2017-09-03 01:19:46','2017-09-03 01:19:46'),
	(583,'MOSES BANDWIDTH','1504405735.jpg','Inspirasi awal pembentukan Moses Bandwidth berawal pada tahun 2003. Saat itu LaVey Junior yang tengah meneruskan studi kuliahnya di kota Bandung, tertarik pada beragam type musik Progressif yang memiliki nuansa metal. Tetapi selanjutnya kakaknya mengenalkan dia pada suatu genre yang bernama Gothic Metal, Dari waktu tersebut lalu LaVey Junior seolah jatuh cinta pada type musik ini, serta berusaha untuk memperoleh beragam Info serta rekomendasi tentang Gothic Metal.\r\n\r\nPada akhir tahun 2004, LaVey mencari orang yang mempunyai visi dan misi yang sama juga dengan dia, untuk membuat suatu band Progressif, tetapi ia mengerti seutuhnya bahwasanya amatlah susah untuk mencari orang di sekitar yang memiliki dedikasi tinggi pada musik Metal. Sesudah lama mencari tiada hasil, dia lalu berinisiatif untuk mebuat beragam materi lagu yang semua pelaksanaan musiknya dikerjakan oleh sendiri serta mengakibatkan, persoalan baru juga timbul saat Ia mesti memperoleh seorang untuk isi vocal.\r\n\r\nSelang beberapa saat ia menghubungi female vocal bernama Riska Elfira dan Chris Bobby (Drummer) yang disebut rekan sekelasnya dibangku kuliah sekalian adalah anggota Gabungan Nada Mahasiswa (Pasuma) UNISBA memiliki ciri-ciri vocal yang pas dengan \"Moses Bandwidth\". Seputar bulan Maret 2005, Moses Bandwidth sudah menyelesaikan suatu single pertamanya berjudul \"Selangkah Menuju Surga\" yang sistem recordingnya dikerjakan dengan cara profesional di MMS Studio, Indramayu.','Rock','facebook;','Jakarta',1089,'2017-09-03 01:28:55','2017-09-03 01:28:55'),
	(584,'The candle\'s','1504409966.jpg','Terbentuk pada tahun 2014\r\nBase studio musik 66\r\nKemayoran','Alternative Rock','facebook;','Jakarta',1078,'2017-09-03 02:39:26','2017-09-03 02:39:26'),
	(585,'The candle\'s','1504409976.jpg','Terbentuk pada tahun 2014\r\nBase studio musik 66\r\nKemayoran','Alternative Rock','facebook;','Jakarta',1078,'2017-09-03 02:39:36','2017-09-03 02:39:36'),
	(586,'Monster Pengerat Wortel','1504411164.jpg','Band dengan komposisi musik yang terbilang menentang arus, anti mainstream, dan segmented ini, sering di anggap sebagai penjelajah mesin waktu. \"mereka tidak terlahir di era ini\" celetukan yang sering terdengar.\r\nDeep, down, dan dirty yang menjadi benang merah atas landasan perpaduan antara blues era lama dan unsur dixie tanpa terompet, berhasil menghantarkan karya mereka mewarnai beberapa radio berkonteks indie di Eropa dan Amerika.\r\nSudut pandang lain dalam menyikapi kesedihan, kesendirian dan air mata, masih menjadi pokok utama dalam setiap garis lirik yang berserakan bernuansa kegelapan.','Others','facebook;instagram;','Surabaya',1091,'2017-09-03 02:59:24','2017-09-03 02:59:24'),
	(587,'The Wrench','1504411831.JPG','The Wrench was created in the late of 2013, starting as a dynamic duo, Priansya as the tempo keeper and the beat maker, and Dillon filling it with a rock- bluesy sounds. Thereafter, we decided to bring the groove as we asked Fajar to join us and we jammed together.\r\nWhen we work on a bluesy tones, we often took a bit of “Jimi Hendrix” style. And when we want to rock a bit out, we took the 60’s or 70’s rock ‘n’ roll kinda sounds, but then we decided to go both ways, and adding a little funk in our sound. Ours, and ours alone. As we’re still green in this kind of music, we got so much to do and a lot of things to explore. Well whatsoever, we love music, and we’ll always be.','Rock','facebook;','Jakarta',1094,'2017-09-03 03:10:31','2017-09-03 03:10:31'),
	(588,'A L I V E','1504412650.jpg','est 2009, formasi awal 6 orang..dan yg tersisa hanya 3 orang, memiliki pengalaman manggung dan punya lebih 10 track,  menjadi bagian event amild wanted 2010.','Pop','teman;','Jakarta',1036,'2017-09-03 03:24:10','2017-09-03 03:24:10'),
	(589,'Sinleto','1504413038.JPG','Sinleto telah merilis mini album yang berjudul \"SEROJA\" pada tanggal 1 januari 2017, dan berisikan 6 lagu (4 lagu mini album, 2 lagu bonus track)','Alternative Rock','instagram;poster;','Surabaya',1095,'2017-09-03 03:30:38','2017-09-03 03:30:38'),
	(590,'Ruang Kosong','1504413687.jpg','Kami terbentuk tahun oktober 2015 dengan formasi awal dicky, novan kemudian january 2016 enggar masuk mengisi plot bass disertai dengan ricard yang bergabung akhir agustus 2017 sebagai posisi drum. di bagian drum kami sudah 3 kali  berganti personil di sepanjang tahun 2016. hingga periode ini kami berkomitmen untuk selamanya berkarya. dari segi prestasi di tahun 2016 kami pernah juara 2 sebagai band favorit pada event ramadhan sensation di graha fairground surabaya, november 2016 sebagai partisipan untuk acara dan pemutaran film perdana di Tribute to oasis di M radio surabaya, july 2017 kami berkesempatan untuk live audition road to soundrenaline di pazkul sidoarjo dan di akhir agustus kami berpartisipasi di pemecahan rekor bersama 1015 musisi di kodam surabaya.','Alternative Rock','instagram;teman;','Surabaya',1083,'2017-09-03 03:41:28','2017-09-03 03:41:28'),
	(591,'Pronks','1504416074.jpg','Band Alternative sejak 2012. Terbentuk dan berdomisili di Malang. Merilis debut EP berjudul Lullabies For Insomnian di akhir 2015.','Alternative Rock','teman;','Surabaya',1059,'2017-09-03 04:21:14','2017-09-03 04:21:14'),
	(592,'MASTERPLAN BAND','1504416272.jpg','MASTERPLAN Band terbentuk 2 tahun yang lalu di kota Ciamis, Jawa Barat.\r\nMusik kami berasal dari berbeda-beda band dan berbeda-beda genre juga. \r\nAda yang senang Rock, Alternative rock, Japanese Rock, British, & Metal. Dan sekarang terbentuk dalam MASTERPLAN Band dengan berGenre musik Alternative Rock.\r\nMASTERPLAN biasa maen di gigs2 Pensi, Produk Event, Ulang tahun Kota, dll. Di sekitaran kota Ciamis, Tasikmalaya, Bandung dll.\r\nTerakhir kemarin kita masuk di ajang RISING STAR INDONESIA 2016 yang ditayangkan oleh RCTI.\r\nMASTERPLAN lolos audisi regional Bandung, lalu lolos di babak ROOM AUDITION (Audisi bertempat di studio RCTI, Kebon jeruk, jakarta. Lolos dan masuk ke tahap LIVE AUDITION, lolos lagi dan masuk ke tahap LIVE DUEL.\r\nDan MASTERPLAN masih berjalan sampai sekarang.','Alternative Rock','instagram;','Jakarta',953,'2017-09-03 04:24:32','2017-09-03 04:24:32'),
	(593,'4 Event','1504417619.jpg','Terbentuk tanggal 29 februari 2016, berawal dari grup jual beli gitar di facebook. Tanpa memandang umur, maupun yang lainnya. Karena keinginan kita semua sama, yaitu berkarya di dunia musik.','Rock','teman;','Surabaya',1007,'2017-09-03 04:46:59','2017-09-03 04:46:59'),
	(594,'MASTERPLAN BAND','1504417732.jpg','MASTERPLAN Band terbentuk 2 tahun yang lalu di kota Ciamis, Jawa barat.\r\nPersonil MASTERPLAN berasal dari berbeda-beda band & berbeda-beda genre pula, ada yang senang Rock, Alternative Rock, Japanese Rock, & British.\r\nMASTERPLAN biasa perform di gigs2 Pensi, Product Event, Ulang Tahun kota dll. Di sekitaran kota Ciamis, Tasikmalaya, Banjar, Bandung, dll.\r\nTerakhir kemarin MASTERPLAN mengikuti ajang RISING STAR INDONESIA season 2, yang ditayangkan oleh RCTI.\r\nKami mengikuti audisi regional Bandung.\r\nDari situ MASTERPLAN lolos ke babak ROOM AUDITION (Audisi bertempat di studio RCTI kebon jeruk, Jakarta). Alhamdulillah lolos dan masuk ke babak LIVE AUDITION, dari LIVE AUDITION alhamdulillah lolos. Sehingga masuk ke babak berikutnya yaitu LIVE DUEL.\r\nDan MASTERPLAN sekarang masih berjalan.','Alternative Rock','instagram;','Jakarta',953,'2017-09-03 04:48:52','2017-09-03 04:48:52'),
	(595,'Radio Story','1504422190.jpg','Radio Story adalah sebuah group/band yang terbentuk di akhir tahun 2014. Konsisten dengan mengusung sub-genre Melodic Punk/Alternative, Radio Story telah melahirkan sebuah mini album yang bertajuk \"Quaternion\".','Alternative Rock','facebook;instagram;','Surabaya',1020,'2017-09-03 06:03:10','2017-09-03 06:03:10'),
	(596,'Breaking the Brain','1504422596.jpg','Breaking the Brain terbentuk pada 19 Februari 2016\r\nPada awal terbentuk ada empat personil, pada akhir 2016 salah satu personil memutuskan keluar karena akan menikah.\r\nSampai saat ini, band ini beranggotakan 3 orang personil.\r\nAbdillah (Vokal,Bass)\r\nSurya (Gitar)\r\nDikin (Drum)\r\nBreaking the Brain bergenre Pop Punk\r\nInfluence : Blink 182, NTRL, Pee Wee Gaskins, Rocket Rockers\r\nPada bulan September 2017, kami mengeluarkan dua single baru, dan total ada 5 single yang sudah kami record\r\nKami sering ikut support acara band lokal di Surabaya dan sekitarnya (Regist)\r\nKami berharap bisa tampil di panggung panggung di seluruh Indonesia, menghibur banyak orang','Others','teman;','Surabaya',1072,'2017-09-03 06:09:56','2017-09-03 06:09:56'),
	(597,'The Paper Roll','1504426570.jpg','Awal anggota terbentuk hanya 2 orang teman yang sepemikiran ingin membuat sebuah mini album untuk di dengar orang-orang. Dan akhirnya terbentuk band yang kami namakan \"The Paper Roll\".\r\nPrestasi kami :\r\n1. Juara Pertama di pestival Magnify \"North Blash\", Tahun 2016.\r\n2. Juara Ke-3 di Pestival Magnify \"Rock Your Freedom\", Tahun 2017','Alternative Rock','facebook;instagram;','Medan',609,'2017-09-03 07:16:10','2017-09-03 07:16:10'),
	(598,'Hunter Band','1504429757.jpg','kami band indie surabaya\r\nterbentuk tahun 2007','Pop','facebook;instagram;teman;','Surabaya',1098,'2017-09-03 08:09:17','2017-09-03 08:09:17'),
	(599,'Bekstun','1504431676.jpg',': BEKSTUN Band Rock Asal Bandung yang terbentuk sejak tahun 2014 dengan formasi Bintang (gitar) Alvin (gitar/vocal) Dani (Bass) Raka (Drum). Genre Musik Bekstun adalah Rock dengan sedikit sentuhan Blues pada setiap lagu nya yang mempunyai Ciri khas tersendiri, saat ini Bekstun sedang sibuk menyiapkan EP (mini album) . Bekstun sering diundang/berkesempatan perform di Beberapa Event di Bandung musik dll dan pernah mendapatkan Sertifikat penghargaan Band dari event UNPAD Bandung . Pada tahun 2016 lalu BEKSTUN telah menyelesaikan projek 2 Single Perdananya. Di tahun 2017 ini Bekstun dan 2 band rock asal bandung juga diundang untuk bisa mengisi acara di Kota Purwakarta.','Rock','guitar_plus;','Jakarta',1109,'2017-09-03 08:41:16','2017-09-03 08:41:16'),
	(600,'Kayana Band','1504431790.jpg','Band ini berdiri pada tanggal 3 mei 2015 di kota pahlawan Surabaya. Event yang pernah kami ikuti yaitu festival W.R Soepratman Jazz Festival Kaza City Mall mendapatkan juara 1, dan Festival dies natalis 56 ITS mendapatkan juara 1. Kami berjumlah 6 personil yang terdiri dari Frisca (vocal), Davit (Drum), Danang (Guitar), Ochang (Guitar), Dimas (Bass), dan Radith (keyboard).','Jazz','instagram;','Surabaya',1108,'2017-09-03 08:43:10','2017-09-03 08:43:10'),
