	(606,'San Reys','1504434848.jpg','San Reys ( dibaca s^n reys ) dibentuk pada tanggal 1 agustus 2016. Nama San Reys diambil dari Bahasa inggris “Sun Rays”, namun penulisannya di ubah kedalam bahasa Indonesia mengikuti Pelafalannya (Pronunciation).  Dengan visi dan misi yang sama dari empat personil yaitu Norman , Dimas, Rifky dan Okta. Dengan mengusung genre \"Alternative Rock\", mereka yakin bisa meramaikan musik di Indonesia terutama Palangkaraya tempat lahirnya band San Reys.\r\n\r\n Sejak mula terbentuknya San Reys, mereka selalu ikut berpartisipasi dalam acara-acara musik yang diadakan di kota asal mereka yaitu Palangka Raya. Mereka selalu turut ambil bagian di \r\ndalam event-event di kota tersebut.\r\nMulai dari Panggung Acara Festival Musik Hingga Panggung Acara Hiburan. \r\n\r\nUntuk acara Festival Musik, di Palangka Raya memang jarang sekali mengadakannya saat mula terbentuknya San Reys, sehingga San Reys hanya pernah mengikuti Festival Musik sebanyak dua kali sejak pertama kali terbentuk hingga saat ini. Prestasi yang pernah diraih San Reys dalam Festival Musik adalah menjadi \"juara satu\" dalam acara Musik Anak Jalanan yang diadakan oleh Polda Kalteng. \r\n\r\nBeda Halnya dengan Acara Panggung Hiburan, San Reys selalu ikut ambil bagian karena seringnya diadakan Acara Musik Panggung Hiburan ketimbang Festival Musik di kota mereka. Mulai dari Full band Hingga Akustik.\r\n\r\nUntuk Full Band, San Reys sering berpartisipasi dalam berbagai Event Kota dan Kegiatan yang diadakan oleh berbagai kalangan. Seperti hari perayaan, hari ulang tahun, pesta rakyat hingga acara musik indie lokal.\r\n\r\nKhusus untuk Akustik, San Reys saat ini mengikat kerjasama sebagai Home Band di Login Cafe setiap minggunya yang berada di Kota mereka.\r\n\r\nSan Reys juga sudah pernah dua kali mengikat Kontrak Kerjasama bersama Aquarius Boutique Hotel untuk tampil menjadi Home Bandnya di Lios Cafe ketika Bulan Ramadhan 2016 dan 2017.\r\n\r\ndemikianlah cerita dan prestasi singkat dari San Reys. Masih banyak cerita Perjalanan dari San Reys yang belum dibagikan, atas perhatiannya, San Reys ucapkan Terimakasih.','Alternative Rock','teman;','Surabaya',404,'2017-09-03 09:34:08','2017-09-03 09:34:08'),
	(607,'Kecikitty','1504435132.png','Finalis Soundsation region Jakarta Selatan, Kami juga sempat mengisi di acara Pensi di SMA Jakarta, Jakcloth Cirebon, Ulang tahun Kota Solo, Semarang Fair, dan masih banyak lainnya, dan salah satu prestasi bagi kami yaitu lahirnya album perdana kami yang bertajuk \"Hedonisme\".','Rock','instagram;','Jakarta',1105,'2017-09-03 09:38:52','2017-09-03 09:38:52'),
	(608,'MAUT','1504437495.jpg','MAUT adalahband bergenre \"Heavy Rock\" asal Jkarta yang dimotori oleh Martin dan Iqbal Aria pada akhir tahun 2015. Kemudian Martin mengajak Agil ikut dalam band dengan mengisi posisi sebagai bassist. Pada awal tahun 2016 MAUT telah merekam single perdana yang bertajuk \"Roda dan Kayu\"diikuti dengan beberapa kali manggung di acara-acara kampus dan gigs kecil. Pada awal tahun 2017 Martin mengundurkan diri dari MAUT, akhirnya Raveliza Ramadhan kami percaya untuk mengisi posisi sebagai drummer. Kini MAUT sedang menggarap album perdana yang akan dirilis pada tahun 2018 mendatang.','Rock','instagram;','Jakarta',800,'2017-09-03 10:18:15','2017-09-03 10:18:15'),
	(609,'Deaf Dog','1504439208.jpg','Berawal dari satu hobi yang sama. Kami, Antonius, Micho, Robby dan Yustino membuat band yang bernama Deaf Dog. Kami sudah memiliki beberapa lagu kami sendiri dan salah satunya adalah \"Dalam Gelap Bercerita\" yang dikemas dengan musik yang fresh, easy listening dan dapar dipertanggung jawabkan','Others','facebook;instagram;vipclub;guitar_plus;umi;lainnya;','Yogyakarta',1116,'2017-09-03 10:46:48','2017-09-03 10:46:48'),
	(610,'Mukalangka','1504439980.jpg','Band yang ingin karyanya disukai oleh banyak orang dan para pecinta musik khususnya.\r\nSering menjadi tribute Nirvana dan menjadi Guest Star dalam acara Indonesia Culture Expo 2016 di Shah Alam, Malaysia.','Alternative Rock','guitar_plus;','Jakarta',1039,'2017-09-03 10:59:40','2017-09-03 10:59:40'),
	(611,'escpd','1504442905.jpg','Escpd merupakan band yang berdiri pada akhir 2016 di Jakarta, Indonesia. Dikembangkan dari grup band sebelumnya yang terdiri dari Riza Bachri (Vokal, Gitar), Satria Bimasakti (Bass, Vokal), dan Thareq Satria (Drum, Vokal). Escpd menambah satu personil yaitu Arfan Bachri (Gitar, Vokal) untuk memperkuat dan menjadikan escpd sebagai band dengan personil yang beranggotakan 4 orang.\r\n\r\nA Fool\'s Foolish Question menjadi single pertama yang akan dirilis di semua platform musik digital (spotify, apple music, dll) pada 17 Agustus 2017. Konflik perbedaan persepsi antara benar dan salah menjadi tema yang diangkat pada lagu ini. Proses produksi lagu ini memakan waktu kurang lebih 6 bulan, diawali dengan proses take rekaman di ALS Studio hingga proses mastering yang dilakukan di Sage Studio, Amerika Serikat. Dengan proses produksi yang sedemikian rupa, berharap single ini akan ikut meramaikan industri musik di Indonesia.\r\n\r\nSetelah merilis lagu ini, ditargetkan Escpd akan merilis EP pertamanya pada tahun 2018 nanti dengan materi yang sedang digarap.','Rock','facebook;','Jakarta',1122,'2017-09-03 11:48:25','2017-09-03 11:48:25'),
	(612,'Shroomeater','1504445201.jpg','shroom eater band yang mengambil genre rock dengan sub genre (stoner, rock n roll ) Band refrensi: black sabbath, the sword, earthless, wolfmother, clutch, graveyard, dan masih banyak lagi. Personel : raksa (tendensi bunuh diri) sebagai vokalis, armando sebagai guitar lead and melody, yongki sebagai drummer, dan Bhamby sebagai bassist. Berdiri sejak 2014 yang sebelumnya beraliran thrash metal lalu berganti menjadi genre rock dengan beberapa sub genre yg diambil pada awal 2015.','Rock','poster;','Jakarta',1026,'2017-09-03 12:26:41','2017-09-03 12:26:41'),
	(613,'D\'ROYALS','1504445967.jpg','DROYALS TERBENTUK PADA JANUARI 2017\r\nPRESTASI:\r\n1. PERINGKAT 1 LAGU INDIE DI RADIO CASSANOVA BALI (PROGRAM INDIE COMUNITY)','Rock','facebook;instagram;teman;','Yogyakarta',84,'2017-09-03 12:39:27','2017-09-03 12:39:27'),
	(614,'The Godspeed','1504446802.jpg','Berawal dari sejarahnya, The Godspeed merupakan band\r\nasal Yogyakarta terbentuk pada bulan Maret 2015 dan bertepatan\r\nketika nama The Godspeed itu sendiri diambil. Nama Godspeed\r\ndiambil dari kata pada sebuah plakat peluncuran Apollo 11 ,dan\r\ndiambil dari kata kata yang di ucapkan para pelaut pada pelaut lain\r\nnya yang akan pergi berlayar \"semoga saudara berhasil\" atau seperti\r\nungkapan makna dari kata good luck.\r\nBand ini terdiri dari Abi Zulfakhry Rosadi (Vokal), Ferdy\r\nRamadhan (Guitar / BackingVokal), Fawwaz Athifi (Guitar),\r\nMertiAfridin / Mree (Bass), Muhammad Kemal Akbar (drum). Secara\r\ngenre Godspeed mengusung Rock dengan sentuhan blues. Secara\r\nkeseluruhan Band-band yang menjadi influence kami yaitu The\r\nBlack Keys, Led Zeppelin, Nirvana, Artic Monkeys.\r\nSingle pertama kami telah kami rilis dan bisa didengarkan\r\noleh khalayak ramai lewat soundcloud melalui akun The\r\nGodspeedINA yang berjudul “Under Control”. Dan dalam waktu dekat\r\nini, single pertama kami tersebut akan segera diperluas melalui akun\r\nSpotify dan media yang lainnya dan berharap musik yang kami\r\nbawakan bisa di apresiasi oleh semua orang.','Rock','guitar_plus;','Yogyakarta',1041,'2017-09-03 12:53:22','2017-09-03 12:53:22'),
	(615,'EVVI','1504446842.jpg','EVVI adalah sebuah grup band beraliran emotional metalcore asal Surabaya yang dibentuk pada tanggal 13 Oktober 2016. Beranggotakan 4 orang pada awal berdiri yang terdiri dari Wino (Drumer), Uyab (bassis), Tanju (gitaris), Nanda (vokalis). Namun saat ini band ini memiliki formasi baru menjadi berlima, dengan menambah gitaris satu lagi bernama Ervan sebagai  gitaris.\r\n\r\nEVVI yang berdiri tahun 2016 dan berdomisili di Surabaya ini terbentuk dari kegelisahan Wino dan Tanju yang baru saja mengundurkan diri dari band-nya yang dulu beraliran rock, karena dirasa kurang cocok. Lalu mereka mengajak Nanda dan Bayu untuk bergabung dalam band-nya. Mereka memadukan antara genre metalcore dan emotional hardcore, lalu mereka berani menyebutnya emotional metalcore untuk menunjukkan jati diri mereka.\r\n\r\nEVVI telah menghasilkan single pertama “The Canary”, yang menceritakan kegelisahan seseorang dalam hidupnya yang mencari sebuah kebebasan, yang mereka gambarkan dengan seekor burung Kenari.\r\n\r\nDan untuk kedepannya, Band yang kini beranggotakan 5 orang ini masih menggarap beberapa single, maka ditunggu saja pergerakan-nya untuk siap mewarnai skena underground tanah air.​\r\n\r\nPernah berpartisipasi dalam event Indie Clothing Expo 2017','Others','teman;','Surabaya',1104,'2017-09-03 12:54:02','2017-09-03 12:54:02'),
	(616,'FAYRUSH','1504446953.jpg','fayrush adalah band pop kreatif asal yogyakarta, berawal dari beberapa band yang berbeda sering bertemu di panggung kemudian kita mencoba sama sama menyalurkan hobi dan kreatifitas membuat karya karya musik seperti yang saat ini.\r\nsemoga bisa mendapat apresiasi dari teman teman pendengar semuanya.','Pop','guitar_plus;','Yogyakarta',526,'2017-09-03 12:55:53','2017-09-03 12:55:53'),
	(617,'Brawijaya','1504448911.jpg','Band ini terbentuk atas dasar keinginan para personel untuk mencapai masa depan yang lebih baik melalui bermusik. Dengan menggabungkan personel personel terbaik di kota Wonogiri yang telah beberapa kali memenangkan festival tingkat nasional, Brawijaya Band berharap dapat bergabung di major label untuk lebih luas mengembangkan musikalitas, dan juga turut memajukan dunia musik nasional dengan kualitas-kualitas yang kami miliki. Band ini merupakan harapan seluruh personel untuk menggapai kesuksesan dan salah satu cara untuk berkontribusi memajukan musik Indonesia yang berkualitas tinggi. Brawijaya Band berharap dengan mengikuti Levi Band Hunt, harapan kami dapat terwujud untuk bergabung dengan major label dan untuk menunjukkan kualitas band kami didepan dewan juri dan masyarakat luas.','Pop','teman;','Jakarta',1114,'2017-09-03 13:28:31','2017-09-03 13:28:31'),
	(618,'GURAU SENJA','1504450676.jpg','awal terbentuknya \"GURAU SENJA\" pada tanggal 19 agustus 2016 terbentuknya saatkita lagi kumpul kumpul sore hari dan ada sebuah ide untuk membentuk sebuah band yang bernuansa folk pop, kita baru manggung di cafe cafe acara pensi sekolah dan acara kampus, bertepatan pada 1 tahunnya band kami berdiri. kami merilis sebuah single baru yang berjudul \"BATAS MIMPI\" sekian terimakasih mari membumi #marimembumi','Folk','facebook;','Jakarta',770,'2017-09-03 13:57:56','2017-09-03 13:57:56'),
	(619,'Garside','1504450928.jpg','Garside merupakan band indie bergenre dance-rock yang berasal dari Medan, Indonesia. Band ini terbentuk pada tgl 1 Maret 2017. Beranggotakan 5 orang: Ellen pada vocal, Jeje dan Afif pada gitar, Sam pada bass, dan Arep di drum. Lagu pertama Garside yang berjudul \"Pretend\" di rilis pada tgl 14 Agustus 2017. Garside sedang mempersiapkan untuk rilis lagu kedua dalam waktu dekat ini. Soundcloud: soundcloud.com/garsideofficial IG: @garsideofficial Email: garsideofficial@gmail.com','Others','teman;','Medan',896,'2017-09-03 14:02:08','2017-09-03 14:02:08'),
	(620,'Evalin','1504451115.jpg','Evalin adalah band beraliran Pop asal Yogyakarta yang beranggotakan Sukma (Vokal), Anton (Bass), Pandu dan Beben (Gitar), dan dibantu Fakhriyan (Additional Drum) dan Dito (Additional Keyboard). Evalin telah melepas single pertamanya yang berjudul \"Masih\" pada tanggal 17 Agustus 2017','Pop','instagram;poster;teman;','Yogyakarta',606,'2017-09-03 14:05:15','2017-09-03 14:05:15'),
