	(626,'RABR','1504452765.jpg','kami terbentuk pada tahun 2014. pada awalnya kami merupakan band tribute The Beatles dan memiliki nama The Rubber\'69 yang kami adaptasi dari judul album The Beatles yaitu Rubber Soul. kemudian di awal tahun 2017 kami memutuskan untuk menulis lagu kami sendiri dan merubah nama band kami menjadi RABR yang merupakan singkatan masing-masing personil (Rama,Ammar,Bismo, dan Refki).\r\n\r\nBerikut adalah prestasi dan jam terbang kami:\r\n1. Tampil di acara Closing Quatrolympic dan Qbike, yang persembahkan oleh SMAI Al-Azhar 04 Kemang Pratama, Bekasi.\r\n2. Tampil di acara Re-Aggression #1, yang dipersembahkan oleh Basilisk dan Indiesline\r\n3. Tampil di beberapa acara Tribute to The Beatles di Bekasi dan Jakarta\r\n4. Tampil di acara KitaKustik dan Musik Teras Atas, yang diadakan oleh yayasan musik KITA ANAK NEGERI.\r\n5. Tampil di acara Friday Madness, di Univ. Paramadina\r\n6. Tampil di acara Astro, yang di persembahkan oleh SMAN 8 Bekasi\r\n7. Tampil di Jakarta Garden City, Cakung','Others','facebook;','Jakarta',1128,'2017-09-03 14:32:45','2017-09-03 14:32:45'),
	(627,'MRBRANDDY','1504456681.jpg','Tour with LA Concert 12 kota di Jatim, 7 kota with Telkom Flexy, Kompas TV, Ultah SBO TV, Juara 2 Dahsyat RCTI, Dahsyat XL, Opening Marvel, Drive, Kotak band.','Pop','instagram;','Surabaya',1106,'2017-09-03 15:38:01','2017-09-03 15:38:01'),
	(628,'Me and My Foodtruck','1504458985.jpg','We began as 4 boys in South Tangerang with nothing better to do and one thing in mind: making music. We started off playing regularly at our highschool, until we thought about getting things serious.\r\nWe took a look at ourselves and found what we all felt collectively about music, we appreciate most by its diversity and it was what led us to the tunes we have now.\r\nWe play different genres. With this in mind the name shortly came after. \"Music is a lot like food, it comes in different tastes and colours.\" And seeing how we play different genres we call ourselves: Me and My Foodtruck.\r\n\r\n-Achievement-\r\n\r\nPerforming on stage, chronologically:\r\n- PL Fair Fest by SMA Pangudi Luhur, Jakarta. (2014)\r\n- Festival Bazaar Ancol, Jakarta. (2014)\r\n- Beevolution Cup by Binus School Serpong, South Tangerang. (2015, 2016)\r\n- Rock n’ Roll Night by Ravers Entertainment, South Tangerang. (2015)\r\n- Bynamic Fest by Binus School Serpong, South Tangerang. (2015, 2017)\r\n- Sky Avenue by SMA Labschool Kebayoran, Jakarta. (2015)\r\n- Dynamite Vancofest by Sekolah Tunas Indonesia, South Tangerang. (2015)\r\n- Dogchella Fest by SMA Garuda Cendekia, South Tangerang. (2015)\r\n- Konser 1000 Band by Pekan Raya Indonesia, ICE BSD. (2016)\r\n- Econofest by ESB FEB Universitas Gadjah Mada, Jogjakarta. (2017)\r\n- A number of private gig.\r\n\r\nMedia who supported us!\r\n-Gadis Magazine edisi 26, 10-23 October 2015. \r\n-Tangsel Pos, April 12th, 2015.','Pop','instagram;poster;teman;','Yogyakarta',1137,'2017-09-03 16:16:25','2017-09-03 16:16:25'),
	(629,'Good Muzzle Love Summer','1504459057.jpg','Good Muzzle Love Summer adalah band beraliran Rock (spesifik: Pop Punk) dari Jakarta.\r\n\r\nDidasari oleh passion dan motivasi yang sama di dunia Musik, Gilang, Jonny, dan Jowel, yang \r\npada awalnya mempunyai band masing-masing, berkomitmen untuk \r\nmembentuk band ini di awal tahun 2017, dengan musik yang fresh, dan dengan tujuan menyegarkan telinga pendengar.\r\n\r\nGood Muzzle Love Summer pun merekrut additional drummer sebagai pelengkap ketika perform.','Rock','facebook;instagram;','Jakarta',1131,'2017-09-03 16:17:37','2017-09-03 16:17:37'),
	(630,'RARE4','1504460404.jpg','RARE4 terbentuk pada tanggal 25 Oktober 2015, pada saat itu kami diajak kepada teman kami untuk mengisi acara Sumpah Pemuda, dengan semangat yang tinggi kami membentuk sebuah band bernama RARE4 yang diambil dari nama-nama personil kami pada saat itu. RARE4 sendiri mengusung genre Pop Alternative karena dianggap yang paling cocok dengan setiap karakter personilnya.','Pop','instagram;','Jakarta',1140,'2017-09-03 16:40:04','2017-09-03 16:40:04'),
	(631,'Arch Project','1504493851.png','Hardrock Band based in Yogyakarta.','Rock','instagram;guitar_plus;maliq;poster;teman;','Yogyakarta',343,'2017-09-04 01:57:31','2017-09-04 01:57:31'),
	(632,'Black Flag Army','1504498088.jpg','musik kami terinspirasi dari musik rock era 80 dan 90, seperti guns n roses, metallica, blue oyster cult dll,dan kami yakin band ini akan menjadi trandseter dan sukses jika mendapat record deal dari universal music indonesia','Alternative Rock','facebook;','Surabaya',603,'2017-09-04 03:08:08','2017-09-04 03:08:08'),
	(633,'Tetra Band','1504502264.jpg','Official Tetra Band Based in Ponorogo City, East Java, Indonesia Est.2015. Membangkitkan kembali jiwa rock di kalangan anak muda, Tetra Band hadir dengan genre bernuansa Rock Modern & Rock Alternatif. \"KITA\" merupakan single & video klip pertama yang bercerita tentang arti persahabatan pada masa remaja, di dalam persahabatan tersebut pasti ada perbedaan-perbedaan yang melengkapi persahabatan tersebut. Didalam perbedaan tersebut kita bisa menyatukan dan membuat persamaan dalam persahabatan. Akhirnya terciptalah \"KITA\"\r\n\r\nPrestasi:\r\n1. Juara 1 Festival Honda MPM Motor 2016 \r\n2. Juara 2 BRI Festival 2016\r\n3. Juara 3 Grebeg Suro Rock Festival','Alternative Rock','guitar_plus;','Yogyakarta',1019,'2017-09-04 04:17:44','2017-09-04 04:17:44'),
	(634,'Every Brains','1504502763.jpg','Every Brains, berdiri sejak tahun 2010. Berawal di massa-massa SMA kami, saat musik elektrik sedang bergejolak tapi kami menolak untuk terhanyut dalam dentuman beat yang terdengar dimana-mana. Kami memilih untuk menikmati kerasnya musik ACDC, The Doors, The Sigit dan musik-musik yang sebagian besar adalah warisan dari ayah-ayah kami. \r\n\r\nGigs pertama kami di imax kemang pada tahun 2010, tercengang saat melihat crowd berlari kearah kami ketika kami membawakan T.N.T dari ACDC. Saat itulah kami meyakini bahwa ROCK adalah musik & lifestyle kami. \r\n\r\nSempat vakum lama karena kebutuhan hidup yang memaksa kami untuk menjauh dari mimpi dan setelah beberapa kali mencari-cari drumer pengganti teman kami yang memutuskan untuk berpisah, akhirnya Togu hadir dengan pukulan blues nya yang membangunkan lagi hasrat kami untuk bermimpi lebih jauh. Kini kami hanya ingin mimpi kami terdengar dan berharap dapat membangkitkan kembali kejayaan musik rock.','Rock','instagram;','Jakarta',1151,'2017-09-04 04:26:03','2017-09-04 04:26:03'),
	(635,'CUBASE','1504504231.jpg','cubase semi finalist asian beat 2015 surabaya regional\r\nmanggung cafe to cafe\r\nband audisi djarum supermusic','Alternative Rock','poster;teman;','Surabaya',181,'2017-09-04 04:50:31','2017-09-04 04:50:31'),
	(636,'Jamuju','1504504391.jpg','Berawal dari akhir tahun 2015, Risky memiliki ide untuk membentuk sebuah band. Lalu ia mengajak Fahmi untuk mengisi posisi drum. Sampai akhirnya mereka berdua mencoba untuk membuat beberapa lagu. lalu mereka bertemu dengan Yusuf Bagus untuk mengisi posisi vokal sekaligus penulis lirik.\r\n\r\n    Seiring berjalannya waktu, Risky mengajak Dimaz untuk mengisi posisi bass. Dan akhirnya setelah personil lengkap, terlahirlah sebuah band bernama Jamuju. Dan meraka memulai untuk membuat beberapa demo DIY dengan serius.\r\n\r\n    Lalu pada awal tahun 2017 Yusuf Bagus memutuskan untuk hengkang. Kemudian, pada pertengahan tahun 2017, Risky mengajak Afrian Arif untuk menggantikan posisi Yusuf Bagus sebagai vokalis.\r\n\r\n    Untuk prestasi, hingga saat ini Jamuju belum pernah mendapatkan satupun prestasi. Ya mungkin jika Jamuju dapat memenangkan Levi\'s Band Hunt ini, itu menjadi prestasi pertama mereka.','Others','guitar_plus;','Jakarta',616,'2017-09-04 04:53:11','2017-09-04 04:53:11'),
	(637,'ROMANTICK','1504505596.jpg','Berangkat dari sebuah persahabatan yang lama, walaupun kami pribadi yang berbeda-beda, tetapi kami selalu menerima perbedaan itu untuk bersatu.\r\n\"SATU NAMA, SATU MIMPI, DIRAIH BERSAMA DAN UNTUK BERSAMA\"\r\nWe Are ROMANTICK!\r\nSweet Rock!\r\n\r\nPrestasi :\r\n- Juara 1 \"Rock Fest Kediri Jatim 2011\"\r\n- Finalis 3 besar Band \"Digital Icon with RCM Jakarta 2014\"\r\n- 10 besar Kompilasi Album Alfa Record \"Project Alfa 2015\"','Alternative Rock','guitar_plus;','Yogyakarta',1021,'2017-09-04 05:13:16','2017-09-04 05:13:16'),
	(638,'Alkemirasa','1504508425.png','Alkemirasa terbentuk tahun 2016 yang beranggotakan 4 personil yang berasal dari Jakarta. Kami merupakan band yang mengawalinya dengan merilis 3 lagu yang sudah ada di soundcloud kami.','Alternative Rock','instagram;','Jakarta',1141,'2017-09-04 06:00:25','2017-09-04 06:00:25'),
	(639,'Nokta','1504513632.jpg','Terebntuk pada 12 November 2012\r\nsingle pertama \"Andai Saja\"','Pop','instagram;poster;teman;lainnya;','Surabaya',1165,'2017-09-04 07:27:12','2017-09-04 07:27:12'),
	(640,'pride','1504514913.JPG','band yang terbentuk 2011 ini terus berkarya dengan membuat beberapa lagu yang terus di rekam,dan kali ini mereka mengikuti festival levi\'s','Alternative Rock','facebook;','Jakarta',1155,'2017-09-04 07:48:33','2017-09-04 07:48:33'),
	(641,'KATFIS','1504516329.jpg','KATFIS was formed on March 2011 at one of the blues music festival in Jakarta, when at that time each of us performed at the festival in our respective groups. It was born from the inspiration of Babet and Efril who have been passionate on the local independent music scene in Jakarta. We decided to create a duo group comprised of guitar and drums to explore music without boundaries. An exploration of blues and rock music expressed without any restrictions and formalities. We often enter the studio and \"boom!\" our works are written with flow and dynamic. We have similar taste, vision and mission to play music that builds our strong characters to stay active on various music events both locally and internationally. In the beginning we were both quite busy with other music groups making Katfis started to be active by the end of 2012. We are releasing a mini album by the end of the year and compact tour gigs are our plans. Realizing changes in the music industry are happening frequently, we believe we can contribute to this trend.\r\n\r\nWe called it Katfis (was \"The Deadcatfish) for the name reflects the other sides of our lives. It serves as a media to express our desires and unique ideas by implementing them into music. To allure and simplify the name of the band, without diminishing the essence of its philosophy, we cut off the name into KATFIS We obtain the name from the philosophy of the catfish itself that has the advantage to survive very nimbly in a difficult terrain. Moreover, we amazed that catfish has an extra respiratory, that is called \"arborecent organ\", which fully folds, just like our band that always has extra ideas to express ourself in a unique way.','Rock','facebook;instagram;guitar_plus;','Jakarta',1166,'2017-09-04 08:12:09','2017-09-04 08:12:09'),
	(642,'RPlay Band','1504518436.JPG','Band kami terbentuk 7 Juli 2011, RPlay adalah singkatan dari Romeo Play sosok Romeo bagi kami adalah tipe Lelaki yang setia, disini kami melambangkan arti setia berarti konsisten berkarya di jalur musik. Kami jarang mengikuti kompetisi band karena kami lebih fokus berkarya di jalur indie, hanya ini saja yang bisa kami jelaskan, terima kasih','Blues','facebook;instagram;teman;','Yogyakarta',846,'2017-09-04 08:47:16','2017-09-04 08:47:16'),
	(643,'O.L.D','1504520444.jpg','O.L.D band terbentuk pada tahun 2010 dikota kecil Kab.Tanah Bumbu Kalimantan Selatan dengan beranggotakan 5 personil yakni Matt Rock(Vocalis), Ayoy(Gitaris), Uyo(Bassist), Azis(Keyboardist) dan Abee(Drummer)\r\nBand ini dulunya bernama Diamond Impact namun pada tahun 2017 ini kami melakukan perubahan nama menjadi O.L.D.\r\nO.L.D band sudah sering meraih juara pada ajang2 festival band dan band competition diKalimantan. Khususnya pada tahun 2016 kemarin O.L.D berhasil meraih Best Runner Up Tingkat Provinsi Se-Indonesia BMF 2016 dan masuk 24 Besar Semifinalis BMF 2016 Tingkat Nasional diJakarta.\r\nO.L.D band ini mengusung konsistensi dijalur musik cadas yaitu Rock dan Progressive Metal dengan ber\'influenze pada musik DGM,Dream Theater, Thirty Second To Mars dan One OK Rock.','Rock','instagram;teman;lainnya;','Yogyakarta',1028,'2017-09-04 09:20:44','2017-09-04 09:20:44'),
	(644,'MARVEEN & THE WHITE ANGEL','1504524626.jpg','Band Pembuka Armada, Republik dan Virgoun','Funk','facebook;lainnya;','Surabaya',1110,'2017-09-04 10:30:26','2017-09-04 10:30:26'),
	(645,'Fornication','1504524646.jpg','Disudut barat kota Yogyakarta pada penghujung akhir tahun 2015 termuntahkan sebuah band yang beraliran Deathcore. Fornication, yang berideologi ingin mengubah skema permusikan Jogja dengan dentuman roda gila yang diiringi raungan dan geraman bertubi tubi bersama melodis gitar yang memperkosa telinga para pendengar, yang sebagian besar dogma orang awam musik undergrond adalah musik teriak-teriak tidak jelas, tidak dapat dinikmati atau didengar, sehingga mereka mengubah anggapan itu dengan mengejakulasikan musik-musik sidestream di Nusatara ini, agar industri musik musik lokal khususnya Underground bisa lebih terdengar kembali. Demo lagu mereka pada tanggal 4 Februari 2016 yang ditangani oleh Flazh Records. Berjudul “The Fallen King Is Rising” resmi keluar di Reverbnation, SoundCloud dan Bandcamp pada tanggal 26 Februari 2016.','Others','facebook;instagram;','Yogyakarta',1153,'2017-09-04 10:30:46','2017-09-04 10:30:46'),
	(646,'Black Revolver','1504530155.jpg','Black Revolver, mengusung genre rock yang banyak mengdaptasi musik vintage era 60an-70an. Pada dasarnya Black Revolver terinfluence oleh budaya musik rock n roll dan budaya hippies di era tersebut. Alunan melodi ala psychedelic rock dan blues adalah ciri khas Black Revolver, serta perpaduan chord sederhana dan hentakan riff ala heavy rock sebagai senjata untuk menggetarkan telinga penikmat musik rock. Seperti namanya, karya-karya Black Revolver dibuat dengan menitik beratkan pada power yang mematikan namun tanpa mengurangi sudut pandang estetikanya. Saat ini Black Revolver sudah merilis 3 single dan rencananya bulan september 2017 akan merilis debut album mereka.\r\nBlack Revolver juga pernah mengikuti festival Rock yang diadakan oleh Soul Kitchen Rock Festival pada tahun 2014 dan berkat semangat dan kerja keras teman - teman band, Black Revolver mendapatkan juara 1 pada Soul Kitchen Rock Festival tersebut.','Rock','facebook;instagram;informasi_toko;umi;teman;lainnya;','Jakarta',1064,'2017-09-04 12:02:35','2017-09-04 12:02:35'),
	(647,'Tarian Dian','1504531655.jpg','Ya cita-cita doang siiih','Jazz','instagram;','Jakarta',4,'2017-09-04 12:27:35','2017-09-04 12:27:35'),
	(648,'No Deadline','1504532203.jpg','NO DEADLINE [CERITA & PERJALANANNYA]\r\nNo Deadline adalah sebuah band yang berasal dari Pasuruan, Indonesia, pertama kali dibentuk pada tanggal 10 November 2009. Dengan mengusung aliran Pop/Rock Alternative, No Deadline berkeinginan untuk menjadi band besar yang musiknya dapat dinikmati oleh semua orang dari kalangan apapun dan dikenang selamanya oleh semua orang.\r\nAwal terbentuknya band ini adalah ketika kami para personel masih bersekolah di SMP yang sama di Bangil dan berada dalam ekstrakurikuler yang sama pula yakni ekskul Musik. Ketika jadwal Pensi tiba, kami diarahkan untuk membentuk sebuah Band agar bisa tampil dan voilaaa.... terbentuklah No Deadline yang personelnya masih sama seperti saat ini yakni Yayan (Vokal), Nur (Bass), Yuan (Drum), Cholis (Gitar) dan terakhir ada Alo (Gitar) yang akhirnya digantikan oleh Decka (Gitar).\r\nKami merencanakan dengan serius untuk berkomitmen berkarir di bidang musik sejak lulus SMP. Seiring berjalannya waktu kami telah memiliki belasan materi yang siap untuk direkam secara profesional, akan tetapi kami belum dapat merealisasikannya untuk saat ini karena terhalang oleh keterbatasan dana dan kesibukan personelnya.\r\nDengan adanya Event Levi’s Band Hunt ini memberikan secercah harapan pada kami untuk dapat membuat impian kami menjadi kenyataan dan sukses. Kami sangat berharap untuk memenangkan event ini dan akan mengupayakan semua yang kami miliki untuk memenangkannya. \r\nSekian secuil kisah dari No Deadline. Terima Kasih.','Pop','poster;teman;','Surabaya',1096,'2017-09-04 12:36:43','2017-09-04 12:36:43'),
