	(655,'The B.O.N.A','1504534000.jpg','The B.O.N.A (Between Old and New Alternative) band ini terbentuk pada 5 Januari 2013 dengan personil awal Mamen (Guitar), Ivan (Guitar), Putra (Vocal), Pety (Vocal), Imam (Bass) dengan mengusung genre Rock Old School, formasi ini berhasil mengeluarkan single \"Temani Aku\" seiring berjalannya waktu kami harus mengganti personil dan akhirnya menjadi Mamen (Guitar), Imam (Bass), Pety (Vocal), Ical (Vocal), Aldino (Guitar), Fajar (Drum), formasi kedua ini menghasilkan single \"What Should I Do\" dan mendaur ulang single pertama kamu \"Temani Aku\", formasi ini mengalami masalah dengan kesibukan masing-masing dan akhirnya kami terpaksa mengganti personil lagi menjadi Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), Nay (Drum) formasi ini berhasil mengeluarkan single \"Menunggu\" dan mendaur ulang \"What Should I Do\" dan mengubah konsep musik kami menjadi Alternative Progresif Rock dan karna kesibukan drummer maka kami terpaksa mengganti personil kembali dengan additional kami dan formasi ini yang bertahan hingga sekarang Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), I\'am (Drum)\r\nPrestasi : Juara 3 MutanFest UPN 2014, Juara 1 Smesco Art Fest 2015, Juara 3 Indonesia Kaya Fest 2016, Guest Star Metrofest 2015, Juara 2 Harumatsuri 2016, Guest Star Metrofest 2016','Alternative Rock','guitar_plus;teman;','Jakarta',1138,'2017-09-04 13:06:40','2017-09-04 13:06:40'),
	(656,'SAVANA','1504534031.jpg','Savana awalnya merupakan sebuah projek solo dari Nanda dengan mengusung lagu lagu bertemakan cinta yang dibawakan dengan musik pop alternatif. namun, seiring berjalannya waktu Nanda akhirnya memutuskan untuk menambah sejumlah personil yakni Ciko, Buntar, Cahyo dan Marcel. pada awalnya formasi tersebut baik baik saja. Akan tetapi karena adanya urusan pribadi yang tidak dapat ditinggalkan akhirnya Buntar, Cahyo dan Ciko memutuskan untuk rehat sejenak dari band dan membuat posisi savana akhirnya kosong. Tak berapa lama, akhirnya SAVANA  kembali menemukan orang orang yang dirasa cocok untuk mengisi kekosongan tersebut. Mereka adalah Jeff, Barak dan Eyo. Bersama Personil baru, SAVANA telah mengisi banyak acara seperti gigs gigs indie, pensi kampus, Indie clothing serta jakarta fair 2017. Dan kini Savana tengah mempersiapkan album serta video klip dari single terbarunya.','Rock','instagram;teman;','Surabaya',1005,'2017-09-04 13:07:12','2017-09-04 13:07:12'),
	(657,'The B.O.N.A','1504534475.jpg','The B.O.N.A (Between Old and New Alternative) band ini terbentuk pada 5 Januari 2013 dengan personil awal Mamen (Guitar), Ivan (Guitar), Putra (Vocal), Pety (Vocal), Imam (Bass) dengan mengusung genre Rock Old School, formasi ini berhasil mengeluarkan single \"Temani Aku\" seiring berjalannya waktu kami harus mengganti personil dan akhirnya menjadi Mamen (Guitar), Imam (Bass), Pety (Vocal), Ical (Vocal), Aldino (Guitar), Fajar (Drum), formasi kedua ini menghasilkan single \"What Should I Do\" dan mendaur ulang single pertama kamu \"Temani Aku\", formasi ini mengalami masalah dengan kesibukan masing-masing dan akhirnya kami terpaksa mengganti personil lagi menjadi Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), Nay (Drum) formasi ini berhasil mengeluarkan single \"Menunggu\" dan mendaur ulang \"What Should I Do\" dan mengubah konsep musik kami menjadi Alternative Progresif Rock dan karna kesibukan drummer maka kami terpaksa mengganti personil kembali dengan additional kami dan formasi ini yang bertahan hingga sekarang Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), I\'am (Drum)\r\nPrestasi : Juara 3 MutanFest UPN 2014, Juara 1 Smesco Art Fest 2015, Juara 3 Indonesia Kaya Fest 2016, Guest Star Metrofest 2015, Juara 2 Harumatsuri 2016, Guest Star Metrofest 2016','Alternative Rock','guitar_plus;teman;','Jakarta',1138,'2017-09-04 13:14:35','2017-09-04 13:14:35'),
	(658,'Rainy Days Today','1504539677.jpg','Rainy  Days  Today  terbentuk  tahun  2009  di  Surabaya  dengan  mungusung genre alternative  yang  digawangi  Rian  Prakoso  (vokal  &  gitar),  Veda  Carreza  (synthesizer), Rusman  Muharom  (gitar),  Adhi  Makayasa  (drum) dan Kukuh Rahman (bass).  Rainy Days Today telah merilis  sebuah  EP sebagai  album  pembuka  yang  berjudul  \"Triangle  Positivity\'  dan 3 rilisan  album  kompilasi. Setelah beberapa kali mengalami pergantian personel dan melakukan perubahan nama Rainy Days  menjadi  Rainy  Days  Today,  di bulan  September 2017 Rainy  Days  Today  kembali  merilis single yang berjudul “Rekreasi Luar Ruangan” sebagai lagu pembuka untuk album kedua yang akan di rilis pada akhir tahun 2017 sekaligus merayakan 8 tahun Rainy Days Today berkarya dalam scene indie surabaya. \r\n\r\nMore info :\r\nTwitter : @rainydaystoday\r\nInstagram : @rainydaystoday_\r\nSoundcloud : rainydaystoday\r\nYoutube : Rainy DaysTV','Others','teman;lainnya;','Surabaya',963,'2017-09-04 14:41:17','2017-09-04 14:41:17'),
	(659,'GURIS','1504539763.jpg','Band GURIS berasal dari \"gurisan\" atau bercanda. Berdiri dari tahun 2011 berawal dari teman satu kampus di salah satu Univeritas di Purwokerto kemudian masing masing punya hoby yg sama yaitu bermain musik dan dari situlah mulai punya ide bentuk suatu band dengan mengambil genre alternative rock. \r\n\r\nPrestasi ;\r\n- Juara I lomba Acoustik Yamaha di Moro Dept. Store Purwokerto tahun 2012','Alternative Rock','facebook;instagram;teman;','Yogyakarta',1172,'2017-09-04 14:42:43','2017-09-04 14:42:43'),
