	(662,'havinhell','1504544750.JPG','havinhell terbentuk di Yogyakarta pasa ahun 2009 dan pada tahun 2012 tepatnya, havinhell merilis album pertama yang bertajuk \"super fighter\", dan pada tahun ini kita dalam proses album yang kedua. Terus bereksperimen, banyak bereksplorasi dan bebas berekspresi , Tak ada yang tak mungkin untuk dijadikan inspirasi dalam berkarya,yang terpenting adalah nada yang mengalun dalam setiap musik Havinhell dapat memberikan semangat bagi siapa saja yang mendengarkan.','Alternative Rock','guitar_plus;','Yogyakarta',1191,'2017-09-04 16:05:50','2017-09-04 16:05:50'),
	(663,'OWN','1504545219.jpg','• Band Featuring in Trisakti Blues Festival 1 at Rolling Stone Cafe Jakarta 2012.\r\n• Band Featuring in Trisakti Blues Festival 2 at Parkir Timur GBK Senayan Jakarta 2013.\r\n• 1st winner for Music Festival A ZONE by A Mild GoAheadPeople for The Beatles Night at Labiere, Central Park 2014.\r\n• Opening Gugun Blues Shelter for A ZONE by A Mild GoAheadPeople for The Beatles Night at Labiere, Central Park 2014.\r\n• Opening PANDAI BESI for Sound Sations by A Mild GoAheadPeople at Patio, Central Park 2014.\r\n• Band Featuring in Parjo 3 at Parkir Timur Senayan GBK Senayan Jakarta 2014.\r\n• Guest Star in Jakarta Museum Day Festival at Museum Kota Tua Jakarta 2014.\r\n• Band Featuring in Trisakti Blues Festival 3 at Rolling Stone Cafe Jakarta 2014.\r\n• Guest Star in Indonesia Motocycle Festival at Parkir Timur Senayan Jakarta March 2014.\r\n• Band Featuring in Trisakti Blues Festival 4 at Parkir Timur GBK Senayan Jakarta 2015.\r\n• “The Best Band Performance” for Saturday Music Indie at Grand Charly Rawamangun Square 2015.\r\n• One of the band in Parkir Musik 1st Compilation Album 2015 (can be donwloaded at App Store\r\n& Play Store)\r\n• Band Featuring in Parjo 2015 live band stage at Parkir Timur Senayan Gelora Bung Karno\r\nSenayan Jakarta.\r\n• Guest Star in Saturday Music Indie at Warung Apresisai (Wapres) Blok M Jakarta 2015.\r\n• Tribute to Jimi Hendrix in Cardinal Stage at Pekan Raya Jakarta (PRJ) 2015.\r\n• Band Featuring in Autoshow by TMED at Plaza Barat GBK Senayan Jakarta 2015.\r\n• Participant Asian Beat Event at FX Sudirman Jakarta 2015.\r\n• Guest Star of grand opening DUZTFIELD Clothe Store at Tanggerang Dec 12, 2015.\r\n• Endorsed by DUZTFIELD Clothe Store from Dec 12, 2015 – March 12, 2016.\r\n• Guest Star in Carnival Tangerang at I amsterdam Kota Bumi January 6-10, 2016\r\n• Band Featuring in Indie Social gig at JK7 Bar Swiss-Belhotel Kemang Jakarta February 25, 2016\r\n• Guest Star in Gathering Pajak feat. Memes “Classy” “The Beginning of Great Changes in Togetherness“ at Gelanggang\r\nMahasiswa Trisakti University Jakarta March 12, 2016\r\n• Guest Star in Parjo (Pasar Jongkok) 2016 “Neverland” stage with Jikunsprain at Plaza Timur GBK, Jakarta March 13, 2016\r\n• Launching 1st USB Compilation Album “Music Call You Back” at Carburator Spring Tanah Kusir Jakarta March 27, 2016\r\n• Guest Star @  Stage Budaya, Jakarta Fair 2017\r\n• Launching 2nd USB Compilation Album \"Reformusical\" 2017 at Teater Kecil Taman Ismail Marzuki\r\n• Live Stream Guest at BATIK (Bicara Asik Seputar Musik) program, Pemuda FM radio.','Rock','teman;','Jakarta',144,'2017-09-04 16:13:39','2017-09-04 16:13:39'),
	(664,'RAKYAT','1504545639.jpg','Cerita Terbentuknya Band :\r\nAwal berdiri band ini pada tahun 1999, berawal dari teman satu tongkrongan dengan selera musik yang berbeda-beda. Dengan inisiatif dari seluruh personil, terbentuklah band ini dengan nama RAKYAT yang berarti \"RAsa KarYa Anak Tongkrongan\".\r\nSebelumnya band kami beranggotakan 5 orang : \r\n- Laonk Blues : Vokal\r\n- Pokin : Guitar\r\n- Regay : Lead Guitar\r\n- Edo : Drummer\r\n- Bontot : Bass\r\nSeiring waktu band ini sempat vakum beberapa tahun\r\nSetelah itu berganti personil dan berkurang 1 orang, hingga akhirnya menetap dengan personil yang sekarang ini.\r\nDengan personil :\r\n- Laonk Blues : Vokal, Guitars (1999 - present)\r\n- Andre : Lead Guitars (2014 - present)\r\n- Bontot : Bass (1999 - present)\r\n- Ipul : Drum (2017 - present)\r\n\r\nDan lagu kami yang berjudul \"Pengembara\" diciptakan oleh vokalist kami, karna memang dia tipe orang yang sangat suka travelling dan dia dapat inspirasi lagu ini ketika travelling ke salah satu gunung yang ada di indonesia.\r\n\r\nPrestasi Band :\r\n- Menjadi band pembuka band2 lokal yang ada di tangsel.\r\n- Milad ke 10 diacara okp GANESPA (Tang-Sel)\r\n- Guest Stars di Universitas Muhammadiyah Jakarta (UMJ) thn 2002\r\n- Milad walikota TANGSEL 2013\r\n- Mengisi acara2 hut RI ke 72 dari kampung ke kampung bulan lalu.','Blues','facebook;teman;','Jakarta',992,'2017-09-04 16:20:39','2017-09-04 16:20:39'),
