	(674,'Julyusman Tanurrezal & The Raging Herd','1504589018.jpg','Julyusman Tanurrezal and The Raging Herd is a solo project by talented young guitarist Julyusman Tanurrezal. He is an active practitioner and passionate lover of blues-rock. He started the band in 2012 with bassist Glory Saringar, drummer Soekanto Kasyim and Rafael Yefta on keyboard. The name of the band “The Raging Herd” is to express the power of blues music and the passion of the people.\r\n\r\nThe four members of Julyusman Tanurrezal and The Raging Herd have all been studying Performing Arts at the Institut Musik Indonesia since 2010. In 2016, Soekanto and Rafael successfully completed their studies and graduated from the Institut.\r\n\r\n\r\nTo share our music with the world, and to use our passion for music to drive us to be better, unique and more consistent musicians. Our objective is to pursue a career in the entertainment industry as musicians. We are a highly enthusiastic team of skillful young musicians, with great communication, boundless energy and creative ideas. We believe that our talent and experience will be a valuable contribution.\r\n\r\nSince the beginning of the project, Julyusman Tanurrezal and The Raging Herd have been playing live in some of Jakarta’s popular venues; Eco Bar, Maitrin Lounge, My Mate Café, JK7 Kemang, Tokove, and Rolling Stone Café. The band played Jakarta’s biggest Blues festival, The Trisakti Blues Festival in 2012 and 2013. In May 2016, Julyusman Tanurrezal & The Raging Herd has become the opening act for French rock band KOKOMO in Jakarta, and top 10 Digilive Indie Band Competition.\r\n\r\nJulyusman Tanurrezal and The Raging Herd released their first album “The Raging Herd” in March 2016 with 6 songs. The album is available on iTunes, Amazon, Spotify and many more.','Blues','facebook;','Jakarta',1157,'2017-09-05 04:23:38','2017-09-05 04:23:38'),
	(675,'The Istiqomah','1504589178.jpg','Di pertemukan dalam kegiatan kampus, yg bergerak di bidang musik, sejak 2011 kami mulai beristiqomah sampai akhirnya membuat karya sendiri.','Pop','instagram;teman;','Yogyakarta',1200,'2017-09-05 04:26:18','2017-09-05 04:26:18'),
	(676,'PARASUT BAND','1504590320.jpg','Band Ini bermula dari inisiatif antara Yusuf dan pandu \r\nyg kala itu gemar membuat lagu di sela-sela aktifitas mereka \r\nyang aktif di berbagai cafe dibandar lampung pada tahun 2015 silam. \r\nDengan adanya levis band talent ini akhirnya PARASUT \r\nmembentuk formasi resmi dan mereka berharap bisa terus berkarya \r\ndi industri musik dan tanah air.','Pop','instagram;guitar_plus;umi;teman;','Jakarta',878,'2017-09-05 04:45:20','2017-09-05 04:45:20'),
	(677,'ARraH Band','1504591317.jpg','Salam Satu ARraH,\r\nARraH Band adalah nama yang kami ambil untuk menyatukan dan menghubungkan kami dalam bermusik dan berkarya,kami mengusun genre alternative rock dimana yang mampu menampung semua ambisi bermusik kami yang berlatar belakang basic musik yang berbeda-beda,pada 13 Agustus 2013 yang lalu tercetuslah nama ARraH Band ini yang beranggotakan ian di Vocal, Ade di Lead Gitar, Gyzen di Gitar 2, Andi di Bass dan Armor di Drum.\r\nPrestasi yang paling berkesan bagi kami ialah saat kami mengikuti audisi untuk mengisi Band Utama pada event yang diadakan di Gresik untuk memperingati hari Ulang Tahun Petrokimia Gresik yang ke-44 pada tahun 2016 lalu, puji syukur kami menjadi Juara 1 dan dalam perform kami, kami membawakan lagu-lagu kami sendiri dari mini album kami. Yaaah ini lah sedikit cerita tentang kami ARraH Band. Salam jaya music Indonesia. Salam Satu ARraH,,, \\m/','Alternative Rock','facebook;instagram;teman;','Surabaya',1132,'2017-09-05 05:01:57','2017-09-05 05:01:57'),
	(678,'Djawara','1504593508.png','djawara band adalah band asal lampung yang mengusung genre Rock Alternative yang ber anggotakan personil nya : \r\n- Vocal : adit\r\n- Gitar : Surya\r\n- Bass : Santo\r\n- Keyboard : Lasmana \r\n- Drum : Rudin\r\n\r\nSemoga Djawara selalu menjadi Djawara di hati seluruh Kalangan masyarakat indonesia dan dunia.\r\nAMIEN.\r\n\r\nCP : 0896 - 5801 - 3997','Alternative Rock','guitar_plus;','Jakarta',1208,'2017-09-05 05:38:28','2017-09-05 05:38:28'),
	(679,'Srundenk','1504598701.JPG','Cerita\r\n\r\nBerdiri bulan september 2011,di Surabaya. Mengusung genre pop kreatif / indie, yang sekiranya bisa diterima masyarakat luas.\r\n\r\nPrestasi :\r\n\r\n10 besar Yamaha band religi 2011 di Surabaya\r\n8 besar finalist jazz traffic MLD spott di Surabaya\r\nJuara 2 festival band religi Jawa Pos, 2014 di Surabaya','Pop','teman;','Surabaya',1190,'2017-09-05 07:05:01','2017-09-05 07:05:01'),
	(680,'New Old','1504600293.jpg','New Old, band yang berasal dari Jakarta. Beranggotakan lima orang pemuda, dengan segala kemampuannya mensuguhkan alunan musik, yang bernuansa vintage -- mencoba mengajak khalayak untuk kembali nostalgia, di ruang imaji dan fantasi. Pada awal karirnya, New Old hanya beranggotakan empat orang, sebelum keluarnya posisi pada instrument bass. Sempat beranggotakan tiga orang pada tahun 2015. Pada tahun 2016, New Old mendapat keluarga baru, yakni; Sonny sebagai Bassist dan Nicko sebagai Keyboardist. Pada tahun itu pula, New Old juara pertama pada acara Ramadan Jazz Festival, dan satu panggung dengan musisi lainnya, seperti; Dira Sugandi,  Yuka Tamada, dan banyak lagi. Pada tahun yang sama, New Old berkesempatan tampil di panggung utama Pekan Raya Jakarta, sebagai band pembuka, bersama Geisha.','Pop','instagram;','Jakarta',1214,'2017-09-05 07:31:33','2017-09-05 07:31:33'),
	(681,'JU\'OND','1504600651.JPG','Lahir dari tangan dingin musisi muda dari Kota Pasuruan, Jawa Timur, Indonesia. Puput (vox) dan Sella (guitarist) yang menyukai warna music  yang sama, yakni paramore.\r\nDalam selang waktu, ju’ond berkumpul menjadi 5 personel. Dengan warna musik dan referensi yang beragam.\r\nParamore, tonight alive, gecko, billfold, Keane, Coldplay, dsb. menjadi referensi dalam pembuatan lagu-lagu dan warna musik kami. Dengan perform on stage yang begitu menjadi ciri khas, membuat kami mudah dikenali dan di ingat oleh penikmat musik.\r\nSentuhan musik poppunk ditambah beat cepat di setiap lagu, semakin menguatkan karakter musik kami. Sound tebal dan tajam di setiap live ataupun recording pun tetap menjadi andalan musikalitas JU’OND tersendiri.\r\n\r\n#Beberapa Event yang pernah kami ikuti:\r\n•	Guest Star “express sensation” Univ. Udayana Denpasar Bali 24-11-2012\r\n•	Feat “nitecoustic” KFC Jimbaran Bali 25-11-2012\r\n•	Guest Star “fest new story of 2013” Lap. Pasca Sarjana STKIP Jombang 2013\r\n•	Feat “ukm musicday se-Jateng” IAIN walisongo Semarang 05-04-2012\r\n•	Guest Star “tribute to paramore II” café capitano Bangil 05-05-2012\r\n•	Guest Star “bandance festival” Aula STKIP Pasuruan 2012\r\n•	Juara 1 “yamaha musicfest” GOR untung surapati Pasuruan 20-07-2013\r\n•	Best performance “yamaha free & style” taman kota Pasuruan 19-01-2013\r\n•	Feat “MKM gathering” Univ. Negeri Malang 2013\r\n•	Feat “melodic fest” Monkasel Surabaya 08-08-2013\r\n•	Feat “Paramore Nite” Colours PUB Surabaya 2013\r\n•	Feat “dies natalis UKM” Ubhara Surabaya\r\n•	Opening Act “Power Metal” Untag Surabaya,\r\n•	SPECIAL Perfprmance Feat “ukm Klinik Music Jombang” Lapangan Basket STKIP PGRI Jombang\r\n•	SPECIAL PERFORMANCE Feat “BAHAYA Record X PARAMORE CLUB INDONESIA” at ROLLING STONE CAFE JAKARTA, 26 Nov 2016.\r\n•	Feat “Campus Idol” at STKIP PGRI PASURUAN, 3 Dec 2016\r\n•	Feat “SUNDAY PSYCOUSTIC” at STREETROCKS WARKOP, 22 Jan 2017.\r\n•	Feat “Refresing Music” at Kantin STKIP PASURUAN, 14 Feb 2017-03-31\r\n•	Feat “PHOBIA TOUR” at Gedung Matahari Pasuruan, 3 Mart 2017\r\n•	Feat \"INDIE CLOTHING EXPO\" at Grand City Surabaya, 2 April 2017\r\n#Etc, …','Pop','facebook;instagram;teman;lainnya;','Surabaya',1130,'2017-09-05 07:37:31','2017-09-05 07:37:31'),
	(682,'Tokyolite','1504603371.jpg','Tokyolite dibentuk pada 2009 di Bogor. Mengusung genre funk rock, kami telah menelurkan 1 album (Avenue, 2015) dan 1 extended playlist (Hello, 2013).  Di tahun 2016, kami terpilih sebagai perwakilan Asia Tenggara di Kansai Music Conference, Osaka - kesempatan ini kami ambil untuk melakukan tur perdana  di 10 panggung di 5 kota di Jepang yang kami biayai secara independen dan juga memanfaatkan network fanbase yang kami miliki di Jepang. Banyak tantangan yang harus dihadapi selama tur, salah satunya ketika 2 additional player kami memutuskan untuk berhenti dari tur dan pulang ke Indonesia sehingga di tengah-tengah tur kami harus mencari pemain tambahan yang bisa membantu kami terus tampil di 6 panggung berikutnya. Beruntung kami dibantu oleh Izumi Miyamoto, musisi kawakan dari band Caro Kissa yang bersedia menjadi drummer kami hingga tur selesai. Dalam kesempatan yang sama, Tokyolite berhasil menjadi band Indonesia pertama yang diliput dan tampil di kanal Tokyo Acoustic Session, yaitu platform dokumenter musik yang menampilkan musisi Jepang serta internasional untuk tampil di area publik di kota Tokyo. Seluruh pencapaian ini tentunya juga tidak lepas dari prestasi kami sebagai runner up Asia Versus Grand Prix 2013, kompetisi band Asia yang diselenggarakan oleh Fuji TV. Di tanah air, kami sempat tampil di sejumlah panggung festival musik antara lain Java Jazz, JakCloth, Monkeylada, Jazz Goes To Campus, Terusik TRAXkustik, dan PopUp Gigs Demajors. Saat ini Tokyolite sedang menyiapkan materi untuk album kami yang kedua.','Funk','guitar_plus;','Jakarta',1127,'2017-09-05 08:22:51','2017-09-05 08:22:51');

musisi adalah cita-cita kami,sejak pertama mendirikan band negara, kami sepakat bahwa main band adalah tujuan hidup kami bukan band yang asal-asalan tapi sebuah band yang merintis dari nol hingga menjadi sebuah band besar Indonesia. \r\n\r\nAwal terbentuknya band Negara yaitu pada 24 mei tahun 2008,band terbentuk  dengan formasi awal adalah Reren ( gitar 1 ), Iman (gitar 2), Ruly (Vokal), Akka (Drummer), Enu (Bass). Namun formasi ini hanya bertahan selama 1 tahun karena enu (bass) memilih untuk hengkang karena alasan akan kuliah diluar kota. Semenjak saat itu Negara kerap mengalami  perubahan formasi pada posisi bass. Namun pada saat Negara belum menemukan pemain bass untuk kesekian kali telah terjadi kejenuhan di personil yang lainnya yaitu Akka memutuskan untuk hengkang dari Negara. Akhirnya Negara pun tersisa dengan 3 orang personil. Langkah Negara pun tak terhenti disana, akhirnya Iman pun memutuskan untuk mengajak teman semasa SMA nya yaitu Maulana untuk mengisi posisi Drum. Dan setelah Maulana bergabung dengan Negara selama 2 bulan, ia pun merekomndasikan temannya yaitu Njul untuk mengisi posisi bass yang selama ini belum terisi. Setelah melihat dan mempertimbangkan Njul akhirnya seluruh personil Negara menyetujui usulan dari Maulana untuk mengisi kekosongan pada posisi bass. Akhirnya hingga saat ini Negara bertahan dengan formasi Ruly (vokal),Reren (gitar 1), Iman (gitar 2), Maulana (Drummer), Njul (Bass).','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;','Jakarta',1404,'2017-09-07 16:34:38','2017-09-07 16:34:38'),
