	(860,'STIKROY','1504806876.jpg','Pada tahun 2017 kami 5 mahasiswa yang berkecimpung dalam organisasi kegiatan band di kampus, suatu ketika ada sebuah kegiatan dimana kita harus menjadi satu band . Berawal dari bermain bersama kami memutuskan untuk terus lanjut dengan formasi band seperti ini dan menseriuskan band ini dengan nama band STICKROY dan dengan genre rock alternative, nama itu terlintas ketika kami ikut di sebuah festival dan salah satu dari kita menceletukkan nama itu. Dengan personil Riski Husein Nasution [vokal], Ilham Ardiansyah Gayo [gitar], Bebby Bimantara [gitar], Budi Triansyah [bass],Muhammad Khirzuddin [drum].\r\nBerawal dari mencover lagu band lain, kini kita mencoba untuk membuat lagu sendiri. Dengan tujuan  untuk meremaikan di blantika musik indonesia. Setelah melalui berbagai macam proses lahirlah  single perdana kita berjudul PENYESALAN. Sukses dengan pembuatan single perdana kami dan selang jangka waktu sebulan kami mencoba untuk membuat single kedua yang berjudul DALAM SENDIRIKU , dalam lagu ini kami berkolaborasi dengan Rachman Mamen gitaris dari band The B.O.N.A. Kami berharap semoga para pendengar musik bisa menyukai dan bisa membantu untuk terus memajukan lagu – lagu dari band kami serta semoga kami bisa terus berpartisipasi dalam blantika musik indonesia.','Alternative Rock','instagram;guitar_plus;teman;','Jakarta',1413,'2017-09-07 16:54:36','2017-09-07 16:54:36'),
