	(863,'Anoop Apoorva','1504808895.jpg','anoop apoorva terdiri dari empat personil rizki/debul (drum) ,wahyu/wacil (bass) ,serpico (lead guitar) ,afif (rytem guitar dan vocal) anoop apoorva terbentuk pada tanggal 17 april 2017 , arti dari nama anoop apoorva itu sendiri diambil dari bahasa sansekerta anoop itu mempunyai arti tidak bisa dibandingi dan apoorva itu indah sekali ,anoop apoorva menjadikan genre skedelick rock n\' roll . awal terbentuk band ini hanya terdiri dari wacil (bass) ,afif (guitar vocal) dan debul (drum) .lalu menggaet lead teman debul bernama ridho ,dan vocal ria temen debul juga . namun ketidak cocokan genre membuat mereka berdua meninggalkan anoop apoorva , kemudian kami bertiga bertemu serpico di studio tempat biasa kami latihan ,setelah berbincang lama kami bertiga pun tertarik dengan skill lead guitar yang dimiliki serpico .kami pun akhirnya menggaet serpico sebagai lead . lagu pertama yang kita buat adalah \"Aku Kau Dan Kalian\" dengan genre alternativ rock bercampur slow rock , kemudian kami membuat lagu berikutnya yaitu \"Sandra\" dengan genre rock n\' roll .karena kecocokan genre rock n\' roll kami berempat meluncurkan lagu selanjutnya yaitu \"Siapa Rasa\" dengan genre rock n\' roll bercampur sckedelick karna lirik yang rumit dan mempunyai arti didalam setiap liriknya .akhirnya kami pun cocok dengan genre yang membuat kami nyaman ,dan kami mengcover lagu the beatles - come together dengan arasement khas dari anoop apoorva . sampai saat ini kami bermain dan bersimponi bersama dalam anoop apoorva sampai saat ini . moto kami bersama di anoop apoorva adalah dari nusantara untuk menggapai dunia. Sudah pernah meraih juara 2 di kompetisi band sman 26 jakarta, pada tanggal 28 agustus 2017','Rock','facebook;instagram;guitar_plus;','Jakarta',1403,'2017-09-07 17:28:15','2017-09-07 17:28:15'),
	(864,'Hellfreezed','1504809626.jpg','terbentuk pada tahun 2014 di suatu Unit Kegiatan Mahasiswa di salah satu institute Perbankan Jakarta Selatan. kami memainkan Progressive/Metalcore, sejauh ini kami sudah mempunyai 3 single yang tersedia di Digital Store dan Youtube. kami pernah menjadi finalis pada event Hellprint Monster Tour 2016 yang diselenggarakan Di Rolling stone cafe jakarta selatan, Menjadi finalis Jakcloth Competition Summerfest 2017 dan Gitaris kami yan akbar nugraha sempat masuk di halaman GITARPLUS mengenai Gear apa saja yang dipakai untuk proses recording single ke 3 kami','Heavy Metal','instagram;guitar_plus;umi;maliq;teman;','Jakarta',1329,'2017-09-07 17:40:26','2017-09-07 17:40:26'),
