	(866,'SUGAR CIGAR','1504811002.jpg','SUGAR CIGAR (SC) ADALAH BAND BERGENRE ROMANTIC POP DARI JAKARTA YANG BERDIRI PADA TANGGAL 3 JUNI 2017. MESKIPUN BAND BARU, NAMUN PARA PERSONILNYA BUKAN NAMA BARU DI INDUSTRI MUSIK TANAH AIR. BEBERAPA PERSONIL SC SUDAH MALANG MELINTANG DI INDUSTRI MUSIK SEJAK TAHUN 2003 DAN SEMPAT MENGELUARKAN SINGLE BERSAMA UNIVERSAL MUSIC INDONESIA PADA TAHUN 2010. SELAIN ITU PARA PERSONIL SUGAR CIGAR JUGA AKRAB DENGAN PENGALAMAN DAN PRESTASI DI DUNIA PERFESTIVALAN BAND. SALAH SATUNYA, SEBUT SAJA SANG VOCALIST YANG MERANTAU JAUH DARI AMBON KARENA MENJADI JUARA 1 KATEGORI SOLO VOCAL DI EVENT PERTAMINA GOT TALENT 2015. SELAIN ITU ADA JUGA PRESTASI BEBERAPA PERSONIL SC DIANTARANYA TOP10 INDIEFEST 2009 DAN KOMPILASI ALBUM INDIEFEST VOL.4, JUARA 3 NASIONAL CARDINAL AWARDS 2009, DAN BERKESEMPATAN MENJADI BAND PEMBUKA DI KONSER-KONSER MUSISI LUAR NEGERI DIANTARANYA BRUNO MARS, LENKA, THE ATARIS, BOYCE AVENUE, SPIN DOCTORS, DAN LAINNYA. SERTA PERNAH JUGA BERKOLABORASI DENGAN BEBERAPA MUSISI TERNAMA TANAH AIR.','Pop','instagram;informasi_toko;teman;','Jakarta',1199,'2017-09-07 18:03:22','2017-09-07 18:03:22'),
	(867,'ADIDURI Band','1504811549.jpg','Awalnya ADIDURI adalah project  solo dari sang vocalis Adi, penyanyi  kelahiran makassar yang menimba ilmu dan menyelesaikan kuliahnya di Yogyakarta. setelah menyelesaikan kuliah di Yogyakarta Adi kembali ke Makassar dan bertemu dengan personil lainnya yang mayoritas juga pernah kuliah di Yogyakarta,dan mereka membentuk sebuah band dengan nama ADIDURI, mereka sepakat untuk menjadikan ADIDURI sebagai nama band mereka, karena terinspirasi dari salah satu band dunia dan juga merupakan salah satu dari idola mereka yaitu BonJovi yang mana mereka juga menjadikan nama vocalist mereka sebagai nama band. ADIDURI sendiri dibentuk pada tahun 2009 dan sudah banyak prestasi yang telah diraih oleh band ini :\r\n	\r\nJuara 2 Yamaha “FREE YOUR SOUL 3” di Bandung 2009\r\nBintang tamu Indie “KICK ANDY” Metro Tv\r\nJuara 1 A MILD LIVE WANTED Regional Indonesia Timur 2012\r\nRunner up A MILD LIVE WANTED nasional audition jakarta 2012\r\n50 besar LA INDIEFEST 2013\r\n\r\ncontact person:\r\n081310290085\r\n081245001113','Pop','facebook;instagram;guitar_plus;teman;','Jakarta',1242,'2017-09-07 18:12:29','2017-09-07 18:12:29'),
	(868,'MOZAIK','1504811672.JPG','Band indie Bandung. Alternative, rock & folks. Mini albumnya \"Cahaya Malam\". Memiliki kekuatan dari segi lirik lagunya yang puitik, segar dan imajinatif. Menjadikan lagu sebagai cerminan realita sekaligus ruang refleksi. Berusaha menawarkan ide-ide baru secara tematik. Tahun, 2016, salah satu lagunya menjuarai Band in Bandung, acara chart band indie seBandung yang digagas Bandung Radio 95,2 fm','Alternative Rock','poster;teman;','Jakarta',1416,'2017-09-07 18:14:32','2017-09-07 18:14:32'),
	(869,'The Rattles','1504812254.jpg','The RATTLES adalah band rock asal Indonesia yang terbentuk pada tahun 2014 di Rawamangun, Jakarta Timur, dengan vocalist & guitarist M.Fauzan Fajri (ojan), bassist Chirst Sandy Anugrah (cacing) dan Drummer Chaqim Naim (apoy). \r\nDan sebelum nama The Rattles tercipta dulu kita bernama \"Paradigma\" dengan vocalist Daniel, Gutaris Febran, bassist Christ dan drummer Chaqim. dan dipertengahan tahun 2015 kita sudah tidak sejalan dengan daniel (vocalist) dan Febran (Guitaris), lalu tidak berangsung lama kita bertemu dengan fauzan (vocal&guitar), dengan cara menyanyi dan bermain guitarnya se irama dengan sub genre kita tersebut, dan secara resmi Fauzan sekarang bagian dari kami dan pada saat itu kita merubah nama band ini dari Paradigma menjadi Rattles.','Rock','instagram;poster;teman;','Jakarta',957,'2017-09-07 18:24:14','2017-09-07 18:24:14'),
