	(872,'Moluska','1504817451.jpeg','BIOGRAPHY\r\nMoluska yang sekarang sudah nggak ada personil awalnya lagi. Pertama bernama Mollusca dibentuk 2008 oleh Barry, vokalis lama bersama teman-temannya yang kebanyakan berasal dari Batam. Karena kesibukan masing-masing, akhirnya tinggal Barry seorang dan direklutlah Ambang, yang kemudian mencari personel tambahan yang ada sekarang. Barry pun mengundurkan diri dan melanjutkan karirnya sebagai pekerja kantoran. Semua personel yang sekarang sebelumnya sudah saling kenal karena dulu masing-masing punya band dan sering ikut festival, dan bandnya pada bubar. Akhirnya kami meneruskan tongkat estafetnya pada tahun 2010. Kenapa kami tetap pakai nama itu, karena namanya bagus menurut kami, akhirnya mengganti ejaannya saja dari mollusca ke Moluska.\r\n\r\nMoluska merupakan hewan triploblastik selomata yang bertubuh lunak. Ke dalamnya termasuk semua hewan lunak dengan maupun tanpa cangkang salah satunya kerang. Kami ambil filosofi seperti kerang, ia dapat memproduksi mutiara dan kami berharap dapat memproduksi karya-karya yang indah seperti mutiara.\r\n\r\nAWARDS & ACHIEVEMENT\r\n-	Juara 1 LA Lights Meet the experts “Online Superstars” di Univ. Budi luhur 2010\r\n-	Peringkat 1 regional Jakarta Barat dalam festival LA Lights Startup 2011 tahap Rookie stage\r\n-	Tahap Big stage LA Lights Startup 2011\r\n-	Juara 1 LA Lights Meet the experts “Build Your Bussines empire” 2011\r\n-	Finalis Cardinal Awards 2011 regional Jawa Timur\r\n-	Juara 1 Blu_M_Fest III November 2011 Univ. Budi Luhur Musik Festival\r\n-	Juara 3 festival Freedom To Music Inara Music Studio 2012\r\n-	Juara 1 festival KFC Talent Green Jak 2012\r\n-	Juara 3 festival suzuki nex hypermall Bekasi 2012\r\n-	Juara 2 festival suzuki nex bekasi mutiara gading timur 2012\r\n-	Juara 3 cardinal awards Depok Town Square 2012\r\n-	Finalis Cardinal awards wilayah Jakarta 2012\r\n-	Juara 3 festival Mr. Puisi MS Hall Vicky Sianipar 2012\r\n-	Juara harapan 3 festival Pasar Anak Negeri bersama Bpk. Hatta radjasa PAN\r\n-	Juara 2 Festival Yamaha ASIAN BEAT 2012 regional Jakarta 1\r\n-	Juara 1 festival Band RespectCup II SMPN 161 Jakarta Selatan 2012\r\n-	Juara 2 Festival Band Al-Azhar BSD 2013\r\n-	Juara 1 Festival A zone A mild Mei 2013 di Grogol foodcenter s3\r\n-	Juara 1 A mild SoundVersity regional Jakarta Barat Mei 2013 di Grogol foodcenter s3\r\n-	Juara 1 A mild soundversity regional Jakarta 2013 at Pisa Cafe Menteng\r\n-	Juara 1 Bedug Coustic at Green Pramuka Square JakPus 4 Agustus 2013\r\n-	Juara 1 festival Untukmu Pahlawan 10 Nov 2013 JakTv\r\n-	Juara 1 festival Smoothplay Envio Mild at Pappajack Jakarta Barat 11 Mei 2014\r\n-	76 Besar Rising Star Indonesia RCTI 2014\r\n-	40 besar music battle vidio.com tim uki Noah','Pop','guitar_plus;teman;','Jakarta',1340,'2017-09-07 19:50:51','2017-09-07 19:50:51'),
