	(877,'Here We Go','1504833913.jpg','Here We Go adalah sebuah band Pop Punk yang terbentuk pada pertengahan\r\ntahun 2014 di kota Nganjuk Jawa Timur, Sebelumnya sudah pernah main dibeberapa gigs kecil dan pensi didaerahnya. Yang paling berkesan pernah bermain diajang djarum super rock, rising star, grand opening VW Se-Indonesia, dll','Others','guitar_plus;','Surabaya',748,'2017-09-08 00:25:13','2017-09-08 00:25:13'),
	(878,'Alley Silence','1504834346.jpg','Sebuah band yang mengusung genre Metalcore pada tahun 2009. Awal terbentuk dengan personil sementara Sinyo, Dayat, Oky, Bagus yang bernama \'ALLEY SILENCE\'. sempat vakum selama 4 tahun dikarenakan kesibukan kuliah, kerja dsb. Kemudian kami lanjut aktif lagi pada tahun 2013 ketika Sinyo (Guitar) bertemu Ryan Jagal (vocal) serta Brilian (drum) dari \'PSYCORE\' mengajak Febry (bass) dan Wahyu (Guitar) untuk memperkuat band ini, namun seiring berjalannya waktu, ada beberapa kali pergantian personil, dari bassist yang semula diisi Febry, digantikan oleh Bagus. Kemudian pada posisi gitar yang sebelumnya Wahyu digantikan oleh Novan, hingga kami berdiri dengan line up yang sekarang :\r\nRyan : Vocal\r\nBagus : Bass\r\nBrilian : Drum\r\nSinyo : Guitar\r\nNovan : Guitar','Others','guitar_plus;poster;teman;lainnya;','Surabaya',1363,'2017-09-08 00:32:26','2017-09-08 00:32:26'),
	(879,'Suaserima','1504836143.jpg','Suaserima terbentuk dari tahun 2012. Tema yang diangkat dalam karya kami seputar kehidupan sehari-hari, pengalaman pribadi, dan lingkungan sekitar. Pendekatan musik yang kami usung dan ilhami seputar musik Pop, Rock, Experimental, dan masih banyak lagi. Secara keseluruhan, warna musik yang kami mainkan \"Alternative\". Pada pertengahan 2017, kami sudah merilis single \"Memorabilia\", sebagai jembatan menuju album perdana yang dalam waktu dekat juga akan dirilis.','Alternative Rock','guitar_plus;','Yogyakarta',1426,'2017-09-08 01:02:23','2017-09-08 01:02:23'),
	(880,'Dominant','1504836343.jpeg','Band ini terbentuk pada tahun 2015 dengan nama Dominant yang terdiri dari 3 personil yaitu Monic (Pianist & Vocalist), Moses (Bassist), Daniel (Drummer). Dominant pernah mengisi acara reguler di salah satu mall di bogor dengan menambah additional player (gitarist) dan beberapa acara pernikahan. Dengan adanya levis band hunt, dominant memiliki mimpi untuk berkarya di industri musik indonesia.','Pop','facebook;','Jakarta',1334,'2017-09-08 01:05:43','2017-09-08 01:05:43'),
	(881,'Baruno','1504841275.jpg','Formed\r\n2015 in Jakarta, Indonesia\r\n\r\nMember\r\nIndro (Guitar), Ravi (Synth), Tefan (Drum), Ichul (Vocal), Deon (Bass)\r\n\r\nYears Active\r\n2015 - Present\r\n\r\nGenres\r\nAlternative Rock\r\n\r\nStyles\r\n•	Alternative Rock\r\n•	Punk/Rock\r\n•	Experimental Rock\r\n•	Alternative/Indie rock\r\n•	Indie Electronic\r\n\r\nMoods\r\n•	Intense\r\n•	Chaos\r\n•	Austere\r\n•	Atmospheric\r\n•	Enthusiasm\r\n•	Earnest\r\n•	Theatrical\r\n•	Suffocating','Alternative Rock','lainnya;','Jakarta',1277,'2017-09-08 02:27:55','2017-09-08 02:27:55'),
	(882,'ROCKET 88','1504842447.JPG','Rocket88, adalah band Rock asal Jakarta yang terbentuk pada tahun 2014 akhir. dengan:\r\n\r\n-Pradipta sebagai Vocal & Gitar\r\n-Dix (Arditya) Sebagai Bass & Vocal\r\n-Kevin sebagai Drum\r\n\r\nTerbentuknya mereka karena mereka berada disalah satu universitas dan jurusan yang sama, serta memiliki passion musik yang sama.\r\n\r\nMereka kebanyakan menyambangi gigs-gigs komunitas, dan pensi sekolah.\r\njuga beberapa kali mengisi di acara clothing festival jakarta (Jakcloth), dan Bermain diBalai Sarbini.\r\n\r\nDi akhir tahun 2017 ini mereka berencana merilis album perdana mereka yang berjudul \" Faceless \". sama seperti single mereka yang diunggah berjudul \" Faceless \"','Rock','instagram;guitar_plus;teman;','Jakarta',1429,'2017-09-08 02:47:27','2017-09-08 02:47:27'),
