	(884,'VELLA','1504844869.jpg','Sebuah band Sekolah yang terbentuk ditahun 2010, sempat facum karna personilnya kuliah semua. ditahun 2014 kami merintis kembali mimpi-mimpi kami.\r\nRentang waktu 2010 hingga sekarang Vella band beberapa kali mengikuti festival band tingkat SMA dan juga Tingkat Umum. Beberapa kali Vella band berhasil menjadi juara.','Pop','instagram;','Jakarta',1433,'2017-09-08 03:27:49','2017-09-08 03:27:49'),
