	(886,'Mort','1504850959.JPG','MORT, sebuah band yang lahir di kota Denpasar pada bulan Maret 2015 dengan memainkan genre rock radikal/radical rock. Band ini beranggotakan 4 orang yaitu Angga Baskara (vokal), I Putu Wicaksana (gitar), Weda Adnyana (bass), dan Bagus Rangga (drum). Namun, seiring berjalannya waktu, disebabkan satu dan lain hal Weda & Rangga meninggalkan band. Kini formasi terbaru Mort diisi oleh Baskara, Putu, dan Mol (drum), serta additional bass.\r\n\r\n\"Mort\" diambil dari bahasa Prancis, dalam bahasa Indonesia berarti \"mati\". Filosofinya yakni MORT ingin membuat mati kejenuhan, kebosanan, dan rasa tidak nyaman para pendengar. Musik mereka berbasis pada thrash metal, punk, dan rock yang ter-influence-kan oleh beberapa band seperti Speedwolf, Viking Skull, Sarcasm, Municipal Waste, Metallica, dan Natterjack yang kemudian diramu menjadi satu keutuhan bernama rock radikal. Kuartet ini telah meluncurkan sebuah mini album bertajuk \"Berontak!!!\" yang dirilis pada tanggal 13 Oktober 2016 yang lalu, serta telah melaksanakan pesta perayaan mini album mereka pada 5 Januari 2017. 5 lagu bising nan menghentak terdapat dalam E.P ini yaitu \"Intimidasi Raksasa Negeri\", \"Cerita Malam Suram\", \"Berontak!!!\", \"Menjejal Ajal\", dan \"Beringas\" yang semuanya dapat didengar secara gratis di www.mortradical.bandcamp.com','Heavy Metal','poster;teman;','Surabaya',1435,'2017-09-08 05:09:20','2017-09-08 05:09:20'),
	(887,'Strange Brew','1504851072.jpg','kendati para personel band sudah cukup lama terendam masuk di dunia musik band ini merupakan salah satu project pertama yang melibatkan mereka bersama di satu band. dari berbagai macam influence tiap-tiap individu dipadukan sehingga tercipta sebuah komposisi yang tidak bisa dikatakan modern atau vintage sekalipun. darisitulah muncul ide nama band yaitu Strange Brew yang berarti campuran yang aneh atau seduhan yang aneh yang juga merupakan salah satu hits dari band rock 60an yang di motori oleh Eric Clapton yang bernama Cream. dengan sound yang dihasilkan oleh gitar fender startocaster yang mengacu pada spec tahun 1965 yang di beri suplemen pedal fuzzface, dentuman drum ala rock 90an vocal yang padat, barikade not-not rendah dari bass serta vokal yang memiliki karakter rock ballad bertemu terjadilah sebuah ekstraksi musikal yang kami sebut Strange Brew.','Rock','instagram;','Surabaya',793,'2017-09-08 05:11:12','2017-09-08 05:11:12'),
	(888,'Cloud.Ink','1504851638.jpg','Pengalaman:\r\n1.	UPH Fest 2016 home band\r\n2.	Maranatha Christian University Bandung “Psycomp 2017” guest star\r\n3.	UPH Open House 2017 home band\r\n4.	Wedding gigs\r\n•	April 2nd for Andreas and Wanglei at Menara Peninsula Hotel\r\n•	July 22nd for Stefanus and Sylvia at Marina Ancol\r\n5.	Beer Garden Valentine gig\r\n6.	Played for Timothy John Luntungan live recording project\r\n\r\nKarya Original:\r\n1. Sailing Sky\r\n2. Why Do We Fall','Pop','maliq;','Jakarta',584,'2017-09-08 05:20:38','2017-09-08 05:20:38'),
	(889,'Greenback Boogie','1504853084.jpg','Greenback Boogie terbentuk pada tanggal 14 Januari 2016, bermula saat Rian dan Faisal ingin membentuk band dan akhirnya bertemu dengan adik kelas Faisal semasa SMA yaitu Panji, Agi dan Satria. Setelah membuat cover project lagu-lagu populer dari era 90 hingga sekarang.\r\nPrestasi dari band kami adalah juara 2 Superrawk fest 2017 (Djarum Super) dan 40 besar Jakcloth band competition.','Alternative Rock','guitar_plus;','Jakarta',490,'2017-09-08 05:44:44','2017-09-08 05:44:44'),
	(890,'Hello Haters','1504853531.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-08 05:52:11','2017-09-08 05:52:11'),
	(891,'Hello Haters','1504853564.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-08 05:52:44','2017-09-08 05:52:44'),
	(892,'Hello Haters','1504853644.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-08 05:54:04','2017-09-08 05:54:04'),
	(893,'VENA','1504854315.jpg','VENA pertama kali terbentuk tgl 29 Maret 2016 (masih dengan formasi 2 orang). Maves sebagai vocalist + guitarist, dan Navila sebagai vocalist + violinist. \r\nKami memilih untuk menggunakan nama VENA karena memiliki arti pembuluh darah balik, dimana setiap manusia pasti memilikinya. Dan vena berfungsi untuk mengalirkan darah dari seluruh tubuh menuju satu titik pusat yaitu jantung. Seperti visi kami, yang ingin menyatukan seluruh jiwa dan raga kami sebagai personil band ini menuju satu tujuan, yaitu kesuksesan, dengan menggunakan musik sebagai penentu arahnya. Begitupun harapan kami bagi setiap mata, hati, dan telinga yang menikmati karya kami akan menyatu dengan kami dan merasakan kebahagiaan. \r\nBerjalan sekitar 1 bulan, formasi kami berubah menjadi 4 orang. Karena Fadhil (drummer / cajon player) mulai bergabung. Kemudian ada Senna (bassist) yang sempat melengkapi penampilan kami namun harus terhenti karena berkuliah di luar kota. Dan ada Wilheart (keyboardist) yang sempat melengkapi penamilan kami, namun sayangnya, karena satu dan lain hal Wilheart tidak dapat melanjutkan perjalanannya bersama kami. Akhirnya formasi VENA saat ini baru berjalan mulai 17 Agustus 2017 sejak bergabungnya Chandra (bassist) dan Alfan (lead guitarist) sehingga penampilan VENA semakin harmonis dan semarak.\r\nBand kami yang bisa dibilang masih seumur jagung ini ternyata sudah mulai diperhitungkan sebagai band berkualitas oleh Masyarakat Jabodetabek. Khususnya bagi pelalu-pelaku usaha Cafe, Restaurant, maupun masyarakat umum dan instansi yang memiliki acara seperti ulang tahun, pernikahan, pembukaan tempat usaha, exhibition, gathering, reuni, seminar, dan event-event lain yang membutuhkan pemusik untuk mengisi acara. \r\nBanyak rintangan yang sudah kami tempuh sepanjang perjalanan karir band kami untuk mencapai kesuksesan. Dan syukur alhamdulillah selama ini hasil dari kerja keras kami semua mulai berbuah manis.  Jadwal kami untuk tampil dari panggung ke panggung saat ini sudah penuh mengisi keseharian kami. Karena kami sudah tampil secara reguler di beberapa tempat di area Jabodetabek. Selain di wilayah Jabodetabek, kami juga sudah mulai merambah area luar kota seperti Jogja, Medan, Bandung, Jombang, dan Surabaya. \r\nKami berharap semoga VENA akan menjadi jauh lebih baik lagi di masa mendatang, untuk itu dukungan dari para Sahabat VENA sangatlah berarti bagi kami.','Others','facebook;instagram;','Jakarta',1436,'2017-09-08 06:05:15','2017-09-08 06:05:15'),
	(894,'Lydian','1504855357.jpg','Lydian adalah band yang dibentuk berdasarkan kesamaan preferensi musik di antara para personil. Seluruh personil menyukai genre musik rock, meskipun masing-masing memiliki taste yang berbeda terhadap jenis rock yang disukai. Untuk menyatukan passion tiap personil, Lydian dibentuk dengan kombinasi sound yang unik. Kami senang bermain-main dengan suara gitar yang raw di satu sisi, dan melodik di sisi yang lain. Begitu juga dengan kombinasi suara bass dan drum yang simpel namun variatif dan powerful.\r\n\r\nMajalah HAI pernah membahas demo kami yang bertajuk \"Melodi\" pada edisi ke 37/2014/XXXVIII (15-21 September 2014). Untuk foto terkait bisa dilihat di on.fb.me/1AuwDV8.','Alternative Rock','facebook;poster;teman;','Jakarta',1441,'2017-09-08 06:22:37','2017-09-08 06:22:37'),
	(895,'Fiverna','1504855464.jpg','Fiverna terbentuk pada tanggal 14 Oktober 2015 dengan mengusung genre Pop-Groove. Kami terdiri atas lima orang personil, yakni Giovanni Yessynia Gunawan (Vocal), Hasrul Novarizki (Guitar), Aderiel Satya Bernike (Bass), Daniel Kinantyo Christy (Keyboard), dan Antonius Tri Cahya (Drum). Fiverna awalnya terbentuk dari beberapa orang anggota Airlangga Orchestra, salah satu Unit Kegiatan Mahasiswa yang ada di Universitas Airlangga, Surabaya.\r\n\r\nPengalaman Stage:\r\n- Guest Star Eco Party 2015 Corner FST Universitas Airlangga\r\n- Guest Star Stovit League 2016 FKG Universitas Airlangga\r\n- Guest Star Seminar Inspiratif 2016 with Keenan Pearce FF Universitas Airlangga\r\n- Guest Star “Private Gigs” Wisma Semen Gresik 2016\r\n- Guest Star Diplomers 2.0 FV Universitas Airlangga\r\n- Guest Star Airlangga Specta 2016\r\n- Guest Star Crown 2016 FF Universitas Airlangga\r\n- Guest Star Seminar Nasional & Fieldtrip Education FKH Universitas Wijaya Kusuma\r\n- Guest Star Inaugurasi FKH Universitas Airlangga','Pop','instagram;guitar_plus;','Surabaya',1150,'2017-09-08 06:24:24','2017-09-08 06:24:24'),
