	(899,'Liana band','1504858036.jpg','Liana band merupakan band yang baru memulai meramaikan kembali  belantika musik Indonesia  setelah beberapa tahun yang lalu sempat vakum dari dunia  hiburan tanah air. Di pertengahan tahun 2017 ini Liana band mencoba kembali peruntungannya  di dunia music Indonesia dengan mengusung Genre Pop Rock Romantic. Liana band terbentuk dari dua band yang berasal dari kota Cilegon dan Lampung, sebut saja  band  tersebut  yaitu Keisha band dan Djantan yang sudah bermusik sejak tahun 2006 s/d  Tahun 2014, di mana keduanya merupakan band yang sudah banyak menghasilkan karya lagu yang Easy Listening dan memenangkan  kejuaraan dari Festival – festival  band dan event event  baik di tingkat lokal maupun tingkat Nasional dan memenangkan kejuaraan seperti : Juara 1 Festival Gudang Garam tingkat Nasional Regional Palembang, Juara 1 Festival  Universitas Saburai Bandar Lampung, Juara 1 Kejuaraan  Piala Walikota Bandar Lampung, Juara  1 Kejuaraan  Piala Walikota  Cilegon, Finalis  A mild live Wanted Regional  Kota Cirebon,  Opening acara  Annivesary Slank “PLUR” , Opening  konser band Dmasiv (Kota Serang & Cilegon), Opening konser band Slank (Depok), Opening   konser band  The Cangcuters (Jakarta) & Opening konser band Seventeen (Kota  Bandar Lampung) \r\nMakna dari  kata Liana sendiri di ambil dari bahasa Jerman yang berarti “Manuasia yang Sederharna”, dimana makna tersebut menjadi dasar band kami untuk selalu menjadi  pribadi yang  selalu Low Profile dalam bermusik dan kami terapkan dalam kehidupan sehari – hari. \r\nPersonil Liana band digawangi  oleh 6 Personil  yaitu : Adit (Vokal), Adhe (Drum), Wildan (Lead Guitar), Rifki (Guitar Rhytem), Dudie (Bass), Eka (Keyboard) .\r\nKARIR\r\n-	Juara 1 Festival Band PT.Chandra Asri Cilegon (26 Agustus 2017)\r\nBand Social Media :\r\nFacebook : Lianaband cilegon\r\nInstagram : Lianabandcilegon\r\nEmail : lianabandgroup@gmail.com\r\nContact Person : Eka (081297858490)','Alternative Rock','poster;teman;','Jakarta',1422,'2017-09-08 07:07:16','2017-09-08 07:07:16'),
	(900,'Luna','1504858381.jpg','band ini berawal dengan nama \"Delv\" yang dulunya dengan vocalis laki2. mengawali karir sebagai pemenang JUARA 1 Speedytrack Telkom 2010, yang sempat ditampilkan live di TRANS corp. Juga Juara 3 Sprit DPlong Indonesia. setelah itu sering tampil di panggung2 besar seperti Soundrenalin.\r\nseiring berjalannya waktu, band ini mengalami perubahan konsep dengan bergabungnya Mahayu sebagai Vocalis, menggantikan Vocalis yg sebelumnya. dan membuat musik kami lebih renyah, dan menyenangkan.','Pop','informasi_toko;guitar_plus;teman;','Yogyakarta',1378,'2017-09-08 07:13:01','2017-09-08 07:13:01'),
	(901,'Sin-Thing','1504859563.jpg','Band yang terbentuk pada 28 Juni 2016 ini mengusung genre punk rock yang mengacu pada unsur sosial, politik, dan persatuan Indonesia. Disini kami menekankan bahwa kami tidak mempunyai skill bermusik yang spesial tetapi kami ingin membuat lagu-lagu yang mempengaruhi kebanyakan orang ke sisi positif.','Others','facebook;instagram;guitar_plus;umi;lainnya;','Jakarta',1447,'2017-09-08 07:32:43','2017-09-08 07:32:43'),
	(902,'Prasiwan','1504859676.jpg','pemain gitar akustik, dan harmonica/ sudah menggeluti dunia musik sejak SD dan berkarir sebagai solois sudah 4 tahun di bantu bersama teman - teman saya, sering perfom di caffe caffe maupun event','Folk','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Surabaya',1228,'2017-09-08 07:34:36','2017-09-08 07:34:36'),
