	(904,'DESMOINE','1504862825.jpg','Band kami terbentuk dari sukanya kami terhadap musik..Demoine dari nama kota Desmoines, kota yang cukup indah dan kami rasa namanya juga cukup unik jadi kami memutuskan mengambil nama Desmoine.','Alternative Rock','facebook;teman;','Jakarta',1448,'2017-09-08 08:27:05','2017-09-08 08:27:05'),
	(905,'Red Maverick','1504862886.jpeg','Red Maverick adalah band yang dibentuk pada pertengahan tahun 2015. Awal terbentuknya\r\ndimotori oleh Happy (Vokal), Bayu Windiasko (Gitar), Rizki Aldo (Bass), dan Caecario Vito\r\n(Drum). Happy pada dasarnya adalah penyanyi Gereja. Saat itu band ini belum memiliki nama\r\npasti dan selalu berubah-ubah. Band ini memainkan musik-musik seperti Nirvana, Creed, Dewa\r\ndan lainnya. Setelah beberapa kali latihan, karena kendala kesibukan pekerjaan akhirnya Vito\r\nmengundurkan diri. Sempat bingung mencari pengganti Vito, pada akhir 2015 Jon sebagai\r\ndrumer resmi menggantikan Vito. Pada saat itu pula Happy menemukan nama yang pas untuk\r\nband ini, yaitu Red Maverick.\r\nBerjalan lurus dengan nama yang sudah pasti dan konsisten latihan, Bayu, Aldo dan Happy\r\nmembuat lagu pertama dengan judul Breakaway. Sebenarnya lagu Breakaway adalah lagu\r\nciptaan Bayu dari band sebelumnya dengan judul lagu Keep The Fire Light dari band Bayu sebelumnya yaitu Beat And Run. Setelah banyak perubahan komposisi lagu, akhirnya Bayu,\r\nAldo dan Happy resmi merubah judul dan komposisi lagu dengan judul Breakaway yang liriknya\r\nsendiri dibuat oleh Happy.\r\nSetelah berjalan hampir setengah tahun, karena kesibukan pekerjaan masing-masing, Red\r\nMaverick vacuum dari bermusik. Sempat berhenti hampir setengah tahun pada tahun 2016 dan\r\nJon pun mengundurkan diri dari posisi drum karena lokasi tempat tinggal Jon yang jauh dan\r\nkesibukan bekerja. Tidak beberapa lama Catra, yang sudah berteman lama dengan Bayu,\r\nmenggantikan posisi Jon sebagai drumer. Catra dan Bayu sempat memiliki band bersama\r\ndengan Fariz ‘Bleng’ Maulana yang sekarang membentuk band Groove Metal bernama Helliost\r\ndi Bandung. Namun Catra saat itu memegang posisi bass.\r\nTidak beberapa lama, Aldo tiba-tiba mengundurkan diri karena kesibukan pekerjaan dan usaha\r\nyang dijalankannya. Dengan segera Red Maverick pun merekrut Pras yang berteman baik\r\ndengan Bayu dan Happy. Pras sebenarnya adalah gitaris pada band sebelumnya, namun\r\nmemutuskan untuk mengambil posisi bass menggantikan Aldo.','Rock','instagram;teman;','Jakarta',1431,'2017-09-08 08:28:06','2017-09-08 08:28:06'),
	(906,'LEFAWIGI','1504864185.jpg','LEFAWIGI adalah band Alternative Rock asal Jakarta Timur. Nama LEFAWIGI sendiri merupakan singkatan dari nama-nama anggotanya (LExy--ex-member, FAlih, WIsnu, Giri--ex-member, Irfan). Untuk tahun ini kami juga kedatangan anggota baru yaitu Idham.\r\n\r\nTerbentuk sejak tahun 2010, LEFAWIGI aktif di kancah musik underground di Jabodetabek, terutama scene hardcore, hip-hop, dan punk rock.\r\n\r\nMusik kami terinspirasi dari berbagai spektrum musik. Mulai dari The Temper Trap dan Kodaline hingga Green Day dan Blink-182. LEFAWIGI mencoba untuk memberikan sound yang baru bagi penikmat musik tanah air.\r\n\r\nSalah satu single yang telah dirilis secara independen berjudul \"Rise\" dapat didengarkan di Spotify, iTunes, Deezer, dll. LEFAWIGI berencana meluncurkan album debutnya pada tahun 2018.\r\n\r\nCari tahu lebih lanjut mengenai kami di blog kami: lefawigi(dot)wordpress(dot)com.','Alternative Rock','instagram;teman;','Jakarta',1394,'2017-09-08 08:49:45','2017-09-08 08:49:45'),
	(907,'FSFS','1504865280.JPEG','Fsfs adalah salah satu band asal kota kembang berawal pada tahun 2009, berbagai formasi telah kami lakukan dan ini formasi baru dengan aldo pada vokal, dwiky pada gitar bachtiar pada gitar, bayu pada bass dan ihsan pada drum. Sebuah karya telah tercipta dengan single  Fake smile, kemudian True friends dan unspoken','Alternative Rock','instagram;','Jakarta',1286,'2017-09-08 09:08:00','2017-09-08 09:08:00'),
