	(910,'Endless Summer','1504867583.JPG','Terbentuk pada pertengahan 2015, dengan nama ENDLESS SUMMER yang bermakna keseruan yang tiada akhir dengan motto \"we\'ll burn you out, like the summer never end\".\r\nPrestasi :\r\nJuara 1 : Kampung Pemuda, 2016\r\nJuara 2 : Man Ice, 2017\r\nJuara 1 : Erlangga Talent Show, 2017\r\n\r\nPerformance:\r\nFestival Kampung Pemuda, Tangerang\r\nD\'sparted, Tangerang\r\nyouth Festival, Tangerang Selatan\r\nSonic Linguistic, Tangerang Selatan\r\nAlbes Festival,Tangerang Selatan\r\nO2 Cafe, Jakarta\r\nTangerang Culinary Night, Tangerang\r\nTMII Rock Nusantara, Jakarta\r\nLapiaza Dock 88, Jakarta\r\nAncol Beach Walk, Jakarta\r\nFestival Cisadane, Jakarta','Alternative Rock','instagram;','Jakarta',753,'2017-09-08 09:46:23','2017-09-08 09:46:23'),
