	(914,'Lake And Trees','1504873913.png','\"Jodoh sudah di atur\" mungkin kalimat itu yang cocok menggambarkan cerita tentang Lake And Trees yang terbentuk dari mencari kerja bersama antara Ikay (Guitar) dan Azit (Vocal) , sharing musik mereka memiliki visi sama dan Azit memperkenalkan Ridwan (Gitar) kepada Ikay , lalu mencoba mencari karakter masing masing dan akhirnya terbentuk lagu Carry On , dari kisah permasalahan band masing masing yang pernah di lalui, lalu Ikay memperkenal kan Indra (Bass) kepada Ridwan dan Azit , Indra bertransformasi dari guitaris menjadi bassist untuk mejadi pondasi musik di band Lake And Trees','Alternative Rock','instagram;informasi_toko;teman;','Jakarta',1232,'2017-09-08 11:31:53','2017-09-08 11:31:53'),
