	(925,'Havanah','1504877982.png','Havanah, band yang lahir tepat diatas bumi Melayu Deli ini merupakan hasil buah pikiran dua insan kawula muda yang siap menggebrak masyarakat Indonesia. Beranjak dari pengetahuan dan pengalaman yang terbilang cukup mendasar, pada akhir tahun 2015 M. Akbar Maulana dan M. Bayu Dwi Utomo sepakat bersuara satu untuk mengeksplorasi dunia musik bersama - sama dalam sebuah ikatan yang mengatas namakan komitmen. Seiring berjalannya waktu, Muliadin Putra, Sigit Purnomosidi beserta Syafi Syafiq resmi melebur kedalam tubuh Havanah. \r\n     Havanah sendiri telah melibatkan diri dalam pergerakan sosial yang dinaungi AIESEC Indonesia yang kala itu diadakan di SMA Harapan 3 Medan. Harapannya, Havanah sedikit banyak dapat membantu AIESEC Indonesia untuk menggali serta mengembangkan bakat dan potensi jiwa jiwa penerus bangsa Indonesia.','Alternative Rock','instagram;teman;','Medan',1463,'2017-09-08 12:39:42','2017-09-08 12:39:42'),
