	(932,'TIME','1504878715.JPG','Band ini terbentuk dari kekeluargaan personel nya yang pada sebelumnya memiliki prestasi pada band nya masing-masing.Berbagai event diikuti dan sebahagiannya adalah GGRC,Cardinal award,Guines,dan band ini juga menjadi bagian dari Sound Of 3 menjadi 3 besar perwakilan kota medan.dan kini kami mempunyai 2 lagu karya kami yang berjudul say something dan Kita bisa.dengan berbagai macam music dari masing-masing personel kami menyatukannya dalam T.I.M.E','Alternative Rock','facebook;teman;lainnya;','Medan',1335,'2017-09-08 12:51:55','2017-09-08 12:51:55'),
