	(934,'ANTC','1504879417.jpg','ANTC adalah singkatan dari Another Chance , berdiri sejak 28 September 2014 , band yang bermula dengan nama SAY HI Dan berawal dari 6 personil pada formasi awal lalu seiring berjalannya waktu pada bulan september 2016 ANTC resmi menjadi 3 personil yaitu Susan (  vocalis ) , Kevin ( Gitaris ) , Dan Fajar ( Drum ) . Genre yang kami usung adalah alternative melodic  . Pada tanggal 30 April 2017 ANTC masuk final acara SUPERRAWK FEST 2017 . Singel pertama kami yang berjudul  Hari dan Hati.','Alternative Rock','instagram;guitar_plus;poster;teman;','Jakarta',1024,'2017-09-08 13:03:37','2017-09-08 13:03:37'),
	(935,'MANJǍ','1504879432.jpg','Terhitung sebagai grup musik anyar — baru resmi berdiri pada Januari 2017 — Kelompok berformat trio ini bisa dibilang sosok yang telah lumayan malang\r\nmelintang di blantika musik Bali.\r\nMencampur banyak genre macam alternative, psychedelic, indie rock, dan prog rock, Manjă agak\r\nbingung jika diminta menyebutkan apa genre yang diusung. \r\n\r\nJika bicara etimologi serta filosofi di balik nama Manjă, itu berasal dari Bahasa Hindi yang diadopsi ke dalam\r\nBahasa Inggris yang berarti benang gelasan yang biasa digunakan dalam lomba layang-layang. Ini\r\ndimaknai sebagai simbol penghubung antara manusia dengan mimpi atau angan-angannya yang bebas\r\nmerdeka terbang di angkasa. Manjă ingin menciptakan musik yang menginspirasi kancah berkesenian di\r\nIndonesia, agar think outside of the box.\r\nSejauh ini Manjă telah memiliki 7 karya sendiri yang telah dinyanyikan saat manggung. Dan prioritas\r\nmereka sekarang ini masih hendak memperbanyak jam terbang seraya menulis lagu, membuahkan\r\nkomposisi baru sebanyak-banyaknya.','Alternative Rock','teman;','Jakarta',1459,'2017-09-08 13:03:52','2017-09-08 13:03:52'),
	(936,'LIBRA','1504879699.jpg','- 3 Besar guines beer jawa barat\r\n- 15 Besar amild live wanted regional Jakarta\r\n- Juara 3 Festival Se-Jak-Tim 2012\r\n- Juara Top Singer Depok\r\n- Juara 1 Antar Fakultas Sejabodetabek 2015','Rock','teman;','Jakarta',1472,'2017-09-08 13:08:19','2017-09-08 13:08:19'),
