	(940,'Niti Project','1504880539.jpg','Niti Project, Niti adalah singkatan dari nama-nama personel kami. Mulai menggunakan nama Niti Project pada awal 2017. Niti Project tidak terbatas hanya dalam satu genre, kami akan menuangkan apa yang ada Di dalam diri kami melalui musik. Kami juga membebaskan para pendengar untuk bebas menginterpretasikan musik yang kami bawakan. \r\n\r\n#SalamKitaIndonesia','Others','instagram;lainnya;','Jakarta',1410,'2017-09-08 13:22:19','2017-09-08 13:22:19'),
	(941,'BRANCHA AMARIS','1504880757.jpg','B.A , demikian singkatan dari BRANCHA AMARIS\r\nMemulai karir bermusik dengan nama B.A sejak tahun 2017,walaupun sebenarnya sudah memiliki kesibukan di dunia musik untuk waktu yang cukup lama.\r\n Di awali dari hubungan kaki beradik antara Ismail dan Dicky,mereka sepakat untuk membuat sebuah band profesional.\r\n\r\n Untuk prestasi,pernah beberapa kali mengikuti ajang festival band,dan sekarang ini B.A sudah memiliki 10 lagu,tetapi masih 1 lagu yang di keluarkan sebagai single dan sebagai lagu untuk promosi band ,yang berjudul MASIH MENCINTAIMU, dan selanjutnya B.A akan mengeluarkan single-single lainnya .','Pop','facebook;','Medan',1475,'2017-09-08 13:25:57','2017-09-08 13:25:57'),
	(942,'KopralJono','1504880986.jpg','Terbentuk\r\n sejak tahun 2011, Kopral Jono mengusung genre musik Ska, namun dengan \r\npengaruh khas daerah Melayu, sehingga kami menamakan genre tersebut \r\nSkaYu (Ska Melayu).\r\n\r\nPrestasi:\r\n10 besar Asean Beat - Palembang\r\n10 besar A Mild Wanted - Palembang\r\ntahun 2016 ; Band line up Pekan Raya Indonesia (Konser 1000 Band) - ICE \r\nBSD Tangerang\r\nTahun 2017 ; \r\n- Band Line Up Jak Cloth Musi Fest\r\n- Band Line Up Countdown to Asian Games 2018 - Palembang\r\n- Band Line Up Kreatifood by BeKraf','Others','instagram;informasi_toko;','Jakarta',681,'2017-09-08 13:29:46','2017-09-08 13:29:46'),
