	(944,'man on wise','1504881605.JPEG','untuk yang terhormat:\r\nLevi\'s Indonesia & Universal Indonesia\r\nberikut cerita tentang kami.\r\n\r\nband ini baru saja dibentuk, kami personilnya ada 2. tapi kalau perform, kami menggunakan additional. proses pembuatan lagu, dikerjakan oleh kami berdua. dari proses pembuatan kerangka hingga tracking. \r\n\r\npengalaman perform sangat sedikit, dikarenakan rizki (voc) masih menyelesaikan studi kuliahnya di jogja. namun kami berdua sudah sangat lama malang melintang menjadi session player dan tahun ini kami disatukan menjadi project Man On Wise. terimakasih :)\r\nsalam hormat kami,\r\nrizki & Azhari','Alternative Rock','instagram;','Surabaya',1483,'2017-09-08 13:40:05','2017-09-08 13:40:05'),
	(945,'The Good Listener','1504881677.jpg','The Good Listener lahir di Yogyakarta pada tanggal 21 April 2011, dengan mengusung genre rock, kami berniat untuk mengibarkan kembali semangat musik rock. Tahun 2013 kami telah melaunching mini album bertajuk \"Partikel Emosi\", yang menceritakan tentang emosi yang ada didalam kehidupan bahkan sampai titik terkecil (partikel). Dalam mini album tersebut berisi 5 lagu yaitu Bebaskan aku, Trima kasih, Pesan dari rakyat, Cerita dilubang hitam, Angkat dan beri.','Rock','instagram;poster;','Yogyakarta',1480,'2017-09-08 13:41:17','2017-09-08 13:41:17'),
	(946,'Titik Awal','1504881717.png','terbentuk 10 juni 2006, band ini berawal dari sebuah ekstrakulikuler sekolah di kota bandung. dan kami memulai cerita bersama dengan main di event seperti java jazz festival, jazzy nite kompas tv, breakout net tv mediatama, PMKT Universitas pharayangan, the internasional kampoeng jazz ,Pasar Seni festival ITB, Jazz On April Pupuk Kaltim ( Tour ), Espose Universitas Padjajaran, Levi\'s Indonesia, Jinggle Indomie, Duta Walikota bandung, Klab jazz, Ixpo Fest Universitas pharayangan, dan event-event lainnya. dan sampai saat ini kami berjalan bersama untuk menggapai impian.','Pop','instagram;','Jakarta',1071,'2017-09-08 13:41:57','2017-09-08 13:41:57'),
