	(951,'Arley','1504882771.jpg','Arley terbentuk pada tanggal 20 Agustus 2015, nama Arley bermakna pemanah dan diharapkan band ini mampu mencapai suatu target seperti anak panah. Arley sering di undang untuk mengisi acara2 kampus dan cafe2 di surabaya. Awalnya band ini beranggotakan 5 orang personil, namun karena 2 personil lainnya harus fokus bekerja maka mereka memilih untuk keluar. Tetap bersemangat Arley pun masih melanjutkan penggarapan album pertamanya yang berjudul Pengagum Rahasia yang terdiri dari 5 lagu. Pengalaman lucu pernah terjadi ketika kita di undang di salah satu kampus kesehatan di surabaya, kita datang tepat waktu namun ternyata kita datang ke kampus yang lainnya dengan nama lain salah tempat.','Pop','guitar_plus;','Surabaya',607,'2017-09-08 13:59:31','2017-09-08 13:59:31'),
