	(955,'Trade Four','1504882801.JPG','Dibentuk pada Oktober 2015, band dengan genre utama jazz ini mengambil nama dari istilah jazz juga, Trade Four. Kami telah berpengalaman di acara-acara musik seperti Jazz Traffic, Stage Bus Jazz Tour, Balai Jazz, Jazz in the City. Selain itu beberapa prestasi yang telah kami raih antara lain : 1st place AsianBeat 2016 tingkat provinsi Jatim, 1st place JakCloth band competition , 1st place FISCAL Hang Tuah band competition, 1st place iSTTS band competition, 3rd place Jazz Heritage.','Jazz','facebook;','Surabaya',1457,'2017-09-08 14:00:01','2017-09-08 14:00:01'),
