	(968,'Brokenjacks','1504882889.jpg','Berdiri 9 juni 2017. Mempunyai 3 lagu hingga saat ini. 2 anggota sering cabutan musisi event seperti wedding dan cafe. Kami membawakan bermacam macam genre. Tidak fokus pada satu genre. Karna genre bukanlah batasan. Moto kami. \"Music is a honest way to speak our soul\".','Others','teman;','Jakarta',1235,'2017-09-08 14:01:29','2017-09-08 14:01:29'),
