	(970,'AFLO','1504883383.jpg','Aflo adalah band yang mengatasnamakan sebuah keluarga bukan band atau team.Sehingga apapun yg terjadi kami saling bantu dan menopang satu dengan yang lain.Kami di satukan lewat musik yang berbeda yang kami kemas menjadi sebuah alunan nada dan kata. Semoga musik yang kami mainkan dapat di terima. \r\nAflo beberapa kesempatan mengikuti event kompetisi antara lain Finalis L.A Meet labels Reg Medan (2012), #3 place Cipta lagu Honda Scoopy, dan beberapa event lokal lainnya','Others','instagram;','Medan',1478,'2017-09-08 14:09:43','2017-09-08 14:09:43'),
