	(972,'BETTER THAN BEFORE','1504883765.jpg','Better Than Before terbentuk pada tanggal 27 Juli 2007, kami berasal dari salah satu daerah yang sekarang  bernama Tangerang selatan yaitu Bintaro.\r\nKami adalah anak-anak muda yang memiliki satu keinginan yang  sama yaitu untuk  membesarkan jiwa musik yang tertanam di masing-masing jiwa kami, tempat yang sangat bersejarah adalah SMA KARTIKA X-1, disanalah awal mula Better  Than Before dapat terbentuk  2 Anak muda yang bersatu didalam sekolah ini yang awalnya  sama sekali  tidak memiliki keinginan untuk  membentuk sebuah band, namun karena ada satu tujuan yang tidak rasional untuk membentuk band \"agar dekat  dengan salah satu wanita\", awalnya si aneh ya dengan alasan itu untuk masuk ke  dalam ekskul band di sekolah,  namun setelah berjalannya waktu alsan itupun pudar dan membuat kami yakin serius dalam menjalanka n hobi  ini.\r\n \r\nkedua anak itu adalah DARWIN SETIAWAN LUBIS dan FAMHY ZUL ZAM ZAMI.Mereka berdua adalah penggagas besarnya nama D\'DAFY nama band  yang terbentuk pada tahun 2006  yang telah memiliki beberapa lagu yang salah satunya adalah TAK LAGI BERSAMA yang cukup diminati  anakanak disekolah karena lagi-lagi alasan mereka suka    adalah liriknya yang galau.setelah satu tahun bermusik, Darwin dan Fahmy merasa harus ada perubahan didalam band ini, sehingga hadir satu nama yaitu ANDI HIDAYAT seorang de kelas yang mencoba memberanikan diri untuk masuk kedalam band ini, namun setelah melakukan beberapa pertimbangan akhirnya Andi pun dicoba\r\nuntuk bisa masuk  kedalam D\'DAFY sebagai pemain gitar rhythm, setelah itu Andi  membawa dan mengenalkan YOGA LUQMAN HUKKAMA sebagai drummer.\r\n \r\nPada   saat   awal   latihan   belum   banyak   kecocokan   yang   didapat  didalam   band   ini, banyak hal-hal yang aneh terutama didalam skill dalam mengelola aransemen. Beberapa bulan berlalu pada tahun 2007 band yang dipimpin oleh Darwin dan Fahmy ini mencoba untuk  mengganti nama mereka menjadi BETTER THAN BEFORE dengan awal aliran adalah Melodic dan mulai  masuk  kedal  dunia  gigs,  acara  demi  acara  telah  dilewati  dengan  hantakan  drum  ala  punk membuat kami mulai  dikenal oleh kalangan musik indie terutama dikawasan kami.\r\n \r\nMerasa ada yang  harus  diperbaiki  pada  tahun  2010  Darwin  Membuat  satu  perubahan  dengan membuat  lagu dengan judul \"KAU\" dan ini adalah sejarah terbesar yaitu nama Better  Than Before sudah banyak yang  mencintai dan satu hari share lagu tersebut mendapatkan respon yang sangat besar dengan download satu hari  itu bisa mencapai  500an orang pendownload, dan aliran BTB pun mulai terarah dan ternyata memang sangat pas dengan sebutan POP PUNK.\r\n \r\nSetelah  1  Tahun  lagu  KAU  tersebar  diseluruh  masyarakat  dengan  free  download,  lagi-lagi kami harus melakukan perubahan konsep agar pendengar kami tidak bosan dan akhirnya pada tahun   2011  GALIH  PRAYOGA  masuk   sebagai  synthesizer  /  Keybordis   BTB   dan   dengan masuknya   galih   kami   merecord  lagu  INGATLAH  KAWAN  dan  dengan  sentuhan  Synth  lagu  ini sangat  membuat  warna  baru  dari  BTB  yaitu  menjadi  POWERPOP  PUNK  dan   respon  dari masyarakat sangat antusias dan membuat lagu ini tidak kalah dengan lagu KAU dan menjadi jagoan\r\ndari BTB dengan lirik dan nada yang Sangat Easy Listening ditelinga parapendengar.\r\n \r\nPada  tahun   2012  BTB  mengeluarkan  single  terbaru  yaitu  yang  ketiga  dengan  judul MELANGKAH lagu  move on dari orang yang telah menyakiti kita ini menjadi salah satu lagu yang sering didengarkan oleh indiersyang sedang sakit hati, lagi-lagi lirik yang diciptakan Darwin membuat para  pendengar tersayat dan merasa sedang berada didalam lagu tersebut, namun lagu yang direkam secara live ini menjadi musik yang kurangdibandingkan2singlesebelumnya.\r\npada tahun 2013 ini Better Than Before yang sudah mantap dengan aliran dan  keyakinan\r\n \r\nmereka dalam mengolah instrumen mengeluarkan single terakhir sebelum mengeluarkan EP yang insya Allah akan keluar pada tahun 2014. single terakhir ini berjudul SENDIRI alunan musik\r\ndan  irama  serta  lirik  menjadi  satu  kesatuan   yang   sangat   diperhitungkan   BTB   pada   lagu   ini, sehingga lagu ini sangat terdengar lebih matang dibandingkan lagu yang lainnya, sampai saat\r\nini lagu Sendiri menjadi andalan BTB dalam mendoktrin  masyarakat agar lebih mengenal dan mencintai BTB, selain lagu-lagu tadi dirilis  secara pribadi oleh btb, lalu  kami juga pernah masuk kedalam CD kompilasi KAISER bersamaan dengan band-band indi terkenal  indonesia, malaysia dan singapura dan dirilis di 3 negara tersebut, kemudian  kami juga pernah masuk kedalam  album kompilasi yang dirilis dan didownload didalam web.','Alternative Rock','instagram;teman;','Jakarta',1489,'2017-09-08 14:16:05','2017-09-08 14:16:05'),
	(973,'HIRA','1504883765.jpg','HIRA terbentuk pada tahun 2014 terdiri dari 4 orang dengan background musik yang berbeda sehingga memperkaya musik dan style bermain HIRA. Single HIRA yang berjudul \"Melangkah Maju\" sempat disiarkan di radio seluruh Indonesia pada tahun 2015 dan menduduki chart di beberapa radio selama 3 bulan.','Rock','instagram;teman;','Jakarta',1351,'2017-09-08 14:16:05','2017-09-08 14:16:05'),
	(974,'Initial','1504883767.jpg','pernah juara 1 ajang festival ban daerah, best player\r\nkami band daerah inhu riau, berawal dari persahabatan, yang mana setiap individu dari kami memiliki potensi yang luar biasa dalam bermusik. kami biasa membuat demo lagu sendiri di studio kami sendiri, lebih tepatnya home recording.','Alternative Rock','instagram;teman;','Medan',1476,'2017-09-08 14:16:07','2017-09-08 14:16:07'),
	(975,'KAWANLAMA','1504884066.JPG','Kawanlama adalah storyteller folk band . kami berkarya dengan sederhana serta lirik yang simple dan positif.','Folk','instagram;guitar_plus;','Jakarta',1488,'2017-09-08 14:21:06','2017-09-08 14:21:06'),
	(976,'Smokin\' Roses','1504884074.jpg','Terbentuk pada tahun 2004 dengan anggota Bani (vocalist & bassist), Dika (drummer), Artha (guitarist), dengan nama band Monday Madness. Mengusung genre alternative rock. Kemudian band yang berasal dari Kota Bogor ini berganti nama menjadi Smokin\' Roses pada Agustus 2017, serta menambah anggota baru yaitu Wira (guitarist) dan Afif (bassist). Bani yang semula mengisi bass, beralih menjadi vokalis. Saat ini Smokin\' Roses sedang proses menyelesaikan mini album yang direncanakan rilis akhir tahun ini.','Alternative Rock','teman;','Jakarta',1474,'2017-09-08 14:21:14','2017-09-08 14:21:14'),
	(977,'Virus.','1504884686.jpg','awal terbentuknya Virus. pada tahun 2006 silam\r\nkami kuliah di universitas,fakultas,angkatan yang sama di UNPAD Bandung\r\npada awalnya terbentuknya band ini bernama Calcyfer yang merupakan sekumpulan teman kuliah yang pada akhirnya membentuknya band dan menjadi home band cafe di score ciwalk bandung pada tahun 2007.\r\n\r\nkemudian dikarenakan adanya sedikit perubahan pada formasi dan kontrak di beberapa cafe yang menginginkan personel yang lebih ramai berubah nama kembali menjadi Orangebox dengan tambahan 2 personel lagi tetapi kami bertiga masih merupakan core/inti band tersebut.\r\n\r\nDan kini kami kembali bertiga lagi pada tahun 2012 sampai sekarang, dikarenakan kenyamanan kami bertiga dengan formasi sedikit orang yang menurut kami lebih mudah dan simple untuk dioraganisir dalam rekaman demo, audisi, show dsb dibandingankan dengan banyak personel.\r\n\r\nkami bertiga sering membawakan dan terinfluence dari musik-musik seperti jazz, blues, pop, akustik, top40\r\n\r\nprestasi:\r\n1.home band cafe score ciwalk bandung pada tahun 2006-2008\r\n2.home band padjajaran mall pada tahun 2008-2009\r\n3.juara 1 akustik fest kedokteran UNPAD 2008\r\n4.juara 1 akustik fest food.tech UNPAD 2008\r\n5.juara 2 jazz fest psikologi UNPAD 2009\r\n6.juara favorit 1 lomba cipta lagu 99ers/prodia ITB 2010\r\n7.Home Band Jatos 2006\r\n9.100 Besar A Mild fest regional Bandung/Jawa Barat\r\n\r\nnote: maaf sebelumnya kami sudah pernah mensubmit lagu sebelumnya dengan email band, tetapi ada kesalahan pada kelengkapan data. terima kasih','Pop','instagram;guitar_plus;','Jakarta',1490,'2017-09-08 14:31:26','2017-09-08 14:31:26'),
	(978,'S.A.M SITE','1504885025.jpg','Project S.A.M Site dimulai sejak 2009, namun tahun 2015 adalah tahun kebangkitan band yang mengusung Industrial Nu Metal, Techno Core sebagai aliran utamanya. Dengan ciri khas penggunaan Distorted Vocals, Distorted \r\nGuitar, High Speed Drums, dan Sampling S.A.M Site selalu mempersembahkan musik yang enerjik dalam setiap penampilannya. Saat ini S.A.M Site sudah merampungkan sebuah mini album yang diberi judul “Into the Parasite”.','Others','guitar_plus;poster;teman;lainnya;','Jakarta',1423,'2017-09-08 14:37:05','2017-09-08 14:37:05'),
	(979,'Polychromatic','1504885801.jpg','Polychromatic are an Indonesian pop rock band from Jakarta, formed in 2011 by lead guitarist Ardika Rizky, drummer Aldo Nugroho, vocalist Lingga Winando and bassist Zulfikar “Ajey” Mohamad. The band’s first song written together was “Jatuh Cinta” and Polychromatic started to be a stage performer. They usually performed at the café, school event and festival.\r\nIn the last of 2011, the band added Alamsyah Ibrahim (guitar) to their line up, and also Brody Vigo (drums) to replace Aldo Nugroho. A year later, Lingga, Alamsyah and Brody left the band. After 10 months apart, Aldo returned to the band, and Ajey left Polychromatic and formed a new band named Sound The Sip with Lingga, Rafi Novadi (drums) and Renzo (guitar).\r\nIn 2014-2015, Polychromatic also worked with Vigar Wardhana (vocal), Bagus Trilaksono (bass) and Erick Mandalika (bass) as an additional members. In 2015, guitarist Aziz Faishal and lead vocalist Yusama Abdurrahman joined the band and released their first single “Save Me” on Soundcloud. This song is also played on the local and online radio in Indonesia and United States. Their single also reached the 1st place on the radio chart for 1 month on Indie Pro 2 RRI (Radio Republik Indonesia/Radio of Republic Indonesia).\r\nThe music has lots of influence of British, American and Australian modern pop rock like Queen, U2, Radiohead, Coldplay, Linkin Park, Fall Out Boy, Arctic Monkeys, Mutemath, OneRepublic, Fun., The Temper Trap, Foals, The 1975, Imagine Dragons, and Twenty One Pilots.','Alternative Rock','instagram;','Jakarta',1466,'2017-09-08 14:50:01','2017-09-08 14:50:01'),
	(980,'AMAKUSA','1504886034.jpg','Amakusa adalah satu-satunya band yang konsisten mengcover X-Japan (Band legendaris Jepang) di komunitas Jepang dan Metal. Genre Amakusa adalah rock TANPA scream / growl, serta ballad dengan feel yang sangat menyentuh. Kami pernah membawakan lagu \"Art of Life\" dari X-Japan dengan durasi 29 menit full song (Special Performance Gelar Jepang UI 2009 dan Honnoukai Star Bandung 2012).\r\n\r\nSelain itu Amakusa masuk dalam finalis band dalam konser Final Fantasy Orchestra bersama Adi MS dan Twilite Orchestra membawakan lagu \"One Winged Angel\" dan \"J.E.N.O.V.A\" karya Nobuo Uematsu. Amakusa memiliki fanbase yang kuat terutama di Jabodetabek dan Bandung bersama komunitas X-Japan Indonesia @XJAPAN_ID sebagai afiliasi utama kami.\r\n\r\nEvent yang pernah kami ikuti selain campus fair dan bunkasai  diantaranya adalah Jakarta Fair 2011, launching album TRAUMA Band \"Dominasi Kemenangan\", Kulturblender music, fx musicmotion bersama FORMI (Forum Music Indie Indonesia) serta Kompas Gramedia Fair 2012, Istora Senayan, dan official pre event L\'arc en Ciel world tour 2012 at Hard Rock Cafe Jakarta oleh LA Lights Music.\r\n\r\nEvent-event selanjutnya yang kami ikuti adalah Urban Fest 2012 Ancol, Ennichisai Blok M 2013, Tribute to Hide Pink Spider, Jakarta (Official event from Headwax Management Japan), Gelar Jepang UI 2013,  LOKA (Indie Rock Band from Japan) DEVA\'S TOUR, Jakarta, JAKCLOTH 2013 at Nushock Stage, Senayan, IRO FEST 101.4 Trax FM at Atrium EX Plaza 30 mei 2014, exclusive interview and accoustic performance on iro-iro 101.4 Trax FM (31 Agustus 2014), Suara untuk Gaza bersama musisi-musisi indie Indonesia, Cosplay Nation Lippo Mall Puri, Doraemon World Anibee TV with IMMG, 27 September 2014, and Japan Festival in Indonesia,1 November 2014 (Official Event from Japan Embassy, as the opening of Ryutaro Makino, Japanese Jazz & Blues Singer), Philosofair FIB UI 2015, Launching album Henohenomoheji and Fairytails, Bandung, The Rock Campus by Ezra Simanjuntak ~Rolling Stone Cafe 2015, featured band in GET TV J-MUSIC CHANNEL VOL 2, Jak Japan 2015, Plaza Blok M Matsuri 2015, J-All Star Carnival, Little Tokyo Ennichisai 2016, Road to Kaori Nusantara Expo 2016, Pekan Raya Indonesia - Konser 1000 Band, Haru Matsuri UHAMKA 2017, Recital Percussion IKJ 2017, dan Jak Japan Matsuri 2017.','Rock','instagram;poster;lainnya;','Jakarta',1439,'2017-09-08 14:53:54','2017-09-08 14:53:54'),
	(981,'DE\'CRUE','1504886181.jpg','Band rock n roll nyentrik asal Manado, Sulawesi Utara.\r\n\r\n- Finalis Grandfinal Cardinal Bali\r\n- Tour 5 kota Sulawesi RockinCelebes 2015\r\n- Line Up Manado Mayhem 2015, 2016\r\n- Opening Act NAIF\r\n- Opening Act SID\r\n- Opening Act SHAGYDOG\r\ndll','Rock','instagram;','Yogyakarta',1443,'2017-09-08 14:56:21','2017-09-08 14:56:21'),
	(982,'MILESTONE','1504886372.jpg','Kami disini ingin menggali tentang isi yang ada dari manusia selama mereka hidup baik dari aspek manapun. Kami disini ingin membuat karya yang berisi pesan kepada manusia agar mereka dapat berfikir sejenak tentang kehidupan yang ada, agar mereka dapat meraih apa yang menjadi tujuan mereka selama mereka masih diberi waktu oleh Sang Pencipta untuk mewujudkannya. Disini kami merupakan pembawa pesan berupa musik yang dikemas dalam bentuk lagu yang ber-aliran Alternative Pop. Projek kami disini berbentuk kelompok/band yang bernama MILESTONE. Milestone sendiri dapat diartikan sebagai Batu Loncatan yang jelasnya adalah menjadi jembatan untuk kita agar menjadi lebih sukses daripada yang sebelumnya kami lakukan. Milestone dibentuk pada pertengahan tahun 2016 dan telah bermain di berbagai event seperti Event Kampus, event komunitas, pensi SMA, dan event-event lainnya seperti soundsation, pagelaran seni budaya, dan lain-lain.','Alternative Rock','instagram;umi;poster;teman;','Yogyakarta',1015,'2017-09-08 14:59:32','2017-09-08 14:59:32'),
	(983,'NARNIA','1504886660.jpg','Awalnya kita punya band masing masing lalu kita sepakat untuk membentuk band bersama yaitu NARNIA dan untuk prestasi masing masing dari kita pernah meraih penghargaan dari beberapa festival band.','Pop','teman;','Jakarta',1085,'2017-09-08 15:04:20','2017-09-08 15:04:20'),
	(984,'Weekend Junction','1504886704.jpg','merupakan band yang dibentuk dengan kesuakaan pada rasa musik yang sama,\r\n\r\ndipengaruhi oleh band-band British Pop Pada era awal setelah bubarnya the beatles.\r\n\r\nBand weekend Junction ( yang sempat bernama Arga Dranie\'s weekend junction)\r\n\r\nsempat beberapa kali mengisi beberapa Event di kota palembang. seperti Acara Urban Gigs ataupun Acara Authenticity.\r\n\r\ndan kini, setelah berangkat ke ibukota, dengan tujuan masing-masing yang berbeda, band ini kembali di Reformasi dengan format dan personil yang baru.','Alternative Rock','instagram;guitar_plus;','Jakarta',874,'2017-09-08 15:05:04','2017-09-08 15:05:04'),
	(985,'Fairytails','1504886872.png','Fairytails, Grup music asal bandung yang kini beranggotakan lima orang. Gema, Rully, Verry, Ovi dan Donny memilih alternative rock sebagai genrenya. Kini sudah memiliki satu mini album bertajuk “ THIS TIME”. Fairytails pernah menjadi finalis Global Battle of the Band dan Planet Rox Indonesia. Saat ini Fairytails juga kerap menjadi pengisi acara di festival jepang, selain membawakan lagu sendiri, merekapun mengcover lagu-lagu dari ONE OK ROCK, The Oral Cigarettes, Maroon 5 dan juga yang lainnya.','Alternative Rock','instagram;teman;','Jakarta',903,'2017-09-08 15:07:52','2017-09-08 15:07:52'),
