	(988,'BREAKLESS','1504887208.jpg','Band indie Surabaya yang terbentuk pada tahun 2016, dengan Genre Rock Alternative yang lebih modern, bebrapa kali berpatisipasi dalam event-event musik Jawa Timur','Rock','facebook;instagram;teman;','Surabaya',1451,'2017-09-08 15:13:28','2017-09-08 15:13:28'),
	(989,'Shelonia','1504887386.jpg','Shelonia terbentuk pada 8 Agustus 2006 di Jakarta. Berawal dari persahabatan Adi (Gitaris), Gio (Vokalis) dan Ronald (Gitaris) saat ketiganya belajar di Lembaga Pendidikan Musik Farabi, akhirnya tercetus lah ide untuk membentuk sebuah grup musik yang dinamakan Shelonia.\r\n\r\nLalu kemudian bergabunglah Ian (Drummer) dan Tommy (Bassis), sekarang ini sudah digantikan Yeke (Bassis). Sejak awal dibentuk Band Shelonia memulai perjalanan musiknya dari acara Pensi-pensi sekolah, Top 40 di cafe-cafe, Wedding, Festival-festival musik dan lain-lain.\r\n\r\nBand Shelonia sempat Vakum semenjak Adi (Gitaris) Meninggal dunia. Kini Band Shelonia ingin berjuang kembali untuk menjadi Band-band besar seperti Sheila on 7, Peterpan, Nidji dan lain-lain.\r\n\r\nPrestasi Shelonia, Juara Festival Audiopro JAPEX PRJ 2013, Opening Ari Lasso di PRJ 2012, Bermain di Java Jazz 2011, Bintang Tamu di setiap pensi-pensi sekolah.','Pop','facebook;','Jakarta',1258,'2017-09-08 15:16:26','2017-09-08 15:16:26'),
	(990,'tiberias','1504887692.jpg','TIBERIAS terbentuk tahun 2012. sebelum berganti nama TIBERIAS sebelumnya band ini bernama BRINA. Beberapa tahun lalu kami hampir bubar , dikarenakan masalah internal. Tapi 1 tahun belakangan ini kami mulai membangun kembali band ini , dan mengubah nama dari BRINA menjadi TIBERIAS .\r\nUntuk prestasi yang dicapai kami hanya menembus 10 besar audisi band lokal bertaraf nasional dan beberapa kami juga berkesempatan menjadi opening beberapa band ternama.','Alternative Rock','instagram;','Yogyakarta',1481,'2017-09-08 15:21:32','2017-09-08 15:21:32'),
	(991,'ASA','1504887716.jpg','ASA BAND terbentuk pada awal tahun 2013 , berawal dari nongkrong bareng di sebuah studio musik di daerah jakarta pusat . Sampai pada suatu saat kami mempunyai ide untuk membentuk sebuah grup band beraliran pop.\r\nHingga akhirnya kita sepakat membentuk band dengan nama ASA.Asa berarti harapan atau juga awal sampai akhir. Dengan harapan dan tujuan yang sama semoga karya-karya kami bisa di terima di masyarakat indonesia.','Pop','facebook;','Jakarta',1408,'2017-09-08 15:21:56','2017-09-08 15:21:56'),
	(992,'NARNIA','1504887736.jpg','Awalnya kita punya band masing masing . Tetapi kiya memutuslan untuk buat band bersama yaitu Narnia . Untuk prestasi masing masing dari kita sempat mraih beberapa penghargaan dari fesyival band.','Pop','facebook;instagram;teman;','Jakarta',1085,'2017-09-08 15:22:16','2017-09-08 15:22:16'),
	(993,'hujan dan mantan','1504887740.JPG','hujan dan mantan bertujuan merepresentasikan sebuah narasi yang mewakili kisah romansa kompleks,\r\nkisah penyesalan,\r\nkisah amarah,\r\nkisah dendam,\r\nkisah caci maki,\r\nkisah kenangan,\r\nsemua kisah yang dalam-dalam kita kubur dan sudah jauh-jauh kita tinggalkan, namun semua kisah tersebut muncul dengan cepat oleh sebuah momen alami yang disebut HUJAN,\r\ntajuk yang kami wakili untuk sebuah alunan syahdu dan mengiringi momen tersebut,\r\nkamilah\r\nHUJAN dan MANTAN\r\n\r\nterbentuk di tahun 2016 dari scene trash metal dan hardcore di surabaya kami terbentuk karena kami ingin memberi nama baru, image yang berbeda dari yang selama kami tekuni, image yang bisa mewakili seluruh segmen yang belum bisa kami sentuh dari cadasnya genre kami sebelumnya\r\n\r\nso LEVI\'S, please endorse us!\r\nlet the story begin in those showbiz!\r\nlet\'s spread the moment!','Pop','informasi_toko;vipclub;','Surabaya',1390,'2017-09-08 15:22:20','2017-09-08 15:22:20'),
