	(998,'white band','1504888581.jpg','white band ini adalah project yang masih baru berusia sekitaran 3 bulan dan terbentuk pada tanggal 27 juni 2017 awal puasa kemarin. kami biasa manggung di acara even,guest star sekolah,birthday party dll.\r\nband ini asli dari kota reog(Ponorogo)','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Surabaya',1495,'2017-09-08 15:36:21','2017-09-08 15:36:21'),
	(999,'MusiM','1504888601.jpg','MUSIM adalah group band yg sudah malang melintang di dunia hiburan. Tapi karena masing2 personel kurang ahli \"bermain\" dengan media sosial, sejauh ini MUSIM hny tampil off air. Dalam 1 minggu tak kurang 3 - 4 kali tawaran untuk jadwal panggung. \r\nBeberapa kali MUSIM masuk 20 besar ajang musik amildlivewanted.dan ada beberapa ajang bergengsi lainnya yg tidak mungkin kami sebutkan satu persatu.Namun, prestasi terbaik adlah sekitar tahun 2015 sempat akan diajak kerjasama dengan mas Piyu (PADIband). Tapi karena terhalang dana, MUSIM merelakan untuk kesempatan itu.\r\nSemangat MUSIM tak berhenti sampai disitu. Saat ini MUSIM terus menerus memproduksi karya2 terbaru. Sudah banyak sekali lagu yg MUSIM ciptakan sebelum2nya tapi untuk kali ini MUSIM sengaja memasukkan lagu sederhana akan tetapi lagu terbaru MUSIM, yg bercerita tentang bahwa perpisahan adalah sesuatu yg tidak abadi. untuk diikutsertakan dalam ajang LEVI\'SBANDHUNT. Semoga Tuhan memberi kesempatan untuk MUSIM dan melalui LEVI\'SBANDHUNT lagu terbaru ini bisa diterima secara nasional.\r\nMUSIM itu sendiri bagi kami memiliki arti yaitu panjang umur. Segala bakat, kemampuan, semangat, dan waktu kami tumpahkan semua disini. Dengan harapan MUSIM bisa panjang unur dan selalu ada dalam meramaikan dunia musik di Indonesia ini.','Pop','teman;','Jakarta',964,'2017-09-08 15:36:41','2017-09-08 15:36:41'),
	(1000,'JOHN LEGO','1504888748.png','Berawal dari kesamaan visi dan misi serta selera musik yang sama, pada tahun 2012 dibentuklah band dengan John Lego yang mengusung genre Rock. Band asal Jakarta ini awaalnya terdiri dari 5 orang personil. Namun dengan seiringnya waktu, salah satu personil mengundurkan diri dan tersisa 4 orang personil sampai saat ini.\r\nSelama perjalanan karier band, telah banyak tampil dari panggung ke panggung dan mengikuti beberaapa festival musik di Indonesia.\r\nBeberapa prestasi yang pernah diraih antara lain :\r\n1. Finalist 3 Besar Indonesia Regional \"Festival Music International Envol Et Macadam Canada 2013\"\r\n2. Juara 1 A Mild Soundsation 2013\r\n3. Juara 2 Wrangler Music Festival Battle Of The Band 2013','Rock','instagram;teman;','Jakarta',1492,'2017-09-08 15:39:08','2017-09-08 15:39:08'),
	(1001,'STAIRS & SNAKES','1504889933.jpg','band yang punya mimpi manggung di las vegas','Classic','facebook;lainnya;','Yogyakarta',1353,'2017-09-08 15:58:53','2017-09-08 15:58:53'),
	(1002,'All Size','1504890005.jpg','Band ini dibentuk dari semua alumni satu sekolah','Rock','poster;teman;lainnya;','Surabaya',1498,'2017-09-08 16:00:05','2017-09-08 16:00:05'),
	(1003,'neo n','1504890242.jpg','neo n adalah proyek solo derekoo irfan amanullah, untuk menuangkan ide-ide musiknya yang \"unik\" (setidaknya menurut dia sendiri) yang sebelumnya selalu kandas dalam bermusik karena tidak menemukan band/personil yang sesuai dengan visinya. Dimulai tahun 2009, dibantu oleh gandu (drum), dan Mirza (bass). Pada 2011 posisi bass digantikan oleh Dewa.\r\nSampai saat ini neon tampil di seputar acara kampus, komunitas indie, komunitas british, dan selalu membawakan lagu sendiri, yang sampai sekarang sudah ada stok 7 lagu.','Pop','facebook;poster;teman;','Surabaya',1288,'2017-09-08 16:04:02','2017-09-08 16:04:02'),
	(1004,'Voodoo Dolls','1504891216.jpg','Composed from soul, funk blues and little rock genre, Voodoo Dolls bring you to another fresh music.\r\nSpecial stage:\r\nPre-Show Ceremony PON Jabar 2016\r\nBest 10 of Kickfest Bandung 2013','Blues','guitar_plus;','Jakarta',1501,'2017-09-08 16:20:16','2017-09-08 16:20:16'),
	(1005,'Gotas De Sudor','1504896510.jpg','ikut acara komunitas dan masuk beberapa kompilasi reggae diantaranya kompilasi yang di produseri starlight musik serta pencapaian terbaru bermain di pekan raya jakarta menjadi pembuka momonon dan steven jam','Others','instagram;lainnya;','Jakarta',1503,'2017-09-08 17:48:30','2017-09-08 17:48:30'),
	(1006,'BAD ELEVEN','1504926393.jpeg','Bad Eleven\r\n\r\nAnggota: Bagus (Guitar/Vocal), Alfin (Bass/Back Vocal), Amry (Drum/Percussion).\r\n\r\nBad Eleven band bergenre Melodic Poppunk yang terbentuk di Malang pada 20 September 2009. Nama Bad Eleven pun berarti masa kenakalan kita sewaktu kelas 11, dan horornya kita semua bersekolah di SMK. Dan history dimulai dari 3 sekawan yaitu, Amry, El dan Bayu yang memiliki kesamaan menyukai musik terutama genre melodic punk yang akhirnya menjadi genre Bad Eleven itu sendiri.\r\n\r\nLagu pertama yang berjudul Scream Your Spirit menjadi jagoan single kami, banyak gigs atau acara musik yang kami ikuti saat itu. 2 Tahun berlalu, Bayu memutuskan untuk mundur dikarenakan pekerjaan dan waktu terus berjalan kita bertemu teman kami Fero dan Bagus menjadikan dia pemain ke tiga dan ke empat di Bad Eleven untuk mengisi posisi Bayu.\r\n\r\nDi tahun 2012 kita mengajak Yugo Atrhaz untuk mengisi Synth dan memberi warna baru di musik Bad Eleven itu sendiri yang menghasilkan lagu berakhir sudah dan First Time dan formasi berlima ini bertahan sampai 2 tahun yang akhirnya Yugo pun memutuskan mundur. Dan tukang record kami saat itu yaitu Alfin kita rekrut menggantikan Yugo di posisi Synth.\r\n\r\nWaktu terus berjalan dan tahun 2015 kita sudah sepakat untuk membuat album pertama kami, dan di saat proses pembuatan album dua teman kami El dan Fero pada saat itu memutuskan untuk mundur dikarenakan pekerjaan. Tidak menyerah dengan formasi bertiga, kita pun tetap melanjutkan pembuatan album pertama kami dan akan di rilis tahun 2016 yang bertitel “This is new Start” yang berartikan awal yang baru di Bad Eleven.\r\n\r\nPengalaman Event:\r\nGuest Star Pensi SMKN 3 Malang\r\nGuest Star Pensi SMAN 1 Lawang\r\nGuest Star Pensi SMA Malang\r\nIndiecloth Surabaya\r\nGuest Star Pensi SMKN 12 Malang\r\nMalang Popunk #4\r\nRLKZFest #3 dan lain lain','Others','teman;','Surabaya',1482,'2017-09-09 02:06:33','2017-09-09 02:06:33');

