	(180,'masih bisa sembuh','Listen to the Oten-Masih Bisa Sembuh.mp3 by teguh tjarda putraa #np on #SoundCloud https://soundcloud.com/teguh-tjarda-putra/the-oten-masih-bisa-sembuh-mp3','bahagiakah kau disana menitih mimpi ciptakan dunia penuh arti\r\nterbuang aku disini hindari dunia terjebak di ruang waktu\r\n\r\njika saja masih ada satu kesempatan hindari dunia yang membuat aku terasing\r\n\r\npernahku nikmati pernah aku miliki hangatnya dunia..\r\n\r\nOooh wajarkah bila ku sesali semua..\r\nOooh semangati aku aku ingin sembuh ingin aku teriak aku belum mau matii\r\ntak pernah aku bayangkan berakhir seperti ini semangatilah akuuuu\r\n\r\n(temanilah aku aku ingin sembuh semangati aku aku masih bisa sembuh)\r\n\r\nOoh bahagiakah kau disana menitih mimpi mimpi terjebak aku disini hindari dunia\r\nmenyesal aku disini terjebak di ruang nafsu jauhi hangat dunia sungguh aku ingin sembuhh',228,'2017-08-20 13:30:30','2017-08-25 07:16:12',3,70,0),
	(181,'Gracia! Itsumo Egao','https://soundcloud.com/jejak-awan-pesawat/gracia-itsumo-egao','Kuingat di saat aku datang\r\nTuk pertama kalinya ditempat ini\r\nDibalik pintu berwarna merah itu\r\nDi ruang yang dipenuhi cahaya yang silau\r\n\r\nBridge:\r\nKaupun hanya tersenyum\r\nDan melambaikan tangan\r\n\r\nKumelihat bahagia dimatamu...\r\n\r\nReff:\r\nWaktu terasa berhenti dan tubuhku terasa kaku\r\nAda rasa saat pertemuan sekali itu\r\nKu gambarkan paras indahmu itu di relung hatiku\r\nGracia! Itsumo egao arigato\r\n\r\nDi balik pintu berwarna merah itu diruang yang\r\nDi penuhi cahaya yang silau\r\n\r\nBridge:\r\nKau pun hanya tersenyum dan melambaikan tangan\r\nKu melihat bahagia di matamu\r\n\r\nReff:\r\nWaktu terasa berhenti dan tubuhku terasa kaku\r\nAda rasa saat pertemuan sekali itu\r\nKu gambarkan paras indahmu itu di relung hatiku\r\nGracia! Itsumo egao arigato\r\n\r\nMelody\r\n\r\nbridge 2:\r\n\"Jikan ga teishi shimaashita karada wa katai, boku no kimochi hajimete atta toki\"\r\n\r\nBack to reff\r\n\r\nGracia! itsumo egao arigato...',229,'2017-08-20 14:00:12','2017-08-24 02:30:44',0,50,0),
	(182,'Lost In The Crowd','soundcloud.com/victband/lost-in-the-crowd','Remember the night, when I was so lonely\r\nLost in the crowd, when the band started to rock the stage\r\nA pretty girl suddenly came to me\r\nShe stared at me, and asked me to dance along the song\r\nSomething clicked my heart\r\n\r\nSince we met on that night, yeah\r\nI\'ve never thought a lot of things but you\r\nYou...\r\nI don\'t know about in love\r\nBut I really wanna see you here, it is true\r\n\r\nShe was so nice, I was so complete\r\nI held her hand, she embraced my shoulder so tight\r\nI closed my eyes, and I lost my mind (my mind)\r\nBut she has gone, and I could not find her anywhere\r\nI haven\'t even asked her name, oh no\r\n\r\nSince we met on that night, yeah\r\nI\'ve never thought a lot of things but you\r\nYou...\r\n\r\nSince we met on that night, yeah\r\nI\'ve never thought a lot of things but you\r\nYou...\r\nI don\'t know about in love\r\nBut I really wanna see you here, it is true\r\nOh no...\r\n\r\n(I\'ve been lost in the crowd, yeah)\r\n(I\'ve been lost in the crowd, yeah)\r\nOh no...\r\n(I\'ve been lost in the crowd, yeah)\r\n(I\'ve been lost in the crowd, yeah)',230,'2017-08-20 14:42:48','2017-08-24 02:30:40',0,50,0),
	(183,'Garis dominan','https://soundcloud.com/berantai-dm/garis-dominan-unmixing','Mencekam terpaku raja hitam berkuasa\r\nmembakar ironi makna, kehancuran\r\n\r\ntertikam membisu tawanan tak berlawan\r\nterjerat terkapar, tak bernyawa\r\n\r\nBias, bangsat, pasukan tak bertuhan\r\nasah, hasrat peperangan\r\n\r\nduka murka darah\r\ndomisi para budak teraniaya\r\n\r\njerit suram kelam\r\nmenikam kaum bawah\r\n\r\nduka murka darah\r\ndomisi para budak teraniaya\r\n\r\njerit suram kelam\r\nmenikam kaum bawah\r\n\r\nBertaruh nyawa terbayar nyawa\r\nBertaruh darah terbayar darah\r\n\r\nStrategi lawan ajang berperang\r\nStrategi tawan tahan bertahan\r\n\r\nBerdarah, fakta tragedi\r\natas kekuasaan dan hasrat amarah duka, dalam nurani\r\ntertindas suram menyakitkan\r\n\r\nKeras berkibar\r\nterpanah lencana darah penguasa\r\npenuh amarah gila menyabda\r\n\r\nRaja hitam tanduk penguasa\r\nberdiri tegap menantang\r\nmenuduh ajal para budak\r\ntertunduk teraniaya\r\n\r\nGARIS DOMINAN',231,'2017-08-20 15:26:29','2017-08-25 07:20:00',2,50,0),
	(184,'Kebangkitan Ummat','https://soundcloud.com/sitihinggil/kebangkitan-ummat','Malam berganti siang, Siang berganti malam.\r\nKehidupan terus berjalan, tanpa melawan tanpa memandang.\r\nWaktu terus berputar, tanpa bisa kita menakar.\r\nIa datang dan menghujam, tak kan pernah bisa kau hindar.\r\n....\r\nTak bisa kau beri arti?, walau dalam berjarak jari?\r\nDengan apa yang ia beri, sungguh hidupmu tak berarti!\r\nHidup kan terus berjalan, dengan atau tanpa balasan.\r\nYang kan engkau suguhkan, dari malam hingga siang.\r\nreff 1 ...\r\nPengharapan keajaiban akan datang pada kita\r\n`tuk membantu setiap usaha yang telah kita lakukan\r\ninterlude ...\r\nreff 1 + \r\nreff 2 ...\r\nKini tibalah saatnya `tuk melawan atau diam saja\r\nMelawan kerasnya jaman, yang telah merusak jiwa.',232,'2017-08-20 15:53:18','2017-08-25 07:24:50',1,50,0),
	(185,'-Melekat dihati -Salah paham -my decision - karna cinta -rahasia -hanya untuku -sentuhlah hatiku','lagunya aku kirim ke whats up kakak ya.. soalnya belum berani ngeshare takut notasinya dicuri.. karna musiknya baru di balancing juga.. mau mixing n mastering engga ada modal kak','\"id\" iyaaa \"id\"\r\nkenapa namanya \"id\" ?\r\n\"id\" artinya identitas..\r\ndibaca inggris \"aiiiidiiii\"\r\nDibaca indonesianya \"iiideee\"\r\nKita anak muda yang ingin menciptakan \"iiideeee\" baru di musik indonesia agar musik indonesia semakin berkualitas!\r\n\r\nYang sebenarnya nama singkatan dari 2 personil dalam band kami yaitu \"id\" \r\nDi vocal \"icky\" dan gitaris \"Dedi\" jadinya \"id\" \r\nGenre musik kami Pop British\r\nSemoga \"id\" bisa menghibur dan meramaikan industri musik di negara kita yaitu INDONESIA.\r\nDan bisa membawa nama negara INDONESIA di industri musik luar negri..\r\nMembawa harum nama negara kita di berbagai negara.. Amin\r\n\r\nMateri lagu dari kami tentang percinta\'an anak anak abg yang lagi pdkt pacaran gitu gitu hehe\r\nMY DECISION selalu menjaga komunikasi tentang hubungan kita agar kita tidak SALAH PAHAM\r\nKenapa aku begini semua KARNA CINTA\r\nWalaupun aku itu masih RAHASIA \r\nTapi hati dan perasa\'an aku itu TAK INGIN SESA\'AT \r\n\r\n\"My Decision\" nama di mini album kami..\r\nDi mini album kami ada 5 lagu :\r\n1. ID - My Decision\r\n2. ID - Salah Paham\r\n3. ID - Karna Cinta\r\n4. ID - Rahasia\r\n5. ID - Tak Ingin Sesa\'at\r\n\r\n#salammusikindonesia\r\n( ID #ickydedi )\r\nMaju terus musik INDONESIA..? \r\n#musik #indonesia #untuk #dunia \r\n\r\nContact person :\r\nrizky.moersas@gmail.com',233,'2017-08-20 17:39:35','2017-08-24 02:30:32',0,50,0),
	(186,'Lights','https://www.youtube.com/watch?v=866pYg5kIe8','AWAN - Lights\r\nCipt.Buhori\r\n\r\n- Hari ini kumelihat cahaya diujung senjaku\r\nbanyak warna yang terlihat sungguh sangat berbeda , seperti diriku berdiri disini menatap dunia baru.\r\n- Jangan pernah , engkau menyerah yankinlah kita pasti bisa , bilieve in our dreams will never give up till where go that a lights.\r\n\r\nREFF :\r\n\r\n- Exspresikan gayamu , wujudkan harpan dan impianmu , jadikan warnamu pelangi indah dilangit biru.',234,'2017-08-20 17:48:06','2017-08-24 02:30:28',0,50,0),
