	(274,'Semangat Liar','https://soundcloud.com/nativerocksby/native-semangat-liar','Hidup tak akan berarti\r\nbila kau terdiam disini dan tak bisa melihat dunia ini\r\nBanyak cacian berganti tuk mengawali hari ini \r\nMenatap masa depan\r\n\r\nDan ku takkan menyerah \r\nHantam kerasnya dunia\r\n\r\nKu kan terus berlari tak hiraukan ambisi semua kata kata perih tak buatku jatuh lagi \r\nBersama hadapi semua penghalang mimpi berjanji dan yakini kita pemimpin generasi ini \r\n\r\nDengan semangat liar ini ku takkan pernah berhenti mencari \r\n\r\nApi kemenangan yang takkan terganti\r\nDan kan teringat sampai nanti\r\n\r\nBack to reff',343,'2017-08-25 09:57:27','2017-09-04 08:56:00',0,50,0),
