	(286,'Langkah Baru','https://open.spotify.com/album/7Mh6x2SDmxDwQyrXBckovd','Hexa - Langkah Baru\r\n\r\nSaat dunia tak lagi membiarkan mu bermimpi biarkan sendiri\r\nJangan kembali walau jauh melangkah tetap satukan arah\r\nTakkan terhenti aku berlari ku kan terus hadapi\r\nMencari warna dalam cerita hitam putih dunia\r\n\r\nKu disini berdiri sendiri\r\nMelewati hari dan menari\r\nKu tak lelah dengan semua kisah\r\nPerjalanan ini takkan pernah berakhir\r\n\r\ntak pernah berfikir berjalan kembali bersama masa lalu\r\nmenata mimpi merangkai asa dan menggengam harapan\r\nangin membawa semua rasa dalam sebuah jiwa\r\ntanpa dirimu tak terbelenggu ku kan terus melaju\r\n\r\nKu disini berdiri sendiri\r\nMelewati hari dan menari\r\nKu tak lelah dengan semua kisah\r\nPerjalanan ini takkan pernah berakhir\r\n\r\nMeski tanpamu uuuuu\r\nmeski tanpamu uuuuu\r\nMeski tanpamu uuuuu\r\nKu kan terus hadapi waktu\r\n\r\nTerkadang sepi menyapaku sendiri\r\nMasa lalu datang terua terbayang\r\nNamun hati tak ingin kembali\r\nPada masa kenangan bersama \r\n(Repeat)\r\n\r\nTak akan lelah untuk mencari semua harapan dan mimpi - mimpi',357,'2017-08-25 16:07:14','2017-09-04 08:55:27',0,50,0),
