	(326,'Mengejar harapan','https://soundcloud.com/adut-stick-up/stick-up-mengejar-harapan-mp3','Mengejar harapa \r\nDi sini hari ini ku kan selalu berdiri\r\nTuk wujudkan semua mimpi yang belum berakhir \r\nWalau lelah menghadang ku kan selalu membuktikan\r\nLangkah kakiku tak akan pernah berhenti mengejar harapan\r\n\r\nPerjalanan yang sangat panjang \r\nMembuat aku berbicara\r\nTak ada kata yang bermakna \r\nLelah tak akan menggoyahkan\r\n\r\nWalau pahit ku tetap bertahan \r\n( ku pastikan arah hidup dan semuanya akan indah) \r\nWalau lelah ku hadapi semua tuk wujudkan mimpi\r\n\r\nDi sini hari ini ku kan selalu berdiri\r\nTuk wujudkan semua mimpi yang belum berakhir \r\nWalau lelah menghadang ku kan selalu membuktikan\r\nLangkah kakiku tak akan pernah berhenti mengejar harapan',408,'2017-08-28 10:19:15','2017-09-04 08:53:13',0,50,0),
