	(332,'selalu bersamamu','https://www.youtube.com/watch?v=4bMWwQqH3Go','Kau yang selalu menemaniku\r\nselalu temani aku\r\ndalam sinaran\r\nsaat sedih dan gundah \r\nkau tetap menemaniku\r\n\r\nreff\r\nkamulah orangnya\r\nkamulah temanku\r\nyang selalu bersamaku\r\n\r\nkau yang selalu menemaniku\r\nselalu temani aku dalam suka dan duka\r\n\r\nReff\r\ninterlute\r\n\r\nbridge\r\ninginku selalu bersamamu\r\ndalam hari demi hari\r\ndengan penuh ceria\r\ndengan penuh cerita',415,'2017-08-28 13:30:35','2017-09-04 08:52:56',0,50,0),
	(333,'Waktu Bersama','https://soundcloud.com/givemesomeadvice/gvm-waktu-bersama','Tetapkan tujuan, satukan pikiran,\r\ndimana kita kan lari\r\nMencari arah, tuk merekam semua\r\nWaktu terbaik bersama\r\n\r\nKau cerita, kau lelah\r\nDengan semua harapanmu\r\nBiarkan lebih lama\r\nWaktu ini berjalan\r\n\r\nMelompatlah, bersamaku,\r\nTakkan jatuh, semua berlalu\r\nDan aku... Selalu\r\nBerada... Di belakangmu\r\n\r\nTentukan hari yang baik\r\nBiarkan tertulis cerita\r\nDan aku... Selalu\r\nBerada... Di belakangmu\r\n\r\nDan akan datang disaat waktunya dimana kau dengan duniamu dan ku dengan duniaku, bertemu kembali di lain waktu',416,'2017-08-28 14:14:05','2017-09-04 08:52:54',0,50,0),
	(334,'Realita Cinta','https://youtu.be/KVFfelneV0k','Bicara tentang cinta\r\nBicara soal rasa\r\nBicara isi hati\r\nBicara sakit hati\r\n\r\nTak ada habisnya\r\nYang sering terjadi\r\n\r\nManis di awal saja\r\nPahit pada akhirnya\r\nSemua hanua rayuan\r\nSemua hanya buaian\r\n\r\nItu sudah biasa\r\nIlusi semata\r\n\r\nSemua yang kurasakan\r\nDalam sebuah drama romansa\r\nDan biarlah jadi ceritaku\r\nItu semua realita cinta',417,'2017-08-28 14:37:38','2017-09-04 08:52:51',0,50,0),
	(335,'Menanti harapan yang tak pasti','https://youtu.be/5UlOMSvIGz4','Ku yakin bahwa semua\r\nInikan jadi cerita yg kelam\r\nDalam hidup ku saat bersamamu\r\nKu ingin kau mengerti di masa yg indah kau tlah gore luka\r\n\r\nReff:\r\nJalani hidup ini dengan semua luka yg ada\r\nJalani kisah ini dengan semua yg tlah kau berikan kau tanamkan\r\nLuka yg tak mungkin tak mungkin ku obati\r\nKu yakin pasti nanti\r\nKau akan dapatkan, dapatkan\r\nBalasan yg lebih pantas tuk kau hancur sendiri\r\nKarna semua yg kau lakukan pada ku\r\nTakan ku takan pernah ku lupakan sampai nanti\r\n\r\nKu yakin semua ini akan jadi kisah yg kelammmm\r\n\r\nKu anggap semua ini hanyalah cerita\r\nYg dulu kelam dari mu\r\nDan kamu membuat qu terluka\r\nKau goreskan lukan yg dalam di hati ku\r\nMembekas perih tak terobati.',418,'2017-08-28 14:47:56','2017-09-04 08:52:49',0,50,0);



