	(7,'DIANDRA','1501759857.jpg','DIANDRA INDONESIA adalah Sebuah band beraliran pop asal tulungagung yang terbentuk sejak 2014, awal mula terbentuknya diandra adalah untuk ikut serta di kompetisi band yang syukurnya hampir di semua kompetisi band, diandra dapat masuk di 3 besar kompetisi tersebut, hingga suatu saat para personil berkumpul dan membahas tentang visi misi para personil diandra yang ingin mencoba masuk di dunia industri musik, sampai pada akhirnya diandra sukses meluncurkan single yang rilis pertama tahun 2016 dengan lagu DIANDRA - Lagu Cinta Untukmu.','Pop','facebook;instagram;poster;teman;lainnya;','Surabaya',16,'2017-08-03 10:30:57','2017-08-03 10:30:57'),
	(12,'LITTLE DAY','1501776552.jpg','“Salam Industri Musik Indonesia”INSERT INTO `bands` (`id`, `band_name`, `foto`, `cerita`, `genre`, `info_bh`, `kota`, `user_id`, `created_at`, `updated_at`)
VALUES
	(322,'Beyond the Mirage','1503606745.PNG','Beyond the Mirage (BTM) terbentuk dari 2015 berawal dari forum komunitas metalcore di salah satu forum ternama di Indonesia. Terbentuk atas dasar saling memiliki passion di progressive/metalcore/djent, BTM mulai lahir perlahan walau kesibukan antar personil tidak dapat ditolerir.\r\nMemiliki influence dari August Burns Red, Miss May I, Between the Buried and Me, Avenged Sevenfold, Bring Me the Horizon, Dreamshade, Bless the Fall, Trivium, Periphery, March (JKT), Vitalism, etc menjadikan BTM memiliki unsur progressive/metalcore/djent yang kental.\r\n\r\nBTM adalah: Andreas (guitar), Calvin (guitar), Rio (drum), Ihsan (vocal) & Nakula (bass).\r\n\r\nBerbagai kendala dialami salah satu personil BTM, sehingga adanya pergantian member (Ganesha - gitaris; yang merupakan salah satu founder awal) dan digantikan oleh Calvin (guitar) agar BTM terus berjalan. \r\nPembuatan single pertama BTM \"SE7EN DAYS AFTER\" memakan waktu 7 bulan dikarenakan lokasi dan jarak antar member dikala itu. Sekarang BTM berevolusi memiliki members yang solid, frequent listener to metal, passion yang sama tanpa terbawa arus genre.','Heavy Metal','facebook;','Jakarta',646,'2017-08-24 19:32:25','2017-08-24 19:32:25'),
	(323,'A+','1503626826.JPG','Terbentuk pada 7 November 2015\r\nmengusung konsep \"boyband nge-band\"\r\nmempunyai pasar dititik ABG sampai remaja\r\nmemiliki single yang berjudul Megaku','Pop','teman;','Jakarta',648,'2017-08-25 01:07:06','2017-08-25 01:07:06'),
	(324,'TEORI','1503644025.png','TEORI terbentuk di kota Solo pada tahun 2010. Adalah Gege Saga, Dhawa Rezkyna, Martinus Sentana juga Ichsandy Nugraha yang mengusung kelompok musik ini. Terpengaruh dengan musik band-band inggris alternatif, menjadikan satu kesamaan diantara banyaknya perbedaan selera. Salah satu yang paling mempengaruhi adalah Radiohead. Disamping itu kemunculan Tame Impala serta Temples turut mewarnai perkembangan karya. Pop Alternatif dengan beberapa siraman modulasi pun lekat tersemat dalam album perdana kami yaitu “TANTRUM” (2016). Band indie dengan segala kemampuan untuk berproses serta promosi seringkali memutar cara agar karyanya didengar. TEORI memutuskan salah satu cara yang paling tepat adalah melakukan tur ke luar kota. Terhitung dalam medio 2 tahun terakhir, TEORI sudah dua kali melakukan ibadah tur Jawa-Bali. Selain itu showcase promo album serta media maya pun juga dilakukan. Tahun ini masih melanjutkan beberapa cara untuk promo album. Video musik untuk single kedua akan segera dirilis pertengahan tahun 2017. \r\nDiscography \r\n-	Confused (single/2014) \r\n-	Sesari Selagu (single/2016) \r\n-	TANTRUM (Album/2017) \r\n-	Lovely Bones (single/2017)','Alternative Rock','instagram;guitar_plus;teman;','Yogyakarta',663,'2017-08-25 05:53:46','2017-08-25 05:53:46'),
	(325,'ANMA','1503644534.jpg','Anma band berdiri pada tanggal 8 Mei 2013, Berawal dari Imam (vokal), Adam (gitar), dan Sandi (drum) yang memang sudah saling kenal dan terlibat beberapa kali dalam suatu projek musik dari SMA mencoba untuk membuat sebuah band yang mengusung genre pop rock. Namun tidak adanya player bass membuat kami disibukan untuk mencari player bass. Mendapat referensi dari seorang teman, Adam bertemu Ibnu (bass) dan ternyata Ibnu tertarik untuk bergabung dengan Anma Band.','Pop','instagram;','Jakarta',658,'2017-08-25 06:02:14','2017-08-25 06:02:14'),
	(326,'Kraken','1503644958.jpg','-Press Rellease-\r\nSalah satu band asal bogor ini terbilang cukup sukses di usianya yang baru terbentuk sejak 6 juni 2016 mereka terdiri dari Borie (vocal), Ryan Boyan & Dhany Kinoy (guitar), Hilman (bass), Fahmi (drum).\r\n\r\nUntuk nama kraken sendiri berasal dari nama untuk monster laut berbentuk gurita yang besar, untuk filosofinya sendiri mereka mengartikan Kraken adalah monster yang berasal dari sekumpulan energi, yang artinya diharapkan kami ber-5 bisa menjadi satu kesatuan untuk memberikan energi yang besar untuk musik kami. (Ujar hilman)\r\n\r\nUntuk influence sendiri kraken sangat terinspirasi oleh musik lamb of god dan Kataklysm namun selain itu mereka sangat explore dengan warna musik musik di luar musik metalcore itu sendiri. \r\n\r\nSoal genre terserah pendapat para pendengar mendeskipsikannya. “Band kita basic musiknya metal, kenapa milih metal? Awalnya itu hanya ingin olahraga aja tiap minggu manggung atau latihan, musik metal kan hentakannya semangat tuh otomatis pada gerak minimal kepalanya, eh ternyata keterusan ampe sekarang di hellprint,” ujar Hilman, salah satu personil Band KRAKEN saat dihubungi di tengah kesibukan KRAKEN.\r\n\r\nBand yang merilis single bertajuk \"Lawan\" yaitu lagu yang bercerita tentang perlawanan terhadap kemalasan diri sendiri dan album Kraken sendiri akan dirilis setelah event hellprint united V tepatnya di akhir tahun ini. Untuk materi lagu dari kraken sendiri berpesankan tentang kehidupan sehari-hari yang sangat kompleks.\r\n\r\nYang di rasakan para awak kraken ketika mereka berdiri atas nama kraken, mereka merasa harus lebih dewasa bukan hanya untuk materi lagu saja seperti hal hal yang kecil ga ngaret latihan dan komitmen yang kuat untuk ngeband tanpa harus mengorbankan seperti pekerjaan. \r\n\r\nResolusi ke depan, kraken berharap musik mereka bisa diterima oleh semua orang dan memberikan warna musik yang baik kepada penikmat metal dan berencana untuk dapat memiliki kesempatan mengenalkan musik mereka ke seluruh Indonesia.\r\n\r\nDalam perjalanan kraken mereka sangat berterima kasih kepada semua pihak yang mendukung seperti bharata (outright) yang memberikan masukan selama proses road to hellprint, Manager Kraken Ishak Rachman, Road Manager Kraken Tyo, Seluruh Metalhead Bogor, Seluruh Band di Bogor yang mensupport kami, komunitas solo guitar BGF, R9 Community, Bogor Metal Community, Bogor Total Metal Community, Indonesianmetalcore dan lain lain.','Others','instagram;guitar_plus;umi;teman;','Jakarta',666,'2017-08-25 06:09:18','2017-08-25 06:09:18'),
	(327,'Ambience of Opera','1503645106.jpg','Ambience of Opera adalah sebuah band bergenre electronic progressive metal dari jakarta, band unik ini memadukan antara genre metal yang notabene musik keras dengan EDM (electronic dance music).','Others','instagram;lainnya;','Jakarta',659,'2017-08-25 06:11:46','2017-08-25 06:11:46'),
	(328,'Epidemic','1503645645.jpg','band ini terbentuk pada 10-10-2015 dengan formasi cipta (guitar),fathur (guitar),ucok (drum),khoir (bass) dan ayub (vokal) formasi awal ini sudah menghasilkan sebuah single yang berjudul \"anti visions\".Karna kesibukan khoir akhirnya khoirpun harus mundur dari epidemic.dan kami sempat kawalahan mencari pengganti untuk posisi bass.akhirnya kami bertemu dengan teman lama yaitu dedi ex god voice,dedi sempat beberapa bulan mengisi kekosongan bass diepidemic,karna tuntutan kerjaan akhirnya dedipun harus mundur dari epidemic dan disusul fathur juga mundur.sempat vakum beberapa bulan karna merasa band sudah tidak produktif akhirnya ayub mengambil keputusan untuk mundur dari band dan disusul ucok.karna semangat masih tersisa akhirnya cipta terus mencoba mencari member untuk menghidupkan kembali epidemic dan bertemulah dengan mueq tara dan endrik.sampai detik ini formasi ini masih tetap solid walau belum ada pemain bass.Dan epidemic sudah mengeluarkan 2 lagu terbaru mereka yang mengusung genre metal/djent.','Others','facebook;instagram;','Medan',656,'2017-08-25 06:20:45','2017-08-25 06:20:45'),
	(329,'STIGMA band','1503645746.jpg','Kami Stigma adalah band indie asal kota kendal jawa tengah','Pop','instagram;','Yogyakarta',665,'2017-08-25 06:22:26','2017-08-25 06:22:26'),
	(330,'SOLOENSIS','1503645825.jpg','Manusia purba Homo Soloensis yang terlahir di pinggiran sungai Bengawan Solo adalah salah satu dari sekian makhluk purba yang sudah bisa berfikir nalar pada lingkungan sekelilingnya, dan juga pintar karena lingkungannya. Tercermin dalam mereka memenuhi kebutuhan hidup dengan memanfaatkan benda-benda disekelilingnya, karena itu kami termotivasi oleh filosofi Homo Soloensis yaitu pintar dan cerdas karena sekelilingnya. Entah ini adalah mandat Nenek Moyang atau hanya semangat berkarya kami saja, SOLOENSIS terbentuk tahun 2008 dan beberapa kali mengalami perubahan personil di kala itu, dan personil tetap saat ini tercatat, Pungkas Pinundi (bass), Gemas Isyak A (vocal/gitar), Sinom Jalu (gitar), dan Faishal Ardi I (drumm). \r\n Sebenarnya susah bagi kami untuk menyebut genre musik yang kami bawakan secara tepat, dibilang Punk, Garage, atau bukan itu, padahal kami membawa protes politik, protes kemanusiaan. Dibilang Psychedelic Rock? Musik kami tidak menggunakan gear-gear effect yang aneh dan penuh ambience, tetapi kami membawakan manifestasi psikis kami pada lirik lagu-lagu kami. \r\n Dibilang Rock? Kami tidak begitu handal dalam skill bermain, tetapi kami selalu berusaha tetap rock menurut kami sendiri. Genre Soloensis adalah ketika teman-teman menyaksikan secara utuh apa yang kami bawakan di panggung live, ketika itulah anda bisa menyebut genre kami sesuai keterwakilan anda terhadap musik Soloensis. Karena apa yang kami lakukan dengan SOLOENSIS ini hanya tentang musik dan apa yang ingin kami sampaikan hingga waktu yang tak tentu.\r\n\r\nDiscography :\r\n1. Soloensis \"Self Titled\" (Album/2014)\r\n2. Tak Lagi Sejati (Single/2014)\r\n3. Sederhana Saja (Single/2016)\r\n4. Renovasi Dini (Single/2017)','Rock','instagram;guitar_plus;teman;','Yogyakarta',667,'2017-08-25 06:23:45','2017-08-25 06:23:45'),
	(331,'Stigma','1503648003.jpg','kami Stigma band indie asal kota kendal jawa tengah\r\n\r\nBand yang didirikan sejak tahun 2010 hingga kini\r\n\r\nKerap tampil di kota lokal jateng\r\nPekalongan , batang , weleri , semarang dan kendal\r\n\r\nBand kami kerap mengisi acara ivent indie lokal','Pop','instagram;','Jakarta',672,'2017-08-25 07:00:03','2017-08-25 07:00:03'),
	(332,'Unbeaten','1503648346.jpg','Unbeaten adalah band rock alternative berasal dari Bogor yang terbentuk pada 2014, single pertama \"Dia\" menduduki chart nomor 1 untuk Band Indie di Lesmana FM Bogor selama 5 minggu beruntun. Single kedua \"Hanya Untukmu\" masuk chart majalah Hai dan berhasil direview dan dimuat di kolom majalah Hai. Pada tahun 2017 Unbeaten merilis lagu terbaru \"The Easiest Thing\" semua lagu Unbeaten tersedia di Digital Music Store.','Rock','instagram;teman;','Jakarta',599,'2017-08-25 07:05:46','2017-08-25 07:05:46'),
	(333,'Kick Your Motor Noise','1503649138.jpg','Kick Your Motor Noise merupakan nama yang kami ambil karena keseharian kami menggunakan motor dalam segala aktivitas, setiap hari nama ini juga merupakan bentuk kritik kami terhadap salah satu bentuk kejadian di jalanan. Kritik itu kami aplikasikan terhadap musik kami yang  penuh dengan suara bising dan mengehentak bertenaga kuda.\r\n\r\n \r\n\r\nTerbentuk pada tahun 2008, Genre yang kami membawakan secara garis besar adalah ROCK, tapi di padukan dengan sedikit unsur genre seperti Stoner, Psychedelic, dan mungkin Shoegaze. Musik kami terinspiras ikebanyakan dari band-band  70an, tapi tidak hanya band  70an saja karena setiap dekade kami mengikuti dan belajar dari mereka.\r\n\r\n \r\n\r\nSaat ini formasi yang terbentuk sudah merupakan formasi terbaru sejak tahun 2015 hingga detik saat ini.\r\n\r\n \r\n\r\nhttps://soundcloud.com/kick-your-motor-noise','Rock','instagram;','Jakarta',649,'2017-08-25 07:18:58','2017-08-25 07:18:58'),
	(334,'MM33','1503649474.jpg','MM33 adalah sebuah band yang terbentuk dari tempat nongkrongnya anak2 band atau sering disebut studio music yang berada di daerah tg.priok Jakarta utara.Nama band ini tersebut diambil dari nama studio music itu sendiri.Awalnya band ini terbentuk karena sering latihan band ditempat tersebut walaupun personilnya punya band masing2.Karena sering ketemu dan sharing ditempat tersebut,Ucon (vocal),Vivin (guitar 1),Ai (guitar 2),Nano (Bass),dan Risto (drummer) mencoba untuk latihan tanpa adanya konsep dan tujuan.Adanya kekurangan dalam latihan tersebut mereka tidak saling menjatuhkan melainkan saling memberi semangat dan masukan yang positif terhadap masing2 player.Merasa adanya kecocokan dalam bermain music dan sikap,Vivin (Guitar 1) berinisiatif untuk membentuk band baru distudio tersebut.Ucon (vocal),Ai (guitar 2),Nano (bass) dan Risto (drummer) setuju dengan inisiatif vivin (guitar 1) dan memberikan nama untuk band ini yaitu “MM33” sesuai dengen nama studio tersebut.Pihak pengelola pun tidak keberatan dengan nama band tersebut disamakan dengan nama studio musiknya,bahkan mendukung agar band ini tetap berjalan.Jakarta,3 Maret 2017 adalah hari yang ditetapkan sebagai hari lahirnya/terbentuknya “MM33”.Tujuan terbentuknya band ini adalah untuk menuangkan inspirasi dalam setiap personil masing2 kedalam music dan memberikan hiburan kepada masyarakat umum dalam berbentuk musik.','Pop','instagram;','Jakarta',673,'2017-08-25 07:24:34','2017-08-25 07:24:34'),
	(335,'Morscode','1503650262.jpg','Terbentuk pada akhir 2013, Morscode adalah sebuah grup alternative rock asal kota Bekasi yang terdiri dari 4 personil yaitu Agam, Hendy, Dioma, dan Tantyo. Nama Morscode sendiri terinspirasi dari nama para supir mereka terdahulu yang suka mengantar jemput apabila latihan dan manggung di gigs.\r\nSejak tahun 2013 hingga saat ini, Morscode telah banyak mengisi acara-acara musik baik itu di kota Jakarta maupun luar Jakarta. Dari mulai pensi sekolahan, acara kampus, sampai acara besar seperti \"Volcom X Panther : Wild in the park\" yang diadakan di Scientica Skate Park BSD dan \"Goers App : Folk Talk\" yang diselenggarakan di Southbox Kemang Jakarta.\r\nSaat ini Morscode sedang dalam proses produksi pembuatan mini album perdana-nya.','Alternative Rock','vipclub;','Jakarta',674,'2017-08-25 07:37:42','2017-08-25 07:37:42'),
	(336,'STARFIVE','1503650372.jpg','STARFIVE adalah salah satu grup band pelajar rilisan Bandkamu Solo dibentuk pada tahun 2014 tepatnya pada tanggal 14 Juli 2014. Personel STARFIVE terdiri dari Vivian Mulano (Vokal) Natsir Musta (Gitar) Tika Syamsuri (Bass) Avan Garda (Keyboard) dan Deva Amru (Drums). Nama STARFIVE berasal dari kata Star (Bintang) Five (Lima) dimana semua personel dari grup band ini adalah anak muda serta pelajar berprestasi dalam bidang pendidikan dan musik baik tingkat nasional maupun daerah, salah satunya adalah Deva Amru (Drummer cilik) di usia 8 tahun ini berhasil menyabet penghargaan sebagai Juara Favorit pada ajang Pemuda Musik Empowering yang diadakan oleh Kementrian Pemuda dan Olah Raga tahun 2013. Avan Garda keyboardis STARFIVE pernah menyabet penghargaan sebagai Best Keyboard DIY Jateng 2014 dan juga merupakan pelajar teladan di sekolahnya. Begitu pula Natsir Musta juga memiliki prestasi penghargaan The Best Gitar DIY Jateng 2 tahun berturut-turut 2013 dan 2014. Dan dua personel cewek grup band ini Vivian Mulano dan Tika Syamsuri adalah Best Vokal dan Best Bass Player Soloraya tahun 2013. Grup band STARFIVE ini dibentuk bertujuan agar dapat menginspirasi para pelajar dan remaja di tanah air untuk mau berkarya dan berprestasi dalam bidangnya secara profesional.\r\nNama STARFIVE sendiri dipakai sejak pertama awal mereka manggung yaitu pada acara Ngabuburit puasa dimana mereka ngejam bareng musisi-musisi Solo di markas mereka yaitu Bandkamu Solo Studio Musik & Recording. STARFIVE lahir dengan mengusung genre rock alternatif sebagai pengintegrasian perbedaan genre musik yang ditekuni oleh masing-masing personel.\r\nAwal Tahun 2015 ini mereka membuat single “Andai Bersamamu” dan baru saja menyelesaikan penggarapan Video klip. STARFIVE memiliki mentor-mentor yang sudah dikenal di dunia hiburan tanah air. Sebagai Manager sekaligus mentor Bobby Teamlo, Fay Ehsan IMB, Plenthe Percussion, Kiky Hendra Pratama dan Bayu Dessabian (Almarhum).\r\nSemestinya dengan kreativitas dan dukungan sumber daya yang hebat dalam bermusik, STARFIVE harusnya mampu bersaing di dunia musik dan jagad hiburan di tanah air. Tentunya dengan persaingan yang positif. Berkarya dengan wajar karena tidak ada jalan pintas dalam seni “No Pain No Gain” tetap rendah hati walau setinggi Malaikat.\r\nSTARFIVE sangatlah menyadari restu dan dukungan pendengar dan pelaku industri musik di Indonesia yang merupakan modal dimana akan merubah situasi band-band di Indonesia agar lebih diminati dan dicintai oleh penggemar musik nasional.\r\nSTARFIVE sendiri memiliki markas di Bandkamu Solo yang beralamat di Jl. Raya Baki No. 173 Kadilangu Baki Sukoharjo Solo Jawa Tengah','Alternative Rock','teman;','Yogyakarta',651,'2017-08-25 07:39:32','2017-08-25 07:39:32'),
	(337,'EGA SIFA','1503651522.jpg','Menjadi band endorse dari beberapa produk distro MR.CRAFTO dan First Goodness','Pop','facebook;','Jakarta',679,'2017-08-25 07:58:42','2017-08-25 07:58:42'),
	(338,'EBON','1503652178.jpg','Endorser produk fashion HALB PROJECT dan HEO Production','Rock','facebook;','Jakarta',682,'2017-08-25 08:09:38','2017-08-25 08:09:38'),
	(339,'SPACE IMPACT','1503652485.jpg','event lokal gigs,jakcloth summer fest 2014','Rock','guitar_plus;','Jakarta',680,'2017-08-25 08:14:45','2017-08-25 08:14:45'),
	(340,'FOLKS!','1503654310.jpg','FOLKS! terbentuk pada tahun  2012 dengan alasan kesukaan kami terhadap musik yang sama,maka kami sepakat dari awal untuk memainkan musik folk sebagai musik utama,walaupun terkadang kami masih membawakan musik dari genre lain,tetapi tetap dengan sentuhan,aransemen dan konsep musik folk,agar tidak keluar dari konsep musik kami yang sebenarnya,karena mungkin musik seperti ini masih sedikit awam di masyarakat kita.Dengan maksud memberikan sesuatu yang berbeda,kami juga berharap semua orang yang mendengarkan musik kami mendapatkan edukasi dan pengetahuan yang lebih luas lagi terhadap musik..Dan yang terpenting kami berharap para penikmat & pecinta musik dapat terhibur & mengapresiasi musik ini lebih baik lagi.','Folk','guitar_plus;','Jakarta',688,'2017-08-25 08:45:10','2017-08-25 08:45:10'),
	(341,'Enter Your Puk','1503654554.jpg','Terbentuk pada tahun 2006 karena menyukai genre musik yang sama. Seiring berjalannya waktu kami menciptakan karya kami sendiri dan mulai mengisi acara acara kampus dan acara anak anak muda di Jakarta','Rock','guitar_plus;','Jakarta',668,'2017-08-25 08:49:14','2017-08-25 08:49:14'),
	(342,'Rising The Fall','1503656916.jpg','Sebuah band yang terlahir dari semangat, dedikasi, dan rasa cinta terhadap musik keras.\r\nSelera musik yang berbeda-beda dari kami tidak menghambat perjalanan bermusik kami.\r\nJustru memperkaya nuansa musik yang kami ciptakan.\r\n\r\nDengan musik yang berteriak tentang keresahan dan pemberontakan.INSERT INTO `bands` (`id`, `band_name`, `foto`, `cerita`, `genre`, `info_bh`, `kota`, `user_id`, `created_at`, `updated_at`)
VALUES
	(683,'Srundenk','1504604492.JPG','Cerita\r\n\r\nBand terbentuk November 2011, dengan formasi lama dan mengusung genre Rock. Seiring waktu, dengan pergantian formasi, maka Srundenk memutuskan untuk beralig ranah Pop industri. dan saat ini tengah mempersiapkan mini albumnya yang akan dirilis sekitar desember 2017.\r\n\r\nPrestasi\r\n\r\n10 besar Yamaha Band Religi 2012 di Surabaya\r\n10 besar festival band UNTAG 2013 di Surabaya\r\nJuara 2 festival akustik Religi Jawa Pos 2014 di Surabaya\r\n8 besar finalist MLD spot jazz fest 2015 di Surabaya','Pop','teman;','Surabaya',1216,'2017-09-05 08:41:32','2017-09-05 08:41:32'),
	(684,'Lavizta','1504606788.jpg','Lavizta terbentuk pada tgl 9 september 2010 lavizta memiliki arti bersinar di awal terbentuknya lavizta memiliki 3 single lagu dengan hits andalan meski ku terluka yang pada saat itu selalu menjadi jawara chart radio se palembang, juara festival band di acara IRC berlokasi di PTC mall palembang, menjadi 10 top finalis A mild wanted dan sering menjadi guest star di tiap daerah se sesumatra selatan dari tahun 2010 sampai 2014. Lavizta sempat vakum selama 2 tahun karena para personil pada saat lebh memilih untuk fokus pada pekerjaan pribadi para personil dan di tahun 2016 akhir tahun para personil lavizta kembali bermusik dan kini mengeluarkan 4 single lagu terbaru dengan hits andalan seperti dia','Pop','teman;','Jakarta',1207,'2017-09-05 09:19:48','2017-09-05 09:19:48'),
	(685,'Imperium','1504608329.jpg','imperium terlahir pada tgl 29 septemer 2016. dikota yg penuh hirup pikuk yaitu bekasi. untuk prestasi belum ada karna belum sempat mengikuti berbagai event dikarenakan fokus menggarap sebuah album insha allah. terimakasih.','Rock','informasi_toko;poster;teman;','Jakarta',1204,'2017-09-05 09:45:29','2017-09-05 09:45:29'),
	(686,'Kras','1504611805.jpg','Pada 2015 bulan November KRAS merilis E.P berupa kaset yang berjudul \"Patriam Fur\" yang mempunya arti Negeri Pencuri.c yang merupakan gabungan dari Heavy Metal, Thrash dan Rock. KRAS adalah band yang berasal dari Kota Jakarta, Indonesia, yang awal mulanya bernama B.A.D. Dibentuk oleh Bobby Ryzkiawan, Audi Cabrio dan Dimas Fajar yang sebelumnya memainkan musik crossover (punk, grindcore dan thrash metal) . Masing masing personil juga tergabung dalam band lainya seperti Bobby Rizkiawan yang tergabung dalam band Raspberry, Audi Cabrio yang tergabung dalam Roxxass dan Mystyfy. Lalu tidak lama kemudian bergabunglah Eben Andreas yang tergabung dengan band GRIBS (Gondrong Kribo Bersaudara) dan akhirnya band ini mengganti namanya menjadi KRAS. KRAS yang artinya \"Keras\" adalah ekspresi dari musik yang dimainkan band ini yang meracik empat elemen influence genre utama mereka Heavy Metal, Thrash, Rock dan Punk menjadi satu yang mereka namai dengan \"Heavy Metal Punk Machine\".\r\n\r\nSeiring berjalannya waktu pada awal 2017 Dimas (drum) pamit undur diri.Saat itu Kras sedang dalam proses produksi EP kedua yang berjudul \"Heavy Metal Punk Machine\".  Posisi drumer baru kemudian diisi oleh Erlangga \"EQ\" Muktia dari band Divine, sebelumnya ia pernah memperkuat Thrashline juga.\r\n\r\nKini formasi Kras pun terdiri dari Bobby Rizkiawan (vokal/bass), Eben Andreas (gitar), Audi Cabrio (gitar/vokal) dan EQ (drum).\r\n\r\nKras pernah masuk dalam jajaran nominasi Hammersonic 2017 dalam kategori Soul Of Steel (pendatang baru).Mendapatkan undangan interview dan perform di Extreme Moshpit TV (Oz Radio Bandung) dan Rase FM Bandung. Kras pun pernah  menjadi pengisi di salah satu event Thrash Metal terbesar di tanah air di Bandung \"Thrash On Hangover vol.1\" dan event metal \"Jakarta Keras\" di Lapangan Bulungan Outdoor, Jakarta Selatan, yang diselenggarakan oleh Ibu Kota Kami Punya.','Heavy Metal','guitar_plus;','Jakarta',1220,'2017-09-05 10:43:25','2017-09-05 10:43:25'),
	(687,'The Flash','1504613404.jpg','- Festival Band Uzone Digital Icon & sebagai satu-satunya band perwakilan dari Yogyakarta, dan tampil bareng Dewa 19 reuni, Mulan Jameela & The Virgin di Tennis Indoor Senayan 2014, Jakarta. \r\n- Menjadi 5 Band pilihan tampil live di acara Radioshow TV One 2017, YOgyakarta','Rock','instagram;','Yogyakarta',1167,'2017-09-05 11:10:04','2017-09-05 11:10:04'),
	(688,'101','1504617806.jpg','10 Finalis L.A Meet The Labels 2015 tingkat Nasional\r\nJuara III Yamaha Matic Music Fest 2013 tingkat Jawa Timur\r\nFinalis Galaxy Superstar 2012 tingkat Nasional','Pop','instagram;','Surabaya',1111,'2017-09-05 12:23:26','2017-09-05 12:23:26'),
	(689,'LANDHACK','1504618462.jpg','band LANDHACK terbentuk januari 2015 sering mengikuti ajang festival dan mengisi acara diberbagai tempat, seiring waktu band LANDHACK sempat mengalami pergantian personil dan akhirnya terbentuk formasi yang solid di bulan juni 2017 .','Rock','facebook;instagram;','Surabaya',1182,'2017-09-05 12:34:22','2017-09-05 12:34:22'),
	(690,'EMO','1504618529.jpg','Etnik Harmoni Bali (Emoni Bali) band asala Pulau Bali terbentuk pada 11 januari 2011 dimana merupakan kumpulan mahasiswa fakultas teknik di salah satu universitas negeri di Bali, pada awal terbentuk emoni pernah mengikuti kompetisi lokal dimana meraih juara pertama sekaligus favorit, sekitar bulan mei 2011 lolos sebagai 6 besar road to soundrenaline regional Bali NTT, lolos dalam 10 besar LA Light meet the labels pada tahun 2012, pada tahun yang sama emoni juga sempat tampil pada acara OVJ yang ketika itu melakukan road show ke Bali\r\ndari awal terbentuk emoni sering tampil pada acara-acara musik di Bali, pernah juga diundang sampai Mataram.\r\nSampai tahun 2017 emoni telah mengeluarkan 3 album dimana salah satu album (album ke 2) memberanikan diri memuat materi berisikan gubahan dan aransemen lagu daerah bali yang kini sudah hampir tidak dinyanyikan lagi oleh orang-orang bali khususnya anak-anak... salah satu lagu yang paling favorit dengan judul \"ketut garing\" yang merupakan lagu dengan views sampai 2,5 juta yang pada saat itu belum ada band bali yang memimiliki views sebanyak itu\r\nkali ini emoni mencoba mengikuti levis band hunt dengan mengirimkan salah satu lagu dari album pertama yang berjudul Rindu, dimana pada video klip ini kami ingin menyampaikan bagaimana perasaan pasangan yang lagi LDR, saking ingin bertemunya dengan sang kekasih sampai-sampai pertemuan pada sebuah mimpi pun terasa begitu nyata\r\n#SalamBerjutaHarmoni','Pop','maliq;','Surabaya',1009,'2017-09-05 12:35:29','2017-09-05 12:35:29'),
	(691,'ANOLUX','1504618860.jpg','ANOLUX adalah sebuah band baru dengan formasi yang menurut kami cocok antar personil.\r\nUntuk prestasi masing-masing personil memiliki prestasi tersendiri ketika dengan band lamanya\r\nKami bersatu mencoba memecahkan permasalahan yang ada dalam industri musik yaitu salah satunya Pembajakan yang mana menurunkan kualitas industri musik di Indonesia .\r\nkami mencoba peruntungan dengan mendaftar LEVIS BAND HUNT dan siapa tau kami bisa memasuki juara 1 dan mendapat kontrak kerjasama dengan Universal yang semoga saja itu gerbang harapan dari mimpi kami yang berjuang bertahu-tahun mencoba menjadi musisi top di Indonesia, Asia, dan Mancanegara .\r\nSemoga aksi, penampilan, dan performance musik kita berkualitas diajang ini hingga seterusnya.\r\nYeaaaahhhhh','Rock','facebook;informasi_toko;','Surabaya',1112,'2017-09-05 12:41:00','2017-09-05 12:41:00'),
	(692,'ANDTHOM BAND','1504621678.jpg','Andthom Band Merupakan Band Yang terbentuk 26 September 2015 Yang berasal dari kota kecil di sulawesi selatan yaitu Kota Palopo,Anthom terbentuk karena personil mempunyai visi dan misi yang sama,adapun prestasi yang di raih dalam 2 tahun belakangan ini yaitu,tahun 2015,8 kali menjuarai Festival Music acostic yang di adakan di kota palopo,makassar sulsel,2016,17 kali menjuarai festival band pop di kota makassar,palopo,masamba,soerako,kendari,.2017 Tour Road to Cafe Sulawesi Barat ,Polman,Majene,dan kota mamuju sponsor Clasmild ..','Pop','instagram;umi;teman;','Jakarta',860,'2017-09-05 13:27:58','2017-09-05 13:27:58'),
	(693,'d\'Almond','1504622194.jpg','bermula dari kumpulan teman di desa yang sering nongkrong bareng','Pop','guitar_plus;','Yogyakarta',1226,'2017-09-05 13:36:34','2017-09-05 13:36:34'),
	(694,'KRANS','1504622742.jpg','Memulai petualangan sejak Juni 2017, KRANS adalah salah satu dari sekian banyak nama yang ada di\r\nbenak kami saat memulai petualangan kami. Nama KRANS diambil dari Kamus Besar Bahasa Indonesia\r\nyang memiliki arti ‘karangan bunga’. Lagu-lagu yang kami buat sering kali merespon isu-isu dan keadaan\r\nyang terjadi di sekitar kami. Musik pop sederhana kami sajikan dengan memasukkan unsur-unsur musik\r\nlain, seperti folk, alternative, indie rock, punk, jazz, new wave, yang dipengaruhi oleh para idola kami.\r\nKami ingin mencoba membuat musik yang layak untuk dinikmati dan didengarkan khalayak umum.','Pop','facebook;teman;','Yogyakarta',924,'2017-09-05 13:45:42','2017-09-05 13:45:42'),
	(695,'SEMI PROJECT','1504623747.png','BAND INI BERAWAL DARI SEBUAH PERKUMPULAN YANG MEMUTUSKAN UNTUK MEMBUAT BAND.\r\nDAN BAND INI PERNAH DIUNDANG UNTUK BERMAIN DI STUDIO YG CUKUP TERNAMA DI DAERAH TANGGERANG','Pop','instagram;guitar_plus;poster;','Jakarta',832,'2017-09-05 14:02:27','2017-09-05 14:02:27'),
	(696,'RADIOMOTE','1504624284.png','Band ini berdiri untuk memberi warna baru di musik indonesia,kami radiomote memiliki pemikiran dan selera musik yang sama untuk berkarya','Pop','facebook;','Medan',1056,'2017-09-05 14:11:24','2017-09-05 14:11:24'),
	(697,'WAV band','1504626327.jpg','Berawal dari kesamaan ide dan kreasi dan sama sama menyukai band dari coldplay keane dan u2 maka terbentuklah wav band untuuk mewujudkan karya untuk sumbangsih untuk musik indonesia','Alternative Rock','facebook;','Jakarta',1229,'2017-09-05 14:45:27','2017-09-05 14:45:27'),
	(698,'Jagang Pinggir','1504629368.jpg','awal terbentuk band ini ketika itu pada awal masuk perukilahaan kita ber-4 sama-sama masuk kedalam organisasi mahasiswa UKM Band sebuah kampus swasta di Surabaya. akmal, wildan dan cici adalah divisi acara nya dan rendy adalah divisi peralatan. akmal wildan dan cici karena berada dalam satu divisi yang sama akhirnya mereka memiliki khemistri yang sama dan akhirnya memutuskan untuk membuat sebuat band dengan nama A.W.C yang adalah singkatan dari nama mereka. kemudian rendy dan akmal seringkali ketika nongkrong di sekretiat UKM Band, mereka berdua menemukan kecocokan dalam referensi musik. akhirnya pada suatu hari akmal mengajak rendy untuk ikut dalam latihan band nya tadi (A.W.C) dan disitu lah pertama kali komposisi pernil ini melakukan jamming dan menemukan warna baru dalam bermain musik rock yaitu dipengaruhi oleh permainan gitar dari rendy. latihan demi latihan di studio seringkali dilakukan dan terciptalah beberapa lagu yang akhirnya kita memutuskan untuk menghasilkan sebuah karya yang menunjukan jati diri dari band ini. yang kemudian dengan formasi ini otomatis nama band dirubah menjadi Jagang Pinggir. kita pun seringkali bermain di acara-acara komunitas, gig sepperti road to soundrenalin 2017 surabaya, serta acara-acara kampus dan juga beberapa bar di surabaya.\r\nnp:  akun instagram @jagangpinggir_official','Rock','maliq;','Surabaya',1231,'2017-09-05 15:36:08','2017-09-05 15:36:08'),
	(699,'O L D F I L E','1504629369.jpg','we are OLD FILE\r\n\r\nfrom Jambi,Indonesia\r\n\r\ncontact person:\r\nRUDI +62 852 7205 9545','Blues','facebook;instagram;informasi_toko;','Medan',1192,'2017-09-05 15:36:09','2017-09-05 15:36:09'),
	(700,'BAY','1504629418.jpg','Band ini memang belum memiliki prestasi, dalam hal kompetisi. Karena band ini baru terbentuk saat mengetahui ada event ini.','Pop','maliq;','Jakarta',494,'2017-09-05 15:36:58','2017-09-05 15:36:58'),
	(702,'Sarsaparilla','1504631166.jpg','Sarsaparilla terbentuk pada 24 November 2013. Yang berawal dari sesama anggota extrakulikuler musik di sebuah SMU. Shoufey Sungkar (Vocal),Gahtan Basandid (Guitar Lead),Fauzan Hanif (Drum),Rifky Algifari (Guitar Rythm).\r\nSarsaparilla merupakan band yang bergenre Pop. Yang berkeinginan besar menunjukan musikalitas yang unik dan fresh tetapi easy listening. Yang mempunyai konsep Colorfull dengan warna setiap personil Hijau,Merah,Biru dan Pink.\r\nDalam waktu singkat sarsaparilla telah melalukan recording yang dilakukan secara sendiri (Home Recording)\r\nSarsaparilla juga telah mengikuti berbagai event dan kompetisi band antar sekolah maupun umum.\r\nDan Pada tanggal 20 agustus 2017 Gitaris kami yang bernama Rifky Algifary (Berbaju biru) telah mengundurkan diri dan sudah tidak bisa bekerja sama dengan Sarsaparilla. Sarsaparilla juga dibantu oleh beberapa Personil additional yaitu Andre Arsanto (Bass), Satria Ghaibi (Keyboard), Marco Bagas (Guitar rhythm). Sarsaparilla Mengubah Fomasinya menjadi Bertiga yaitu Shoufey Sungkar (Vocal), Gahtan Basandid (Guitar Lead), Fauzan Hanif (Drum).\r\n\r\nPrestasi:\r\n-Menjadi Guest star di beberapa Pensi\r\n-Menjadi Guest star di beberapa Event\r\n-Bermain di Center Stage Jakarta Fair 2017','Pop','instagram;informasi_toko;guitar_plus;umi;maliq;','Jakarta',1178,'2017-09-05 16:06:06','2017-09-05 16:06:06'),
	(703,'Later Just Find','1504631711.jpg','Kami 7 manusia yang ingin bermusik dan bermain sekaligus bekerja bersama. mari dengarkan kami.','Pop','instagram;informasi_toko;vipclub;maliq;teman;lainnya;','Jakarta',1062,'2017-09-05 16:15:11','2017-09-05 16:15:11'),
	(704,'DBest Band','1504632500.jpg','10 Besar Festifal Band Koran Lampu Merah','Alternative Rock','instagram;','Jakarta',1193,'2017-09-05 16:28:20','2017-09-05 16:28:20'),
	(705,'TRILOGI','1504641554.jpeg','Trilogi adalah band Bandung yang beranggotakan tiga orang. memiliki tiga ideologi namun satu visi. memutuskan bergenre rock agar orang yang mendengarkan bisa termotivasi dan semangat dalam kesehariannya.','Alternative Rock','facebook;','Jakarta',1244,'2017-09-05 18:59:14','2017-09-05 18:59:14'),
	(706,'TCRS','1504652114.JPG','The  Curious,  band  yang  t e r l a h i r p a d a 2 0 1 1 . Diibentuk awalnya oleh Essa di Vocal dan Alan di G i t a r .​s e t e l a h mengumpulkan beberapa m a t e r i l a g u a k h i r n y a mereka memulai band ini dengan mengajak Samuel ( ex - D r u m ) L u ck y ( B a s s )\r\n.\r\nsempat memulai band ini dengan empat orang diatas dengan format yang sederhana, namun karena dirasa kurang dapat memenuhi kebutuhan akhirnya mereka sepakat mengajak Ruben (Keyboard) untuk memenuhi kebutuhan band ini. Pada perjalanannya TCRS yang beraliran Shoegaze-Alternatif ini,memilih referensi musik seperti mew, radiohead, the national, the other lives. sempat beberapa kali melakukan rekaman dan menghasilkan beberapa lagu. band ini mengawali karyanya dengan “Human” 2011. setelahnya kemudian disusul dengan merilis EP yang berisikan tiga lagu yakni : “Enggan Mati Masuk Surga”, “Mengencani Imajinasi dan “Reaksi Kimia”. Saat ini TCRS baru saja mengganti drumer mereka dengan Yuda “Bable” yang dengan formasi baru ini TCRS sedang dalam proses merampungkan album debut yang berisi 9 lagu dan akan dirilis dalam waktu dekat.','Alternative Rock','instagram;','Yogyakarta',1241,'2017-09-05 21:55:14','2017-09-05 21:55:14'),
	(707,'rula&reba','1504652270.jpg','kami band baru yang ingin mencari pengalaman :)','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',55,'2017-09-05 21:57:50','2017-09-05 21:57:50'),
	(710,'Pinkertune','1504664203.png','kehadiran pinkertune dalm dunia musik indonesia tak lepas dari sepak terjang sang vocalis/gitaris,apink risejet        dari awal pembentukan dan pencetusan nama pinkertune di tahun 2006 lihat foto “formasi awal”,dialah yang berandil besar melahirkan karya karya untuk pinkertune,namun seiring waktu berjalan dan beberapa kali mengalami pergantian personil dan pergantiannya di sebabkan adanya anggota yang memilih berhenti bermain musik  membuat band ini pasang surut dan tak tentu arah alias galau\r\ndan dengan segala apa yg terjadi  kembalilah di tahun 2017 ni\r\ntergugah kemauan untu menghadirkan kembali pinkertune setelah mencoba untuk menyeleksi beberapa lagu untuk membuat full album perdana mereka,begini kata apink saat di temui beberapa saat lalu“ada beberapa sih,\r\ndan yg akan di jadikan single \r\npertama itu kemungkinan where’s love sahut \"apink,\r\nini seperti mencari apa yg hilang dalam diri setiap org, kadang kadang dunia itu kacau tapi dengan cinta itu bisa menjadi indah dan bermamfaat,tidak sabar untuk bernyanyi bareng pinkisser ,cetusnya,,\r\nokay pinkisser tunggu ya\r\nlagu -lagu dari pinkertune\r\nsemoga bisa mewarnai dunia musik indonesia dan mewarnai harimu\r\npeace','Rock','umi;','Jakarta',781,'2017-09-06 01:16:43','2017-09-06 01:16:43'),
	(711,'Javanice','1504669033.jpg','Bermula dari sebuah event di kota Cianjur tahun 2013, Dira (vokal) yang saat itu memutuskan untuk berhenti bermusik dan menjadikan event tersebut last solo performance karena akan fokus bekerja dan meninggalkan dunia musik, setelah tampil, Ram (bassis) langsung menemui Dira karena tertarik dengan suara dan gaya panggung nya, Ram bercerita bila ia telah lama bermusik dengan teman masa kecil nya Dodi (gitar) dan belum menemukan teman lain yang kompak, dari sana beberapa bulan kemudian mereka bertemu dan mulai membentuk sebuah band dengan Harits (Drumer) yang bergabung tak lama setelahnya.\r\nBeraliran awal Japanese Rock, \"Javanice\" dipilih sebagai nama band dengan artian Java is nice (orang jawa/Indonesia itu relatif baik) dan Javanice siap memenangkan acara Levi\'s Band hunt Competition 2017\r\n\r\nPrestasi:\r\n-berpartisipasi dalam banyak event di kota sekitaran bandung sukabumi cianjur bogor jakarta dll, kebanyakan event bertema japanese.\r\n\r\n-Guest star di beberapa event\r\n\r\n-Dira (vokal) pernah masuk acara tv pencarian bakat suara mirip iman j-rocks\r\n\r\n-sudah memiliki 4 buah lagu dan 2 klip','Rock','facebook;','Jakarta',1254,'2017-09-06 02:37:13','2017-09-06 02:37:13'),
	(712,'ROMANTICK','1504669534.jpg','Berangkat dari sebuah persahabatan yang lama, walaupun kami pribadi yang berbeda-beda, tetapi kami selalu menerima perbedaan itu untuk bersatu.\r\n\"SATU NAMA, SATU MIMPI, DIRAIH BERSAMA DAN UNTUK BERSAMA\"\r\nWe Are ROMANTICK!\r\n\r\nPrestasi :\r\n- Juara 1 \"Rock Fest Kediri Jatim 2011\"\r\n- Finalis 3 besar band \"Digital Icon with Republik Cinta Management Jakarta 2014\"\r\n- 10 besar kompilasi album Alfa Record \"Project Alfa : Naga Mencari Bintang 2015\"\r\n\r\nContact Person :\r\n- 087758487111 (Tifa)\r\n- 085790540508 (Bayu)','Alternative Rock','guitar_plus;','Yogyakarta',1222,'2017-09-06 02:45:34','2017-09-06 02:45:34'),
	(713,'KANESIA','1504670605.jpeg','Salam Kenal dari KANESIA .\r\nKami merupakan Band yang menciptakan Lagu lagu bernuansa semangat nasional . Band kami memiliki misi untuk selalu memberikan semangat kepada kaum muda melalui lagu lagu yang kami bawakan . \r\nSebelumnya kami pernah tampil di Acara Jambore Daerah Se-Jawa Barat Tanggal 2 Agustus 2017 kemarin . Semoga Band kami dapat diikutkan dalam kompetisi ini . Terima Kasih','Pop','teman;','Jakarta',1217,'2017-09-06 03:03:25','2017-09-06 03:03:25'),
	(714,'Blind majesty','1504670766.jpg','Ancol lebaran festival 2017','Rock','facebook;instagram;informasi_toko;guitar_plus;umi;teman;','Jakarta',1221,'2017-09-06 03:06:06','2017-09-06 03:06:06'),
	(715,'nothingfall','1504671234.jpg','NF (nothingfall) adalah transformasi dari 3 personil  band pionir raprock di bandung pada 90an Ragajimesin ditambah 2 personil yang juga cukup lama bermain di skena underground kota bandung lain nya..\r\nterbentuk akhir 2016..sudah merilis single = video klip dan sekarang sedang proses menuju rilisan fisik','Others','guitar_plus;teman;','Jakarta',1257,'2017-09-06 03:13:54','2017-09-06 03:13:54'),
	(716,'Beauty and The Beats','1504671508.JPG','Band yang terbentuk atas keresahan yang sama. yaitu tidak berani berkarya secara Independent. Akhirnya kami memusutskan untuk membentuk band ini. dengan tujuan berkarya secara merdeka','Pop','instagram;maliq;','Yogyakarta',1230,'2017-09-06 03:18:28','2017-09-06 03:18:28'),
	(717,'The Dance Going On','1504671535.jpg','The Dance Going On terbentuk pada tanggal 6 Juni 2016, yang juga bertepatan dengan 1 Ramadhan dalam kalender Islam, Islam dan semakin mendukung konsep \"Baik-Buruk\" yang ada dalam konsep band ini sendiri.\r\n\r\nThe Dance Going On mengusung musik beraliran Gypsy, Psychedelic, Jamaican, Ska, Rock n Roll dan Rock Steady. The Dance Going On bukan hanya sekedar band melainkan Ide untuk regenerasi musik lokal, yang ingin menunjukan disharmony sebagai suguhan \"like-new\" dalam skena musik Indie Surabaya.\r\n\r\nAdapun beberapa Prestasi yang sempat kita raih, diantaranya adalah sebagai Best Local Band 1st Semester UrbanGigs dan Juara 2 Sound of Tri regional Surabaya.','Others','facebook;instagram;teman;lainnya;','Surabaya',1126,'2017-09-06 03:18:55','2017-09-06 03:18:55'),
	(718,'Passatu Band','1504672543.jpg','Juara II festival Band Antar Pelabuhan Se-Indonesia th 2012\r\nJuara I festival Band Antar Pelabuhan Se-Indonesia \r\nth 2013,2014,2015\r\nJuara I festival Band Car Terminal Lapiaza th 2016\r\nJuara I Festival Band antar BUMN th 2015\r\nJuara II Festival Band HUT KOLINLAMIL Angkatan Laut \r\nth 2016\r\nJuara I Festival Band antar BUMN th 2016','Pop','instagram;umi;','Jakarta',1256,'2017-09-06 03:35:43','2017-09-06 03:35:43'),
	(719,'Terts Mayor','1504675470.png','Kami sekumpulan anak muda yang terbenteuk dalam sebuah band yang bernama “Terts Mayor” awal mula kami terbentuk dari sebuah salah satu kampus seni di Jakarta dan kami semua adalah mahasiswa di kampus tersebut . Awal kami terbentuk tahun  2015 , dan dari awal hingga sekarang kami sudah mengeluarkan 3 track lagu ciptaan kami sendiri yang kami unggah di souncloud . Sejauh ini kami pernah mengikuti beberapa pagelaran musik seperti event music , festival ,acara wedding dll dan sampai sekarang menjadi home band di beberapa kafe .','Pop','instagram;','Jakarta',1100,'2017-09-06 04:24:30','2017-09-06 04:24:30'),
	(720,'7Miles','1504675718.jpg','7miles di bentuk pada tahun 2012 dengan mengusung aliran musik pop. 7miles terdiri dari lima(5) personel masing-masing adalah Naka(vocal), Iam(lead guitar), ivan(guitar), Rezard(bass), dan Rama(drum). Pada arangemen lagu kami sendiri bertemakan cinta dan kehidupan, instrumen yang di kedepankan lebih menonjolkan string dan petikan ciri khas pop modern dengan sound yang terasa luas pada saat pengolahan suara agar para pendengar enjoy dan mampu masuk dan merasakan karya yang kami olah. Arti 7miles sendiri memiliki arti yang luas. Angka 7 merupakan angka yang fenomenal menurut kami. Dan miles merupakan ukuran jarak dalam bahasa inggris. Jadi bisa di katakan motivasi kami adalah bagaimana kita menjadi band fenomenal tanpa menghitung jarak apapun baik dari sisi komunikator/penikmat musik 7miles. Maupun 7miles itu sendiri.','Pop','instagram;guitar_plus;','Jakarta',1261,'2017-09-06 04:28:38','2017-09-06 04:28:38'),
	(721,'ACTINIUM','1504676093.jpg','ACTINIUM Band yang terbentuk pada tanggal 12 Desember 2012 di Kota Bogor yang bergenre Rock/Nu Metal. Actinium saat ini sudah mempunyai mini album yang terlah di rilis bulan April 2017 lalu dalam bentuk fisik dan digital yang berisikan 4 lagu di dalam nya. ACTINIUM sendiri terinspirasi dari band band seperti Linkin Park, Bring Me The Horizon, Coldrain, Pierce The Veil, Mice Of Man, Limpbizkit, dan Lain nya. ACTINIUM sendiri biasa mengisi acara di acara acara pensi, festival festival musik lain nya, dan juga festival musik musik Matsuri/Jepang di berbagai daerah Jabodetabek.','Rock','guitar_plus;','Jakarta',1264,'2017-09-06 04:34:53','2017-09-06 04:34:53'),
	(722,'A.M.O Project','1504676273.jpg','Dibentuk Tahun 2016 di Bandung\r\nAmo project adalah project solo guitar instrumental oleh Gitarisnya sendiri, Amo. Beranggota  4 orang, 2 Gitaris, (Amo dan Hadi) Drummer (Andi) dan Bassis (Robert) Merekam, mendanai dan merilis sendiri EP yang berjudul \"My Guitar and Me\" yang memiliki genre yang luas dari heavy metal sampai jazz fusion pada September 2016. Dan akan terus maju berharap musik instrumental dapat menembus pasar musik Indonesia.','Others','guitar_plus;','Jakarta',1262,'2017-09-06 04:37:53','2017-09-06 04:37:53'),
	(723,'AFTER SKY','1504676593.jpg','AFTER SKY adalah girlband asal kota Malang Indonesia yang beraliran pop rock hingga speed metal. Resmi berdiri pada tanggal 4 september 2016,awalnya beranggotakan 4 orang tapi sekarang tersisa dua orang dan 2 additional player dan tetap solid sebagai band yang mengusung genre pop rock n speed metal\r\nPersonil after sky adalah Diana Novitasari (15  tahun) pada posisi gitar dan vokal dan Viola Intania (14 tahun) pada posisi drum dan vokal dibantu oleh Agung pradana (17 tahun) di posisi bass dan Fredyk theo (17tahun) drummer pengganti\r\nSetelah sukses dengan mini album mereka FIRST STEP TO FLY yg dirilis 20 November lalu, kali ini mereka merilis single yang berisi 2 lagu KIBARKAN BENDERA dan SELAMAT ULANG TAHUN TEMANKU yang sengaja dirilis pada 14 Agustus ini untuk menyambut hari kemerdekaan RI yang ke 72 \r\nRilisan single ini ditandai dengan pemutaran serentak di radio2 kota Malang, di Jawa Timur dan sebagian Jawa dan beberapa radio di luar pulau jawa di Indonesia pada tanggal 14 Agustus 2017\r\n\r\nPrestasi :\r\n-Favorit Djarum super Rock in Battle audisi malang\r\n-Band pembuka tour konser NINA WANG di malang','Alternative Rock','facebook;instagram;guitar_plus;umi;','Jakarta',861,'2017-09-06 04:43:13','2017-09-06 04:43:13'),
	(724,'TEORI','1504676728.png','TEORI terbentuk di kota Solo pada tahun 2010. Adalah Gege Saga, Martinus Sentana juga Ichsandy Nugraha yang mengusung kelompok musik ini. Terpengaruh dengan musik band-band inggris alternatif, menjadikan satu kesamaan diantara banyaknya perbedaan selera. Salah satu yang paling mempengaruhi adalah Radiohead.\r\n\r\nDisamping itu kemunculan Tame Impala serta Temples turut mewarnai perkembangan karya. Rock Alternatif dengan beberapa siraman modulasi pun lekat tersemat dalam album perdana kami yaitu “TANTRUM” (2016).\r\nBand indie dengan segala kemampuan untuk berproses serta promosi seringkali memutar cara agar karyanya didengar. TEORI memutuskan salah satu cara yang paling tepat adalah melakukan tur ke luar kota. Terhitung dalam medio 2 tahun terakhir, TEORI sudah dua kali melakukan ibadah tur Jawa-Bali. Selain itu showcase promo album serta media maya pun juga dilakukan. Tahun ini masih melanjutkan beberapa cara untuk promo album. Video musik untuk single kedua akan segera dirilis pertengahan tahun 2017.\r\n\r\nDiscography :\r\n-	Confused (single / 2014) \r\n-	Sesari Selagu (single / 2016) \r\n-	TANTRUM (album / 2017) \r\n-	Lovely Bones (single / 2017)','Alternative Rock','instagram;teman;lainnya;','Yogyakarta',1266,'2017-09-06 04:45:28','2017-09-06 04:45:28'),
	(726,'Palapa band','1504677764.jpg','Palapa band didirikan pada tanggal 27 Juni 2001 , seiring munculnya inspirasi kami untuk lebih maju dan lebih serius dalam bermusik , walaupun kemarinkemarin sempat berganti personil dan putus harapan tapi alhamdulillah sekarang masih bisa tetap berkarya dan masih tetap eksis dan tetap solid . Palapa band diambil dan ter inspirasi dari sebuah nama satelit yang mana fungsi dari satelit itu adalah memancarkan signalnya begitu luas dan mendunia , kami ingin juga memberikan sebuah alunan musik dan karya kami untuk didengar oleh seluruh masyarakat indonesia pada khususnya dan dunia pada umumnya . prestasi-prestasi palapa band : 1. Juara 1 festival musik se sulawesi Piala Menristek dibulukumba 2004\r\n2. Juara 2 festival suzuki se indonesia timur 2008 \r\n3. Juara 1 festival indivest regional kabupaten soppeng 2005\r\n4. Band opening GIGI kabupaten sinjai 2006\r\n5. Band opening KOTAK kabupaten Bone 2009\r\n6. Band opening COKLAT kabupaten Bone 2008\r\n7. Band terfavorit 10 besar festival A MILD WANTED regional Indonesia Timur 2009/2010 dll','Pop','teman;','Yogyakarta',1265,'2017-09-06 05:02:44','2017-09-06 05:02:44'),
	(727,'Ming&Mong','1504678656.jpg','Ming&Mong adalah band yang berdiri pada tahun 2016 dengan single pertama lagu Sebuah Lagu.','Pop','instagram;','Yogyakarta',1268,'2017-09-06 05:17:36','2017-09-06 05:17:36'),
	(729,'Mike Chemichael','1504679616.jpg','band ini berawal dari project solo Michael Manurung,\r\ndan kemudian berkembang menjadi sebuah band\r\n\r\nband ini telah menjadi performer dibanyak event pensi, sekolah, universitas, wedding, gigs, dan juga launching','Pop','instagram;teman;','Jakarta',1263,'2017-09-06 05:33:36','2017-09-06 05:33:36'),
	(730,'ALIVE BAND','1504679939.jpg','Alive band berasal dari kota brebes jawa tengah , kita terbentuk 7 june 2016 beranggotakan 4 orang bergenre pop , kita sering mengisi pensi2 sekolah dan d cafe2 IG : alive_official\r\n\r\nUntuk info hub 085742922241','Pop','instagram;guitar_plus;','Jakarta',1269,'2017-09-06 05:38:59','2017-09-06 05:38:59'),
	(731,'KeyP.A.D','1504680012.jpg','Formasi awal KeyP.A.D. ialah Purnama Ramadhan di posisi gitar dan vokal, Ahmad Adlan di posisi bass dan backing vocal serta Danialsyah di posisi drum dan vokal. Namun di awal Maret 2015 Ahmad Adlan meninggal dunia akibat penyakit akut yang menggerogotinya, untuk menghormati dirinya KeyP.A.D. akan terus memakai additional player untuk mengisi posisi pemain bass di setiap penampilan mereka. Menurut mereka Adlan tetap menjadi unsur band tersebut dan tidak boleh digantikan oleh siapapun.\r\nNama KeyP.A.D. diambil dari kata Key yang dalam bahasa Inggris artinya adalah Kunci dan P.A.D. diambil dari inisial nama ketiga personilnya. Yang dimana mereka memfilosofikannya bahwa unsur atau kunci dari band tersebut terletak kepada ketiga personilnya.\r\nAwalnya mereka tergabung didalam manajemen Be_Avenue dibawah bimbingan Fakhrie Ristrano atau akrab disapa Bang Ano dan mulai melebarkan sayap mereka di dunia musik Provinsi Aceh. Namun sekarang mereka memutuskan mengatur manajemen mereka secara independen.\r\nKeyP.A.D. menghasilkan 6 lagu sejauh ini yaitu Just Do It,Promise You,Be Yourself,I Love You Like a Music on the Dancefloor,Ijo dan PAD.\r\nKarya-karya mereka bertemakan Kehidupan sosial,cinta dan motivasi hidup seperti di lagu “Just Do It” yang menceritakan tentang ajakan untuk berani bertindak dalam hidup agar tidak menjadi seorang pecundang. “Promise You” menceritakan tentang romansa ketika diputuskan oleh pasangan tetapi tidak menjadi permasalahan bagi yang ditinggalkan. Dalam lagu “Be Yourself” KeyP.A.D. menyarankan orang-orang untuk menjadi dirinya sendiri didalam hidup. “I Love You Like a Music on the Dancefloor” menceritakan ketidakpedulian mendengarkan pendapat orang lain ketika kita mencintai seseorang dan tetap pada keputusan kita untuk mendapatkannya. Dalam lagu “Ijo” diceritakan tentang menikmati kesenangan dalam hidup dan “PAD” menceritakan ketiga personil di dalam band KeyP.A.D.\r\nDalam rencananya keenam lagu tersebut akan mereka kemas di dalam mini album yang sedang mereka kerjakan yang bertajuk “A” dan akan segera mereka rilis dalam waktu dekat ini. Rencananya mereka mendedikasikan album ini untuk Alm. Ahmad Adlan yang telah meninggalkan mereka.\r\nSekarang KeyP.A.D telah menetapkan Jafri Hasman dan Teuku Gabriel untuk menjadi personil dari KeyP.A.D.','Rock','instagram;guitar_plus;poster;teman;lainnya;','Medan',1271,'2017-09-06 05:40:12','2017-09-06 05:40:12'),
	(732,'Every Brains','1504680867.jpg','Every Brains, berdiri sejak tahun 2010. Berawal di massa-massa SMA kami, saat musik elektrik sedang bergejolak tapi kami menolak untuk terhanyut dalam dentuman beat yang terdengar dimana-mana. Kami memilih untuk menikmati kerasnya musik ACDC, The Doors, The Sigit dan musik-musik yang sebagian besar adalah warisan dari ayah-ayah kami. \r\n\r\nGigs pertama kami di imax kemang pada tahun 2010, tercengang saat melihat crowd berlari kearah kami ketika kami membawakan T.N.T dari ACDC. Saat itulah kami meyakini bahwa ROCK adalah musik & lifestyle kami. \r\n\r\nSempat vakum lama karena kebutuhan hidup yang memaksa kami untuk menjauh dari mimpi dan setelah beberapa kali mencari-cari drumer pengganti teman kami yang memutuskan untuk berpisah, akhirnya Togu hadir dengan pukulan blues nya yang membangunkan lagi hasrat kami untuk bermimpi lebih jauh. Kini kami hanya ingin mimpi kami terdengar dan berharap dapat membangkitkan kembali kejayaan musik rock.','Rock','instagram;','Jakarta',1274,'2017-09-06 05:54:27','2017-09-06 05:54:27'),
	(733,'Q-OZ ZEROFIVE','1504683379.jpg','Berdiri tanggal 05/05/2005.\r\nQ-oz zerofive sendiri telah banyak mengikuti festival-festifal dan parade di berbagai tempat baik di dalam kota maupun luar kota.seiring dengan proses itu,kami pun memiliki jam terbang sebagai bintang tamu baik didalam kota maupun luar kota','Rock','umi;','Jakarta',1275,'2017-09-06 06:36:19','2017-09-06 06:36:19'),
	(734,'EGO BAND','1504683571.jpg','Single \" Permainan Cintamu \" dan \" Seharusnya Setia \" meski lewat jalur indie tapi sudah diputar secara reguler di 40 radio di seluruh indonesia dan sudah terdaftar di spotify','Pop','facebook;lainnya;','Surabaya',1255,'2017-09-06 06:39:31','2017-09-06 06:39:31'),
	(738,'Mier','1504685605.jpg','Mier, /mɪ yɛr/ atau disebut juga sebagai Mier Music, sebuah band Alternatif Rock yang berdomisili di kota Medan, berasal dari kota Medan, Sumatera Utara, Indonesia. “Mier” sendiri merupakan anagram dari kata “Meir”, yang diambil dari nama Jewish yang memiliki arti “sesuatu yang bersinar”. Terbentuknya Mier diusung oleh Ihsan, Farid, Dafi, Ardi, dan Reza. Mier sendiri merupakan perubahan dari grup band SIX yang sudah aktif sejak 2015. SIX sendiri sudah pernah bekerjasama dengan beberapa musisi lokal dalam menjalankan kegiatan musik, antara lain raka ivanda, rizki pillo, serta mawi. Melanjutkan karir bermusik dalam naungan band, ihsan, farid, dafi bersama ardi dan ezak, menyusun kembali nama serta manajemen band untuk memulai menghasilkan karya sebagai band indie, yaitu Mier. Dalam menghasilkan karya musik, Mier mengambil beberapa musisi-musisi dunia sebagai referensi, antara lain Angle and Airwaves, Radwimps, The Killers, dan sebagainya. Keinginan untuk menyuguhkan musik yang ringan didengar dan dapat diterima golongan muda, tanpa mengurangi nuansa rock dan sentuhan modernisasi dalam dunia musik, Mier telah memperdengarkan hasil karya pertamanya ke dunia pada Juli 2017. Singel perdana Mier yang berjudul “Puisi Sunyi” dapat diakses pada banyak media pemutar lagu online seperti iTunes, Spotify, Deezer, dan masih banyak lagi.','Alternative Rock','instagram;','Medan',199,'2017-09-06 07:13:25','2017-09-06 07:13:25'),
	(744,'sound of inspiration','1504685911.jpg','terbentuk tanggal 5 maret 2008, dengan konsep pop groove dengan musik yg fresh dan fun, berharap bisa memberikan inspirasi positif bagi pendengar. meluncurkan single pertama yang berjudul \"hari ini indah\" dalam album \"student stars compilation\" pada tahun 2008. tahun 2010 meluncurkan single ke 2 berjudul \"salah siapa\" dalam album \"go green compilation\" bersama CSA record. pada tahun 2012 kami meluncurkan album indie pertama yang berjudul \"impian\" dengan single \"selalu ku rindukan\".pada tahun 2013 kami merilis single ke 2 dari album pertama berjudul \"impian\" dan berhasi masuk ke dalam album kompilasi kickfest 2013 yang di rilis di malang pada bulan mei. di tahun 2014 kami merilis single terbaru berjudul \"good time\"','Pop','maliq;','Jakarta',447,'2017-09-06 07:18:31','2017-09-06 07:18:31'),
	(747,'Hyu','1504687583.jpg','Cerita:\r\nBerawal dari pertemuan di studio di bilangan Jakarta Selatan pada tahun 2011, pada saat itu kami para personil memiliki Band masing-masing. Dan singkat cerita Band yang kamu punya masing-masing akhirnya menemukan titik jenuh yang tidak dapat di persatuan lagi, dan akhirnya guntur, sera, kiki, dedi memiliki visi dan misi bermusik yang sama, kami bentuklah band yang bernama HYU. Hingga saat ini kami sering mengikuti berbagai macam lomba festival. Tujuan kami dalam bermusik supaya kami dapat menghibur para penikmat musik tanah air, dan dapat di terima di industri musik Indonesia. \r\n\r\nPrestasi band :\r\n- juara 1 festival lomba full band majalah aneka yes sudirman 2014\r\n- juara 2 lomba akustik tahun 2016 baywalk pluit mall (musik indie bersatu) \r\n- juara 2 lomba akustik band Religi tahun 2017 blok M square  (FORMI forum musik indie)','Pop','facebook;','Jakarta',1278,'2017-09-06 07:46:23','2017-09-06 07:46:23'),
	(748,'JAVA JAVU','1504687688.PNG','JUARA 1 PIALA MENPORA \"ANDI MALARANGENG\"\r\nJUARA 1 HONDA BLADE NATIONAL\r\nJUARA 1 FESTIVAL TRINI NATIONAL\r\nJUARA 3 HUT TVRI NATIONAL','Rock','guitar_plus;','Jakarta',894,'2017-09-06 07:48:08','2017-09-06 07:48:08'),
	(749,'Basic Evolution','1504689367.JPG','Basic Evolution adalah sebuah band yang berasal dari Kota Depok, Jawa Barat, Indonesia. Band yang terbentuk pada Agustus 2012 lalu ini digawangi oleh 5 orang, yaitu :\r\n- Ichsan Novan Septian / Vocal, Rythm\r\n- Fachri Ghozali / Lead Guitar\r\n- M. Dinda Nugroho / Midi Controller, Vocal\r\n- Dien Galuh Ekananda / Bass\r\n- Ludfi Satria Nugraha / Drum\r\n\r\nKonsep musik yang Basic Evolution terapkan adalah \"Pop Sweet Punk\". Genre musik ini merukapan perkembangan dari Pop-Punk pada umumnya, hanya saja Basic Evolution memainkan musik Pop-Punk yang cenderung tidak melupakan nuansa lembut yang diberikan dari instrument midi controller. Karena hal itu kami menyebut musik yang kami mainkan bergenre \"Pop Sweet Punk\" \r\n\r\nBasic Evolution sudah menyelesaikan Mini Album pertama mereka yang bertajuk \"Monologue\" pada pertengahan tahun lalu. Mini album ini berisikan 5 buah lagu oroginal dari Basic Evolution, yaitu :\r\n- Aku Bukan Mereka\r\n- Mellisa\r\n- Running Out Of Time\r\n- Lost In Wonderland\r\n- The Night Is Alright\r\n\r\nDan pada pertengahan bulan Agustus 2017 lalu, Basic Evolution baru saja menyelesaikan sebuah film pendek berjudul \"Aku Bukan Mereka\" yang disutradarai oleh Haqie Rivardy. Film pendek ini merupakan pengembangan dari lagu andalah Basic Evolution yang berjudul \"Aku Bukan Mereka\". Setelah project film pendek ini, Basic Evolution berencana melanjutkannya dengan membuat video clip untuk lagu \"Aku Bukan Mereka\" tersebut. Jika tidak ada perubahan, project ini akan dilaksanakan pada awal tahun depan.\r\n\r\n\r\nBasic Evolution juga sering melakukan perform diberbagai pensi-pensi sekolah dan berbagai festival di daerah Jabodetabek, serta beberapa kali menghadiri undangan Radio.','Others','guitar_plus;','Jakarta',1285,'2017-09-06 08:16:07','2017-09-06 08:16:07'),
	(750,'The CleanTones','1504689624.jpg','- Top 5 finalist UI Music Festival 2016\r\n- 3rd Winner Liga Medika 2016\r\n- 1st Winner CGT 2016\r\n- Finalist CompFest 2016 & CompFest 2015\r\n- Playing at Labsproject 2017, Grand Closing UI Art War 2016, Pop Up Market 2015, Kuliner Merdeka, Tangerang Jazz Fest 2015','Alternative Rock','poster;teman;','Jakarta',1202,'2017-09-06 08:20:24','2017-09-06 08:20:24'),
	(751,'FOX FORT','1504690843.jpg','Fox Fort beranggotakan 5 manusia yang bertemu di sebuah kampus di kota Bandung yang mempunyai hobi yang sama di bidang musik yang beranggotakan Arga (Vocals, Guitar), Anyu (Drums, Percussion), Valdy (Backing Vocals, Guitar ), Lukman (Bass), dan Bayu (Guitar). \r\n\r\nMakna dari nama Fox Fort itu sendiri yaitu yang pertama “Fox” adalah rubah yang selalu beraktifitas dan berfikir keras pada malam hari karena pada waktu tercipta nama Fox Fort itu kami sedang duduk di bangku kuliah yang memiliki kebiasaan tidur menjelang pagi hari datang. Sedangkan “Fort” yang berartikan benteng, itu memaknai bahwa pondasi dari band ini kuat dan tidak bisa rubuh yang diibaratkan dengan materi-materi lagu yang kuat yang menjadi pondasi dari band Fox Fort sendiri dan menjadi modal dan bekal untuk gendang telinga para calon audience dari Fox Fort untuk merasakan hal yang berbeda pada setiap lagu yang kami buat.','Alternative Rock','instagram;','Jakarta',1289,'2017-09-06 08:40:43','2017-09-06 08:40:43'),
	(752,'Life Cicla','1504691670.png','LIFE CICLA Lahir dan Hadir di kota Cibinong, Bogor. Pada tanggal 11-12-2013. Nama LIFE CICLA memilik arti “Siklus Kehidupan”, Di ambil dari konsep music kami yang berisi tentang bagaimana memandang dan menjalani hidup. Karena, Life Cicla tidak ingin sekedar bermusik melainkan ingin bisa menyampaikan pesan pesan dari setiap lagu kepada masyarakat. Unsur ethnic & Rockoustic tidak lepas dari karya karya kami. Sentuhan gamelan dan instrument – instrument lain lahir ketika kami mengagumi keragaman dan keunikan yang ada di Tanah Air Indonesia.\r\nPada tahun 2013 Life Cicla merilis Official Mix Video Lagu Mata Hati, lalu pada tahun 2014 Life Cicla merilis mini album “From The Country with a Thousand Island yang berisikan tiga track. Setahun kemudian Life Cicla merilis song cover Rasa Sayange serta Kicir kicir. Dan pada tahun yang sama dibantu Paviliun Records dalam hal pendistribusian Life Cicla merilis Full Album “Jejak Pesinggah” yang berisikan 11 Track.\r\n\r\n\r\nOn Air \r\n\r\n2015\r\n\r\nOz Radio Jakarta\r\nBinus Tv \r\nTaman Buaya TVRI\r\n\r\n2016\r\n\r\nTrending Topic Jak Tv\r\nArdan Radio Bandung\r\nSapa Indonesia Pagi Kompas Tv\r\nIndonesia Morning Show\r\nTonight Show \r\n\r\n2017 \r\n\r\nDCDC Musik Kita Global Tv\r\n\r\nOff Air\r\n\r\nUrban Action\r\nPop Up! Demajors\r\nKisi Fest\r\nPesta Rakyat Jakarta\r\nA Mild Soundsation\r\nFreedom Fest\r\nRevolution Trisakti\r\nKlipKlim.com','Folk','facebook;','Jakarta',1213,'2017-09-06 08:54:30','2017-09-06 08:54:30'),
	(753,'Daneen','1504694739.jpg','Juara 2 Smex Band Competition 2017\r\nJuara 3 Smex Band Competition 2016\r\nJuara 1 High Up Festival 2017\r\nJuara 1 Engine Brake Band Competition 2016\r\nJuara 1 Mexpo Band Competition (Unair) 2016\r\nJuara 1 Enginering Festival (Ubaya) 2017\r\nJuara 1  Fisip Umsida Band Competition 2017\r\nJuara 3 Adi Buana Band Competition 2017\r\nJuara 3 ISTTS Band Competition 2016\r\nJuara 1 Unesa Band Competition 2015\r\nJuara 1 PUV (Ubaya) Band Competition (2014)\r\nBest Song Stiesia Festival 2016','Pop','instagram;umi;maliq;poster;teman;','Surabaya',1227,'2017-09-06 09:45:39','2017-09-06 09:45:39'),
	(754,'Fair','1504695123.png','Band yang berasal dari depok dengan konsep baru dari format lama dengan tambahan personil baru yang mengusung aliran musik british pop. dengan menciptakan terus karya lagu itu bagi kami adalah prestasi tersendiri','Pop','instagram;teman;lainnya;','Jakarta',1176,'2017-09-06 09:52:03','2017-09-06 09:52:03'),
	(755,'Bleeding Last Season','1504696244.jpg','Band asal kota Banyuwangi - Jawa Timur yang terbentuk dari tahun 2015 yang mencoba memberi warna baru pada musik indie Indonesia dengan mengusung genre Deathcore yang berbeda dari musik Underground yang lain. Bleeding Last Season mempunyai dua single. Single perdana berjudul \"Bloody Mary\" dan baru saja mengeluarkan single kedua yang berjudul \"Shoot Me\" yang sudah dapat didengar di Reverbnation / Soundcloud beserta VideoClip yang dapat ditonton pada saluran YouTube kami \"Bleeding Last Season\"\r\n\r\nUntuk prestasi, kami masuk top 10 bands dalam event BeholderFest (Bandung) yang di ikuti oleh band Indie seleruh Indonesia dan kami adalah salah satu yang mewakili Jawa Timur dalam audisi tersebut. Dan juga kami sudah sering perform dalam event besar di wilayah kami maupun di luar kota. Event besar yang pernah kami kunjungi seperti BeholderFest (Bandung), JakCloth 2016 (Jember), JemberIndieClothing (Jember), JemFest (Jember), Soundanger (Jember) dan kami juga sering menjadi Guest Stars di kota kami (Banyuwangi) seperti GrandOpening ExhaleApparel Store, RockGoJampi, Serdadu Blambangan #1, Banyuwangi Youth Fest 2017, Brotherhood 2017 dan lain lain. Lagu kita \"Shoot Me\" juga sering masuk dalam nominasi top Indonesia Deathcore songs di berbagai Channel YouTube indie di Seluruh Indonesia seperti PalingBerisik, Loudonesia, Indonesian Deathcore dan lain lain.\r\n\r\nLebih lengkap nya bisa di cek FansPage akun kami \r\nInstagram : https://www.instagram.com/bleedinglastseason/\r\nFacebook : https://www.facebook.com/bleedinglastseason/\r\nReverbnation : https://reverbnation.com/bleedinglastseason\r\nSoundcloud : https://soundcloud.com/bleedinglastseason\r\nChannel YouTube : Bleeding Last Season','Others','instagram;guitar_plus;','Surabaya',1292,'2017-09-06 10:10:44','2017-09-06 10:10:44'),
	(756,'Gema Reunion','1504699593.jpg','Gema berdiri tahun 2009. Gema memiliki genre pop yang terdiri dari 3 personil tetap. Gema mempunyai single hits yang berjudul  \"Salahku\" Cipt.Ade Gema. Prestasi kami dari tahun 2004 sampai 2008 menjuarai festival band diberbagai event,karena awalnya kami bergenre Rock. Tahun 2009 kami memutuskan utk merubah genre kami menjadi pop.','Pop','poster;teman;','Jakarta',1287,'2017-09-06 11:06:33','2017-09-06 11:06:33'),
	(757,'Never Turn Left','1504700892.png','Never Turn Left terbentuk pada 12 April 2017, berawal dari ujian Unit Kegiatan Mahasiswa (UKM) Band Metronome UHAMKA. Band ini terbentukdengan formasiCatur (Vokal), Aan (Guitar), Aldo (Guitar), Ilham (Drum), Jajang (Bass) dan mengusung genre Pop Punk. Seiringberjalannya waktu kami berhasil merilis single pertama yang berjudul Hey Kawan. Dalam lagu ini Never Turn Left featuring dengan Fanfun. Lagu ini ditulis oleh Fanfun dan Aan. Setelah menyelesaikan single pertama kami membuat single kedua yang berjudul Luka Cinta. Lagu ini ditulis oleh Aan guitaris dari Never Turn Left.\r\nSaat ini kegiatan yang sering diikuti adalah perform di berbagai acara seperti gigs dan acara pensi lainnya. Kami juga sering mengisi acara internal di kampus seperti Metrofest 3, yaitu acara UKM Band Metronome yang diadakan setiap tahun.','Others','instagram;teman;','Jakarta',1243,'2017-09-06 11:28:12','2017-09-06 11:28:12'),
	(758,'MINERAL EFFECT','1504700924.jpg','Terbentuk 10 Mei 2011, dengan 4 personil awal dan telah memproduksi 6 buah lagu (mini album). Salah satunya masuk dalam kompilasi album KICKFEST Malang 2013. Dan saat ini adalah formasi yg ke 6 dengan 5 personil.','Alternative Rock','teman;','Surabaya',1250,'2017-09-06 11:28:44','2017-09-06 11:28:44'),
	(759,'Fat Industry','1504700947.jpg','At first , Fat Industry was just a bedroom project. But after a few demo/project we decide to take this band outside the bedroom and let people listen to our song. Through this event, we hope to make a great debut for the band.','Alternative Rock','facebook;instagram;','Jakarta',1296,'2017-09-06 11:29:07','2017-09-06 11:29:07'),
	(760,'Monster Pengerat Wortel','1504701909.jpg','Sebuah band dengan karakter yang sangat kuat, baik dalam segi musik dan juga lirik. Genre musik dengan pengaruh era lama yang authentic dan unique, sering kali membuat band ini mendapat julukan \"penjelajah mesin waktu\"\r\nKomposisi pop yang dipadukan dengan unsur dixie tanpa terompet, dibalut nuansa kegelapan nan mendalam, berhasil membuat karya mereka diperhitungkan oleh beberapa radio indie di Eropa dan Amerika. Sempat merekam 2 lagu dalam bentuk video live performance, semakin memantabkan mereka untuk meluncurkan EP / album kedepannya','Others','facebook;instagram;','Surabaya',1295,'2017-09-06 11:45:09','2017-09-06 11:45:09'),
	(761,'Freak Deed','1504706571.jpg','Kita mencoba menyatukan rasa musik dihati masing\" personil dan kita kemas menjadi sebuah lagu','Alternative Rock','facebook;instagram;teman;','Jakarta',1303,'2017-09-06 13:02:51','2017-09-06 13:02:51'),
	(762,'Sevenday\'s band','1504707619.jpg','Cerita nya : sudah sering mengikuti festival musik di lampung dan pernah menjadi bintang tamu di acara acara dan di chanel tv lokal yang ada di lampung\r\nFrestasinya : baru memiliki 1 lagu single lembaran baruku hasil seni sendiri dan video klip','Alternative Rock','instagram;teman;','Jakarta',1184,'2017-09-06 13:20:19','2017-09-06 13:20:19'),
	(763,'DASHA 4FACE','1504708442.jpg','Dasha 4Face mencoba berkarya untuk meramaikan kancah musik dengan konsep sederhana.mengungkap perasaan berkarya lewat musik...','Pop','teman;','Yogyakarta',1301,'2017-09-06 13:34:02','2017-09-06 13:34:02'),
	(764,'Mistletoe','1504708598.jpg','Sejarah singkat MISTLETOE \r\nMistletoe band berdiri pada tanggal 6 Mei 2016, band asal BandungBandung ini mengambil genre rock alternatif. Kata MISTLETOE berarti sebuah gantungan harapan,  Prestasi Mistletoe masuk 5 besar di ajang Battle Coustic bisa di lihat di IG @kremamanagment','Alternative Rock','instagram;teman;','Jakarta',1299,'2017-09-06 13:36:38','2017-09-06 13:36:38'),
	(765,'Meyza Band','1504710962.jpg','Meyza Band berasal dari kota Bogor, Jawa Barat. Band ini terbentuk tanggal 14 February 2012 yang beranggotakan saat ini yakni Rendy sebagai Vocalis, Canski sebagai Gitaris, dan Dira sebagai Keyboardis. Genre yang diusung oleh Meyza band adalah Pop Rock.\r\n\r\nSelama 5 tahun diawal, Meyza band aktif sebagai pengisi acara dan bintang tamu pada acara-acara budaya Jepang, seperti Gelar Jepang UI, Jiyuu Matsuri UNJ, dan Bijac no Tanjowai Binus. Dan di tahun lalu, 14 Februari 2016. Meyza band sudah merilis Single Album \"Prologue\". Album ini dipasarkan oleh outlet Kizaru Animanga cabang Jakarta dan Bandung.','Alternative Rock','guitar_plus;poster;teman;','Jakarta',1212,'2017-09-06 14:16:02','2017-09-06 14:16:02'),
	(766,'TSOS','1504711002.jpg','Berbicara tentang prestasi, sampai saat ini, kami telah merekam dan merilis sebanyak 12 lagu yang dapat didengar di berbagai music store seperti Spotify, iTunes, Soundcloud, dll. di mana 5 di antaranya masuk ke dalam Mini Album kami yang berjudul “With Words”, yang resmi kami rilis pada bulan Mei 2016.','Pop','instagram;','Jakarta',1308,'2017-09-06 14:16:42','2017-09-06 14:16:42'),
	(767,'Mery Celeste','1504711188.jpg','Mery Celeste, merupakan Band Indie Pop/Rock lahir di Bogor pada tahun 2013. Nama Mery Celeste juga dipilih Oleh Rifqi Danu sang vokalis, yang merupakan nama suatu Kapal Kargo yang hilang di Samudra Atlantik. Mery Celeste baru merilis 2 single berjudul Orange dan Sham. Keduanya pernah memenangkan beberapa chart di beberapa media, seperti 1st Chart DCDC Musikkita Indie 2016, Hits Play Sushi 99.1 FM Padang, 1st Chart Demos Hai Magazine (Oct 2015), 1st Chart Indie Pro 2 RRI Bandung 2015, 1st Chart Oz Radio Bali 2015. Selain itu mendapatkan juga apresiasi sebagai, 1st Best Indie Band RRI Indonesia, 1st Band Indie Jakarta Audio Pro, Finalis Road to Soundrenaline Bali. Pada tahun 2016 Mery Celeste diberikan kesempatan berharga bisa kolaborasi bersama salah satu band idola Pure Saturday (Bandung) di GlobalTv pada acara DCDC Musikkita.','Pop','instagram;umi;maliq;teman;','Jakarta',1298,'2017-09-06 14:19:48','2017-09-06 14:19:48'),
	(768,'VETO','1504711937.jpg','Veto adalah band bernuansa Pop yang siap menggebrak industri musik Indonesia dengan lagu yang bertemakan cinta, perjuangan dan harapan','Pop','guitar_plus;','Jakarta',989,'2017-09-06 14:32:17','2017-09-06 14:32:17'),
	(769,'NINETY','1504713060.png','Ninety is an Indonesia Band with four personnel formed in August 2013 in Jakarta, Indonesia. It currently consists of Arya Nara Kusuma, Ryan Rizki Ramanda, Dimas Dzulfi Kurniawan, and Lanang Hanggoro. Their music style is inspired by the sound of 90\'s. The band brought their songs to the stream music of rock','Rock','instagram;teman;','Jakarta',1305,'2017-09-06 14:51:00','2017-09-06 14:51:00'),
	(770,'RAP N RESPECT','1504713464.jpg','Kami grup band asal Solo yang terbentuk pada tanggal 10/10/2010. Sempat beberapa kali berganti personil, dan pada saat ini kami beranggotakan 6 orang yaitu Syahrul (rapper), Yuditya (rapper & human beatbox), Wahyu (vokal & bass), Raihan (gitar 1), Sabar (gitar 2) dan Azri (drum). Kami sepakat dari awal terbentuk bermusik di genre hiprock, berkiblat pada Bondan Prakoso & Fade2Black, Saint Loco, Linkin Park.\r\n\r\nKenapa memilih hiprock? Karena menurut kami hiprock adalah jiwa kami, it’s our soul. Dan menurut kami di Solo atau bahkan di lingkup Surakarta pada umumnya, masih jarang yang mengabungkan sebuah rap digarap dalam format full band seperti ini. Kami coba mengambil “celah” yang berbeda dari kebanyakan genre musik yang laku dan booming pada saat ini. Kami tetap optimis untuk ber-hiprock karena kami yakin bahwa setiap genre musik itu pasti ada penikmatnya masing-masing.','Others','guitar_plus;','Yogyakarta',420,'2017-09-06 14:57:44','2017-09-06 14:57:44'),
	(771,'Violet Fighters','1504713938.jpg','Violet Fighters Band adalah band yang berasal dari kota Palembang yang terdiri dari empat personil yaitu Didit ( Vocal, Guitar ), A\'uw ( Guitar Lead ), Adi ( Bass ) dan Reza ( Drum ) yang masing masing personel berbeda style dan karakter serta latar belakang musik yang berbeda juga, namun saling melengkapi karena semua personel Violet Fighters menyukai berbagai jenis musik dan menerapkan dalam setiap permainan mereka, namun Violet yang berdiri pada tahun 2010 tetap solid dan selalu saling memahami porsi masing-masing personel dan juga kekeluargaan pastinya. Band Violet ini Pernah bermain bersama atau mengiringi artis-artis seperti Bang Ariyo Wahab The Dance Company, Candil Serius Band, Andy RIF, Judika dll dan juga Performing di acara Big Event dan juga Off air event di kota Palembang serta di Hotel dan Cafe-cafe ternama di kota Palembang. Band- band besar seperti U2, Xtreeme, Nirvana, Foo Fighters, Travis, Blink 182, Maroon 5 memiliki pengaruh besar di band ini namun Violet Fighters tetap memiliki karakter bermusik khas sendiri dan tertuang dalam karya yang berjudul \"Garis Batas\" dan ikut serta dalam Levi\'s Band Hunt dan ingin bisa memberi warna baru dalam dunia musik Indonesia, Maju terus Musik Indonesia. Suksess teruss Levi\'s dan Levi\'s Band Hunt Big Thanks','Alternative Rock','facebook;instagram;informasi_toko;umi;poster;teman;','Jakarta',1196,'2017-09-06 15:05:38','2017-09-06 15:05:38'),
	(774,'suburbians','1504720486.jpg','Suburbians, adalah band yang terdiri dari tiga orang yang terbentuk pada pertengahan 2016, mengusung genre Alternative Sad-Punk. Terbentuk di kota Bekasi, Jawa Barat. Band ini terbentuk karena pertemanan semasa SMA yang mana karena kesukaan dalam bermusik dan keinginan untuk mengibarkan bendera di kota kami sendiri.','Others','facebook;informasi_toko;poster;teman;','Jakarta',1120,'2017-09-06 16:54:46','2017-09-06 16:54:46'),
	(775,'vocad band','1504720768.jpg','Konser di acara band anak muda (BAM) TVRI riau ... live acara lagu pilihan pemirsa (LPP) distasiun TVRI riau ... lolos seleksi jadi band pembuka kotak di acara soundstations roud to soundrenaline 2017 di lap.bola pangkalan kerinci riau... diundang on air dipersada radio pekanbaru di acara local heroes','Pop','instagram;','Jakarta',402,'2017-09-06 16:59:28','2017-09-06 16:59:28'),
	(776,'BEMBI','1504721838.jpg','Teman-teman seperjuangan dari kafe ke kafe, hingga wedding dan event, kami memutuskan untuk mencoba membuat karya sendiri. Kami punya sebuah tujuan sederhana, yaitu membangkitkan kembali semangat musik band pop yang pernah populer di tahun 1990-2000an.','Pop','maliq;','Jakarta',1323,'2017-09-06 17:17:18','2017-09-06 17:17:18'),
	(777,'NOY BAND','1504723419.jpg','NOY terbentuk dari tahun 2011 yang mengusung aliran trans pop, berasal dari kota Palembang yang beranggotakan lima personil Reva (vocal), Dedi (gitar), Hafizh (gitar), Agus (bass), Eby (drum)\r\n\r\nFilosofi NOY itu sendiri adalah singkatan dari sebuah kata \"Not Only You\" (bukan hanya kamu), dan NOY pun kami definisikan suatu keoptimisan dalam hal positif yang dimana setiap orang bisa untuk menggapai sebuah impiannya yang tak terbatas bukan hanya kamu,aku, ataupun mereka\r\n\r\nTema dari musik yang kita buat tetap ada unsur cinta dan kehidupan yang dikemas dari ide2 kita berlima dengan influence yang berbeda','Pop','instagram;','Jakarta',1160,'2017-09-06 17:43:39','2017-09-06 17:43:39'),
	(778,'TELECOUSTIK','1504724580.jpg','Juara indigital fest quardata 2017','Pop','facebook;instagram;guitar_plus;lainnya;','Jakarta',1326,'2017-09-06 18:03:00','2017-09-06 18:03:00'),
	(779,'COFFEE STRIKES','1504726341.jpg','COFFEE STRIKES adalah band yang terbentuk di Kota MEDAN pada tanggal 22 November 2014.\r\nCOFFEE STRIKES memulai gerakan musiknya dengan mengupload video-video cover musik di YouTube dan Instagram dengan ciri khas\r\n“ROCK VERSION” pada setiap lagu yang mereka cover.\r\nKarena mendapat respon yang baik dari audiens, mereka sepakat untuk menciptakan mini-album yang didalamnya berisikan lagu-lagu original ciptaan sendiri.\r\n\r\nPrestasi :\r\n- 10 besar dalam kompetisi Digital Icon di Jakarta perwakilan dari Medan (saat itu masih bernama AFTERNOON Band)\r\n- Juara 2 pada festival band \"Rock Pool\" di Kota Medan\r\n- Juara 2 pada festival band \"Road to NORTHBLAST\" di Medan\r\n- Best guitarist pada festival band \"Road to NORTHBLAST\" di Medan','Alternative Rock','facebook;instagram;guitar_plus;umi;poster;teman;','Medan',1146,'2017-09-06 18:32:21','2017-09-06 18:32:21'),
	(780,'D\'Minim','1504726918.jpg','Mengisi acara karnaval ancol\r\nMengisi acara dalam rangka HUT kota Bekasi\r\nMengisi acara dalam rangka Pekan Raya Jakarta','Others','facebook;instagram;teman;','Jakarta',1321,'2017-09-06 18:41:58','2017-09-06 18:41:58'),
	(781,'Lune','1504730141.jpg','Bermula dari sharing tentang musik bareng, kemudian atas dasar hasrat bermusik kami tercetuslah band ini. Mengusung genre Rock/Stoner, kami terinspirasi oleh band seperti Black Sabbath, Sleep, Pentagram, The SIGIT.','Rock','instagram;','Jakarta',1322,'2017-09-06 19:35:41','2017-09-06 19:35:41'),
	(782,'Vaterland Band','1504750102.png','Berawal dari mempunyai hobi dan bercita-cita di musik, Andri dan Dzikri adalah satu Grup Band sewaktu SMA. Setelah lulus SMA kami bubar dan berjalan sendiri-sendiri. Setelah lewat 1 tahun Andri dan Dzikri memutuskan untuk bergabung dan membuat Band kembali, tanpa banyak membuang waktu kami pun bertemu dengan Hendri, [Hendri sendiri adalah teman Band Dzikri sewaktu dulu di SMP]. Setelah posisi terisi ber 3 kami pun membentuk band tanpa Drummer, terpaksa posisi Bassist di alihkan menjadi Drummer \"Sementara\" melewati pencarian yang rumit akhirnya masuklah Ryan, [Ryan sendiri adalah teman kerja Andri] setelah masuknya Ryan sebagai Drummer kemudian di susul masuknya Inno yang menempati posisi Vocalist, [Inno sendiri adalah teman kerja dari Andri dan Ryan]. Setelah membicarakan Band ini ternyata kami ber 5 cocok 1 sama lain, 1 mimpi dan 1 cita-cita, dari kecocokan ini kami mencoba untuk menyatukan semua perbedaan yang ada, untuk genre musiknya sendiri kami memutuskan untuk mencoba menyatukannya lewat musik yang kami usung \'Alternatif\' (Pop Rock). Nama VaterLand sendiri pun akhirnya kami tetapkan sebagai tempat penaungan karya-karya kami, VaterLand sendiri yang kami ambil dari bahasa Jerman yang berarti TANAH AIR mewakili filsuf yang berarti bahwa kami mencintai tanah air, siap berdiri dan melangkahkan kaki di blantika musik tanah air. Mengapa menggunakan bahasa asing jika cinta tanah air..? Karena kami berharap, tidak hanya di tanah air, tapi musik kami bisa sampai ke negeri lain. Dengan kami mencoba mengedepankan karya dan cita-cita semoga kami dapat diterima di industri musik Indonesia.\r\nlalu kami dan seluruh anggota memutuskan untuk berinovasi dengan membuat projek baru dengan Kiki (teman kerja dari Andri, Inno dan Ryan), yang sejak pindah ke Pringsewu ikut mendukung VaterLand (sebagai manajer) sebagai vokalis menggantikan Inno yang memutuskan untuk fokus memperdalam kemampuan bermusiknya (sembari memegang peran manajer menggantikan Kiki).\r\nSemoga dengan formasi baru ini VaterLand dapat semakin berkembang dan mampu melebarkan sayap hingga ke seluruh penjuru negeri.\r\n\r\nPenghargaan\r\n~ Live perfome di PRESMOVE MARKET 2017 di Pringsewu, MIE TIME CAFE tgl 19 Agustus 2017.\r\n\r\n~ Pringsewu Rockinmob 2017 di Pringsewu, Rest Area Pringsewu tgl 5 dan 17 Agustus 2017.\r\n\r\n~ Guest star di Putri Hijab Tanggamus 2017 di Gedung NU, Gisting tgl 14 Mei 2017.\r\n\r\n~ Juara Harapan 1 Pringsewu Acoustic Parade #2 yang di selenggarkan di Sokrim Cafe tgl 17 Juni 2017.','Alternative Rock','teman;','Jakarta',1224,'2017-09-07 01:08:22','2017-09-07 01:08:22'),
	(783,'MANUVER','1504753301.jpg','BAND ASAL BATAM, TERBENTUK 2016 AWAL \r\nTELAH MEMILIKI 3 SINGLE JAGOAN..','Pop','facebook;instagram;teman;','Jakarta',1314,'2017-09-07 02:01:41','2017-09-07 02:01:41'),
	(784,'Lada','1504753342.jpg','Lada adalah band asal Cibinong, Bogor yang memiliki segudah prestasi. Band yang digawangi oleh Ale Funky dan Cyntia ini terbentuk atas kesukaan mereka terhadap musik pop rock era 90-an. Ale sendiri adalah salah satu juara perta Supergitar Competition tahun 2015 lalu. Lada juga pernah menjadi juara di ajang festival band di Cibinong pada 2014 lalu.','Rock','guitar_plus;','Jakarta',1339,'2017-09-07 02:02:22','2017-09-07 02:02:22'),
	(785,'HIVE ID','1504754332.JPG','Berawal dari band kampus yang dibentuk oleh Faisal, Aha, dan Aris di akhir 2010, mimpi yang besar dan keinginan untuk tetap menjalankan passion bermusik walaupun setelah lulus kuliah menjadikan HIVE tetap eksis hingga sekarang.\r\n\r\nTelah aktif manggung di Jakarta sejak akhir 2015 khususnya di scene indie berbasis komunitas tempat mereka aktif bersosialisasi, 101% Music Community, HIVE mulai dikenal luas di Jakarta, dan telah bermain di beberapa panggung besar seperti panggung Cardinal di Pekan Raya Jakarta dan juga telah pernah tampil live sebagai guest star di program Teras Sore di Elshinta TV.\r\n\r\nKini di tahun 2017, HIVE fokus kembali ke root mereka sebagai musisi yaitu untuk berkarya, kembali ke studio untuk menyelesaikan beberapa lagu barunya yang siap untuk direkam dan diperdengarkan ke khalayak.\r\n\r\nKesempatan yang ditawarkan Levi\'s Band Hunt merupakan peluang emas bagi HIVE untuk bisa mendapatkan partner yang mumpuni dalam memperdengarkan karya-karya bermusik terbaru mereka, karya musik yang memadukan karakter vocal falsetto khas dari Aha yang berbau Japanese Rock, dengan aransemen musik khas British yang banyak dipengaruhi oleh Radiohead, Oasis, dan tentunya, The Beatles.\r\n\r\nGet ready to be HIVED.\r\n\r\nFB Page: https://www.facebook.com/HIVE.ID.OFFICIAL/\r\nTwitter: @HIVE_ID\r\nYoutube Channel: https://www.youtube.com/channel/UC1s4jn4MzCy63uNKwlgT1Sw','Alternative Rock','instagram;','Jakarta',1341,'2017-09-07 02:18:52','2017-09-07 02:18:52'),
	(786,'Syntesis','1504755179.jpg','Kami adalah band berasal dari Pringsewu Lampung yang ingin bercita cita menjadi band yang punya karakter bermusik tersendiri, band kami pernah mengikuti festifal musik dan masuk kedalam 5 besar, dan mendapt 2 piagam, kami juga sering mengisi acara di cafe cafe.','Pop','instagram;guitar_plus;','Jakarta',962,'2017-09-07 02:32:59','2017-09-07 02:32:59'),
	(787,'Walker','1504755297.jpg','Walker\r\nIndonesian Thrash Metal ,Cikalong Wetan , Bandung Barat.ID\r\n\r\nWalker adalah band yang berbasic aliran thrash metal, pada awalnya Walker hanya fokus pada materi lagu lalu dimainkan di studio, dikarenakan kesibukan para personil masing-masing. pada suatu waktu ada ajang pencarian bakat yaitu Hellprint West Java Invasion 2015,Walker mencoba peruntungan di ajang pencarian bakat tersebut. Dan tidak disangka ternyata Walker berhasil menjuarai ajang pencarian tersebut. Kini Walker sedang dalam menjalani promo album yang bertitle Mr.Walker dan akan membuat E.P di akhir tahun 2017 ini.\r\n\r\nContact : Subhan Rizal\r\nSms/Phone: 0896-5395-5936\r\nEmail : walkerthrash06@gmail.com\r\nFacebook : Walker Thrash\r\nInstagram : @walkerthrash\r\nTwitter : @walkerthrash\r\nAnother website:\r\nsoundcloud.com/walkerthrash \r\nreverbnation.com/walkerthrash\r\nhttps://www.youtube.com/channel/UCp4LDmdGfCoChD-mEjc-mRA','Others','facebook;instagram;guitar_plus;umi;poster;teman;lainnya;','Jakarta',1259,'2017-09-07 02:34:57','2017-09-07 02:34:57'),
	(788,'maGna','1504755501.jpg','magna terbentuk sejak tahun 2008 di kota Bogor..awal kami terbentuk karena persamaan visi dalam bermusik..sudah banyak event yang kita lalui seperti musik asik nesacafe..event radio bogor di megaswara fm,lesmana fm dsb..akhir kata mudah2 an kami bisa melangkah lebaih baik dan maju lagi dengan mengikuti event dari Levi\'s..\r\n\r\nSalam dari kami,\r\nMaGna','Pop','instagram;','Jakarta',1338,'2017-09-07 02:38:21','2017-09-07 02:38:21'),
	(789,'JackLine','1504757312.jpg','Dibentuk pada 1 oktober 2014, band kita bergenre MoodFlusso , kenapa genre kami moodflusso karena di lagu pada album kami terdapat banyak sekali genre. dari pop, funk, rock, folk, dan lain-lain. dan masih belum kita sebarluaskan\r\n\r\nJackLine pernah mendapatkan juara 2 pada tahun 2015 di acara festival diesnatalis ITS Surabaya\r\ndan festival WR. Soepratman di kaza city mall mendapatkan juara 3','Alternative Rock','instagram;','Surabaya',595,'2017-09-07 03:08:32','2017-09-07 03:08:32'),
	(790,'Good News','1504757314.jpg','Sebuah Band yang solid','Pop','instagram;','Jakarta',1333,'2017-09-07 03:08:34','2017-09-07 03:08:34'),
	(791,'BANANA PROJECT','1504760623.jpg','Banana Project adalah sebuah proyek iseng2 yang bisa dipertanggung jawabkan. Berawal dari keresahan akan situasi dimana industri musik yang kini semakin tidak jelas dan sebagai bentuk kekecewaan kami kepada lebel karena sempat memberi harapan angin surga. kami memutuskan untuk jalan dengen independent mengerjakan segala sesuatunya sendiri. Kami berdomisili diKota Bandar Lampung \r\n\r\nPresetasi -','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',1344,'2017-09-07 04:03:43','2017-09-07 04:03:43'),
	(792,'After Midnight','1504760649.jpg','After Midnight adalah sebuah band bergenre pop punk yang didirikan pada 21 April 2016 asal Bandung yang menggabungkan antara genre pop, rock, alternatif, melodic punk. After Midnight pernah mengikuti festival band Pasundan dan Supermusic ID Rockin Battle 2017.','Alternative Rock','guitar_plus;','Jakarta',1346,'2017-09-07 04:04:09','2017-09-07 04:04:09'),
	(793,'Jejak Awan Pesawat','1504761789.jpg','Jejak Awan Pesawat adalah sebuah band atau kelompok musik yang terbentuk pada tanggal 3 juni 2016 berasal dari kota Bandung, yang awal mulanya hanya sebuah project kecil2an untuk sesuatu hal, tapi lama kelamaan malah semakin menjadi seurius untuk di jalani, yang didirikan oleh 3 orang yaitu cepi, eki dan dyka, didirikan karena atas kecintaan kami terhadap musik dan hobi yang sama, lalu masuklah ahmad untuk mengisi kekosongan di posisi drum, karena saat itu posisi drum sedang kosong, karena kami bertiga tidak ada yang mengisi posisi itu. Nama Jejak Awan Pesawat sendiri kami ambil dari salah satu judul lagu sebuah idol group. Jejak Awan Pesawat mengusung jenis musik yang bergenre pop alternatif, tapi di setiap lirik dan musiknya kami berusaha memasukan bahasa dan musik2 sunda, jepang dan inggris.\r\nKalau masalah prestasi kami belum pernah mendapatkan prestasi, karena band ini masuk baeu terbentuk, tapi pada tahun 2016 kami pernah lolos audisi dan manggung di acara kick fest.','Pop','guitar_plus;','Jakarta',1347,'2017-09-07 04:23:09','2017-09-07 04:23:09'),
	(794,'Jumper Fi','1504762957.JPG','Jumper Fi adalah band modern rock masa depan. Dipimpin Cas Coldfire di garda depan sebagai vokalis, kharismanya yang kuat dan power vokalnya yang gagah namun melodic memberi nyawa dan identitas yang kuat. Gitaris Tino Hutabarat yang meledak-ledak semangatnya membuat crowd juga ikut terbakar. Jupiter Jupi di sector bass memberi rhythm section yang solid namun sarat musikalitas. Kevin Sugito di sector drum, selain sebagai tulang punggung musik yang kokoh juga memberi atraksi ‘akrobat’ stick drum yang memukau. Jujur, menonton band ini akan sangat sukar untuk membagi perhatian mata kita karena semua sector sangat atraktif. Prestasi musik antara lain adalah pernah menjadi 5 Besar finalis di ajang Indonesia Planet Rox 2016','Rock','guitar_plus;','Jakarta',1348,'2017-09-07 04:42:37','2017-09-07 04:42:37'),
	(795,'Niwakaraa','1504763536.JPG','Band ini terbentuk dari 2008,\r\nsudah menelurkan 2 album, yaitu Heartnote dan Revive\r\n\r\ndan telah manggung dibeberapa gigs, pensi, dan event lainnya.','Rock','instagram;teman;','Jakarta',1273,'2017-09-07 04:52:16','2017-09-07 04:52:16'),
	(796,'Redwine','1504766179.JPG','PROFIL REDWINE MUSIC\r\n \r\nRedWine Music adalah sebuah group band yang terbentuk pada tanggal 6 November 2015. Didirikan atas dasar kecintaan setiap personilnya terhadap musik. Masing-masing personil memiliki berbagai latar belakang dan basic yang berbeda namun memiliki VISI dan MISI yang sama dalam bermain musik, RedWine Music berkeinginan bermain musik untuk memuaskan semua publik . Maka terbentuklah RedWine Music yang membawakan jenis musik bernuansa Fussion Jazz.\r\n\r\nTujuan RedWine Music membawakan jenis musik ini adalah untuk mengisi acara di Café, pentas seni, tempat hiburan serta tidak tertutup kemungkinan mengisi acara musik di panggung-panggung indoor maupun outdoor. RedWine Music lebih mengutamakan live perfomance dan entertain sehingga audience akan merasa menikmati dan puas dengan penampilan RedWine.\r\n\r\nDalam perwujudannya RedWine Music akan menyuguhkan suatu pertunjukan yang menarik untuk dinikmati dan dikemas secara professional. RedWine Music menawarkan sebuah konsep musikalitas untuk meramaikan suasana tempat. Konsep kami menyuguhkan hiburan segar dengan penampilan profesional yang tidak hanya mementingkan keindahan harmonisasi musik belaka tapi juga menampilkan suatu perfomance yang atraktif.\r\n\r\nDengan demikian audience akan merasa terhibur dan merasa puas dengan penampilan RedWine Music serta ingin kembali lagi untuk mengunjungi tempat-tempat yang sudah kami kunjungi dan sponsor, serta dukungan anda .Besar harapan kami untuk bisa bekerjasama.\r\n \r\nTidak lupa juga, RedWine Music memiliki single perdana yang berjudul “Titik Nol”, dalam beberapa kedepan RedWine akan menyelesaikan albumnya pada tahun 2018.\r\n\r\n* PRESTASI : \r\n \r\n- MALAM KEAKRABAN UNIVERSITAS SURABAYA 2016, SURABAYA\r\n \r\n- MASTECH GADGET FEST 2016, GIANT WARU SIDOARJO\r\n\r\n- FRIDAY M LIVE, M RADIO 98.8 FM SURABAYA.\r\n\r\n- WHITE MODJO, MOJOKERTO\r\n\r\n- ACOUSTIC LAND, EATORLAND SURABAYA\r\n\r\n- YOX’S MUSIC COURSE, M RADIO SURABAYA.\r\n \r\n- MALAM AKRAB SENI, UNIVERSITAS SURABAYA 2017\r\n\r\n- UBAYA CULTURE FESTIVAL, UNIVERSITAS SURABAYA 2017\r\n \r\n - RISE TO GLORY, UPN VETERAN SURABAYA 2016\r\n\r\n- MARKETING EXPO, UNIVERSITAS AIRLANGGA SURABAYA 2016\r\n\r\n- GO A HEAD PEOPLE 2016, SURABAYA','Jazz','instagram;lainnya;','Surabaya',1349,'2017-09-07 05:36:19','2017-09-07 05:36:19'),
	(797,'HYRA','1504767493.JPG','HYRA adalah band yang berasal dari Yogyakarta, terbentuk di salah satu Universitas swasta di jogja,pada tahun 2014, akhir cerita terbentuklah 4 anggota band HYRA, Rohmat (vokal),  habibi (guitar),  yanda (bass),  adi (drums),  dengan mempunyai satu tujuan,  yang bergenre pop kekinian. HYRA memiliki satu mini album, terdiri dari 4 lagu.salah satunya akan di kirim linknya ke audisi levi\'s ini. Prestasi juara 1 band acoustic se\'Univ Janabadra, juara 2 festival band antar kampus, juara 3 festival band se\'bantul.','Pop','facebook;','Yogyakarta',1354,'2017-09-07 05:58:13','2017-09-07 05:58:13'),
	(798,'Andalusia','1504768595.JPG','Berawal dari teman nongkrong dan juga teman dekat, band yang terbentuk awal tahun 2017 ini awalnya hanya ingin menciptakan materi untuk specialist recording, namun juga tidak banyak cerita dan prestasi yang telah dibuat\r\ndikarekan yang bentrok dengan kesibukan masing-masing\r\n\r\ntetapi jauh sebelum ini, mereka terlebih dahulu sudah eksis dengan bandnya masing-masing sebut saja Ismu sang vocalist, dia lebih dulu terjun di bidang film dan iklan maupun video clip, Lanjut cerita ada Ady sebagai drumer yang telah lama bergabung dengan band D`Mozza. \r\nKhusus untuk pembetot bass di isi oleh Angger dia dulu sempat bergabung dengan band KATA dan Hunian.\r\n\r\nDi posisi gitar ada Gitagkumala yang masih tergabung dari band DEGA saat ini, namun sayang sekali posisi dia disini cuma sebagai addtional, sama hal juga dengan Eko dia juga additional keyboard dari band ini, dan Eko sendiri sudah lama bergabung dengan band Pillo sampai saat ini.\r\n\r\nBerbicara soalnya ajang kompesti yang sangat bergengsi ini kami jujur sangat antusias untuk mencapai jadi yang terbaik','Pop','facebook;','Jakarta',1357,'2017-09-07 06:16:35','2017-09-07 06:16:35'),
	(799,'Melody of Jessica','1504768786.jpg','Band yang awalnya bernama \"Next Uprising\" terbentuk pada tahun 2010 mempunyai 6 personel. Berbagai gigs dan event banyak kami ikuti. Beberapa yang berkesan adalah termasuk dalam album kompilasi band-bang indie di kota kami yaitu \"Gresik Band Community\" dan menjadi finalis \"LA Lights Indie Community\" di Surabaya. Kami juga pernah beberapa kali mengisi acara \"Indiekustik\" di stasiun TV lokal SBO TV.\r\n\r\nNamun seiring berjalan waktu dan kesibukan, beberapa personel memilih berhenti. Hanya tersisa Fachrizal \"Cecha\", Fahrezal \"Icang\", dan Bagas. Kami masih sering bermain di gigs dengan nama \"Next Uprising\" sampai akhirnya kami memilih untuk berganti nama. Lalu kami memutuskan berganti nama menjadi \"Melody of Jessica\" dan diikuti dengan masuknya personel baru yaitu Hernawan.\r\n\r\nTak banyak gigs yang kami ikuti, tapi kami lebih sering memproduksi lagu di rumah. Entah itu lagu cover artis lain atau lagu yang kami ciptakan sendiri. Fun fact, lagu-lagu band kami semuanya kami produksi sendiri di rumah.','Pop','facebook;','Surabaya',437,'2017-09-07 06:19:46','2017-09-07 06:19:46'),
	(800,'BM','1504769778.jpg','Band Ini Terbentuk Dari Teman Setongkrongan Yang Mempunyai Visi Dan Misi Yang Sama','Pop','teman;','Jakarta',1361,'2017-09-07 06:36:18','2017-09-07 06:36:18'),
	(801,'AFMA','1504770480.jpeg','AFMA terbentuk dari Singkatan dari Kalimat \"Angel From My Nightmare\" AFMA Lahir diTahun 2011 dengan Visi Misi Sebagai Band Heavy Metal dan sebagai Band Tributte Avenged Sevenfold dari Jakarta, Experience AFMA yaitu sebagai Band Guestar pengisi Acara Pentas Seni diSekolah Sekolah Seperti PENSI dan diAcara Band Tributte, Experience AFMA sendiri Kami pernah meraih Pemenang juara Pertama di Acara Battle Band Of Tributte Avenged Sevenfold, dan pernah bekerja sama dalam beberapa waktu kontrak bersama Al Ghazali dan Ahmad Dhani, dan kini kami sedang dalam proses pembuatan mini Album yang berjudul \"HeartBreakers\"','Heavy Metal','instagram;teman;','Jakarta',1345,'2017-09-07 06:48:00','2017-09-07 06:48:00'),
	(802,'TENHOLES','1504771047.jpg','Tenholes dibentuk pada bulan Oktober 2003 dimana pada saat itu scene Oi! dan Punk agak surut di Jakarta. Banyak band lawas berguguran,bubar dan vakum tak berkesudahan karena rehab,bui, bahkan ditinggal mati personil. Ukien (Achmad Muchlis) yang saat itu hampir memutuskan untuk berhenti dan meninggalkan dunia Underground karena vakum tak berkesudahan band nya yang terdahulu (The Useless). Alm Botaka (eks RGB) dan Ambonasty (Overcast) jadi dua sosok yang berhasil meyakinkan Ukien untuk membentuk band lagi dengan konsep yang lebih mengalir, genre yang disuka dan terarah. Meski masa-masa awal Tenholes banyak di pengaruhi Blitz, Cock Sparrer, Sham69 sampai The Business, Tenholes tidak ingin menjadi epigon dan memilih mengeksplor musikalitas masing-masing. Ketika Danny Mcblewer masuk mengisi formasi dan menularkan Dropkick Murphys dengan Celtic Punk nya. Gotcha! ini lah ide yang muncul pada saat itu yang menggabungkan musik Celtic yang dikemas dalam bentuk Punk Rock. Album pertama \'This is Fun This is Oi! This is Tenholes\' rilis tahun 2008 dibawah naungan Warriors Record dan Album \'Loyalty\' rilis pada tahun 2016 oleh Bergerak Records dengan dua single promo yang dirilis secara free download. Tenholes saat ini beranggotakan Ukien Bstrd (Voc), Andry (Guitar), Endry (Guitar), King Ewin (Mandolin), Aco (Drum), Bary (Bass).','Others','guitar_plus;','Jakarta',1291,'2017-09-07 06:57:27','2017-09-07 06:57:27'),
	(803,'Soulight','1504771891.jpeg','New Simply Souling Music Project','Others','facebook;instagram;teman;','Jakarta',1359,'2017-09-07 07:11:31','2017-09-07 07:11:31'),
	(804,'ROBBRS','1504772701.JPG','We found each other amidst our last dreadful years of university. Based in Yogyakarta, it started in early 2016 with just four people (Farigh, Lintang, Maher, and Icang) who study in the same faculty until later we met Awan on the way. Our knowledge in music varies as well as our taste and the genres that build us. Awan and Farigh both mostly listen to jazz; while Awan grew up with his guitar and a touch of pop-rock, Farigh has his heart on bass with neo-soul and hip-hop. Lintang as the vocalist has a strong connection with modern pop-punk bands and a handful of female solo pop musicians who are mostly from YouTube. Maher drums his way through a couple of brit-pop, pop-dance, and pop-jazz, and Icang strums his guitar with Japan 80’s Future Funk and Asian Vaporwave. With all the differences they push us to learn more about music from each other and help us explore our genre in ROBBRS.\r\nIt is safe to say that in ROBBRS we express our music via pop-alternative and our lyrics reach for the young adults who, even though most of the time question life itself, sometimes drown in their feelings. For now, we are still independent in sharing our music; We are extremely lucky to have a supporting environment where there are genuine people helping us grow and get through the music scene.\r\n\r\nWe have been blessed and very thankful to have been on several different stagesfor this past year. Some that challenged us, some that kept us humble. To pick one stage and tell the experience in detail in just a letter is an understatement because each stage has its own unique story. However, this is how ROBBRS is summed up throughout the year:\r\n	Urban Gigs by was our peak, with Monita Tahalea choosing us to play for her opening after hearing our first single, Spell You Do. It was the same day that we played at Malioboro in Malioboro Night Festival, the first time we had two gigs in one day and ended up in pain relief patches.\r\n	We also went on a trip to Jakarta with a 12-hour drive from Yogyakarta for a gig in Konser 1000 Band at BSD City and in Lalala Festival at Cikole, Lembang; those were quite special as we were chosen from a bunch of other bands who applied as well.\r\n	The night we met Stars and Rabbit in Foodiest’s Soft Opening was also a very magical one. We played right before them and the appreciation was overwhelming, they even gave us a shout out on stage saying they liked our originals.\r\n	Living in ‘the center of education’ or‘the city of students’, we have the advantage of playing in various campus environment such as HI Peace Festival, Evofest, Creative Days, Tourism Fair, and Korean Street Food Festival just to name a few.\r\n	And aside from all those exposures, we always manage to have some time for the small indie gigs and mingle with fellow indie musicians to support each other’s work.\r\n\r\nIt has been our dream from the beginning to push our limits and focus on creating and presenting our music to an audience. We still cannot forget how nervous and agitated we were the first time we played a full set-list of our own originals, how we were excited to record our very first song and share it on social media with amazing feedbacks from our friends and family. Our dream has slowly but surely been progressing and we cannot be more grateful about it.\r\nAlso we have released Silence EP on July 2017.','Pop','instagram;teman;','Yogyakarta',1358,'2017-09-07 07:25:01','2017-09-07 07:25:01'),
	(805,'fatkiller','1504774419.JPG','pengisi acara di Konser 1000 band Ice BSD\r\nPengisi acara di Jakarta fair 2017, Gambir Stage\r\nHeadline acara rock 90s tribute di atamerica','Rock','instagram;','Jakarta',1368,'2017-09-07 07:53:39','2017-09-07 07:53:39'),
	(806,'JUST ALKINGS','1504775857.jpg','KITA BERTIGA ADALAH KARYAWAN, KAMI BARU MEMBENTUK BAND INI DI TAHUN 2017. KAMI MEMILIKI PASSION YANG BESAR DI MUSIK. MANJA ADALAH SALAH SATU KARYA TERBAIK KAMI DAN LAGU PERTAMA YANG KAMI BUAT DEMONYA. OLEH KARNA ITU KAMI MAU MENCOBA DI LEVIS BAND HUNT INI UNTUK MEMULAI KARIR KAMI DI DUNIA MUSIK.  SEMOGA KARYA KAMI BISA DITERIMA OLEH SEMUA ORANG. GOD BLESS.','Pop','guitar_plus;','Jakarta',1000,'2017-09-07 08:17:37','2017-09-07 08:17:37'),
	(807,'Fayola','1504775965.jpg','Band yg berdiri pada pertengahan tahun 2015 ini sudah melewati banyak proses, mulai dari pergantian personil hingga sampai saat ini adalah formasi paling solid. Fayola pernah bermain di beberapa event besar & pensi, contohnya adalah IDP Fest 2017','Pop','teman;','Jakarta',1343,'2017-09-07 08:19:25','2017-09-07 08:19:25'),
	(808,'Smiling Horse','1504776190.jpg','Smiling Horse is a band with Rock N\' Blues/Expanded Blues genre. The name itself represents strong, royal, teamwork, brave, agile philosophy for reaching goals in music. So far, Smiling Horse was a winner for favorite band category at Psychofair 2016 UIN Jakarta and has been performing several times and some of them were big stages like Road to Soundrenaline, Jakcloth, and Indomusically Best Performances.','Rock','instagram;','Jakarta',1237,'2017-09-07 08:23:10','2017-09-07 08:23:10'),
	(809,'AK47 BAND','1504777081.jpg','Band Ak47 ingin menawarkan beberapa Karya Musik, & Terbentuk pada tanggal 01 Januari 2005','Pop','facebook;teman;','Jakarta',1365,'2017-09-07 08:38:01','2017-09-07 08:38:01'),
	(810,'Emotion Band','1504777806.jpg','Emotion adalah salah satu kelompok band musik bergenre Pop Rock Alternative yang terbentuk sejak tahun 2009, tapi sempat vacuum dan bersatu kembali di tahun 2013 dengan mempunyai lima personil tetap. Jimmy (Gitarist 1), Andri (Gitarist 2), Hendri (Basist), Martin (Drummer) dan Firly Natha (Vocalist). Kita juga berlima sebelumnya mempunyai band masing-masing, tapi dengan seiring waktu band kita itupun juga ikut vacuum. Maka dari itu kami berlima sepakat untuk membentuk band ini dengan berkeyakinan bisa mengekspresikan hobi bermusik kami kembali.\r\nNama Emotion itu sendiri yang artinya Emosi dalam konotasi positif, karena kami berlima mempunyai jenis aliran atau genre music yang berbeda-beda maka emosi kamipun juga berbeda-beda. Hanya dalam bermusik inilah kami bisa bersatu dan menggabungkan semua emosi kami serta visi misi kami untuk menciptakan hasil karya music yang bisa diterima dikalangan industry musik Indonesia. Serta Semoga kami juga bisa mengajak semua emosi pendengar kami ikut dalam alunan musik yang kami ciptakan.\r\n\r\nKalau Prestasi kita tidak ada, paling kita manggung-manggung di acara kampus dan jadi bintang tamu local di event-event musik di kota kita Palembang.','Alternative Rock','informasi_toko;poster;teman;lainnya;','Jakarta',1201,'2017-09-07 08:50:06','2017-09-07 08:50:06'),
	(811,'Emotion Band','1504777806.jpg','Emotion adalah salah satu kelompok band musik bergenre Pop Rock Alternative yang terbentuk sejak tahun 2009, tapi sempat vacuum dan bersatu kembali di tahun 2013 dengan mempunyai lima personil tetap. Jimmy (Gitarist 1), Andri (Gitarist 2), Hendri (Basist), Martin (Drummer) dan Firly Natha (Vocalist). Kita juga berlima sebelumnya mempunyai band masing-masing, tapi dengan seiring waktu band kita itupun juga ikut vacuum. Maka dari itu kami berlima sepakat untuk membentuk band ini dengan berkeyakinan bisa mengekspresikan hobi bermusik kami kembali.\r\nNama Emotion itu sendiri yang artinya Emosi dalam konotasi positif, karena kami berlima mempunyai jenis aliran atau genre music yang berbeda-beda maka emosi kamipun juga berbeda-beda. Hanya dalam bermusik inilah kami bisa bersatu dan menggabungkan semua emosi kami serta visi misi kami untuk menciptakan hasil karya music yang bisa diterima dikalangan industry musik Indonesia. Serta Semoga kami juga bisa mengajak semua emosi pendengar kami ikut dalam alunan musik yang kami ciptakan.\r\n\r\nKalau Prestasi kita tidak ada, paling kita manggung-manggung di acara kampus dan jadi bintang tamu local di event-event musik di kota kita Palembang.','Alternative Rock','informasi_toko;poster;teman;lainnya;','Jakarta',1201,'2017-09-07 08:50:06','2017-09-07 08:50:06'),
	(812,'Honeybeat','1504778555.jpg','Band acid yang terbentuk tahun 2009. tumbuh besar di komunitas jepang & jazz. untuk info lebih lanjut bisa diakses di www.facebook.com/honeybeat','Pop','instagram;guitar_plus;maliq;teman;','Jakarta',1370,'2017-09-07 09:02:35','2017-09-07 09:02:35'),
	(813,'The Colleagues','1504778667.jpeg','The Colleagues adalah band indie pop yang terbentuk di Bandung tahun 2011. Lagu pertama yang kami ciptakan berjudul \"Take It Easy\" dan kami membuat lima lagu lainnya hingga terbentuk sebuah EP album berjudul \"The Sweet Simple Colour\" pada tahun 2013 yang pertama kali dirilis oleh sebuah indie label di Inggris, Dufflecoat Records. Pada tahun yang sama, album EP pertama kami dirilis oleh sebuah indie label di Indonesia, Shinyhappy Records.\r\n\"The Sweet Simple Colours\" EP Album released in Cambridge, UK by Dufflecoat Records, 2013:\r\nhttp://www.dufflecoatrecords.fr/project/the-colleagues/\r\n\"The Sweet Simple Colours\" EP Album released in Depok, Indonesia by Shinyhappy Records, 2013:\r\nhttp://shinyhappyrecords.weebly.com/releases.html\r\n\"The Sweet Simple Colours\" EP Album sold out in Japan:\r\nhttp://www.thestonerecords.com/?pid=57582397\r\n\"I Can Never Be\" 5,000+ plays in South East Asia Indie (SEA Indie) Thailand:\r\nhttps://soundcloud.com/southeastasiaindie/sea-018-the-colleagues-i-can\r\n\"The Sweet Simple Colours\" EP Album and Band on-line and international review:\r\nhttps://www.discogs.com/Colleagues-The-Sweet-Simple-Colours/release/4622096\r\n\r\nhttp://thesoundofconfusionblog.blogspot.co.id/2013/04/the-colleagues-sweet-simple-colours-ep.html?m=1\r\n\r\nhttp://www.artisttrove.com/artist/374189429317168/The+Colleagues','Pop','informasi_toko;','Jakarta',1372,'2017-09-07 09:04:27','2017-09-07 09:04:27'),
	(814,'Lemon-T','1504779787.JPG','Lemon-T adalah sebuah group band yang terbentuk pada tanggal 11 Oktober 2016. Lemon-T dibentuk atas dasar kecintaan setiap personilnya terhadap musik. Masing-masing personil memiliki berbagai latar belakang yang berbeda namun memiliki visi dan misi yang sama dalam bermain musik. Lemon-T dalam perjalanan kariernya sudah pernah menjuarai beberapa festival musik seperti Festival akustik USU Medan 2016 (Juara 3), Festival Band di acara Dies Natalis Fakultas Ilmu Komputer USU Medan yang ke-5 (Juara 1), dan homeband regular di Kopi Takar Cafe&resto Jl. Setiabudi, Medan.','Pop','teman;','Medan',1306,'2017-09-07 09:23:07','2017-09-07 09:23:07'),
	(815,'BANTERR','1504779880.jpg','Berkumpul di awal tahun 2017 dengan mengusung indie garage rock sebagai garis musik yang akan kami jalani dan mengawali terbentuknya BANTERR.\r\n\r\nMeramu musik rock terdahulu dengan musik masa kini kami menunjukkan sebuah paduan nada, distorsi, dan skenario penuh irama.\r\n\r\nInstagram : @banterrmusic\r\nfacebook : /banterrmusic\r\nTwitter : @banterrmusic','Rock','instagram;','Jakarta',1366,'2017-09-07 09:24:40','2017-09-07 09:24:40'),
	(816,'NSFL','1504779910.jpg','NO STACK FOR LUCK atau yang biasa disingkat NSFL merupakan rock unit dari Bandung yang terbentuk di pertengahan 2017. Beranggotakan Nara (vocal), Mr. Pur (guitar), Chandra (bass), dan Qays (drums), NSFL bermula dari meng-cover lagu-lagu band-band Japanese Punk seperti SHANK, MONOEYES, dan FOUR GET ME A NOTS.\r\n\r\nNama NO STACK FOR LUCK sendiri mengindikasikan pemahaman pada tidak ada keberuntungan yang datang bertubi-tubi; yang berarti keberuntungan dapat diraih jika sudah melewati proses kerja keras; dalam hal ini proses kreatif dalam bermusik.\r\n\r\nMeski belum lama terbentuk, kami sudah memiliki demo-single yang telah rilis pada 31 Agustus 2017 berjudul GO MY WAY. Single ini sendiri berkisah tentang problematika dalam menjalani hidup yang kita inginkan, bagaimana menyikapi pandangan orang terhadap kita, dan kesiapan hati untuk menerima segala resiko dari jalan yang kita pilih.\r\n\r\nSOCIAL MEDIA\r\nhttps://www.instagram.com/nsfl.id/\r\nhttps://www.facebook.com/nsfl.id/\r\nhttps://www.youtube.com/channel/UCuRrJVqnMifA2h4c1FVDlqQ\r\n\r\nCONTACT\r\nnsfl.id@gmail.com\r\n0853-1400-3506 (Chandra)','Rock','guitar_plus;','Jakarta',1369,'2017-09-07 09:25:10','2017-09-07 09:25:10'),
	(817,'Hansel En Gretel','1504780651.jpg','Hansel En Gretel (Fictional Character)\r\n\r\nHansel & Gretel adalah, virtual band yang diciptakan pada tahun 2017 oleh Ricky A. Jeffersen (Guitar/Synth) & Rafaela Lisa S. (Vocalist/Drum/Percussion), setelah melewati berbagai macam proses sejak tahun 2015. Ditambah dengan William Budiyana (Gitar/Vocal) pada tahun 2017.\r\n\r\nMemainkan genre Pop (electro) yang divariasikan dengan genre lain seperti Deep House, Trap, Dubstep, Rock, Blues, Metal, Punk dll.\r\n\r\nDiresmikan pada tahun 2017 dengan Single yang berjudul \"Ikigai\".','Pop','facebook;','Jakarta',1319,'2017-09-07 09:37:31','2017-09-07 09:37:31'),
	(818,'Freund','1504781533.jpg','Dibentuk 2010 setelah gonta ganti nama dan personil. Juara festival pelajar dan umum tingkat kota dan provinsi. Masuk album indie tegal.','Pop','lainnya;','Jakarta',1373,'2017-09-07 09:52:13','2017-09-07 09:52:13'),
	(819,'La Hila band','1504781979.jpg','La Hila band berdiri pada tanggal 1 Januari 2010. La Hila diangkat dari kisah seorang putri yang hilang di tanah Donggo, Bima, NTB. La Hila menjadi inspirasi karena pengorbanan, kelembutan, pesan, dan niat untuk mengangkat sejarah La Hila itu sendiri. Visi dan Misi La Hila band adalah menjadi warna baru di belantika musik Indonesia dan mengangkat cerita rakyat Bima menjadi sebuah legenda Nusantara.\r\n\r\nPRESTASI :\r\n1. Mewakili provinsi Nusa Tenggara Barat dalam Festival Lagu Daerah oleh 32 provinsi. Desember - 2015\r\n2. Juara 2 Accoustic Competition, Emporium Pluit Mall. Maret - 2016\r\n3. Harapan 1 Festival Musik Betawi, Metro Cipulir Mall. Mei - 2016\r\n4. Juara 3 Festival Musik Jalanan. April - 2017\r\n5. Juara 1 Festival Musik Religi. Juni - 2017\r\n6. Juara 2 Festival Musik Nuansa Religi, Dinas Kebudayaan dan Pariwisata Jakarta Pusat. Agustus - 2017','Pop','teman;','Jakarta',1253,'2017-09-07 09:59:39','2017-09-07 09:59:39'),
	(820,'SOULMAKER','1504783590.jpg','Soulmaker dibentuk tahun 2014 dari sebuah sekolah menengah atas Sman 2 tangerang. tahun 2015: \r\n-Juara 1 pensi Fourtfhest Sma 14 Tangerang\r\n-juara 1 pensi Starfest Sma 7 Tangerang\r\n-juara 1 pensi greenive Sma 5 Tangerang\r\nTahun 2016:\r\n-juara 1 festival band budaicia\r\n-juara 1 festival band pelajar hut kota Tangerang\r\n-juara 1 festival Telkom jakarta\r\n-juara 1 fourthfest Sma 14 Tangerang\r\n-Juara 1 festival sumpah pemuda tangerang \r\n-juara 1 festival sma 6 Tangerang\r\n-juara 2 Greenive sma 5 Tangerang\r\n2017:\r\n-Juara 2 festival Cisadane Tangerang\r\nDan Soulmaker menjadi bintang tamu pensi pensi di kalangan sma dan smp di kota Tangerang\r\nINSTAGRAM: Soulmaker_sm\r\nYOUTUBE: https://www.youtube.com/channel/UC-_iPxe5E4S1wkzqwRLIIqg','Alternative Rock','instagram;guitar_plus;umi;teman;','Jakarta',1376,'2017-09-07 10:26:30','2017-09-07 10:26:30'),
	(821,'Rubic','1504784105.jpg','Rubic adalah band dari Yogyakarta, Indonesia . Mulai terbentuk pada tahun 2014 dengan mengusung genre Pop Jazz.\r\n\r\nNew Single  \"Secangkir Kopi Pagi\"','Pop','instagram;informasi_toko;','Yogyakarta',1087,'2017-09-07 10:35:05','2017-09-07 10:35:05'),
	(822,'Nadia feat Fanfun','1504784365.jpg','Saya adalah penyanyi solo yang baru saja mengeluarkan single perdana saya yang berjudul Balikan. Dilagu ini saya berkolaborasi dengan pemain ukulele bernama Fanfun. Lagu ini bernuansa Pop dan berunsurkan nuansa EDM.','Pop','teman;','Jakarta',1382,'2017-09-07 10:39:25','2017-09-07 10:39:25'),
