	(824,'The Very Nice','1504785110.jpeg','Kami  adalah The Very Nice Band\r\nDengan beranggotakan Yhuliant(Voc), Yayan(Gtr), Arga(Bass), Yosua(Drum), Yason(Keys), sekumpulan \'Nice-Guy\' yang menjadi perantau di Jakarta. \r\nBand kami terbentuk awal  tahun ini setelah kami berlima bertekad untuk menyelesaikan sebuah EP/Mini Album sebagai tanda rasa bermusik kami masih ada.\r\nmengusung aliran Pop dengan sentuhan Crunch Overdrive dari Gitar, iringan Drum dan Bass yang dinamis berbalutkan String Section.\r\nLatar belakang kehidupan kami menjadi lirik di dalam lagu-lagu yang kami ciptakan. \r\nBaik suka maupun duka kami tuliskan menjadi lirik dan lagu. \r\nMari mendengarkan musik kami, karena musik kami adalah perjalanan hidup kami.','Pop','facebook;instagram;','Jakarta',952,'2017-09-07 10:51:50','2017-09-07 10:51:50'),
