	(830,'Ming&Mong','1504790885.jpg','Ming&Mong merupakan band asal Yogyakarta yang berdiri pada tahun 2016. Personelnya terdiri dari tiga orang mahasiswa yang berkuliah di Universitas Ahmad Dahlan dan UIN Sunan Kalijaga Yogyakarta. Single pertamanya yaitu Tentang Ku dan Kamu.','Pop','instagram;','Yogyakarta',1389,'2017-09-07 12:28:05','2017-09-07 12:28:05'),
	(831,'Meirani & Anggi','1504791553.jpg','Meirani & Anggi adalah duo grup musik Indonesia beraliran pop yang berawal dari belajar musik disebuah organisasi musik dan didirikan pada 31 Mei 2017. Grup ini diciptakan oleh seorang guru musik yang sekaligus producer dalam organisasi tersebut dan nama grup dinamai dengan nama personil yaitu Meirani (Vocal) & Anggi (Vocal dan Guitar). Kami telah merilis single pertama kami yang berjudul \"Terimakasih\" sebagai karya pertama kami. Semoga karya kami dapat menghibur dan diterima dengan baik oleh masyarakat luas.','Pop','guitar_plus;teman;','Jakarta',1384,'2017-09-07 12:39:13','2017-09-07 12:39:13'),
	(832,'senja','1504793538.JPG','kami hanya sekumpulan remaja yang ingin terus berkarya dengan sederhana','Pop','guitar_plus;','Yogyakarta',1225,'2017-09-07 13:12:18','2017-09-07 13:12:18'),
