	(834,'Koza','1504793887.JPG','Koza adalah band bergenre pop dengan lagu-lagu yang merefleksikan kehidupan sehari-hari, bercerita tentang suka duka, motivasi, jatuh cinta, patah hati yang dialami khususnya para remaja. Lagu-lagu Koza juga bertema aksi sosial dan menyuarakan hal-hal positif. \r\nBeberapa prestasi Koza sebagai berikut;\r\n- lolos sebagai semi-finalist International Song Writing Competition 2016 (ISC) dengan lagu \"The Trapped Man.\" \r\n-Pianist Koza Telah menciptakan 108 lagu sejak tahun 2005\r\n-Opening Performance for Musikimia di grand atrium, supermal karawaci (2013)\r\n-tampil di beberapa acara di supermal karawaci dibawah Djarum\r\n-Tampil sebagai guest star tiap tahun di acara drama Musikal Sekolah Berkebutuhan Khusus Spectrum (2012-2017) serta pianist Koza sebagai komposer untuk lagu-lagu drama Musikal acara sekolah ini.\r\n-menjadi bintang tamu pada acara Inbox SCTV (2014)\r\n-Runner Up acara Bintang Dari Rumah SCTV (2011)\r\n-dll.','Pop','teman;','Jakarta',1364,'2017-09-07 13:18:07','2017-09-07 13:18:07'),
	(835,'TIGER PAW','1504793918.jpg','BIOGRAFI :\r\n\r\nSPEED ROCK BAND DARI YOGYAKARTA YANG TERBENTUK DI TAHUN 2016 AKHIR. DI\r\nGAWANGI OLEH BRANDE EL TIGRE (OPATUA/GARAGE ROCK). DI REKRUTLAH DUA\r\nGU I TAR I S YANG BERASAL DAR I  GENRE YANG BERBEDA, FAR I D S I LOL\r\n(TREATMENT/DEATH METAL), DAN SI JOHN (ANTILOSER/PUNK). SERTA EPAN UZUMAKI\r\nDIPERCAYA SEBAGAI TUKANG GEBUK DRUM\r\nKEMBALI KE ERA PENDAHULU TIGER PAW BERANGKAT DARI MOYANG MEREKA SEPERTI\r\nHELLOWEN, IRON MAIDEN, JUDAS PRIEST DARI MEREKALAH MUSIK TIGER PAW ADA\r\nSEKARANG.  SEDANGKAN UNTUK VOCAL SANG VOCALIST BRANDE EL TIGRE\r\nTERLANJUR JATUH CINTA DENGAN CARA BERNYANYI ZACH SLAUGHTER DARI\r\nSKULLFIST. TERIAKAN MELENGKING PANJANG DENGAN DIIRINGI VIBRA TERATUR\r\nMENJADI CIRI KHAS KARYA DARI TIGER PAW, DIMANA DI ISI OLEH LEAD SUPER KENCANG\r\nDENGAN KARAKTER SEPERTI HERMAN LI DARI DRAGON FORCE, DAN GEBUKAN\r\nDRUM CEPAT YANG SIAP MEMBAKAR SETIAP PENDENGAR AKAN MENJADI PONDASI DI\r\nHAMPIR SEMUA KARYA YANG DIMILIKI TIGER PAW.\r\nTIGER PAW MERUPAKAN SEBUAH RAMUAN SEMANGAT BARU YANG MEMBARA DAN SIAP\r\nMEMBAKAR PANGGUNG MANA SAJA, MATERI LIRIK DI AMBIL DARI PENGALAMAN SANG\r\nVOKALIS SEPERTI DIA AMAT MENCINTAI MOTOR, DIA PERNAH MENJADI PENGGILA\r\nDOTA, PENENGGAK MINUMAN KERAS DAN MASIH BANYAK LAGI MATERI YANG\r\nTERKANDUNG DALAM KARYA-KARYA TIGERPAW DAN YANG UNIK DARI BAND INI  “KAMI\r\nBERBEDA DARI BAND METAL LAINNYA, KARENA HANYA TIGER PAW LAH YANG MEMAKAI\r\nSEMPAK DI LUAR SAAT MANGGUNG” UJAR BRANDE SELAKU VOCAL. DIBALUT OLEH\r\nANIMAL PATTERN DAN FESYEN KULIT MENJADI SALAH SATU CIRI KHAS KOSTUM\r\nBERAKSI SEKUMPULAN CAKAR MACAN INI. SILAHKAN MENIKMATI TIGER PAW DARI\r\nSEGALA PERSPEKTIF YANG ADA, NAMUN APAPUN YANG AKAN ANDA CETUSKAN\r\n“GAHAR” ADALAH KATA YANG TEPAT UNTUK INI SEMUA. \r\n\r\n\r\nPRESTASI :\r\n\r\n\"THE BEST OUTFIT\" DI FESTIVAL \"DJARUM ROCK IN BATTLE\" (YOGYAKARTA 2017).\r\n\"THE BEST METAL BAND\" PADA ALBUM KOMPILASI \"1000 KALORI\" (YOGYAKARTA 2017).\r\n\r\n\r\nCONTACT :\r\n\r\nWA : 0858 7773 5464 ( VERA SAURUS )\r\nE-MAIL : tigerpawrock@gmail.com\r\nYOUTUBE : https://www.youtube.com/channel/UCePBDLqfdnVtlyyUUh6J1PA\r\nSOUNDCLOUD : https://soundcloud.com/tigerpawrock\r\nINSTAGRAM : https://www.instagram.com/tigerpawrock/\r\nFACEBOOK : https://www.facebook.com/tigerpawrock\r\nTWITTER : https://twitter.com/tigerpawrock','Heavy Metal','facebook;instagram;teman;','Yogyakarta',1391,'2017-09-07 13:18:38','2017-09-07 13:18:38'),
	(836,'The Big Thing Machine','1504793980.jpg','Terbentuk sejak tahun 2004 dengan nama HIKARI dan aktif jejepangan di surabaya dengan mengusung genre JROCK yang banyak tersinspirasi oleh L~Arc~En~ciel, vakum sejak 2007 dan aktif kembali pada tahun 2015 dengan menambahkan unsur FUNK ROCK dalam setiap karya yang dihasilkan dan mengubah nama band menjadi THE BIG THING MACHINE.','Funk','teman;','Surabaya',984,'2017-09-07 13:19:40','2017-09-07 13:19:40'),
	(837,'Ketika Petir Menyambar','1504796264.jpg','Ketika Petir Menyambar adalah sebuah band\r\nModern Hard Rock yang terbentuk pada 17 Oktober 2012 di Bali, nama Ketika Petir Menyambar terinspirasi dari\r\npetir yang mempunyai cahaya kilat dan suara yg\r\nbergemuruh. Sempat juga ingin menggunakan nama\r\nKetika Petir Menyambar dengan bahasa inggris\r\n(when the lightning strike) namun penamaan dengan\r\nbahasa indonesia dirasa lebih cocok,\r\nmaka diputuskan menggunakan nama Ketika Petir\r\nMenyambar.\r\n\r\nAward dan Gigs perform,\r\n- Juara 1 Cardinal Award 2016\r\n- Juara 1 Festival musik STIKOM denpasar\r\n- Runner up Singaraja Band Heroes 2016\r\n- Performer, road to Soundrenaline 2017','Rock','instagram;guitar_plus;','Surabaya',345,'2017-09-07 13:57:44','2017-09-07 13:57:44'),
	(838,'TIMES NEW ROMANCE','1504796515.jpg','TIMES NEW ROMANCE ADALAH BAND YANG MEMAINKAN MUSIK SIMPLE POP\r\nDENGAN NADA YANG SEDERHANA DAN LIRIK YANG MUDAH DI INGAT MENJADIKAN BAND INI PEDE MEMBAWAKAN SELURUH LAGUNYA DENGAN MENGGUNAKAN BAHASA INDONESIA','Pop','facebook;instagram;umi;maliq;','Jakarta',1325,'2017-09-07 14:01:55','2017-09-07 14:01:55'),
	(839,'GODLIKE','1504796636.jpg','Cikal bakal GODLIKE, sudah terbentuk sejak Januari 2015. Berawal dari bertemunya Hendy (Bass) & Hudi (Gitar) yang merupakan rekan satu band, dengan Defit (Drum) untuk membentuk sebuah band rock.\r\n\r\nDari pertemuan tersebut Defit menyarankan untuk mengajak Dika yang juga seorang drummer untuk di daulat menjadi Vokalis.\r\n\r\nDari hasil sesi jamming pertama, ketidak cocokan langsung terlihat, perbedaan konsep dan pemikiran membuat band ini bubar bahkan sebelum berjalan.\r\n\r\nBerbulan-bulan setelah perpisahan tersebut Hendy, Hudi & Dika kembali dipertemukan oleh situasi. \r\n\r\nKetika Dika membutuhkan gitaris dan bassist untuk mengisi take recording, Dika menghubungi Hendy dan Hudi.\r\n\r\nSebaliknya, ketika band project Hendy & Hudi membutuhkan drummer atau pengisi vokal, maka mereka menghubungi Dika.\r\n\r\nTanpa disadari chemistry bermusik antara ketiganya terbentuk, materi pembentukan band side projectpun kembali dibahas.\r\n\r\nSekalipun berkali-kali sempat vacum karena perbedaan genre & konsep musik yang berbeda, toh band ini tetap berjalan tanpa nama.\r\n\r\nBeberapa drummer & vokalispun sempat diuji coba, karena pada awalnya Dika menginginkan agar band ini unik dengan 2 drummer dan vokalis yang dapat membawakan berbagai genre musik termasuk \"Rap\". \r\n\r\nMerasa sudah cukup kompak, pada akhirnya band ini memutuskan untuk berjalan hanya bertiga ketimbang harus menunggu sosok yang diinginkan dan membentuk chemistry dengan personil baru.\r\n\r\nDan terbentuklah formasi GODLIKE dengan posisi Hendy pada Bass, Hudi pada Gitar, sedanghkan Dika mengisi Drum & Vokal.\r\n\r\nNama GODLIKE sendiri diambil dari ungkapan game PC bertajuk \"DotA Allstars\" .','Alternative Rock','teman;','Jakarta',1395,'2017-09-07 14:03:56','2017-09-07 14:03:56'),
	(840,'ARIETTA','1504797281.jpg','ARIETTA adalah band yang berdiri pada Maret 2014, band yang berasal dari Karawang ini mengusung genre Modern Rock. Nama Arietta sendiri berasal dari bahasa Inggris yang berarti Syair / Melodi Cinta. Musik Arietta sendiri dipengaruhi oleh One Ok Rock, L’arc En ciel, Ungu, J-Rocks. Band ini digawangi oleh Yondi (Vocal), Ricki (Guitar), Arga (Guitar), Indra (Bass), Arif (Drumm).\r\nPrestasi ARIETTA :\r\n-Festival Band Purwakarta Kreatif (2015)=Juara I\r\n-Festival Band Se-Purwasukasi (2015)=Juara II\r\n-A ZONE Road To Soundsations Zona Purwasukasi (2015)=Juara III\r\n-Local Hero Soundsations Bekasi (2015)\r\n-Local Hero Soundsations Bogor (2015)\r\n-Local Hero Soundsations Karawang (2015)\r\n-10 Besar Band terbaik di HUT LANUD SURYADARMA Subang\r\n-Gueststar di beberapa Mall-mall & Event Pensi\r\n-Best Player Vocal,Guitar,Bass,Drumm\r\n-Dan masih banyak lagi prestasi lain nya dari Arietta.','Alternative Rock','facebook;instagram;teman;lainnya;','Jakarta',502,'2017-09-07 14:14:41','2017-09-07 14:14:41'),
	(841,'Gloria\'s Band','1504798009.jpeg','Band kami telah memiliki banyak pengalaman di dalam dunia musik. Band kami telah mengikuti festival musik di kampus-kampus dan terakir band kami masuk ke dalam 10 besar top finalist MLD SPOT dalam acara MLD Jazz Wanted.','Pop','instagram;','Jakarta',900,'2017-09-07 14:26:49','2017-09-07 14:26:49'),
	(842,'Bakat Terpendam','1504799063.jpg','Kami pernah mengikuti lomba band indie di Jakarta. Kami terpilih masuk 15 besar dan harus pergi ke Jakarta. Perjalanan penuh cerita serta pengalaman itu terbayar saat kami terpilih menjadi juara pertama yang sama sekali tidak pernah bayangkan atau sangka-sangka. Itulah salah satu cerita yang sangat berkesan yang dialami teman-teman Bakat Terpendam band','Others','guitar_plus;','Jakarta',1377,'2017-09-07 14:44:23','2017-09-07 14:44:23'),
	(843,'Varsha','1504799089.jpg','Juara 2 Indie Band Festival It\'s Mine Tang City Mall','Pop','instagram;','Jakarta',1397,'2017-09-07 14:44:49','2017-09-07 14:44:49'),
	(844,'VOW','1504799696.jpg','VOW adalah band pop rock asal Jogja. Dengan 1 vokalis dan 2 gitaris.','Alternative Rock','guitar_plus;','Yogyakarta',1402,'2017-09-07 14:54:56','2017-09-07 14:54:56'),
	(845,'Bougenvile','1504799946.jpg','juara 3 pestipal musik antar sekolah','Pop','facebook;','Jakarta',1399,'2017-09-07 14:59:06','2017-09-07 14:59:06'),
	(846,'Black Briar','1504800914.jpg','Dengan mengambil jalur genre Brit/Rock, Black Briar mencoba\r\nmengudara di kancah industri musik Indie di Jogjakarta.\r\nDigawali oleh Endi (Vocal/Gitar), Adnan (Drum), dan Tian (Bass)\r\nsejak awal tahun 2015 Blackbriar mulai menaiki panggung:\r\n-Civil League, UII, Jogjakarta, 2015\r\n-Last Intro Anniversary, Ruang Café,Jogjakarta, 2015\r\n-Heaven Sound, Hard Case Café,Jogjakarta, 2016\r\n-Sounds for Arctic Monkeys 2, Ecobar, Kemang, Jakarta 2016\r\n-British Night by KMA, Wedangan Kampoeng, Jogjakarta 2017\r\n-Sensasi Musik Rabu, Arcaf Café,Jogjakarta 2017\r\n-Opening band, Jakcloth Goes To Yogyakarta, 2017','Alternative Rock','poster;teman;','Yogyakarta',1330,'2017-09-07 15:15:14','2017-09-07 15:15:14'),
	(847,'MAOSKO','1504800998.JPG','MAOSKO terbentuk Mei 2017, karena kebiasaan nongkrong bersama di sebuah studio dan kami merasa satu pemikiran dalam bermusik. \r\n\r\nBand kami belum memiliki prestasi.','Rock','teman;','Jakarta',1396,'2017-09-07 15:16:38','2017-09-07 15:16:38'),
	(848,'Fatria Suma feat Rhythem Nusantara','1504801226.jpg','Rhythem nusantara project adalah band indie asal Lampung, Kotabumi Lampung Utara, yang terbentuk pada tanggal 12 januari 2016, prestasi yang di miliki setiap personil berbeda beda karna saat terbentuk nya Rhythem nusatara adalah pada saat event kumpul kangen musisi Kotabumi, terbentuk nya Rhythem nusantara  menambah warna baru untuk belantika musik di Indonesia khusus nya Lampung, Kotabumi Lampung Utara. Dari  sekian lagu yang dimiliki Rhythem nusantara Saat ini Rhythem nusantara memiliki satu lagu yang di record sebagai debut single dari sang vocalist suma fatria, dan semoga Rhythem nusantara selalu menjadi bagian warna warni di blantika musik Indonesia, yang selalu ikut andil dalam segala kegiatan yang menyangkut kesejahteraan musisi Indonesia.','Pop','instagram;guitar_plus;umi;maliq;','Jakarta',1401,'2017-09-07 15:20:26','2017-09-07 15:20:26'),
	(849,'The 5','1504801581.jpg','kami band asal pemalang \r\ndari sma kita selalu manggung sana sini tapi tak pernah juara...karna dulu kami hanya berkeinginan untuk merasakan sound yang mewah hahaha','Alternative Rock','facebook;','Jakarta',1407,'2017-09-07 15:26:21','2017-09-07 15:26:21'),
	(850,'ANONYMOUS','1504801824.jpg','ANONYMOUS berdiri pada pertengahan tahun 2014 dari  pertemanan di salah satu studio musik  di bilangan Bekasi Timur. warna musik yang dimainkan ialah    alternative,pop rock dengan pengaruh dari band-band, seperti Creed, Muse, DLL\r\nSetelah menimba pengalaman manggung diberbagai event dari band-band sebelumnya, pada pertengahan september ini DGAS akhirnya menyelesaikan satu lagu untuk demo mereka yang pertama. Lagu berjudul Kisahkku Tersimpan Di Kotamu. Dan masih dalam penggarapan lima lagu berikutnya. Rencananya ANONYMOUS akan menluncurkan mini album yang pertama.','Rock','teman;','Jakarta',1380,'2017-09-07 15:30:24','2017-09-07 15:30:24'),
	(851,'DIVO','1504802657.jpg','Semua Berawal Dari Imajinasi. Awali karier pada Medio 2006, DIVO telah temukan jati diri lewat 5 pendekar musikNya.. DIVO adlah gmbaran aktualisasi diri para personilnya dalam bermusik & berkarya,yang coba tawarkan sesuatu yg baru buat para pendengarnya.. Eksplorasi & inovasi tiada henti teLah buat DIVO berbeda..\r\nSO....DIVO IS ABOUT NEW CONCEPT MUSIC AND SONG !!!!','Alternative Rock','teman;','Yogyakarta',1406,'2017-09-07 15:44:17','2017-09-07 15:44:17'),
	(852,'Cendrawasih accoustik','1504802682.png','Pernah menjadi bintang tamu di acara malam puncak HUT RI ke 72','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',1310,'2017-09-07 15:44:42','2017-09-07 15:44:42'),
	(853,'Hansel En Gretel','1504803556.jpg','Hansel En Gretel (Fictional Character)\r\n\r\nHansel & Gretel adalah, virtual band yang diciptakan pada tahun 2017 oleh Ricky A. Jeffersen (Guitar/Synth) & Rafaela Lisa S. (Vocalist/Drum/Percussion), setelah melewati berbagai macam proses sejak tahun 2015. Ditambah dengan William Budiyana (Gitar/Vocal) pada tahun 2017.\r\n\r\nMemainkan genre Pop (electro) yang divariasikan dengan genre lain seperti Trap, Dubstep, Rock, Blues, Metal, Punk dll.\r\n\r\nDiresmikan pada tahun 2017 dan diresmikan dengan Single yang berjudul \"Ikigai\".','Pop','facebook;','Jakarta',1414,'2017-09-07 15:59:16','2017-09-07 15:59:16'),
	(854,'Aira Band','1504803777.jpg','Aira band awalnya bernama Qtha band,terbentuk pada tahun 2012.lalu karena seringnya tergonta ganti personil yang tinggal menyisakan abeng (vocal) dan erie (gitar) sebagai personil tetap,akhirnya mereka memutuskan untuk mengganti nama band mereka menjadi aira.','Pop','instagram;guitar_plus;teman;','Jakarta',1412,'2017-09-07 16:02:57','2017-09-07 16:02:57'),
	(855,'Remembering Sunday','1504804297.jpg','Sekelompok anak muda yang memiliki beberapa tujuan yang sama dalam hal bermusik, yang di bentuk pada 06 Juli 2017.','Others','instagram;teman;','Jakarta',507,'2017-09-07 16:11:37','2017-09-07 16:11:37'),
	(856,'HOT LAVA','1504805605.jpg','Berawal dari kami berdua (amir & tambi) yang mempunyai ide yang sama untuk membuat jenis musik yang berbeda dari biasanya tetapi tetap mudah di nikmati oleh pendengar musik. Kami pun membuat musik yang sekarang kami ikut kan dalam ajang levi\'s band hunt ini. Oh ya, kami menamakan jenis musik kami \"LAVAPOP\". Semoga dapat di terima oleh pendengar musik sekalian.. enjoy..','Others','teman;lainnya;','Surabaya',1035,'2017-09-07 16:33:25','2017-09-07 16:33:25'),
	(857,'NEGARA BAND','1504805678.jpg','Negara dapat diartikan sebagai sekelompok manusia yang dipersatukan oleh suatu rasa persamaan, karena nama Negara mempunyai makna yang dalam dan memiliki persamaan dalam visi & misi kami,akhirnya kami memakai nama tersebut dan diartikan sebagai sekelompok manusia yang mempunyai persamaan-persamaan dan tujuan dalam bermusik.Menjadi musisi adalah pilihan hidup kami walau jadi musisi tak semudah yang dibayangkan,penuh dengan perjuangan,pengorbanan,baik waktu dan materi,namun semua itu menjadi langkah-langkah kami untuk tetap semangat menjadi musisi. INSERT INTO `members` (`id`, `member_name`, `email`, `phone`, `dob`, `gender`, `instrument`, `uk_celana`, `uk_baju`, `band_id`, `created_at`, `updated_at`)
