INSERT INTO `songs` (`id`, `judul`, `link`, `lirik`, `band_id`, `created_at`, `updated_at`, `status`, `score`, `final`)
VALUES
	(6,'Berjuang','https://soundcloud.com/user-555754352/little-day-berjuang-1','Ku langkahkan kaki ini\r\nDengan semangat membara\r\nTak pernah ku hiraukan\r\nDengan segala ocehan\r\nDimana mereka yang selalu memandangku sebelah mata\r\n\r\nBuka lebar kedua matamu\r\nInilah aku yang kau remehkan\r\nKini jadi pujaan\r\nDiman mereka yang selalu memandangku sebelah mata\r\n\r\nOoo...ooo..\r\n\r\nInilah api yang kau berikan\r\nSemangatku untuk membuktikan\r\nTak pernah berhenti ku terus\r\nBerjuang\r\nBERJUANG.. BERJUANG..',12,'2017-08-03 15:09:12','2017-08-24 02:39:16',2,50,0),
	(7,'Dan Bila Esok Hari','https://soundcloud.com/hive-id/hive-dan-bila-esok-hari-new-arrangement','Dan bila esok hari\r\nSong & Lyric by Nugraha Saputera\r\n\r\n(Verse 1)\r\nDeras hujan yang turun\r\nMengingatkan aku pada dirimu\r\nBangkitkan seluruh rindu\r\nYang tertimbun\r\n\r\n(Verse 2)\r\nTak bisa ku pungkiri\r\nSemua rasa yang kini terpatri\r\nDan tak bisa hilang dari\r\nPikiranku..\r\n\r\n(Chorus)\r\nDan bila esok hari kau dengar aku\r\nBernyanyi dalam benakmu\r\nMaka saat itulah aku\r\nMerindukan dirimu\r\n\r\nDan bila esok hari kau ingin aku\r\nTuk berada di sampingmu\r\nAku disini\r\nMasih disini, menunggumu..\r\n\r\n(Verse 3)\r\nApakah kau rasakan apa yang kurasakan\r\nSemua yang kulakukan hanya untuk dirimu\r\nTak dapat kau mengerti atau tak mau mengerti\r\nDengarkan lah diriku ini sungguh dari hati\r\n\r\n(Back to reff)\r\n(Interlude)\r\n(Back to reff)\r\n(Back to Verse 3)',13,'2017-08-04 02:51:41','2017-08-24 02:39:11',2,50,0),
	(8,'Matahari','https://soundcloud.com/duapintu/matahari','Matahari terik bersinar langit biru\r\nAngin berhembus debu cahaya di wajahmu\r\n\r\nOh Cantiknya muka bumiku\r\n\r\nGerimis sejukkan badanmu langit mendung\r\nBerkendara di jalan panjang dan berliku\r\n\r\nOh nikmatnya berpetulangan \r\nOh indahnya laut, gunung, dan pantai\r\nSemua kita jaga lah',14,'2017-08-06 03:37:52','2017-08-23 08:02:47',3,60,0),
	(9,'Jadi pacarku','Listen to JADI PACARKU by Aranda Abi Prinanda #np on #SoundCloud https://soundcloud.com/aranda-abi-prinanda-1/jadi-pacarku','Aku dan kamu di sini\r\nAku ingin bicara\r\nCoba dengarkanlah aku\r\nHanya sebentar saja\r\nHanya sebentar saja\r\n\r\nRasa yang hadir dalam hidupku\r\nTak pernah begini\r\nPelan pelan buatku menggila\r\nSaat kau tak bersamaku\r\n\r\nReff\r\nAku ingin kau tau selama ini\r\nAku memendam rasa yang dalam padamu\r\nDan kini kau tau bagaimana \r\nAku padamu\r\nApa kau juga dan kau mau\r\n\r\nSong\r\nSejak pertama ku mengenalmu\r\nAda yang beda darimu\r\nKau slalu tampil apa adanya\r\n\r\nInterlude\r\nKucinta apadanya\r\nKau slalu apa adanya\r\n\r\nReff\r\nAku ingin kau tau selama ini\r\nAku memendam rasa yang dalam padamu\r\nDan kini kau tau bagaimana \r\nAku padamu\r\nApa kau juga dan kau mau\r\nApa kau juga dan kau mau\r\n\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nPacarmu\r\nPacarmu....\r\nBacksound\r\n(Jadikan aku jadi pacarmu)',15,'2017-08-06 08:07:50','2017-08-23 08:02:43',3,60,0),
	(10,'Animal','https://soundcloud.com/high-gain/animal','One of these days\r\ni guess it will finally end\r\nall the memories, and all the pain\r\nit\'ll unravel one last time\r\n\r\nOr maybe i should just give into it\r\nlet myself fall again\r\npain and me have a long and deep understanding of one another\r\n\r\nOne last time, one last time\r\n\r\nWhen you fall that far, when you fall that far\r\nwhen you lose all the control, and got nothing left to grab onto\r\nAll that\'s left is an animal.',16,'2017-08-06 17:13:08','2017-08-23 08:02:39',2,60,0),
	(11,'Watch Your Step','https://soundcloud.com/dynamic_trio/dynamic-trio-watch-your-step','Watch Your Step \r\n\r\nLook at the central street in the morning\r\nSee busy people walking down\r\nWorried about the future and worried about the money\r\nAnd they forget about, their deepest dream\r\n\r\nQuick thinking is choice to follow\r\nGet my suit and combing hait\r\nAin\'t sure gone get it but\r\nLife is get hard, it just about how abounding rich\r\n\r\nWatch your mind take deep breath don\'t be falling\r\nShut your eyes, be wise of choosing, wisely\r\nWhat your fighting for it\'s to be further, further, better\r\nI guess your done\r\n\r\nMy oldman say to seek the passion\r\nEven wealth it\'s not around\r\nIt\'s sound so cheesy\r\nBut choice is all yours\r\nYou know what i\'d say\r\nThat\'s is alright',17,'2017-08-07 16:44:57','2017-08-23 08:02:26',2,60,0),
	(12,'Severine','https://soundcloud.com/agustino-carvallo/vilotes-severine','Severine you come to me, when everything seems hard to see\r\nSeverine you come to me, then everything is bright to be\r\n\r\nReff :\r\nSave me, I don’t wanna crazy\r\nI don’t wanna be standin’ here, without you here\r\nI’ll take this pain alone\r\n\r\nSave me, I don’t wanna be lonely\r\nLike I ever felt, I know I’m deaf, I know I’m blind\r\nBut you’re the shining light\r\n\r\n* Save me, I don’t wanna be crazy, I don’t wanna be lonely \r\n   take me now, shine me now down along',18,'2017-08-08 00:52:35','2017-08-23 08:02:30',2,60,0),
	(13,'Planet Lain','https://www.youtube.com/watch?v=2-8FQTZnNjM','Kami dari planet lain \r\ndi sini kami semua sama (2x)\r\ntiada putih tiada hitam\r\ndisini kami semua sama (2x)\r\nreff:\r\nkami iri kami iri kami iri\r\ndisana kalian semua berbeda\r\nkami iri kami iri kami iri\r\ndisana kalian semua berbeda \r\nnamun kalian membuat perbedaan ini menjadi alasan untuk ber-barbar-ria',19,'2017-08-08 02:08:44','2017-08-23 08:02:19',2,60,0),
	(14,'Inilah Janjiku','https://soundcloud.com/aabeproject/inilah-janjiku-1','Cinta\r\nYang selalu kuberi kepadamu\r\nKumau kau coba coba mengerti\r\nYang kuberikan hanya satu arti\r\n\r\noooh...beiby\r\n\r\nKumencari cari arti semua ini\r\nHanya kamu yang selalu dihati\r\nTakkan pernah ada yang lain lagi \r\nkamu kumohon percaya...percaya aku\r\ntakkan.. takkan mungkin tinggalkan cinta kita nanti\r\nkumau kamu mengerti\r\nini cinta\r\n\r\nInginnya aku kamu kamu tuk mengerti\r\nMengerti akan cintaku yang hanya untuk dirimu\r\nKamu kamu kamu tuk pahami..pahami\r\nInilah Janjiku\r\n\r\nOoh...Beiby\r\nKumencari cari arti semua ini\r\nHanya kamu yang selalu dihati\r\nTakkan pernah ada yang lain lagi kamu kumohon percaya..percaya aku\r\ntakkan.. takkan mungkin tinggalkan cinta kita nanti\r\nkumau kamu mengerti\r\nini cinta\r\n\r\nInginnya aku kamu kamu tuk mengerti\r\nMengerti akan cintaku yang hanya untuk dirimu\r\nKamu kamu kamu tuk pahami..pahami\r\nInilah Janjiku\r\n\r\nInginnya aku kamu kamu tuk mengerti\r\nMengerti akan cintaku yang hanya untuk dirimu\r\nKamu kamu kamu tuk pahami..pahami\r\nInilah Janjiku\r\n\r\nInginnya aku kamu kamu tuk mengerti\r\nMengerti akan cintaku yang hanya untuk dirimu\r\nKamu kamu kamu tuk pahami..pahami\r\nInilah Janjiku',20,'2017-08-08 02:38:49','2017-08-23 08:02:14',3,60,0),
	(15,'Independence Day','https://www.youtube.com/watch?v=C-eA5YOxtGY','epada siapa aku mengadu..\r\nMelihatmu merampas lembaran hidup, katamu..\r\nMelihatmu menenteng koper bertuliskan penguasa\r\nPerih tak menentu di hati ini\r\nPadahal langit kita sama..\r\n\r\nTak ada yang lebih hebat dan kuat\r\nTapi..kekuasaan menjadi senjata ampuhmu!\r\nSangar bengismu tak lebih dari sebuah pancingan\r\nYang bertahta atas dukungan palsu….\r\nMurkamu menandingi skenario Pilatus!\r\nAir tangannya kau simpan, bahwa kau ikut munafik..\r\nEntah dunia sudah lelah menegurmu\r\nKau tetap saja jatuh…',21,'2017-08-08 03:41:40','2017-08-23 08:02:11',2,60,0),
	(16,'Lepaskanlah','https://soundcloud.com/hocuspocuz/hocus-pocuz-lepaskanlah','Menjalani hari tanpa sebuah pasti\r\nMeratapi mimpi pastikan yang terjadi\r\nLaknati birahi akan sebuah mati\r\n\r\nLepaskanlah!\r\nLuka bisu, hidup bersanding haru, itu bukan milikmu\r\nLepaskanlah!\r\nGelap jiwa yang harus diakhiri, hidup harus berarti\r\n\r\nMeratapi hati, ter-remuk dalam hari yang tlah terobati,\r\nnaluri terganti\r\nLaknati birahi akan sebuah hati\r\n\r\nTelah aku jalani jalan yang tengah kutapaki\r\nMenahan lelahku sendiri,\r\ntakkan pernah berhenti (2x)\r\n\r\nLepaskanlah!\r\nLuka bisu, hidup bersanding haru, itu bukan milikmu\r\nLepaskanlah!\r\nGelap jiwa yang harus diakhiri, hidup harus berarti\r\n\r\n(dialog)\r\nhidup tak pernah indah..\r\napakah pendosa akan selalu jadi pendosa..\r\nmengapa kita hanya berdoa tanpa mencoba..\r\nmakan tuh idealis gak laku dijual..\r\naku orang yang bebas dan tak akan pernah memilih..\r\n\r\nLepaskanlah!\r\nLuka bisu, hidup bersanding haru, itu bukan milikmu\r\nLepaskanlah!\r\nGelap jiwa yang harus diakhiri, hidup harus berarti\r\n\r\nit will be forever\r\nas the one i\'ll be remind\r\nas the one i\'ll be recall\r\nas the one i\'ll be relate',22,'2017-08-08 08:31:25','2017-08-23 08:02:08',2,60,0),
	(17,'Weirdoom','https://www.youtube.com/watch?v=aTkX1mFq7z0','Bicara... teruslah bicara\r\nSeakan semua tanpa arah\r\n\'kan datang menerka\r\nLangkah desah mereka\r\nTerdengar jelas merana\r\nWahai tabu mengertilah\r\nLelah menyapu semuanya\r\n\r\nTerlalu banyak kata yang terlepas dari bibir ini\r\nDan ku masih menemani malam yang penuh tanya\r\nBegitu naif kau merindukan semua abadi\r\nTak kau lihat sekitar apa yang terjadi\r\n\r\nTerombang-ambing ku bawa jauh ke dalam\r\nMasa kelam yang tak pernah habisnya\r\n\r\nDan ku tak peduli\r\nHancurkan saja ku tak berdaya\r\nHancurkan semuanya\r\nDan ku tak peduli\r\nHancurkan saja ku tak berdaya\r\nHancurkan semuanya\r\n\r\nTerombang-ambing ku bawa jauh ke dalam\r\nMasa kelam yang tak pernah habisnya\r\nTerombang-ambing ku bawa jauh ke dalam\r\nCaci maki yang tak pernah habisnya\r\n\r\nTerlalu banyak kata yang terlepas dari bibir ini\r\nDan ku masih menemani malam yang penuh tanya\r\nBegitu naif kau merindukan semua abadi\r\nTak kau lihat sekitar apa yang terjadi',23,'2017-08-08 11:40:46','2017-08-24 02:39:02',3,70,1),
	(18,'Music Everywhere','https://m.soundcloud.com/numan-nugraha/music-everywhere','Saat kejenuhan menghampiri diri saat semua terasa hilang \r\nTak ada yang peduli membuat ku putus asa berjalan sendiri tanpa arah \r\nTerdengar alunan nada memberi semangat menginspirasi membangkitkan ku dari semua keterpurukan \r\n\r\nDengarlah musikmu\r\nBukah hatimu \r\nRasakan semuanya \r\nTerdengar indah \r\nLihat sekitar mu \r\nBayangkan semua berpadu \r\nLihat sekitarmu \r\nWhen music makes you move',24,'2017-08-08 12:22:23','2017-08-23 08:01:59',3,60,0),
