	(20,'Cerita di Luar Jendela','https://soundcloud.com/lamafa-23/cerita-diluar-jendela','Cerita di luar jendela \r\nmenyapa gulita di luar sana\r\nmembangunkan mimpi yang pulas di dasar mata\r\n\r\nKisah mimpi semalam yang begitu mesra\r\nSeberkas cahaya warnai seulas tawa\r\n\r\nReff : Di suatu pagi raut wajah mentari berseri\r\n          sinari arti akan hadirnya hari ini\r\n\r\nBias-bias cahaya menggelitik mata \r\nDi luar jendela hiduplah seulas tawa\r\n\r\n\r\nReff : Di suatu pagi raut wajah mentari berseri\r\n          sinari arti akan hadirnya hari ini',26,'2017-08-08 14:00:14','2017-08-23 08:01:53',3,70,1),
