	(41,'Hadapi dan Lalui','Http://www.ripstore.asia/flowchart','HADAPI DAN LALUI\r\n       Flowchart\r\n\r\nIntro 	: C Dm F G (2X), C Dm F G C Dm F\r\nSong	: C Dm F (2x)\r\nMemulai hari yang kan kita jalani\r\nsegala yang akan terjadi\r\nhadapi dan lalui...\r\n\r\nPercaya kita kan selalu bersama\r\nkita lawan semua rintangan yang ada\r\nku yakin kita bisa.......\r\n\r\nChorus :  Am F C G Am F G\r\nPerbedaan membuat kita semakin sempurna \r\nyakinkanlah kita tetap bersama......\r\n\r\nReff : C F Dm G C F Dm G (2x) C G (Hold)\r\nJadikan kita yang terkuat\r\ndibalik dari segala beda\r\nraihlah impian yang selama ini  \r\nmenjadi tujuan bersama\r\n\r\nBerani hadapi semua\r\nbersiap tuk jadi yang terhebat\r\nbiarkan perjalanan ini menjadi \r\nnada dari makna yang sempurna.....\r\n\r\nSong	: C Dm F\r\nPercaya kita kan selalu bersama\r\nkita lawan semua rintangan yang ada\r\nku yakin kita bisa.......\r\n\r\nBACK TO Chorus & Reff (1x)\r\nBridge : Am F C G (3x)\r\nBack To Reff (1x)\r\nOutro : C Dm F G C Dm F',47,'2017-08-09 14:31:24','2017-08-23 08:00:54',3,60,0),
