	(130,'Dengarlah Suara Hatiku (Ayah)','https://youtu.be/kBrtOFYp7ss','Ku harus bisa bangkitkan diriku\r\nYang tertunduk dari gelapnya hidup\r\nHidup yang kini telah berbeda\r\nKetika dirinya telah tiada\r\n\r\nReff\r\nAku harus bisa untuk\r\nMelihat dunia dengan caraku\r\nWalaupun berbeda semenjak engkau\r\nPergi jauh\r\n\r\n\r\nRapper\r\nHembusan angin sudah tak lagi terasa sejuk, mawar yang harum kini berbau busuk, awan langit menutup, malam sawan menyusup, sinar mentari redup gelap jadi kawan hidup, kasih sayangmu telah hilang di telan waktu, kasih sayangmu yang mengalun didalam benakku, ketika tubuhmu kaku, kubisikkan kepadamu, ayah dengarlah suara hatiku\r\n\r\nManisnya madu tlah berubah rasa pahit terasa, kepergianmu tinggalkan berjuta kisah, duka telah menyiksa, puing kenangan yang tersisa, ingin kembali bersama takkan mungkin bisa, dengan besar hati kecil relakan penuh tangisan, bangkit dari keterpurukan, sedikit lengkung senyuman, dengan penuh kesabaran, ikhlas karna kesadaran, ayah semoga kau mendengarkan.\r\n\r\nReff \r\nSemua mimpiku yang dulu pernah ada\r\nKini telah pergi menjauh\r\nSeperti juga dirimu yang kini\r\nPergi tinggalkanku ayah\r\n\r\nAku harus bisa untuk\r\nMelihat dunia dengan caraku\r\nWalaupun berbeda semenjak engkau\r\nPergi jauh',164,'2017-08-16 15:02:32','2017-08-25 06:48:57',2,50,0),
	(131,'You And Me','https://m.soundcloud.com/fatman-official/you-and-me-ft-nia','it\'s 3.00 AM and i wake up \r\nit\'s hard to sleep, i\'m too fucked up \r\ncause\' the only thing that pops up is your name \r\ni remember all we used to do \r\nbut there\'s nothing i can do \r\nand i doubt about \"real love\" will come back it\'s true \r\n\r\n* \r\ncause now we start to leaving in \r\nanother place, another space \r\nbecause we never ever come back here again \r\ncause\' everytime i try to hold you back \r\nbut you\'re so far away from here \r\n\r\nReff \r\nYou and me iss like a stranger \r\nbut we used to be something special \r\ni know your fears and you know mine \r\nbut now i think it\'s time to say good night \r\nlet\'s meet in our dreams so good night \r\n\r\ntime keeps ticking, i\'m still awake \r\nthinkin\' about would you still wait \r\nthe only thing i do is cry alone \r\ni remember all we used to do \r\nbur there\'s nothing i can do \r\nand maybe time will never let me tell the truth \r\n\r\nback to * \r\nback to reff 2x  see less',165,'2017-08-16 16:07:35','2017-08-25 06:47:34',2,50,0),
