	(133,'EXPLORASI','https://soundcloud.com/hiptoday-band/explorasi','Rap 1	: \r\nDitengah hingar bingar kota yang sesak\r\nTerhimpit ribuan jejak dimana tempat ku berpijak\r\nSeribu satu kisah yang tak mudah ditebak\r\nMendekap ku dalam goresan pena bersajak\r\n\r\nDan ku coba, tuk gambarkan apa yang terlintas\r\nSketsakan inspirasi diputihnya kertas, lantas\r\nJiwa terpacu bereksplorasi\r\nMencari dan menggali dalam ruang inspirasi\r\n\r\nAda kebebasan di sini, tlah ku temui kini\r\nIngin ku pacu rima dan puisi\r\nDedikasikan karya didalam setiap ungkapan\r\nBerikan, nada selaras apa yang kupikirkan\r\n\r\nRap rock dalam satu masa\r\nFrasa aksara sketsakan hitam putih yang bernuansa\r\nQuick get ready, iam ready, you ready\r\nDan explorasi takkan berhenti\r\n\r\nReff: \r\nExplorasi menembus batas imajinasi\r\nGali potensi ledakan beribu aksi\r\n(force your self) rubah fantasi menjadi nyata\r\n(bring the power) tumpahkan keringat diatas karya (2x)\r\n\r\nRap 2: \r\nSeperti pepatah, mimpi ku gantung tinggi diatas langit\r\nTak pernah resah, harus ku raih meski menahan rasa sakit\r\nTak pesimis, ku terus berpikir optimis\r\nSemakin berbisa seperti ular berdesis\r\n\r\nExplorasi tanpa henti dari masa yang kelam\r\nMerobek nadi, bertabur luka beralas garam\r\nKuhantam tinju keras menghancurkan batasan\r\nDitengah dunia yang keras penuh kepalsuan\r\n\r\nKini aku tersadar ini jalan yang ku inginkan\r\nKu tak peduli apa yang mereka katakan\r\nInilah pilihanku, dan kuterus melaju\r\n\r\nHentakkan bumi dengan rima yang terucap dari mulutku\r\nKu siap hadapi dunia ini, meski suatu hari indera ini perlahan mati\r\nTapi selama masih ada puisi dan distorsi\r\nKubiarkan jiwa ini berdedikasi tanpa henti\r\n\r\nBridge: \r\nAdalah satu dan seribu makna yang sulit terdefenisi\r\nAdalah satu dan seribu cara untuk dapat kau gali dan cari\r\nHingga perlahan kan kau temui dimana sesungguhnya klimaks sang imaji\r\nDan, hingga kan kau gemparkan dunia dengan ribuan aksi\r\nExporasi,…',168,'2