	(387,'takkan diam','https://youtu.be/ixau0sFK2NQ','Rasa benci terus \r\nMengalir deras \r\nMenyulut nadi hingga perih \r\nPanas membakar \r\nAmarahkulah saksinya \r\nBersumpah demi diriku \r\n\r\nKu takkan diam \r\nMelihat semua \r\nMendengar dia \r\nSiksa diriku \r\n\r\nAnjing hancurkan harapan \r\nKecam dendam dalam kelam \r\nSingkat cerita \r\n\r\nKupasang topeng di muka \r\nMenjilat demi sebuah dukungan \r\nSampai kapan aku akan \r\nSakit menahan semua kepalsuan \r\n\r\nTeraniaya, tersiksa hati dan jiwa \r\nTeriak, hitam rencana di kepala \r\nBersumpah untuk membalas \r\nSemua, segala, dendam untuk dia \r\nUntuk dia \r\n\r\nDia pengkhianat semuanya \r\nSemua yang ada di sana hina \r\nDan terinjak, dan teriak \r\n\r\nKata katanya membuat luka \r\nTeriak, sakit dan sakit di dalam hati \r\nKau hancurkan harapanku sakiti jiwa \r\nTakkan diam ku teriak \r\nTeriak ku takkan diam',480,'2017-08-30 08:35:45','2017-09-04 08:50:10',0,50,0),
