	(421,'Duduk Duduk Manis (DDM)','https://m.soundcloud.com/oekman/bea_duduk-duduk-manis-mp3','*Duduk-Duduk Manis*\r\n\r\n_Ada cerita teman teman kerja di DDM_\r\n\r\n_Ada yang kerja_\r\n_Ada yang pura-pura kerja Padahal mah duduk duduk manis_\r\n\r\n*BRIDGE :*\r\n~Iya ge..4X~\r\n\r\n_Ada tukang packing_\r\n_Ada juga tukang cutting_\r\n_Office nya sibuk pada meeting_\r\n\r\n_Anak produksi estimasi enggak pasti_\r\n_Akhirnya pada pulang pagi_\r\n\r\n*BRIDGE :*\r\n~Pending..pending..pendiiiing~\r\n\r\n*REFF :*\r\n```anak printing gawena peuting,siang-siang ya nunggu reprint```\r\n\r\n```anak gudang kerjanya loading,revisi joblist die pada pusing```\r\n\r\n*BRIDGE :*\r\n~pusing..yang pusing..pak bob..bob.. 2X~\r\n\r\n*REFF 2 :*\r\n```Ada pak joko, ada pak vito, siswanto, bang joe,mas dodo, asep show```\r\n\r\n```bikin cuti ame si sobri```\r\n```Naik gaji nego pak goci```\r\n```uang jalan minta bu dian```\r\n```request bangku sama bang kukuh```\r\n```soal duit paling cepet adit```\r\n```tapi kalo kasbon ya sama bang john```\r\n\r\n*CODA :*\r\nAda lagi ngomongnya aneh..anu-anuan(jimbrin..jimbrin)\r\n\r\nAda lagi ngomongnya aneh..kopi kapal item(blaem blaem wit)\r\n\r\nAda lagi ngomongnya aneh..botol aryantol tol tol tol(arianto arianto)\r\n\r\nAda lagi ngomongnya aneh..iya es(bener bener bener)\r\n\r\nAda lagi *yang* ngomongnya aneh..inyong ora sudi(mas yul loading mas yul)\r\n\r\nAda lagi *yang* ngomongnya aneh..secelup dua celup(iyaaaaw)\r\n\r\nAda lagi... *orangnya* aneh (kang jetli kemana ya)\r\n\r\nPulang ah...finger print nya error',529,'2017-09-01 03:22:30','2017-09-04 08:44:20',0,50,0),
