	(443,'Seperti Piano','https://soundcloud.com/akla-official/seperti-piano','AKLA - Seperti Piano\r\n\r\nVerse:\r\nAlunan cinta yang telah kau beri selama ini\r\ndalam irama yang tak pernah sama\r\ntapi tak kusangka kau beri pelajaran ku\r\nseperti piano\r\n\r\nTempi hati ku semakin berdebar\r\nkala kau mainkan nada-nada asmara\r\nyang sungguh tak ku sangka\r\nkau beri pelajaranku\r\n\r\nReff:\r\nSeperti piano, dan kau mainkan improvisasi nada dengan\r\njemari lembut tanganmu yang kan membuat\r\nku jatuh hati pada simphony alunan indah.. Cinta\r\n\r\nBridge:\r\nSetiap gerak laku mu, melantun sempurna dan berpadu Harmoni\r\ntak salah ku gambarkan, dirimu bagai sebuah.. Piano\r\n\r\nReff:\r\nReff:\r\nSeperti piano, dan kau mainkan improvisasi nada dengan\r\njemari lembut tanganmu yang kan membuat\r\nku jatuh hati pada.. \r\nSeperti piano, dan kau mainkan improvisasi nada dengan\r\njemari lembut tanganmu yang kan membuat\r\nku jatuh hati pada simphony alunan indah..  alunan indah...\r\nKau membuat semuanya \"indah\"..',555,'2017-09-01 23:49:29','2017-09-04 08:31:52',0,50,0),
