	(508,'CINTA GILA','https://youtu.be/-2ZHhxcrjv8','CINTA GILA\r\n\r\nParas cantik wajahmu.. Slalu menggoda imajiku\r\nIndah tatapan mata..Terlintas dibenakku\r\nInikah yang kurasa.. Saat jumpa denganmu\r\nSelalu..\r\n\r\nSaat ku di dekatmu.. Berdebar rasa dihatiku\r\nSehari tak berjumpa.. Gelisah tak menentu\r\nInikah yang kurasa.. Saat jumpa denganmu\r\nBerdegup kencang hati.. Membuat aku melayang\r\n\r\nReff :  Aku bisa gila, bila sedang jatuh cinta..\r\nKepadamu.. kepada dirimu..\r\n        \r\n   Aku bisa gila, bila sedang jatuh cinta..\r\nKepadamu.. kepada dirimu..\r\n\r\nJangan kau bilang cinta..\r\nBila takut tuk patah hati.. ooh..\r\nJangan kau bilang cinta..\r\nBila kau tak rasa..\r\nBila tak ingin bersama..\r\n\r\n-- interlude --\r\n\r\nReff  :  Aku bisa gila, bila sedang jatuh  cinta       \r\nKepadamu.. kepada dirimu..\r\n\r\n            Aku bisa gila, bila sedang jatuh cinta..\r\nKepadamu.. Ooh kepada dirimu.. Ooh',627,'2017-09-03 15:38:02','2017-09-04 07:34:37',0,50,0),
	(509,'Jangan Takut Jatuh Cinta Lagi','https://soundcloud.com/goodmuzzlelovesummer/jangan-takut-jatuh-cinta-lagi','Bukalah mata hati\r\nAgar kau tahu aku yang terbaik di hatimu\r\nBukan dia yang sakitimu \r\nLagi dan lagi, berulang kali\r\nDan lagi, dan lagi, dan lagi..\r\n\r\nReff:\r\nCinta kan kuatkan hatimu\r\nWalau masa lalu kan datang mengganggu hidupmu\r\nTenang saja karna ada aku..\r\nCinta kan sembuhkan lukamu\r\nWalau masa lalu kan datang mengganggu hidupmu\r\nTenang saja karna ada aku..\r\n\r\nGenggamlah tangan ini\r\nAgar kau yakin aku yang selalu di sampingmu\r\nBukan dia yang sakitimu\r\nLagi dan lagi, berulang kali\r\nDan lagi, dan lagi, dan lagi..\r\n\r\n*Back to reff\r\n\r\nBuka sedikit hatimu\r\nPerlahan coba jalani denganku\r\nHingga ku bisa memiliki dirimu..\r\n\r\n*Back to reff',629,'2017-09-03 16:17:37','2017-09-08 06:52:07',3,60,0),
	(510,'Janganlah','https://www.youtube.com/watch?v=EGa2VoLIUWk','RARE4 – Janganlah\r\n\r\nAku tak percaya lagi atas kata cinta yang kau berikan\r\nTak akan ku berikan lagi kesempatan yang kesekian kalinya\r\nKau membuatku hilang arah karena kau pergi tinggalkan diriku\r\nAku sakit dan ku hancur....\r\nReff:\r\nJanganlah kau datang lagi keduniaku \r\nKarena ku tak ingin bersamamu lagi\r\nJanganlah kembali lagi kehidupku\r\nBiarkan diriku disini sendiri\r\n.....\r\nAku sakit dan ku hancur....\r\nBack to reff:\r\nJanganlah kau datang lagi kehidupku\r\nKarena ku tak ingin bersamamu lagi\r\nJanganlah kembali lagi keduniaku\r\nBiarkan diriku disini sendiri....\r\nDan Janganlah kau datang lagi kehidupku\r\nKarena ku tak ingin bersamamu lagi\r\nJanganlah kembali lagi keduniaku\r\nBiarkan diriku disini sendiri\r\nSendiri....\r\n~END~\r\nCERITA\r\nSuatu ketika ada seseorang yang sedang patah hati karena seorang pasangannya telah mengkhianati hatinya, dan suatu hari mantan pasangannya mencoba kembali lagi. Matan pasangannya ingin menjalin hubungannya seperti dulu lagi, tetapi karena sudah dikhianati dia tidak percaya lagi dengan semua janji – janji yang diberikan dan tidak percaya lagi atas kata cinta yang telah diberikan kepada mantan pasangannya, dan dia tidak ingin diganggu – ganggu lagi.',630,'2017-09-03 16:40:04','2017-09-04 07:32:51',0,50,0),
	(511,'Mesin Pencetak Citra','https://soundcloud.com/arch-project/mesin-pencetak-citra','Mereka lihat yang tak terdengar \r\nDan mereka temukan yang tak hilang\r\nSelagikan terus mengelak\r\nMenganggap semua tak pernah ada !\r\n\r\nKebodohanpun diumbar-umbar \r\nSakit hati yang dijual belikan\r\nDimana tak kulihat adanya logika\r\nSindiran Bencana\r\n\r\nSemua tak masuk di akal\r\n\r\n(Chorus)\r\nSemua kata,semua palsu\r\nBeban moral, eksistensi belaka\r\nkomentar yang tak ada guna\r\nHanya apresiasi semata\r\n\r\nPerusak citra, Perusak nama\r\nMuka dua untuk menjilat tahta\r\nMenggugat akal, menggugat moral\r\nKebodohan yang tak ada guna\r\n\r\n(Solo)\r\n\r\nSebuah mesin pencetak citra\r\nSebuah mesin perusak nama\r\nSebuah mesin pencetak citra\r\nSebuah mesin perusak nama\r\n\r\n(Chorus)\r\n\r\nPerusak citra, Perusak nama\r\nMuka dua untuk menjilat tahta\r\nMenggugat akal, menggugat moral\r\nKebodohan yang tak ada guna',631,'2017-09-04 01:57:31','2017-09-04 07:32:21',0,50,0),
	(512,'Kita','https://youtu.be/I-XVqGaLfb0','Kita \r\nAdalah cinta yang engkau punya\r\nRindu yang slama ini kau puja\r\nKita\r\nAda di dirimu \r\nDan karena \r\nKita \r\nRindu yang kau tunggu\r\n\r\nEngkau \r\nAdalah api yang slama ini \r\nMembakar jiwa yang kujalani\r\nEngkau\r\nAdalah jantung jiwaku \r\nDan engkau\r\nDetak \r\nNadi di hidupku\r\n\r\nReff:\r\nMeski kita slalu berbeda\r\nTapi cinta kan tetap sama \r\nDan tetap\r\nJangan pernah berubah\r\nTetaplah begitu sampai nanti\r\nKu akan datang untukmu\r\n\r\nSemua \r\nBegitu indah saat kita bersama \r\nBegitu sempurna saat kau dan aku\r\nKita \r\nAdalah dirimu \r\nDan karena \r\nKita\r\nAdalah hidupmu\r\n\r\nReff: \r\nMeski kita slalu berbeda \r\nTapi cinta kan tetap sama \r\nMeski ku kan jauh disana\r\nKuyakin kau tetap menunggu \r\nMeski kita slalu berbeda \r\nKuyakin kau tetap setia\r\nDan tetap\r\nJangan pernah berubah\r\nTetaplah begitu\r\nSampai nanti\r\nKu akan datang untukmu\r\n\r\nAkulah milikmu \r\nAkulah hidupmu \r\nAkulah nadimu \r\nAkulah jiwamu 3x\r\n\r\nReff: \r\nMeski kita slalu berbeda\r\nTapi cinta kan tetap sama\r\nMeski ku kan jauh disana \r\nKu yakin kau tetap menunggu\r\nMeski kita slalu berbeda \r\nKu yakin kau tetap setia.',633,'2017-09-04 04:17:44','2017-09-08 06:49:53',3,70,1),
	(513,'BUKAN CINDERELLA','https://www.youtube.com/watch?v=umWWHG9oadI','Wahai semua yang hendak berpesta\r\nHilangkanlah engkau punya keluh kesah di dada\r\nHapus duka lara dan segala problema\r\nDan jangan lah ragu melesat ke lantai dansa\r\nMari bergoyang ikuti irama\r\n\r\nWahai kau wanita yang bersepatu kaca\r\nSebelah sepatu mu tertinggal di teras istana\r\nPangeran takkan mencari dimana kau berada\r\nKarna sia-sia baginya kau bukan Cinderella\r\nCantik mu hanya setengah jam saja\r\n\r\nTak ada kereta labu itu hanya dicerita\r\nTak ada tikus-tikus yang dapat jahit bajunya\r\nTak ada ibu peri yang dapat tolong dirinya\r\nSemua sia-sia dan memang kau bukan Cinderella\r\nCantikmu hanya setengah jam saja\r\n\r\nKau bukan Cinderella\r\nKau bukan Cinderella\r\nKau bukan Cinderella\r\nKau bukan, engkau bukan Cinderella\r\nCantikmu hanya setengah jam saja',634,'2017-09-04 04:26:03','2017-09-04 07:30:25',0,50,0),
