	(660,'Air Mata Langit','https://soundcloud.com/herru-pramono/air-mata-langit','Begitu bangganya bumi memiliki generasi muda\r\npadanya lah bumi dititipkan\r\ntanah, bumi, air bersatu pada indahnya alam\r\n\r\nbetapa adilnya Tuhan memberikan anugerah berlimpah\r\nlukisan langit yang indah, bentangan laut yang luas\r\npohon-pohon, bebatuan terangkai cantik di alam semesta\r\n\r\nTapi perlahan berubah bumi tak bersahabat\r\nmulai menunjukkan kemarahannya\r\npara generasi muda yang harusnya menjaga\r\nmalah sebaliknya jadi sumber kehancuran\r\n\r\nLangit-langit menangis bumi berguncang\r\nanak-anak menangis ketakutan\r\nhutan-hutan terbakar, laut kuat bergelombang\r\ninikah teguran Tuhan??\r\n\r\nAir mata dunia (rasa kecewa) \r\nPada kita semua ( pada kita semua)\r\ndimanakah agama, mana budaya\r\ndimanakah semua jati diri kita...\r\n\r\nSudah hilang entah dimana..',814,'2017-09-07 09:23:07','2017-09-08 01:19:14',0,50,0),
