	(662,'GO MY WAY','https://soundcloud.com/no-stack-for-luck/go-my-way','GO MY WAY\r\nMusic/Lyric by Chandra Clestopia\r\nReleased: 2017.08.31\r\n\r\nCould not speak clearly\r\nTo say what I want\r\nDress me nothingness\r\nSomehow I will find a nightmare\r\n\r\nPeople said useless\r\nThickened this black wall\r\nLately I aware\r\nSomehow I will find a fine day\r\n\r\nDo what you want... Do what you need...\r\nTo crushing down my hope and dream\r\nAt the last I\'ll proof with my rise\r\nGo back! Go back! What faceless you are!\r\n\r\nWhat left behind make me more strong\r\nThan the past when you looking down for my life, for my dream\r\nYou must know that everyone have a chance',816,'2017-09-07 09:25:10','2017-09-08 01:16:23',0,50,0),
