	(703,'Yang Lebih Baik','https://soundcloud.com/bobbyandtheofficeproject/yang-lebih-baik','Yang Lebih Baik\r\nCipt: Bobby Yocbahawie\r\n\r\nDengar kawan jangan sering makan bakwan\r\nBibir kering pecah-pecah nanti kau kena sariawan\r\nSi kancil makan mentimum jangan suka banyak melamun\r\nJodoh ga kemana tapi saingan yang dimana-mana \r\nHei kawan mengapa diam meratap\r\nTatapan muram gersang bagaikan halte bus tak beratap\r\nDaripada diam saja mari kita main catur \r\nTak usah kau risau hei jodoh sudah ada yang atur\r\n\r\nBridge:\r\nBila cinta tak berbalas bersyukurlah kawan\r\nkarena Tuhan menuntunmu ke yang lebih baik\r\n\r\nReff:\r\nTuhan berikanlah aku petunjukMu, \r\nTunjukanlah yang lebih baik, tunjukanlah yang lebih baik\r\nTuhan kirimkanlah aku kekasih\r\nLepaskanku dari belenggu, belenggu kesunyian ini\r\n\r\nMinum kopi jangan sampai tumpah ke pipi\r\nCinta itu kadang sulit untuk dimengerti\r\nMenyenangkan ketika menjalani tapi kadang suatu saat sulit\r\nUntuk tidak sakit hati\r\nHei lihat sebuah timbangan kawan\r\nHidup ini seimbang bukan tanpa alasan\r\nKita dianugerahi hati bukan tanpa teman\r\nhati tanpa pikiran kan tenggelam dalam duka perasaan\r\n\r\nBack to Bridge and Reff',861,'2017-09-07 16:56:59','2017-09-08 00:49:17',0,50,0),
