	(731,'Nafas Hidupku','https://www.youtube.com/watch?v=ukhEFtKOIAU&t=79s','PROFIL\r\nLiana band merupakan band yang baru memulai meramaikan kembali  belantika musik Indonesia  setelah beberapa tahun yang lalu sempat vakum dari dunia  hiburan tanah air. Di pertengahan tahun 2017 ini Liana band mencoba kembali peruntungannya  di dunia music Indonesia dengan mengusung Genre Pop Rock Romantic. Liana band terbentuk dari dua band yang berasal dari kota Cilegon dan Lampung, sebut saja  band  tersebut  yaitu Keisha band dan Djantan yang sudah bermusik sejak tahun 2006 s/d  Tahun 2014, di mana keduanya merupakan band yang sudah banyak menghasilkan karya lagu yang Easy Listening dan memenangkan  kejuaraan dari Festival – festival  band dan event event  baik di tingkat lokal maupun tingkat Nasional dan memenangkan kejuaraan seperti : Juara 1 Festival Gudang Garam tingkat Nasional Regional Palembang, Juara 1 Festival  Universitas Saburai Bandar Lampung, Juara 1 Kejuaraan  Piala Walikota Bandar Lampung, Juara  1 Kejuaraan  Piala Walikota  Cilegon, Finalis  A mild live Wanted Regional  Kota Cirebon,  Opening acara  Annivesary Slank “PLUR” , Opening  konser band Dmasiv (Kota Serang & Cilegon), Opening konser band Slank (Depok), Opening   konser band  The Cangcuters (Jakarta) & Opening konser band Seventeen (Kota  Bandar Lampung) \r\nMakna dari  kata Liana sendiri di ambil dari bahasa Jerman yang berarti “Manuasia yang Sederharna”, dimana makna tersebut menjadi dasar band kami untuk selalu menjadi  pribadi yang  selalu Low Profile dalam bermusik dan kami terapkan dalam kehidupan sehari – hari. \r\nPersonil Liana band digawangi  oleh 6 Personil  yaitu : Adit (Vokal), Adhe (Drum), Wildan (Lead Guitar), Rifki (Guitar Rhytem), Dudie (Bass), Eka (Keyboard) .\r\nKARIR\r\n-	Juara 1 Festival Band PT.Chandra Asri Cilegon (26 Agustus 2017)\r\nBand Social Media :\r\nFacebook : Lianaband cilegon\r\nInstagram : Lianabandcilegon\r\nEmail : lianabandgroup@gmail.com\r\nContact Person : Eka (081297858490)\r\n \r\nLiana Band\r\nCreated By. Epeng & Pamong\r\nTittle : nafas hidupku\r\nSatu sisi takkan Berhenti\r\nUntuk Menunggu dan Memahami\r\nSemua ini..\r\nAku Berjanji Untuk Setia\r\nMenemanimu..\r\nSampai Ajal memisahkan Kita\r\nYakinkanlah Hatimu..\r\nSatu sisi takkan Berhenti\r\nUntuk Menunggu dan Memahami\r\nSemua ini Takkan berakhir\r\nMeski  jarak memisahkan kita Berdua\r\nPercayalah..\r\nAku Berjanji untuk Setia Menemanimu..\r\nSampai Ajal memisahkan Kita\r\nYakinkanlah Hatimu..\r\nAku berjanji untuk menjaga Cinta ini\r\nSampai akhir nafas hidupku\r\nYakinkan Aku untukmu…',899,'2017-09-08 07:07:16','2017-09-08 07:07:16',0,0,0),
	(732,'Bhinneka Tunggal Ika','https://m.youtube.com/watch?v=Y62lf23mT0g','Bhinneka Tunggal Ika\r\n\r\nBhinneka tunggal ika\r\nSemboyan negara Indonesia\r\nBhinneka tunggal ika\r\nBukan hanya hiasan di kaki sang garuda\r\nBhinneka tunggal ika\r\nJangan sampai terpecah konflik isu SARA\r\nBhinneka tunggal ika\r\nSatu simbol persatuan yang harus kita jaga\r\n\r\nPancasila bukan sebuah catatan buta\r\nItulah dasar kita hidup bernegara\r\nDi Indonesia kita banyak saudara\r\nDari Aceh hingga Papua\r\n\r\nBhinneka Tunggal Ika\r\nTak membedakan warna baju suku dan agama\r\nBhinneka tunggal ika\r\nLandasan awal terwujudnya cita-cita bangsa\r\nBhinneka tunggal ika\r\nTersenyum bersama anak cucu kita\r\nBhinneka tunggal ika\r\nWalau berbeda beda tetap satu jua\r\n\r\nPancasila bukan sebuah catatan buta\r\nItulah dasar kita hidup bernegara\r\nDi Indonesia kita banyak saudara\r\nDari Aceh hingga Papua\r\n\r\nBhinneka tunggal ika\r\nSemboyan negara Indonesia\r\nBhinneka tunggal ika\r\nBukan hanya hiasan di kaki sang garuda\r\nBhinneka tunggal ika\r\nTak membedakan warna baju suku dan agama\r\nBhinneka tunggal ika walau berbeda beda tetap satu jua',901,'2017-09-08 07:32:43','2017-09-08 07:32:43',0,0,0),
